(5553, 7760, 'Drkovac frza iletkov (D=30; I=50; S=20; Z2+1) HW', 'Drkovac frza iletkov (D=30; I=50; S=20; Z2+1) HW', '<p>- Frza pro frzovn drek, falc a zavrtvn<br />- Ureno pro CNC a run obrbn deva, lamina a HPL<br />- Kvalitn vytvoen drky nebo oznut materilu</p>\\n<p>Drkovac stopkov frza sjednou zavrtvac iletkou a dvmi ezacmi iletkami. M vynikajc vlastnosti pi zavrtvn vtvrdm dev adeskovch materilech (lamino, devotska, MDF, HDF a Corian). Stopka prmru 12 mm je urena pro upnut v CNC obrbcch centrech pi vysokch posuvovch rychlostech. Lze pout tak pro run frzovn.</p>', '_vyr_7760_vyr_96Drazkovaci-freza-Griani-Z2-1.jpg', 0, '3780.00', '0.00', '1333005008', '_vyrn_7760_vyr_96Drazkovaci-freza-Griani-Z2-1.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-7-43-0|14-0-0-0|14-610-0-0', NULL, '2020-10-01 12:04:56'),
