(5601, 7819, 'Pedezov skldan kotou DSC.070020016.004', 'DIA pedezov skldan kotou', '<h3><strong>Pouit:</strong></h3>\\n<p>Ideln pro formtovn odolnch materil. Velkou vhodou je mon pouit pro pn nebo podln formtovn. Pedezov kotou m a 50 del vdr ne HW kotoue dky specilnmu polykrystalickmu diamantovmu zubu.</p>\\n<p>Tm pdem tento kotou disponuje naprosto bezkonkurenn<span></span><strong>nejlepm pomrem<span></span><em>kvalita/cena/vkon!</em></strong></p>\\n<h3><strong>Stroje:</strong></h3>\\n<p>Velice vhodn je pouit tohoto kotoue na strojch jako jsou stoln pily, horizontln a vertikln formtovac stroje i CNC pily vybaven pedezovm agregtem s monost nastaven vky ezu.</p>\\n<h3><strong>Materil:</strong></h3>\\n<p>Pedezov kotou lze velmi dobe vyut pi formtovn jednostrann nebo oboustrann laminovanch desek, DTD, MDF, HPL.</p>\\n<div></div>\\n<h3><strong>PODROBN SPECIFIKACE VECH PEDEZOVCH KOTOU:</strong></h3>\\n<table border=\\\"3\\\" cellpadding=\\\"1\\\" width=\\\"100%\\\" height=\\\"285\\\">\\n<tbody>\\n<tr>', '_vyr_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', 0, '8022.00', '0.00', 'DSC.070020016.004', '_vyrn_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', '', '', '', 21, 1, 0, 0, '', 0, '10-0-0-0|2-0-0-0|2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0|2-7-47-563|10-475-0-0|10-475-561-0', NULL, '2020-10-01 12:04:57'),
