(5894, 8127, 'Frza spirlov (D=10; I=32; L=80; Z=3) hrubovac DIA povlakovan', 'Frza spirlov (D=10; I=32; L=80; Z=3) hrubovac DIA povlakovan', '<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/nadia.jpg\\\" alt=\\\"\\\" width=\\\"303\\\" height=\\\"92\\\" /></div>\\r\\n<div></div>\\r\\n<div>\\r\\n<h3>TECHNICK INFORMACE:</h3>\\r\\n<ul>\\r\\n<li>Z3 - 3 spirlovit uloen bity</li>\\r\\n<li>Tlo ze specilnho tvrdho materilu HM o tvrdosti 93,8 HRA</li>\\r\\n<li>NaDia nkolikansobn zvyuje ivotnost HM</li>\\r\\n<li>Sniuje ten pi frzovn</li>\\r\\n<li>Sniuje zahvn</li>\\r\\n</ul>\\r\\n<h3>POUIT:</h3>\\r\\n<p></p>\\r\\n<ul>\\r\\n<li>Ureno pro vechny CNC stroje a run frzky pro mkk i tvrd masivn devo</li>\\r\\n</ul>\\r\\n<h3>DIA SPIRLOV FRZY:</h3>\\r\\n<p><span>Diamantov</span>povlak (DLC) je vsledkem procesu PECVD, kter je jednou z nejnovjch technologi povlakovn. Celkov tlouka povlaku 1 mikron dosahuje velmi odolnho povrchu a nekorozn prosted. Z provedench test vyplvaj velmi dobr vsledky, kter potvrzuj zven ivotnosti eznch nstroj a o 300 %.</p>\\r\\n</div>', '_vyr_81275.jpg', 1, '1647.00', '0.00', '195.100.11XTR', '_vyrn_81275.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-7-0-0|2-7-45-0|2-7-45-597', NULL, '2020-10-01 12:04:58'),
