(5911, 8144, 'Upna HSK63F HYDRO D=12', 'Upna HSK63F HYDRO D=12', '<p>Pesn upna HYDRO umouje dokonal upnut stopky. Dotaen roubku zpsob, e olej dokonale stla stopku nstroje. Takov een prakticky eliminuje vibrace a umouje pouit vysokch posuv na CNC strojch.</p>\\r\\n<p>Zaujal-li Vs tento nstroj a chtli byste znt nap. rozmry, nebo cenu, nevhejte zavolat na nae <strong>odborn poradenstv</strong> na . <strong>704 192 430</strong>.</p>', '_vyr_814418.jpg', 1, '0.00', '0.00', 'H6FPDXHYDRO12', '_vyrn_814418.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-8-0-0|2-8-664-0', NULL, '2020-10-01 12:04:58'),
