(5914, 8147, 'Univerzln profilov n HSS 40x4 mm', 'Univerzln profilov n HSS 40x4 mm', '<p><strong> Ureno pro frzovac hlavy od , CMT, Pilana, Flury, Guhdo atd.<br /> Pesn otvory pro kvalitn umstn ve frzovac hlav.<br /> Nabzme v ce 40 mm nebo 50 mm.<br /> Vyrobeno z legovan nstrojov oceli.<br /> Pesn vybrouen.</strong></p>\\n<p>Univerzln profilov noe jsou uren pro univerzln frzovac hlavy s euro upnacm systmem. Dky jednoduchmu upnacmu systmu, mete bhem chvilky zmnit profil frzovn na sv frzovac hlav. Pesn ustavovac otvory pro kolky maj prmr 6 mm a jsou v roztei 24 mm.<br />Dodvno v pru (2ks), baleno v blistru.</p>\\n<p>Celkov nabdka univerzlnch no obsahuje tm 200 standardnch profil. irok nabdka uspokoj i nronho zkaznka. Univerzln profilov noe nejsou uren pro sriovou vrobu, ale jako dostupn pomoc pi zakzkov a individuln vrob.</p>\\n<p><strong></strong></p>\\n<p><strong>TECHNICK INFORMACE:</strong></p>\\n<ul>\\n<li>Rozmry univerzlnho profilovho noe jsou 40x4 mm</li>\\n<li>', '_vyr_8147690691.jpg', 0, '376.80', '357.96', '690.000', '_vyrn_8147690691.jpg', '', '', '', 21, 1, 0, 0, '', 0, '22-0-0-0|22-671-0-0|22-671-673-0', NULL, '2020-10-01 12:04:58'),
