(5954, 8188, 'Kotou pro zsmolky D100x8 d22 Z4 R30 HM', ' Kotou pro zsmolky D100x8 d22 Z4 R30 HM', '<p>Nov 100 mm CMT kotou na zsmolky s teflonovm oranovm povrchem je vyroben z jakostn oceli. Tlo je osazeno 4 tvrdokovovmi zuby, kter garantuj dlouhou ivotnost. D100x22x8 R30mm Z4. Ureno pro lamelovac frzky</p>', '101456_8188__vyr_66C240-lodickovaci-kotouc.jpg', 0, '1771.00', '1968.00', '240.004.04', '101456_8188__vyrn_66C240-lodickovaci-kotouc.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-2-286-0|2-2-0-0|2-2-287-0', NULL, '2020-10-01 12:04:59'),
(5955, 8189, '355 Vrtk kolkovac neprchoz s vodcm hrotem - D3x25 S=10x30 L57 HWM, RH', '355 Vrtk kolkovac neprchoz s vodcm hrotem - D3x25 S=10x30 L57 HWM, RH', '<p><span></span>Tlo vrtku z vysoce kvalitnho monolitu usazenho do stopky z tvrzen oceli.<br />- Hrot vrtku s pesn vycentrovanm stedicm hrotem.<br />- Kvalitn pedezy a vodcm hrotem radilnm podbrouenm (V2).<br />- 2 spiralov drky a dv odlehovac.<br />- Vlcov upnac stopka s unec plochou a roubem pro nastaven dlky.<br />- Pesn brouen stopka pro pesn upnut ve stroji.</p>\\r\\n<p><br />Pouit: navrtacch strojch akolkovakch pro vrtn neprchozch otvor doDTD, MDF, lamina, HPL aplast.</p>\\r\\n<p>- RH - pravotoiv proveden - ern barva vrtku</p>\\r\\n<p>- LH - levotoiv proveden - oznaeno ervenou barvou</p>\\r\\n<p>- HWM - celotvrdokov</p>', '_vyr_8189vrtak-kolik.jpg', 1, '540.72', '0.00', '', '_vyrn_8189vrtak-kolik.jpg', '_vyrp11_8189vrtak-kolik1.jpg', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-372-0-0|2-372-391-0', NULL, '2020-10-01 12:04:59'),
