(7687, 24, 'EVLC Jig  Vrtac ppravek pro Lamello Cabineo', 'EVLC Jig  Vrtac ppravek pro Lamello Cabineo', '<p> Maximln rychl zpsob vytvoen spoje<br />  Spoj vytvote pomoc vrtaky nebo aku roubovku<br />  Rychl a pevn spoj dvou desek na 90<br />  Tvorba spoje na hran nebo v ploe<br />  Jedinen ppravek pro spojky Lamello Cabineo<br /> <br /> Vrtac ppravek EVLC Jig spojuje jednoduchost a dvtip pro jednoduch ovldn a snadn vytvoen otvor pro spojovac systm Lamello Cabineo. Ppravek je uren pro pesn a produktivn run spojovn nbytkovch dlc pomoc vrtaky nebo aku roubovku. Ppravek EVLC je vybaven pesnmi otvory pro pedvrtn dr do dna, pdy a bonic korpusu. S ppravkem EVLC zhotovte nejen otvor pro roub spojky, ale tak navrtte ti otvory pro samotnou spojku Lamello Cabineo. S EVLC ppravkem doclte vysokou pesnost a produktivitu prce tm jak na CNC stroji. ablona je urena pro pouit s vrtacm vetenem, do kterho upnete potebn vrtky o prmr od 5mm a 15mm.<br /> <br /> Prce s ppravkem je velmi rychl intuitivn. Na vrta', '_vyr_24EVLCJig2-a.jpg', 0, '2371.00', '2790.00', 'EVLC Jig1', '_vyrn_24EVLCJig2-a.jpg', '_vyrp11_24EVLC_Lamello-cabineo-15.jpg', '_vyrp12_24EVLC_Lamello-cabineo-14.jpg', '_vyrp13_24csm_Alle_CNC_Maschinen_34d966500f.jpg', 21, 1, 14, 1, '', 0, '4-107-0-0|4-107-384-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7688, 33, 'Pilov kotou na podln a pn ez - D300x3,2 d30 Z48 WS HW', 'Pilov kotou na  podln a pn ez- D300x3,2 d30 Z48 WS HW', '<p>Univerzln pilov kotou od znaky Stehle vynik nmeckou kvalitou. Konstrukce vynik kvalitnm odhlunnm a rozdlen na vce segment. M vylepen tlumc drky pro snen vibrac a hlunosti. Je osazen stdavmi zuby z extra tvrdho nmeckho tvrdokovu pro pn i podln ezn deva a devnch panel. Vysok ivotnost a vdr.</p>\\n<p></p>', '_vyr_33kotouc-hlavni-Stehle.jpg', 0, '1926.00', '2139.00', 'S58100702', '_vyrn_33kotouc-hlavni-Stehle.jpg', '_vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-19-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7689, 34, 'istic emulze pro nstroje, FORMULA 2050 - 5l', 'istic emulze pro nstroje, FORMULA 2050 - 5l', '<p>Pro perfektn oitn devoobrbcch nstroj odsmly a dalho zneitn. Bezpen anetoxick emulze zvyuje ivotnost nstroj azanechv rzi odoln povlak. Napomh kezven ivotnosti nstroje mezi ostenm.</p>', '_vyr_34cistici-emulze-CMT.jpg', 0, '1275.56', '1275.00', 'C99800103', '_vyrn_34cistici-emulze-CMT.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-285-0|2-2-289-0|2-3-292-0|2-3-292-363|2-7-304-0|7-0-0-0|7-422-0-0|14-0-0-0|14-619-0-0', NULL, '2021-01-10 15:44:03'),
(7690, 35, 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z6 HM stdav zub', 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z6 HM stdav zub', '<p>Nov 100 mm CMT lamelovac kotou s teflonovm oranovm povrchem je vyroben z jakostn oceli. Tlo je osazeno tvrdokovovmi zuby, kter garantuj dlouhou ivotnost. Ureno pro lamelovac frzky.</p>', '_vyr_35C240-lamelovaci-kotouc.jpg', 0, '459.00', '510.00', 'C24000604', '_vyrn_35C240-lamelovaci-kotouc.jpg', '', '', '', 21, 1, 5, 1, '', 0, '2-2-286-0|2-2-287-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7691, 39, 'F049 Falcovac iletkov frza - H9,5 D34,9x12 L55 S=8 HMvv', 'F049 Falcovac iletkov frza - H9,5 D34,9x12 L55 S=8 HM', '<p>Falcovac frza je vybavena koprovacm vodcm loiskem B =15,8 mm pro ku falcu H = 9,5 mm.<br /><br />Ktto frze je mon dokoupit koprovac loiska prmr B = 9,512,7192228,534,9 mm, ktermi vyrobte ku falcu H = 12,711,186,33,20 mm.<br />K volitelnmu loisku potebujete podloku C54155200, aby vm loisko nesjdlo.</p>', '_vyr_39f049.jpg', 0, '1159.20', '1288.00', 'F049-35581', '_vyrn_39f049.jpg', '_vyrp11_39f049-1.jpg', '_vyrp12_39f049-2.jpg', '_vyrp13_39f049-3.jpg', 21, 1, 1, 0, '', 0, '2-1-17-335|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7692, 40, 'F049 Velk falcovac frza - H16 D50,8x28,3 L87,3 S=12 HM', 'F049 Velk falcovac frza - H16 D50,8x28,3 L87,3 S=12 HM', '<p> ikm ost pro lep odvod tsek.<br /> Pro oezvn inejobtnjch dl podle ablony.<br /> HM tvrdokovov bity.<br /> Speciln koprovac loisko naele frzy.<br /> Prodlouen dlka ost.<br /><br />Velk falcovac frza je dodvna se zkladn sadou loisek akroukem 19mm pro frzovn 15,8 mm falcu. Ktto frze je mon dokoupit 3 sady koprovacch krouk, se ktermi vyrobte 17 rznch rozmr falc. Pi frzovn falc vtch ne 12 mm provdjte vcensobn bry pomoc postupnho zvtovn hloubky.<br /><br />Doporuujeme pouit ve frzovacm stolku.</p>', '_vyr_40f049-4.jpg', 0, '1623.60', '1804.00', 'F049-50821', '_vyrn_40f049-4.jpg', '_vyrp11_40f049-5.jpg', '_vyrp12_40f049-6.jpg', '_vyrp13_40f049-7.jpg', 21, 1, 1, 0, '', 0, '2-1-17-336|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7693, 41, 'F046 hlov iletkov frza - 45 D29x12 L52 S=8 HM', 'F046 hlov iletkov frza - 45 D29x12 L52 S=8 HM', '<p>Frza je urena pro oezvn asren hran.<br /><br />Typ F046 je bez loiska. Uren pro run frzovn atak pro strojn frzovn naCNC centrech.</p>', '_vyr_41f046.jpg', 0, '773.10', '859.00', 'F046-45081', '_vyrn_41f046.jpg', '_vyrp11_41f046-1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-13-320|2-1-0-0|2-1-13-0|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:03'),
(7694, 42, 'F051 iletkov frza HM na V drku - 90 D23x11 L60 S=8', 'F051 iletkov frza HM na V drku - 90 D23x11 L60 S=8', '<p>Ideln nstroj pro gravrovn a tvorbu npis. Pokud se vm iletka zd tup nebo opoteben, jednodue otote a pouijte dal z ostrch bit. Uzamykac roubek bezpen zajiuje iletku a tm i pesnost prce.</p>', '_vyr_42f051.jpg', 0, '430.00', '470.00', 'F051-23081', '_vyrn_42f051.jpg', '_vyrp11_42f051-1.jpg', '_vyrp12_42f051-2.jpg', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-0-0|2-1-15-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7695, 43, 'F062 Radiusov iletkov frza HM - R2 D27x3 L58 S=8', 'F062 Radiusov iletkov frza HM - R2 D27x3 L58 S=8', '<p> Vmnn iletky z mikrozrnnho tvrdokovu.<br /> iletky mete otoit o 90 a zskte tm celkem 4 ezn hrany.<br /> iletky jsou upevnny specilnmi Torx rouby.<br /> Tlo frzy vyrobeno z kvalitn oceli.<br /><br />iletkov frza osazen dvma trvdokovovmi iletkami pro zaoblen hran. Radius je vybrouen na vech 4 stranch iletky pro maximln efektivitu nstroje. Frza je osazena iletkou s radiusem R3mm nebo R2mm, kter se pouv zejmna na ABS hrany. K frze je mon dokoupit i radius R1mm a R1,5 mm, kterm mete srazit hranu pi lepen umakartu, dhy nebo lamina na deskch. Pro pouit na runch hornch frzkch.</p>', '_vyr_43F062.png', 0, '1166.40', '1296.00', 'F062-02081', '_vyrn_43F062.png', '_vyrp11_43F062-1.png', '_vyrp12_43F062-2.png', '', 21, 1, 1, 0, '', 0, '2-1-14-0|2-1-0-0|2-1-14-322|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:03'),
(7696, 44, 'F042 hlov iletkov frza - 22 D25x11 L65 S=6 HM', 'F042 hlov iletkov frza - 22 D25x11 L65 S=6 HM', '<p>Urena pro oezvn asren hran.<br /><br />Typ F042 je vybaven koprovacm loiskem. Uren pro run frzovn.</p>', '_vyr_44f042.jpg', 0, '921.60', '1024.00', 'F042-22081', '_vyrn_44f042.jpg', '_vyrp11_44f042-1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7697, 45, 'Freza VHM (D=4; I=15; S=4; Z=1+1) RH', '190 Freza VHM (D=4; I=15; S=4; Z=1+1) RH', '<p><strong>TECHNICK INFORMACE:</strong><br /><em></em></p>\\n<ul>\\n<li>Z2+2 spirlv uloen bity</li>\\n<li>Tlo ze specilnho tvrdho materilu HM o tvrdosti 93,8 HRA</li>\\n<li>Perfektn hrana ezu na horn i spodn stran dlce</li>\\n<li>Osteno novou laserovou technologi</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/Screenshot_2.jpg\\\" alt=\\\"\\\" width=\\\"538\\\" height=\\\"85\\\" /></p>\\n<h3>POUIT:</h3>\\n<ul>\\n<li>Osteno novou laserovou technologi</li>\\n<li>Ureno pro vechny CNC stroje a run frzky pro spojovn a frzovn DTD, LTD, MDF a kompozit na bzi deva, HPL.</li>\\n</ul>\\n<h3>EZN PODMNKY:</h3>\\n<ul>\\n<li>4 - 6 mm</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/4-6 mm.jpg\\\" alt=\\\"\\\" width=\\\"471\\\" height=\\\"283\\\" /></p>\\n<ul>\\n<li>8-18 mm</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/8-16 mm.jpg\\\" alt=\\\"\\\" width=\\\"522\\\" height=\\\"305\\\" /></p>\\n<h3><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/DT1%20(2).jpg\\\" alt=\\\" width=\\\" 200=\\\"\\\" height=\\\"225\\\" /></h3>', '_vyr_45c190.jpg', 0, '486.00', '0.00', '190.040.11', '_vyrn_45c190.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-588|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7698, 50, ' Spirlov frza na ALU a PVC (D=4; I=40; S=8) RH, HSS', ' Spirlov frza na ALU a PVC (D=4; I=40; S=8) RH, HSS', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Kvalitn HSS ocel Co 5%</li>\\n<li>Jeden spirlov uloen bit s</li>\\n<li>Pozitivn odvod tsky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/DT1.jpg\\\" width=\\\"550\\\" height=\\\"102\\\" caption=\\\"false\\\" /></p>\\n<h3>POUIT:</h3>\\n<p></p>\\n<h3></h3>\\n<ul>\\n<li>Tento nstroj je uren pro efektivn frzovn vech slitin hlinku, duralu. Konstrukce bitu dovoluje vysokou produktivitu frzovn, mnohem lep ne tradin spirlov frzy.</li>\\n<li>Ideln do duralo, hlinku i plastu.</li>\\n</ul>\\n<p></p>\\n<h3></h3>', '_vyr_50c188.jpg', 0, '679.80', '0.00', '188.041.51', '_vyrn_50c188.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-11-0|2-1-11-313|2-7-0-0|2-7-45-0|2-7-45-589|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7699, 53, 'Drkovac spirlov frza (D=3; I=12,7; S=6,35; Z=2) RH', 'Drkovac spirlov frza (D=3; I=12,7; S=6,35; Z=2) RH', '<div class=\\\"row\\\">\\n<div class=\\\"col-lg-12\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_TCWebPartZone12\\\">\\n<div id=\\\"WebPart_TabContainer1\\\">\\n<div class=\\\"responsive-tabs-container  accordion-xs\\\">\\n<div class=\\\"tab-content\\\">\\n<div id=\\\"tab1\\\" class=\\\"tab-pane active\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_WebPartZone21\\\">\\n<div id=\\\"WebPart_FCKEditorNavBarNote1\\\">\\n<div class=\\\"fckeditornavbar\\\">\\n<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Z2 zuby uloen do spirly</li>\\n<li>Tlo ze specilnho tvrdho materilu HM o tvrdosti 93,8 HRA</li>\\n<li>Pozitivn odvod tsky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/191.jpg\\\" alt=\\\"\\\" width=\\\"285\\\" height=\\\"61\\\" /></p>\\n<h3>POUIT:</h3>\\n<p></p>\\n<h3></h3>\\n<ul>\\n<li>Ureno pro poit na CNC strojch pro ezn a frzovn masivnho deva a materil na bzi deva.</li>\\n</ul>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"></pre>\\n<p></p>\\n<h3></h3>\\n</div>\\n</div>\\n</', '_vyr_53c191.jpg', 0, '798.66', '887.00', '191.003.11', '_vyrn_53c191.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-590|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7700, 54, 'Drkovac spirlov frza (D=3; I=12; S=3, Z=2) RH, negativn', 'Drkovac spirlov frza (D=3; I=12; S=3, Z=2) RH, negativn', '<div class=\\\"row\\\">\\n<div class=\\\"col-lg-12\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_TCWebPartZone12\\\">\\n<div id=\\\"WebPart_TabContainer1\\\">\\n<div class=\\\"responsive-tabs-container  accordion-xs\\\">\\n<div class=\\\"tab-content\\\">\\n<div id=\\\"tab1\\\" class=\\\"tab-pane active\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_WebPartZone21\\\">\\n<div id=\\\"WebPart_FCKEditorNavBarNote1\\\">\\n<div class=\\\"fckeditornavbar\\\">\\n<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Z2 zuby uloen do spirly</li>\\n<li>Tlo ze specilnho tvrdho materilu HM o tvrdosti 93,8 HRA</li>\\n<li>Negativn odvod tsky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/Screenshot_3.jpg\\\" alt=\\\"\\\" width=\\\"422\\\" height=\\\"96\\\" /></p>\\n<h3>POUIT:</h3>\\n<ul>\\n<li>Ureno pro pouit na CNC strojch pro ezn a frzovn masivnho deva a materil na bzi deva.</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/192 grafo.jpg\\\" alt=\\\"\\\" width=\\\"415\\\" height=\\\"311\\\" /></p>\\n<p><img src=\\\"/fotky101456/192 grafito.jpg\\\" alt=\\\"\\\" width=\\\"414\\\" height=\\\"313\\\" />', '_vyr_54192.jpg', 0, '341.42', '379.00', '192.03.012.050.03R', '_vyrn_54192.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-591|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7701, 57, 'C2S hlov frza s loiskem - 15 D22x22 S=8 HW', 'C2S hlov frza s loiskem - 15 D22x22 S=8 HW', '<p> HW tvrdokovov zuby.<br /> Teflonov nepilnav povrch<br /> Koprovac loisko.<br /><br />Pouit: Snadn vroba mnohohelnkovch dl. Frzuj ist apesn kosy pro vrobu dokonale vyrovnanch mnohostrannch kontejner, krabic adalch dekorativnch pedmt. Mohou bt pouity svbornmi vsledky pro celou adu prac, jako je vroba pek asloupk.<br /><br /><strong>TIP:</strong>Je mono pout celou dlku ezn hrany. Pravideln nastavujte vku frzy, aby byl maximln vyuit cel HM tvrdokovov bit.</p>', '_vyr_57C2S-web.jpg', 0, '810.00', '900.00', 'GZ2485', '_vyrn_57C2S-web.jpg', '_vyrp11_57GZ-C2S-1.jpg', '_vyrp12_57Dis_B_C2s-lav.png', '_vyrp13_57Dis_B_C2S.png', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|7-0-0-0|7-422-0-0|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7702, 59, '7C Zaoblovac frza vydut - R2 D17 S=6 HW', '7C Zaoblovac frza vydut - R2 D17 S=6 HW', '<p> Pro zaoblovn inejobtnjch dl<br /> HM tvrdokovov bity<br /> Speciln koprovac loisko naele frzy</p>\\n<p>Nejpouvanj zaoblovac frza, kter je uren na zaoblovn hran deva, MDF nebo zaistn ABS hran s perfektnm vsledkem opracovn.<br />Pro obrzovn irok struktury a druh materil a to dky HW zubm. Oprn loisko zajiuje pesn veden a opru v ezu.</p>\\n<p></p>', '_vyr_597C-web.jpg', 0, '652.00', '725.00', 'GZ1248', '_vyrn_597C-web.jpg', '_vyrp11_597C-1.png', '_vyrp12_597C-2.png', '', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-322|7-0-0-0|7-422-0-0|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:03'),
(7703, 60, 'C Oezvac frza, rovn zuby - D13x15 B13 S=8  HW', 'C Oezvac frza, rovn zuby - D13x15 B13 S=8  HW', '<p> Pro oezvn inejobtnjch dl podle ablony<br />  HM tvrdokovov bity<br />  Speciln koprovac loisko naele frzy</p>\\n<p>Nejpouvanj oezvac frza, kter je uren na koprovn ablon s perfektnm vsledkem opracovn.<br /> Pro ofrzovn irok struktury a druh materil a to dky HW zubm. Oprn loisko zajiuje pesn veden a opru v ezu.</p>', '_vyr_60C-web.jpg', 0, '517.00', '575.00', 'GZ1050', '_vyrn_60C-web.jpg', '_vyrp11_60GZ-C-1.jpg', '_vyrp12_60Dis_B_C-lav.png', '_vyrp13_60Dis_B_C.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7704, 61, '5 Frza na V drku 22,5 - D15x15 45 S=6 HW', '5 Frza na V drku 22,5 - D15x15 45 S=6 HW', '<p> ist dokonal ezydodesek nebo el zsuvek<br /> Pro sren hran<br /> Pro frzovn npis a grarovn</p>\\n<p>Nejpouvanj popisovac frza, kter je uren pro popisovn, gravrovn a frzovn ostrh roh s perfektnm vsledkem opracovn.<br /> Pro ofrzovn irok struktury a druh materil a to dky HW zubm. Pouit v run frzce nebo na CNC strojch.</p>', '_vyr_615-web.jpg', 0, '607.00', '675.00', 'GZ135', '_vyrn_615-web.jpg', '_vyrp11_61GZ-5-1.jpg', '_vyrp12_615-1.png', '_vyrp13_615-2.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|7-0-0-0|7-422-0-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03');
