(7705, 62, 'CC Sada na rm nbytkovch dvek S=8  HW', 'CC Sada na rm nbytkovch dvek S=8  HW', '<p>Sestava obsahuje jednu frzu, pomoc kterch vyrobte okrasn rmeek pro kuchysk dvka, do dve komod, vitrn nebo skn. Sestavou vyrobte podln profil napce. Peskldnm profilov frzy drkovacho kotouku vyrobte kontra profil nakonci pek. Cel spoj mte v jednom nstroji.</p>\\n<p>Jako voliteln psluenstv je mon dokoupit profilov talek dky ktermu jednodue zmnte prosil rmeku.<br /> <br /> Frza je opatena loiskem a podlokami, dky emu si pesn seskldte potebnou vku profilu.<br /> <br /> Pouit: Pro vrobu vpln dvek a dve. Doporuujeme pouit frzovacho stolku.</p>', '_vyr_62GZ-817.png', 0, '1500.00', '1875.00', 'GZ817', '_vyrn_62GZ-817.png', '_vyrp11_62GZ-817-1.png', '_vyrp12_62GZ-817-2.png', '_vyrp13_62GZ-817-3.png', 21, 1, 3, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|7-0-0-0|7-422-0-0|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7706, 63, 'CT Nhradn kotouek HEL pro frzu CC na dvka D=6  HW', 'CT Nhradn kotouek HEL pro frzu CC na dvka D=6  HW', '<p></p>\\n<p>Profilovac talek, voliteln psluenstv dky ktermu jednodue zmnte prosil rmeku.<br /> <br />Ureno pro frzu HZ817<br /> <br /> Pouit: Pro vrobu vpln dvek a dve. Doporuujeme pouit frzovacho stolku.</p>', '_vyr_63F-semplice-web.jpg', 0, '900.00', '1000.00', 'GZ1943', '_vyrn_63F-semplice-web.jpg', '_vyrp11_63GZ-CTU-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7707, 64, 'CT Nhradn kotouek RDIUS pro frzu CC na dvka D=6  HW', 'CT Nhradn kotouek RDIUS pro frzu CC na dvka D=6  HW', '<p></p>\\n<p>Profilovac talek, voliteln psluenstv dky ktermu jednodue zmnte prosil rmeku.<br /> <br />Ureno pro frzu HZ817<br /> <br /> Pouit: Pro vrobu vpln dvek a dve. Doporuujeme pouit frzovacho stolku.</p>', '_vyr_64F-compl-web.jpg', 0, '900.00', '1000.00', 'GZ1942', '_vyrn_64F-compl-web.jpg', '_vyrp11_64GZ-CTR-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7708, 65, '8PB Frza na vpln - D42x12 S=8 HW', '8PB Frza na vpln - D42x12 S=8 HW', '<p>POZOR: Frzy pouvejte pi nich otkch mezi 10000 a12000 ot./min. Pro bezpen apesn dosaen poadovanho profilu doporuujeme ti a pt prchod. Vkon frzky mus bt nejmn 1500W.<br /><br />Pouit: Pro vrobu vpln dvek, dve azsuvkovch el. Nutno pout frzovac stolek. Doporuujeme n frzovac stolek, kter byl testovn pro toto pouit.</p>', '_vyr_658PB-web.jpg', 0, '1192.00', '1325.00', 'GZ1235', '_vyrn_658PB-web.jpg', '_vyrp11_65GZ-8PB-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|7-0-0-0|7-422-0-0|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7709, 67, 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z4+4 HW vmnn iletky', 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z4+4 HW vmnn iletky', '<p>- Lamelovac kotou s CHROME povrchem<br />- HW iletkov zuby, kter nabzej maximln vkon<br />- Ureno pro run lamelovac frzky</p>\\n<p>Fink lamelovac kotou s chromovm povrchem je vyroben z jakostn oceli. Tlo je kvalitn obrobeno na CNC stroji a osazeno vmnnmi tvrdokovovmi iletkami, kter garantuj dlouhou ivotnost a monost rychl vmny i otoen. Ureno pro lamelovac frzky.</p>', '_vyr_67fink16-lamelovaci-kotouc.jpg', 0, '3100.00', '4133.00', 'FRHWFINK16', '_vyrn_67fink16-lamelovaci-kotouc.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-2-286-0|2-2-287-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7710, 68, 'Pedezov kotou dvoudln - D100x2,8-3,6 d20 Z10+10 HW', 'Pedezov kotou dvoudln - D100x2,8-3,6 d20 Z10+10 HW', '<p>Pilov kotou od znaky Stehle vynik nmeckou kvalitou. pikovpedezov dvoudln pilov kotou pro pily s pedezovm agregtem. Je osazen HW zuby z extra tvrdho nmeckho tvrdokovu pro ezn lamina, devotskovch desek, MDF a HPL nebo kompakt. Vysok ivotnost a vdr.</p>', '_vyr_68predrez-Stehle.jpg', 0, '1819.00', '2139.00', 'S58110190', '_vyrn_68predrez-Stehle.jpg', '101456_68__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7711, 69, 'Pilov kotou na lamino, DTD a MDF - D300x3,2 d30 Z96 HW', 'Pilov kotou na lamino, DTD a MDF - D300x3,2 d30 Z96 HW', '<p>Pilov kotou od znaky GDA. Konstrukce vynik kvalitnm odhlunnm a rozdlen na vce segment. M v tle tlumc drky pro snen vibrac a hlunosti. Je osazen trapzovmi zuby z tvrdokovu pro ezn lamina, devotskovch desek, MDF a HPL nebo kompakt. Vysok ivotnost a vdr.</p>\\n<p>Ureno pro pouit s pedezem.</p>', '_vyr_69kotouc-hlavni-GDA.jpg', 0, '1600.00', '2000.00', 'PKTFFL0019', '_vyrn_69kotouc-hlavni-GDA.jpg', '101456_69__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7712, 71, 'Pilov kotou SK 300x3,2/2,2x30 5383-35 28 LWZ', 'Pilov kotou SK 300x3,2/2,2x30 5383-35 28 LWZ', '<p>Pro pn a podln ezn prodnch dev. Pilov kotoue jsou vybaveny omezovaem tsky. Run posuv.</p>', '_vyr_71pilovy-kotouc-5383-35.jpg', 0, '816.00', '907.00', 'PKWZPL0007', '_vyrn_71pilovy-kotouc-5383-35.jpg', '_vyrp11_715383-35.jpg', '_vyrp12_715383-35-2.jpg', '', 21, 1, 2, 0, '', 0, '2-2-19-0|2-2-0-0|2-2-19-352|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7713, 72, 'Pilov kotou SK 250x3,2/2,2x30 5381-16 48 WZ', 'Pilov kotou SK 250x3,2/2,2x30 5381-16 48 WZ', '<p>Pro pn ezn prodnch dev. ezn tvrzench textli a tvrzenho papru s vymi poadavky na kvalitu ezu.</p>', '_vyr_72pilovy-kotouc-5381-20.jpg', 0, '959.00', '1066.00', 'PKWZPL0010', '_vyrn_72pilovy-kotouc-5381-20.jpg', '_vyrp11_725381-20.jpg', '_vyrp12_725381-20-1.jpg', '', 21, 1, 2, 0, '', 0, '2-2-19-0|2-2-0-0|2-2-19-353|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7714, 74, '511B Oezvac iletkov frza - D1225 L70 S=8 HW', '511B Oezvac iletkov frza - D1225 L70 S=8 HW', '<p>- Masivn konstrukce</p>\\n<p>- Jedinen konstrukce s vyvenm</p>\\n<p>- Pesn ustaven iletky v lku</p>\\n<p>- Nejmen prmr v iletkovm proveden</p>\\n<p>Frza urena pro pesn lcovac frzovn akoprovn podle ablony, kter je vespod. Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza tento jev eliminuje pomoc pesn ustavench vmnnch iletek, kter se navc daj otet apout a 4 bity. Pro frzovn Corianu je mon dokoupit rovn nebo kuelov loisko splastovm kroukem, kter zabezpe pesn veden pomaterilu.</p>\\n<p>Specifikace:</p>\\n<p>- Loisko</p>\\n<p>- MAN</p>\\n<p>- Z1</p>\\n<p>- HW iletky</p>', '_vyr_74orezavaci-ziletkova-Briani.jpg', 0, '2105.88', '2237.00', '511B1200800', '_vyrn_74orezavaci-ziletkova-Briani.jpg', '', '', '', 21, 1, 2, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7715, 77, 'Vrtac veteno EVVP1 pro EVLC Jig', 'Vrtac veteno EVVP1 pro EVLC Jig', '<p>Vrtac veteno EVVP1 je ureno pro vrtac ppravky k vyvrtn potebnch otvor.<br /><br />Jedinen vrtac pouzdro nahrazuje ji znanzastaral a namhav systm kalench ocelovchpouzder a levnch ocelovch vrtk, kter vydrostr v laminu opravdu jenpr dr.<br /><br />Vrtac pouzdro umouje pouit rznchprmr kolkovacch HM tvrdokovovch vrtkod prmru 3 mm do prmru 15 mm s upnacm prmrem stopky 8 mm.</p>', '_vyr_77EVVP1-2.jpg', 0, '695.00', '0.00', 'EVVP-1', '_vyrn_77EVVP1-2.jpg', '_vyrp11_77EVLC_Lamello-cabineo-15.jpg', '', '', 21, 1, 5, 0, '', 0, '4-107-0-0|4-107-384-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7716, 78, 'Vrtk pro neprchoz dry D-5mm HW', 'Vrtk pro neprchoz dry D-5mm HW', '<p>Tlo vrtku z vysoce kvalitn tvrzen oceli.<br /> HM hlava s pesn vycentrovanm stedicm hrotem.<br /> 2 precizn brouen HM bity (Z2).<br /> 2 HM zuby s pedezy a radilnm podbrouenm (V2).<br /> 4 spiralov drky.<br /> Vlcov upnac stopka s unec plochou a roubem pro nastaven dlky.<br /> Baleno v plastov krabice po 1 kuse.<br /> Ekonomick balen po 5 kusech.<br /> Vrtac hlava pro vrtn istch neprchozch otvor s plochm dnem.<br /> Pesn brouen stopka pro pesn upnut ve stroji.<br /> Teflonov povrch pro lep odvod tsek.<br /><br />Pouit: navrtacch strojch akolkovakch pro vrtn neprchozch otvor doDTD, MDF, lamina aplast.</p>', '_vyr_78c30805011.jpg', 0, '243.00', '0.00', 'EVVN5', '_vyrn_78c30805011.jpg', '_vyrp11_78c30805011-1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-0-0-0|2-372-0-0|4-107-384-0|7-0-0-0|7-422-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
(7717, 79, 'Sukovnk pro neprchoz otvor D-15mm HW', 'Sukovnk pro neprchoz otvor D-15mm HW', '<p>Sukovnk se stopkou 8 mm, pedezovmi hroty, centrovacm hrotem a 2 eznmi zuby.<br />Vechny hroty jsou z tvrdokovu urenho pro vrtn do DTD, LTD a mkkho i tvrdho deva.<br />Vborn i pro vrtn do lamino desek.<br />Kvalitn a pesn nstroj.</p>', '_vyr_79c39215011.jpg', 0, '472.00', '0.00', 'EVSN15', '_vyrn_79c39215011.jpg', '_vyrp11_79c39215011-1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-0-0-0|2-5-0-0|2-5-293-0|2-5-293-373|2-5-293-375|4-107-384-0|7-0-0-0|7-422-0-0|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:03'),
(7718, 80, 'Spojovac prvek LAMELLO - CABINEO, dlka euro roubu 12mm - 1 ks', 'Spojovac prvek LAMELLO - CABINEO, dlka euro roubu 12mm - 1 ks', '<p>Cabineo lze vyvrtvatna jednoduchch CNC strojch o 3 osch nebo pomoc naeho ppravku EVLC Jig. Ve je konstruovno pro maximln jednoduchost vroby a monte i s minimem prostedk.</p>\\n<p>Systm nabz velice jednoduchou vrobu,dopravu a konenou mont u zkaznka. Samozejmost je stohovn s minimem vynvajcch st a tm pokozen lakovanch povrch.</p>\\n<p>Vzhledem k tomu, e prvky jsou ji z vroby nainstalovny, toto urychluje mont a znan pomh pi sniovn ppadn chyby.</p>\\n<p>Pedinstalovan roub uvnit tvarovky je pak zaroubovn do 5 mm vrtan dry v odpovdajcm obrobku, pomoc imbusovho kle s kulovou hlavou.</p>\\n<p>Krytky v rznch barvch jsou tak k dispozici</p>', '_vyr_80Lamello-Cabineo.jpg', 0, '9.00', '11.00', '186320-1', '_vyrn_80Lamello-Cabineo.jpg', '_vyrp11_80EVLC_Lamello-cabineo-10.jpg', '_vyrp12_80EVLC_Lamello-cabineo-13.jpg', '_vyrp13_80Rozmery-a-roztece-vrtani-4.jpg', 21, 1, 1, 0, '', 0, '5-389-0-0|5-0-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7719, 81, 'Spojovac prvek LAMELLO - CABINEO, dlka euro roubu 8mm - 1 ks', 'Spojovac prvek LAMELLO - CABINEO, dlka euro roubu 8mm - 1 ks', '<p>Cabineo lze vyvrtvatna jednoduchch CNC strojch o 3 osch nebo pomoc neho ppravku EVLC Jig. Ve je konstruovno pro maximln jednoduchost vroby a monte i s minimem prostedk.</p>\\n<p>Systm nabz velice jednoduchou vrobu,dopravu a konenou mont u zkaznka. Samozejmost je stohovn s minimem vynvajicch st a tm pokozen lakovanch povrch.</p>\\n<p>Vzhledem k tomu, e prvky jsou ji z vroby nainstalovny, toto urychluje mont a znan pomh pi sniovn ppadn chyby.</p>\\n<p>Pedinstalovan roub uvnit tvarovky je pak zaroubovn do 5mm vrtan dry v odpovdajcm obrobku, pomoc imbusovho kle s kulovou hlavou.</p>\\n<p>Krytky v rznch barvch jsou tak k dispozici</p>', '101456_81__vyr_80Lamello-Cabineo.jpg', 0, '8.00', '10.00', '186310-1', '101456_81__vyrn_80Lamello-Cabineo.jpg', '101456_81__vyrp11_80EVLC_Lamello-cabineo-10.jpg', '101456_81__vyrp12_80EVLC_Lamello-cabineo-13.jpg', '101456_81__vyrp13_80Rozmery-a-roztece-vrtani-4.jpg', 21, 1, 80, 0, '', 0, '5-389-0-0|5-0-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7720, 82, 'Drkovac frza iletkov nstrn 125x8 d30 Z4+4 HW', 'Drkovac frza iletkov nstrn 125x8 d30 Z4+4 HW', '<p>- Frza pro drkovn a falcovn<br />- Cist hrany dky predrezovm iletkm<br />- Na masivn drevo velkoplon materily</p>\\n<p>Nstroj je osazen tvrdokovovmi iletkami. Ureno pro run posuv. Pouit vhodn na rostl i aglomerovan devo.</p>', '_vyr_82drazkovaci-fr--ziletkova-RH.jpg', 0, '1950.00', '2166.00', '22012508', '_vyrn_82drazkovaci-fr--ziletkova-RH.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-3-24-0|2-3-0-0|13-0-0-0|13-601-0-0', NULL, '2021-01-10 15:44:03'),
(7721, 83, 'Zaoblovac frza konvex-konkv 1162030 HW', 'Zaoblovac frza konvex-konkv 1162030 HW', '<p>- HW vmenn iletky o tloutce 2mm<br />- Monost zakoupen nhradnch HW iletek<br />- Na masivn drevo, velkoplon materily a plasty</p>\\n<p>Pouit na rostl i aglomerovan devo, plasty apod.</p>\\n<p><strong>Proveden:</strong></p>\\n<ul>\\n<li>Oocelov tleso</li>\\n<li>Dvoubit frza</li>\\n<li>Vmnn bitov destiky (VBD)</li>\\n<li>Ustavovn bez poteby seizovn</li>\\n<li>Monost doplnn loiskem D100mm</li>\\n<li>Run posuv - MAN</li>\\n</ul>', '_vyr_83freza-konvex-konkav-RH.jpg', 0, '2990.00', '3322.00', '57308030', '_vyrn_83freza-konvex-konkav-RH.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-3-0-0|2-3-27-0|7-0-0-0|7-422-0-0|13-0-0-0|13-604-0-0', NULL, '2021-01-10 15:44:03'),
(7722, 86, 'Frzovac hlava staviteln  pro spojovn deva na dlku D150x80  d30(40) HW', 'Frzovac hlava staviteln  pro spojovn deva na dlku D150x80  d30(40) HW', '<p>- Sestava masivnch frz s ocelovm tlem<br /> - Extra siln, vmnn HW noe<br /> - Pesn nastaven pomoc mezi krouk</p>\\n<p>Staviteln spojovac frza CAUL s nastavitelnou tloukou frzovn.<br />Zvlt vhodn pro podln nastavovn deva.<br /><br /></p>\\n<p>Masivn tlo nstroje. Maximln vka frzovn je 80mm s nastavitelnou vkou pomoc podloek.</p>\\n<p>Frzovac hlavu je mon upnout na hdel 30mm nebo 40mm.</p>\\n<p>Ureno pro profesionln obrbn deva.</p>', '_vyr_86freza-na-spoje-caul.jpg', 0, '15900.00', '22700.00', 'CAULTG02S', '_vyrn_86freza-na-spoje-caul.jpg', '_vyrp11_86freza-na-spoje-caul-3.jpg', '_vyrp12_86freza-na-spoje-caul-4.jpg', '_vyrp13_86freza-na-spoje-caul-1.jpg', 21, 1, 1, 1, '', 0, '2-3-28-0|2-3-0-0|7-0-0-0|7-422-0-0|13-0-0-0|13-605-0-0', NULL, '2021-01-10 15:44:03'),
(7723, 87, 'Frzovac hlava na sprovku D125x60 d30 HW', 'Frzovac hlava na sprovku D125x60  d30 HW', '<p>- Masivn tlo frzy z oceli<br />- Extra HW noe pro sprovku a 60mm<br />- Tvar no pro pohodln lepen deva</p>\\n<p>Spojovac iletkov frza CAUL s nastavitelnou tloukou frzovn.<br />Zvlt vhodn pro tvorbu sprovky ze deva. Dky tvaru vlnovky dochz k lepmu staen dky plynulmu vytlaen lepidla.<br /><br /></p>\\n<p>Masivn tlo nstroje. Maximln vka frzovn je 60mm.</p>\\n<p>Frzovac hlavu je mon upnout na hdel 30mm.</p>\\n<p>Ureno pro profesionln obrbn deva.</p>', '_vyr_87freza-na-sparovku-caul.jpg', 0, '3980.00', '4975.00', 'FRHWCAUL00', '_vyrn_87freza-na-sparovku-caul.jpg', '_vyrp11_87freza-na-sparovku-caul-1.jpg', '_vyrp12_87freza-na-spoje-caul-1.jpg', '_vyrp13_87freza-na-spoje-caul-2.jpg', 21, 1, 1, 1, '', 0, '2-3-28-0|2-3-0-0|7-0-0-0|7-422-0-0|13-0-0-0|13-605-0-0', NULL, '2021-01-10 15:44:03'),
(7724, 89, 'Kletinov upna CNC HSK 63F - DIN6388 RH/LH', 'Kletinov upna CNC  HSK 63F RH/LH', '<p>Upna nstroj s upnac kletinou na CNC frzovacch strojch s automatickou vmnou nstroj.</p>\\n<ul>\\n<li>upnac kuel podle DIN 69893-6 tvar F</li>\\n<li>kalen a brouen proveden</li>\\n<li>pesn vyven</li>\\n<li>zabezpeen nstroj proti pootoen pomoc roub nebo kolk</li>\\n<li>upnae jsou dodvny vetn pevlen matice pro provo-lev chod</li>\\n</ul>', '_vyr_89HSK63F.jpg', 0, '2497.00', '2775.00', '900101', '_vyrn_89HSK63F.jpg', '_vyrp11_89HSK63F-1.jpg', '', '', 21, 1, 1, 1, '', 0, '2-8-0-0|2-8-306-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7725, 91, 'ep unaee ISO30 - BIESSE, HSD Masterwood, Cosmec', 'ep unaee ISO30 - BIESSE, HSD Masterwood, Cosmec', '<p>Krom kletin a unae Vm nabzme epy pro unaee. Tento ep je uren pro stroje <strong>BIESSE</strong>, <strong>HSD Masterwood</strong> a <strong>Cosmec</strong>. Prmr nstroje je <strong>12 mm</strong>, celkov delka je <strong>44 mm</strong>.</p>\\n<p><strong>Technick parametry:</strong></p>\\n<ul>\\n<li>Pro upna <strong>ISO30</strong></li>\\n<li>Pro stroje<strong>BIESSE</strong>, <strong>HSD Masterwood,</strong><strong>Cosmec</strong></li>\\n<li>Prmr stopky <strong>12 mm</strong></li>\\n<li>Prmr v nejum mst <strong>8 mm</strong></li>\\n<li>Celkov dlka <strong>44 mm</strong></li>\\n<li>Dlka hlavice <strong>19,5 mm</strong></li>\\n<li>Radius hlavice <strong>R 3,2</strong></li>\\n</ul>\\n<p></p>\\n<p><img src=\\\"/fotky101456/biesekoty.jpg\\\" alt=\\\"\\\" width=\\\"250\\\" height=\\\"258\\\" /></p>\\n<p>Vyuijte tak naeho odbornho poradenstv. Nai odbornci Vm telefonicky pomohou s <strong>vhodnm vbrem nstroje</strong>, projdou s Vmi cel proces osazovn novho stroje, nebo', '_vyr_91upinaci-cep-CNC.jpg', 0, '440.10', '489.00', 'CDM12BIE', '_vyrn_91upinaci-cep-CNC.jpg', '_vyrp11_91biesekoty.jpg', '', '', 21, 1, 13, 1, '', 0, '2-8-0-0|2-8-812-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7726, 92, 'ep unaee ISO30 - Cms, HSD Cms', 'ep unaee ISO30 - Cms, HSD Cms', '<p>Krom kletin a unae Vm nabzme epy pro unaee. Tento ep je uren pro stroje<span></span><strong>Cms, HSD Cms</strong>. Prmr nstroje je<span></span><strong>12 mm</strong>, celkov delka je<span></span><strong>44 mm</strong>.</p>\\n<p><strong>Technick parametry:</strong></p>\\n<ul>\\n<li>Pro upna<span></span><strong>ISO30</strong></li>\\n<li>Pro stroje <strong>Cms, HSD Cms</strong></li>\\n<li>Prmr zvitu<span></span><strong>12 mm</strong></li>\\n<li>Prmr v nejum mst<span></span><strong>9 mm</strong></li>\\n<li>Celkov dlka<span></span><strong>44 mm</strong></li>\\n<li>Dlka hlavice<span></span><strong>19 mm</strong></li>\\n<li>Radius hlavice<span></span><strong>R 2,4</strong></li>\\n</ul>\\n<p></p>\\n<p><img src=\\\"/fotky101456/cmskoty.jpg\\\" alt=\\\"\\\" width=\\\"336\\\" height=\\\"334\\\" /></p>\\n<p>Vyuijte tak naeho odbornho poradenstv. Nai odbornci Vm telefonicky pomohou s<span></span><strong>vhodnm vbrem nstroje</strong>, projdou s Vmi cel proces osazovn', '_vyr_92cdm12cms.jpg', 0, '440.10', '489.00', 'CDM12CMS', '_vyrn_92cdm12cms.jpg', '_vyrp11_92cmskoty.jpg', '', '', 21, 1, 3, 1, '', 0, '2-8-0-0|2-8-305-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7727, 93, 'Kletina OZ 25/DIN 6388 - 8mm', 'Kletina OZ 25/DIN 6388 - 8mm', '<p> Kletinov kuel v kombinaci s dlouhm upnacm otvorem pro siln seven a tuhost.<br /> Konzistentn siln seven v celm dlce 52mm v rozsahu 0-0,5 mm upnacho prmru.<br /> Navreno pro vechny druhy sloitjch operac s nrokem na pesnost upnut.<br /> Zaruena dlouh ivotnost dky vysoce kvalitn oceli a pelivmu tepelnmu zpracovn.</p>\\n<p>O sprvn monti kletin a pevlench matic si mete peit v naem <a title=\\\"Usazen kletiny do upnae\\\" href=\\\"https://www.stopkovefrezy.cz/Usazeni-klestiny-do-upinace-a6_15.htm\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">lnku</a>.</p>', '_vyr_93klestina-pro-din.jpg', 0, '524.00', '582.00', '910008', '_vyrn_93klestina-pro-din.jpg', '_vyrp11_93klestina-pro-din-1.jpg', '', '', 21, 1, 2, 1, '', 0, '2-8-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7728, 95, '161 Frza na V drku iletkov Z1 D50x25 91 S=20 HW', '161 Frza na V drku iletkov Z1 D50x25 91 S=20 HW', '<p>- Frza pro gravrovn a frzovn V drek<br />- Ureno pro CNC obrbn deva, lamina a HPL<br />- Masivn tlo nstroje s pesnm vyvenm</p>\\n<p>Frza s vmnnmi iletkami s jednm bitem, urenm k V drkovn tvrdho deva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobr upnut na CNC strojch pi vysokch otkch.</p>', '_vyr_95freza-uhlova-a-popisovaci-Briani.jpg', 0, '4890.00', '6112.00', '1619102008', '_vyrn_95freza-uhlova-a-popisovaci-Briani.jpg', '_vyrp11_95161-30-_BRIANI.jpg', '_vyrp12_95161-91-_BRIANI.jpg', '', 21, 1, 2, 1, '', 0, '2-7-43-0|2-7-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7729, 100, '2 Drkovac frza standard - D6x18 L50 S=8 HW', '2 Drkovac frza standard - D6x18 L50 S=8 HW', '<p>- Frzy pro drkovn<br />- Snadn vytvoen drky nebo vezu</p>\\n<p>Gamma Zinkendrkovac frza je urena pro vechny druhy prac. Vyznauje se kvalitnm ostm, kter vyfrzuje dokonalou drku. Pro frzovn podle ablony lze pout koprovac loiska nastopce.<br /><br />Frza m HM bity sdlouhou ivotnost, je precizn naostena. Dky konstrukci je vhodn pro frzovn mkkho atvrdho deva, lepenho deva, DTD, lamina , MDF, HPL aCorianu.<br /><br /><br /></p>', '_vyr_1002-web.jpg', 0, '675.00', '750.00', 'GZ1535', '_vyrn_1002-web.jpg', '_vyrp11_100Dis_B_2HM-lav.png', '_vyrp12_100Dis_B_N.png', '', 21, 1, 1, 1, '', 0, '2-1-11-312|2-1-0-0|2-1-11-0|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:03'),
(7730, 101, '2LTT Stopkov frza se zvrtnm zubem - D8x20 L70 S=8 HW', '2LTT Stopkov frza se zvrtnm zubem - D8x20 L70 S=8 HW', '<p>- Frzy pro pm zavrtn<br />- Po zavrtn mete frzovat poadovanou vku ezu<br />- Snadn vytvoen drky nebo vezu</p>\\n<p>- Men ezn hloubka, vt celkov dlka</p>\\n<p>Gamma Zinken drkovac frza se zvrtnm HM zubem jse urena pro vechny druhy prac vetn zavrtvn domaterilu. HM zavrtvac zub usnaduje zavrtvn domkkho atvrdho deva, DTD, lamino desek, MDF a HDF.<br /><br /><strong>Zavrtvac HM bit naosten pro hlubok zavrtn domaterilu.</strong></p>', '_vyr_1012TTL-web.jpg', 0, '720.00', '800.00', 'GZ3237', '_vyrn_1012TTL-web.jpg', '_vyrp11_101Dis_B_2TT_lav.png', '_vyrp12_101Dis_B_2TT_lav2.png', '_vyrp13_101Dis_B_2TT_70.png', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:03'),
(7731, 102, '2C Falcovac frza na polodrku - H9,5 D32x12 S=8 HM', '2C Falcovac frza na polodrku - H9,5 D32x12 S=8 HM', '<p> ikm ost pro lep odvod tsek.<br /> Pro oezvn inejobtnjch dl podle ablony.<br /> Speciln koprovac loisko naele frzy.</p>\\n<p>S falcovac frzou mete dokonce obnovit lbky starch okennch rm pro vsazen izolovanch skel.<br /><br />Pouit: Pro vsazovan dvka azsuvkov ela, pevn polodrkov spoje, frzovn dokonalch spoj napero adrku apro adu dalch prac.</p>', '_vyr_1022C-web.jpg', 0, '765.00', '850.00', 'GZ488', '_vyrn_1022C-web.jpg', '_vyrp11_102Dis_B_2C-lav.png', '_vyrp12_102Dis_B_2C.png', '', 21, 1, 1, 0, '', 0, '2-1-17-335|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7732, 103, 'Cn Oezvac frza, ikm zuby - D19x20 L70 S=8 HW', 'Cn Oezvac frza, ikm zuby - D19x20 L70 S=8 HW', '<p> Negativn hel ezn hrany.<br /> Pro oezvn inejobtnjch dl podle ablony.<br /> HM tvrdokovov bity.<br /> Speciln koprovac loisko naele frzy.<br /> Prodlouen dlka ost.<br /><br />Gamma Zinken frzy jsou vybaveny spodnm loiskem a jsou spirlov vybroueny co umonuje ist hladk ezy do mnoha materilu. Jedinen nstroj zejmna pro frzovn zakivench tvar podl ablony.</p>', '_vyr_103Cn.jpg', 0, '810.00', '900.00', 'GZ4140', '_vyrn_103Cn.jpg', '_vyrp11_103Cn-1.jpg', '_vyrp12_103Cn-2.jpg', '', 21, 1, 2, 1, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7733, 104, 'Cs Oezvac frza s hornm loiskem - D19x25 S=8  HW', 'Cs Oezvac frza s hornm loiskem - D19x25 S=8  HW', '<p> Pro oezvn inejobtnjch dl podle ablony<br />  HM tvrdokovov bity<br />  Speciln koprovac loisko na stopce frzy</p>\\n<p>Nejpouvanj oezvac frza, kter je uren na koprovn ablon s perfektnm vsledkem opracovn.<br /> Pro ofrzovn irok struktury a druh materil a to dky HW zubm. Oprn loisko zajiuje pesn veden a opru v ezu.</p>', '_vyr_104Csup-web.jpg', 0, '742.50', '825.00', 'GZ3244', '_vyrn_104Csup-web.jpg', '_vyrp11_104Dis_B_Csup-lav.png', '_vyrp12_104Dis_B_Csup.png', '_vyrp13_1046dbfe62e64b4873608b92df198d27a7b.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:03'),
(7734, 105, 'CS Oezvac frza se sraenm 45 - D24x11 B19 S=8 HW', 'CS Oezvac frza se sraenm 45 - D24x11 B19 S=8 HW', '<p> Pro oezvn inejobtnjch dl podle ablony<br /> HM tvrdokovov bity</p>\\n<p> Zaznut a sraen hrany na 45 v jedn operaci<br /> Speciln koprovac loisko naele frzy</p>\\n<p>Nejpouvanj oezvac frza, kter je uren na koprovn ablon s perfektnm vsledkem opracovn.<br />Pro ofrzovn irok struktury a druh materil a to dky HW zubm. Oprn loisko zajiuje pesn veden a opru v ezu.</p>', '_vyr_105CS-web.jpg', 0, '765.00', '850.00', 'GZ1052', '_vyrn_105CS-web.jpg', '_vyrp11_105Dis_B_CS-lav.png', '_vyrp12_105Dis_B_CS.png', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7735, 106, '2TTgf Drkovac frza s upnnm M12 - D16x25 L63 S=M12x1 HW', '2TTgf Drkovac frza s upnnm M12 - D16x25 L63 S=M12x1 HW', '<p>- Ureno pro kovn na bezfalcov dvee</p>\\n<p>- Ideln pro vrobu otvor pro kovn Tectus, BACA PROTECT</p>\\n<p>- HW bity pro maximln vdr a vkon</p>\\n<p>Drkovac frza se zvitovm upnnm je ideln pro frzovn hlubokch otvor, zvs na bezfalcovch dvech pomoc ablony a jinho stavebnho kovn napklad znaku Tectus. Tato frza se umst na unaec stopku dky zvitu M12x1 a dky unaes stopce je mon nstroj prodlouit na celkovou dlku a 132 mm. Dky HW bitm jsou vhodn na masiv, devn kompozity, plasty a laminty. Me bt pouvna na obrbn v CNC frzch a runch frzkch. Upnac stopku pro upnut v kletin je nutno objednat zvl.</p>\\n<p>- Tectus 210/240 - Prmr nstroje 16mm, ezn hloubka 25mm nebo 35mm</p>\\n<p>- Tectus 310/340 - Prmr nstroje 24mm, ezn hloubka 25mm nebo 35mm</p>\\n<p>- BAKA PROTECT 3D - Prmr nstroje 20mm, ezn hloubka 25mm nebo 35mm</p>', '_vyr_1062tt-gf-web.jpg', 0, '990.00', '1100.00', 'GZ1137', '_vyrn_1062tt-gf-web.jpg', '_vyrp11_106Dis_B_2TT_lav.png', '_vyrp12_106Dis_B_2TT_lav2.png', '_vyrp13_106Dis_B_N.png', 21, 1, 1, 0, '', 0, '2-1-11-314|2-1-0-0|2-1-11-0|14-0-0-0|14-610-0-0|14-610-623-0', NULL, '2021-01-10 15:44:03'),
(7736, 107, 'IGM FKP656 Vrtac ppravek sada 656mm + ZDARMA 100ks kolk 8x35', 'IGM FKP656 Vrtac ppravek sada 656mm + ZDARMA 100ks kolk 8x35', '<p><strong> Pro kolkovn na hran dlce<br /> Pro spojovn na konfirmty<br /> Monost upnut rznch prmr vrtk<br /> Rozte otvor v evropsk norm</strong><br /></p>\\n<p><strong>Univerzln vrtac ppravek je uren pro pesn a produktivn run kolkovn nbytkovch dlc.Doclte vysokou pesnost a produktivitu prce. Jednotliv pozice dr jsou konstruovny s rozte32mm, co odpovd standardn euro norm pro strojn kolkovn dlc. Ppravek je uren pro pouitnaich kolkovacch vrtk z HM tvrdokovovou pikou, kter jsou upnut ve vrtacm pouzdru stejnmsystmem jako v kolkovace.</strong><br /></p>\\n<p><strong>Pesnost a jednoduchost pi vrtn kolk</strong><br />Vrtac ppravek automaticky vytv pesn rohov spoj s fazetkou 0,5mm. Koncov dorazy<br />ppravku zajiuj zarovnn spojovanch dlc z pedn nebo zadn strany.<br /></p>\\n<p>Kolky i konfirmty je mon vyrbt pouhouvmnou vrtk ve vrtacm pouzde.<br /><br /><strong>Vrtn ko', '_vyr_107pictureprovider-aspx.jpg', 0, '3800.00', '4089.00', 'FKP656-set', '_vyrn_107pictureprovider-aspx.jpg', '_vyrp11_107pictureprovider1-aspx.jpg', '_vyrp12_107pictureprovider2-aspx.jpg', '', 21, 1, 1, 1, '', 0, '4-107-384-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:03'),
(7737, 108, 'IGM FKP900 Vrtac ablona sada 900mm + ZDARMA 100ks kolk 8x35', 'IGM FKP900 Vrtac ablona sada 900mm + ZDARMA 100ks kolk 8x35', '<h2><span style=\\\"font-size: 14px;\\\">Jednoduchost a rychlost -snadn zpracovn celho korpusu</span></h2>\\n<p><strong> Pro kolkovn do plochy<br /> Otvory pro konfirmty do ploch<br /> Pro nosie polic<br /> Pro vrtn chytek<br /> Pro NK panty (Hettich, Blum, Mepla, Grass a dal)</strong><br /><br />Univerzln vrtac ablona je urena pro pesn a produktivn run kolkovn nbytkovch dlc doplochy s Euro rozte 32mm, pro vrtn dr nosi polic prmru 3 a 5mm, vrtn otvor pro chytka, provrtn a znaen otvor pro NK panty. FKP900 obsahuje ablony pro pedvrtn dr nejpouvanjch NKpant. Se ablonou FKP900 zhotovte jak dry pro Euro rouby i vruty podloek pant na korpusovmdlu, tak pedvrtte dry pro pant na dvkch vetn oznaen stedu misky NK pantu. S FKP900 docltevysokou pesnost a produktivitu prce jak v dln, tak i na monti. ablona je urena pro pouit s vrtacmvetenem FKP101, do kterho lze upnout vrtky rznch prmr od 3mm ', '_vyr_108pictureprovider4-aspx.jpg', 0, '3200.00', '3548.00', 'FKP900-set', '_vyrn_108pictureprovider4-aspx.jpg', '_vyrp11_108pictureprovider5-aspx.jpg', '_vyrp12_108pictureprovider6-aspx.jpg', '_vyrp13_108pictureprovider7-aspx.jpg', 21, 1, 1, 0, '', 0, '4-107-384-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:03'),
(7738, 115, '153 Dlabac frza iletkov HM D20x30 L135mm S=20 Z2', '153 Dlabac frza iletkov HM D20x30 L135mm S=20 Z2', '<p> Stl ezn prmr vmnnch iletek HM<br /> Odolnj tvrdokov u iletek proti celotvrdokovovm frzm<br /> Perfektn vyven tlo<br /> Snen rizika zlomen<br /> Produktivn a ekonomick vroba<br /></p>\\r\\n<p>Pro vyvrtvn extra hlubokch dlab do masivnho deva. Ideln pro frzovn tvrdho deva nebo devnch kompozit. Lze frzovat dlaby postupn krok za krokem a do clov hloubky s vysokou rychlost. Ureno pro pouit s CNC obrbcmi centry.<br /><br />D=20 mm, L=135 mm<br /><br /><em> Vyrobeno z extra pevn oceli<br /> 2 bity (Z2R)<br /> Lama tsky</em></p>', '_vyr_115153.jpg', 0, '4880.66', '5422.95', '1532003008', '_vyrn_115153.jpg', '', '', '', 21, 1, 1, 4, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7739, 116, '155 Drkovac frza iletkov - D19x50 L110 S=20 HM', '155 Drkovac frza iletkov - D19x50 L110 S=20 HM', '<p>Drkovac stopkov frza sjednou zavrtvac iletkou ajednou ezac iletkou. M vynikajc vlastnosti pi zavrtvn vtvrdm dev adeskovch materilech (lamino, devotska, MDF a Corian). Stopka prmru 20 mm je urena pro bezpen upnut v CNC obrbcch centrech pi vysokch posuvovch rychlostech. Lze pout tak pro run frzovn.<br /><br />Frza je vybavena zavrtvac iletkou, kter usnaduje zavrtvn do materilu.</p>\\n<p>Specifikace:</p>\\n<p>- Drkovn, oezvn</p>\\n<p>- CNC</p>\\n<p>- MEC</p>\\n<p>- Z2</p>\\n<p>- HW iletky</p>', '_vyr_116155_BRIANI.jpg', 0, '3810.73', '4234.14', '1551905009', '_vyrn_116155_BRIANI.jpg', '_vyrp11_116155_BRIANI_TECH.jpg', '_vyrp12_116155_WORKING.jpg', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7740, 117, '158 Frza na V drku iletkov Z1 T7,3 L73 92 S=12 HW', '158 Frza na V drku iletkov Z1 T7,3 L73 92 S=12 HW', '<p>- Frza pro gravrovn a frzovn V drek<br />- Ureno pro CNC obrbn deva, lamina a HPL<br />- Masivn tlo nstroje s pesnm vyvenm</p>\\n<p>Frza s vmnnmi iletkami s jednm bitem, urenm k V drkovn tvrdho deva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobr upnut na CNC strojch pi vysokch otkch.</p>\\n<p>Specifikace:</p>\\n<p>- Popisovac, hlov</p>\\n<p>- CNC</p>\\n<p>- MEC, MAN</p>\\n<p>- Z1</p>\\n<p>- HW iletky</p>', '_vyr_117158_BRIANI.jpg', 0, '1409.64', '1566.27', '1584501208', '_vyrn_117158_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-15-0|2-7-0-0|2-7-43-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7741, 118, '164 Stopkov frza na plochy HM - D80x12 L90 S=20x50 Z3', '164 Stopkov frza na plochy HM - D80x12 L90 S=20x50 Z3', '<p>Frza na plochy je ideln pro rychl posuv a velk bry materilu z plochy materilu. Vsledkem je vdy dokonale srovnan povrch. Frzy maj 3 ubrac iletky posazrn v axilnm hlu, pro vytvoen skuten ostrho rohu. Pro frzovn mkkho a tvrdho deva , DTD a MDF, HPL na CNC obrbcch centrech.<br /><br />roub pro nastaven dlky frzy je pouze na stopce S=20mm</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drkovn, oezvn, srovnvn</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MEC</p>\\r\\n<p>- Z3</p>\\r\\n<p>- HW iletky</p>', '_vyr_118164_BRIANI.jpg', 0, '5105.92', '5673.24', '1648002008', '_vyrn_118164_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7742, 119, '162 hlov iletkov frza - 45 D50x25 L75 S=12 HM', '162 hlov iletkov frza - 45 D50x25 L75 S=12 HM', '<p>Frza je urena pro oezvn asren hran.<br /><br />Typ F046 je bez loiska. Uren pro run frzovn atak pro strojn frzovn naCNC centrech.</p>\\n<p>Specifikace:</p>\\n<p>- Sren hrany, oezvn</p>\\n<p>- CNC</p>\\n<p>- MEC, MAN</p>\\n<p>- Z2</p>\\n<p>- HW iletky</p>', '_vyr_119162_BRIANI.jpg', 0, '4004.64', '4449.60', '1624501208', '_vyrn_119162_BRIANI.jpg', '', '', '', 21, 1, 1, 4, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:03'),
(7743, 121, '171 Zaoblovac frza iletkov - R8 D32x18 L80 S=20 HW', '171 Zaoblovac frza iletkov - R8 D32x18 L80 S=20 HW', '<p>Frza je dodvna s HW iletkami. iletky jsou na frze umstny v pesnch lkch pro kvalitn ez materilu.<br /><br />Pouit :<br />Pro velk zaoblovn hran dlc. Ideln pro masivn devo nebo DTD, LTD a MDF. Frzovn je mon pouze po obvodu, nen mon zavrtvn do materilu. Ureno pro mechanick posuv. Pro CNC obrbc centra.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Zaoblovn, oezvn</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_121171_BRIANI.jpg', 0, '5564.00', '6183.00', '1710800200', '_vyrn_121171_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7744, 126, '235 Rybinov iletkov frza pro sten trmy - 15 D40x31,5 S=M12x1 HW', '235 Rybinov iletkov frza pro sten trmy - 15 D40x31,5 S=M12x1 HW', '<p>Rybinov frza je uren pro velk rybinov spoje trm pro devostavby, stechy, krovy atd. Upnac systm vnitn zvit M12x1. Dv HW vmnn iletky.</p>\\r\\n<p>Frzovn spoj pomoc ablony v masivnm dev.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drkovn, rybiny</p>\\r\\n<p>- Run frzovn, CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_126235-ARUNDA_BRIANI.jpg', 0, '4310.09', '4788.99', '2351500028', '_vyrn_126235-ARUNDA_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-16-333|2-1-0-0|2-1-16-0|2-1-16-331|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:03'),
(7745, 127, '259 Frzovac vrtk pro Domino Festool - D8x28 L49 S=M6 HW', '259 Frzovac vrtk pro Domino Festool - D8x28 L49 S=M6 HW', '<p>Dlabac vrtky pro Domino systm firmy Festool od firmy Briani.<br />Neplate vce ne muste a dopejte si pesn a kvalitn vrtky pro Vai Festool Domino frzku.<br />Ureno pro pouit v Domino frzce od Festool.</p>\\n<p></p>\\n<p>Ureno pro:<span style=\\\"font-size: 12px;\\\">DF 500 Q ,</span><span style=\\\"font-size: 12px;\\\">DF 700 EQ</span></p>', '_vyr_127259_DOMINO_FESTO_BRIANI.jpg', 0, '578.10', '642.33', '2590800028', '_vyrn_127259_DOMINO_FESTO_BRIANI.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-1-11-311|2-5-35-0|2-5-35-369|12-0-0-0|12-599-0-0|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:03'),
(7746, 130, '507 Drkovac talov frza - D40x1,5 F6 HW', '507 Drkovac talov frza - D40x1,5 F6 HW', '<p>Talov frza bez unaec stopky v nmeck variant proveden.</p>\\n<p>Pro upnut a nsledn pouit je teba dokoupit unaec trn t.509 ( s loiskem ) nebo t.510( bez loiska )</p>\\n<p>Upnac otvor pro unaec trn m prmr 6mm.</p>\\n<p>Specifikace:</p>\\n<p>- Drkovn v hran, falcovn</p>\\n<p>- MEC,MAN</p>\\n<p>- Z2</p>\\n<p>- HW pjen</p>', '_vyr_130507_BRIANI.jpg', 0, '400.22', '444.69', '50701500600', '_vyrn_130507_BRIANI.jpg', '_vyrp11_130507_kit_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-11-315|2-1-0-0|14-0-0-0|14-610-0-0|14-610-624-0', NULL, '2021-01-10 15:44:03'),
(7747, 133, '511 Oezvac iletkov frza se spodnm loiskem - D19x30 L72 S=8 HW', '511 Oezvac iletkov frza se spodnm loiskem - D19x30 L72 S=8 HW', '<p>Frza Briani je urena pro pesn frzovn akoprovn podle ablony, kter je vespod ( pod materilem ). Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza tento jev eliminuje pomoc pesn ustavench vmnnch iletek, kter se navc daj otet apout a 4 bity.<br /><br />Typ nstroje 511C seznou dlkou 50 mm je vybaven dvma koprovacmi loisky pro lep veden podle ablony.</p>\\n<p>Specifikace:</p>\\n<p>- Loisko</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW iletky</p>', '_vyr_133511_BRIANI.jpg', 0, '1375.87', '1528.74', '51119030800', '_vyrn_133511_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
