(7749, 135, '512 hlov iletkov frza - 45 D29x12 L65 S=8 HW', '512 hlov iletkov frza - 45 D29x12 L65 S=8 HW', '<p>hlov frza Briani je urena pro oezvn asren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.<br /><br />Frza je vybavena koprovacm loiskem, kter je zajitno matic. Uren pro run frzovn.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Loisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_135512_BRIANI.jpg', 0, '1225.94', '1362.15', '51245000800', '_vyrn_135512_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7750, 136, '512B hlov iletkov frza - 45 D29x14 L60 S=8 HW', '512B hlov iletkov frza - 45 D29x14 L60 S=8 HW', '<p>hlov frza Briani je urena pro oezvn, sren a drkovn hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.<br /><br />Frza je vybavena koprovacm loiskem, kter je zajitno roubkem. Nstroj umouje frzovat V drku do hrany materilu. Uren pro run frzovn.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Loisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_136512B_BRIANI.jpg', 0, '1401.62', '1557.36', '512B4500800', '_vyrn_136512B_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7751, 137, '543 hlov iletkov frza - 45 D29x12 L65 S=8 HW', '543 hlov iletkov frza - 45 D29x12 L65 S=8 HW', '<p>hlov frza Briani je urena pro oezvn asren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.<br /><br />Frza je bez loiska. Uren pro CNC a run frzovn.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_137544_BRIANI.jpg', 0, '1106.87', '1229.85', '54445000800', '_vyrn_137544_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:03'),
(7752, 138, '546A Oezvac iletkov frza se stedovm loiskem - D22x12-30 L70 S=8 HW', '546A Oezvac iletkov frza se stedovm loiskem - D22x12-30 L70 S=8 HW', '<p>Frza Briani je urena pro pesn ofrzovn pesah a nklik na materilu podle stedovho materilu. Vhodou tohoto typu oezvac frzy je monost zvolit jakou st nstroje potebujete vyuvat. Mon vyut jako nstroj k oezvn se spodnm, hornm nebo stedovm loiskem.</p>\\n<p>Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza zajiuje pesn ustavench vmnnch iletek, kter se navc daj otet a 4x pout.<br /><br /></p>\\n<p>Specifikace:</p>\\n<p>- Loisko</p>\\n<p>- MAN</p>\\n<p>- Z2/4</p>\\n<p>- HW iletky</p>', '_vyr_138546A_BRIANI.jpg', 0, '2995.95', '3328.83', '54612030800', '_vyrn_138546A_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|2-1-12-318|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0|14-611-627-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7753, 139, '546B Oezvac iletkov frza se stedovm loiskem - D22x30-45 L84 S=8 HW', '546B Oezvac iletkov frza se stedovm loiskem - D22x30-45 L84 S=8 HW', '<p>Frza Briani je urena pro pesn ofrzovn pesah a nklik na materilu podle stedovho materilu. Vhodou tohoto typu oezvac frzy je monost zvolit jakou st nstroje potebujete vyuvat. Mon vyut jako nstroj k oezvn se spodnm, hornm nebo stedovm loiskem.</p>\\r\\n<p>Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza zajiuje pesn ustavench vmnnch iletek, kter se navc daj otet a 4x pout.<br /><br /></p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Loisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2/4</p>\\r\\n<p>- HW iletky</p>', '_vyr_139546B_BRIANI.jpg', 0, '3416.58', '3796.20', '54630045800', '_vyrn_139546B_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|2-1-12-318|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0|14-611-627-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7754, 140, '547 Oezvac iletkov frza s drkovacm kotouem - D22x26 D2-40x4 L66 S=8 HW', '547 Oezvac iletkov frza s drkovacm kotouem - D22x26 D2-40x4 L66 S=8 HW', '<p>Frza Briani je urena pro pesn ofrzovn pesahy a vytvoen drky pro narec hranu. Vhodou tohoto typu frzy je, e jednm projetm oznete materil a vytvote drku 2,5mm, 3mm nebo 4mm. Pouit pomoc oprnho pravtka nebo upnutm ve frzovacm stolku.</p>\\r\\n<p>Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza zajiuje pesn ustavench vmnnch iletek, kter se navc daj otet a 4x pout.<br /><br /></p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2/6</p>\\r\\n<p>- HW iletky</p>', '_vyr_140547_BRIANI.jpg', 0, '4099.65', '4555.17', '54722040800', '_vyrn_140547_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-11-315|2-1-12-390|14-0-0-0|14-610-0-0|14-610-624-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:03'),
(7755, 141, '557C Velk falcovac frza - H17 D50x29,5 L95 S=12 HM', '557C Velk falcovac frza - H17 D50x29,5 L95 S=12 HM', '<p> ikm ost pro lep odvod tsek.<br /> Pro oezvn inejobtnjch dl podle ablony.<br /> HW tvrdokovov bity.<br /> Speciln koprovac loisko naele frzy.<br /> Prodlouen dlka ost.<br /><br />Velk falcovac frza je dodvna se zkladn sadou loisek akroukem 16mm pro frzovn 17 mm falcu. Ktto frze je mon dokoupit 16 velikost koprovacch krouk a ti velikosti loisek, se ktermi vyrobte 19 rznch rozmr falcu. Pi frzovn falc vtch ne 12 mm provdjte vcensobn bry pomoc postupnho zvtovn hloubky.<br /><br />Doporuujeme pouit ve frzovacm stolku.</p>', '_vyr_141557C_BRIANI.jpg', 0, '4004.64', '4449.60', '557C5001200', '_vyrn_141557C_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-17-336|2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7756, 142, '513 Stopkov frza rybinov, iletkov - D28x26 L60 15 S=8 HW', '513 Stopkov frza rybinov, iletkov - D28x26 L60 15 S=8 HW', '<p>Rybinov frza je uren pro vt rybinov spoje foem a desek na nbytku nebo stavebnch prvcch jakou jsou dvee a dal. Dv HW vmnn iletky s monost otoen a dvou ost.</p>\\r\\n<p>Frzovn spoj pomoc ablony nebo pravtek v masivnm dev.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drkovn, rybiny</p>\\r\\n<p>- Run frzovn, CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_142513_BRIANI.jpg', 0, '2995.95', '3328.83', '51315000800', '_vyrn_142513_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-16-331|2-1-0-0|2-1-16-0|2-1-16-333|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:03'),
(7757, 143, '557 Falcovac frza iletkov - B12,5 D38x12 L50 S=8 HW', '557 Falcovac frza iletkov - B12,5 D38x12 L50 S=8 HW', '<p> Pro falcovn inejobtnjch dl podle ablony.<br /> HW tvrdokovov bity.<br /> Koprovac loisko naele frzy.<br /><br />Briani falcovac frza je dodvna se zkladnm loisekem 13mm pro frzovn 12,5 mm falcu. Ktto frze je mon dokoupit tyi velikosti loisek. Pi frzovn falc vtch ne 12 mm provdjte vcensobn bry pomoc postupnho zvtovn hloubky.</p>', '_vyr_143557_BRIANI.jpg', 0, '1551.80', '1724.22', '55738000800', '_vyrn_143557_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7758, 144, '567 Oezvac iletkov frza s hornm a spodnm loiskem - D19x50 L105 S=12 HW', '567 Oezvac iletkov frza s hornm a spodnm loiskem - D19x50 L105 S=12 HW', '<p>Briani oezvac frza s hornm a spodnm loiskem. Dvoustrann iletky upnuty pevnostnmi Torx rouby. Pro pesn lcovac frzovn horn frzkou nebo ve frzovacm stolku.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Loisko horn a spodn</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_144567_BRIANI.jpg', 0, '2144.48', '2382.75', '56719050120', '_vyrn_144567_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-318|14-0-0-0|14-611-0-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7759, 145, '580 Frza na V drku iletkov Z1 T7,3 L63 92 S=8 HW', '580 Frza na V drku iletkov Z1 T7,3 L63 92 S=8 HW', '<p>- Frza pro gravrovn a frzovn V drek<br />- Ureno pro run a CNC obrbn deva, lamina a HPL<br />- Masivn tlo nstroje s pesnm vyvenm</p>\\r\\n<p>Frza s vmnnmi iletkami s jednm bitem, urenm k V drkovn tvrdho deva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobr upnut na CNC strojch pi vysokch otkch.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Popisovac, hlov</p>\\r\\n<p>- RUN frzovn, CNC</p>\\r\\n<p>- MEC, MAN</p>\\r\\n<p>- Z1</p>\\r\\n<p>- HW iletky</p>', '_vyr_145580_BRIANI.jpg', 0, '1499.00', '1566.00', '5804500800', '_vyrn_145580_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-15-0|2-7-0-0|2-7-43-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7760, 146, '583 hlov iletkov frza - 45 D26x19,5 d16 S=8 HW', '583 hlov iletkov frza - 45 D26x19,5 d16 S=8 HW', '<p>hlov frza Briani je urena pro oezvn asren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.<br /><br />Frza je vybavena koprovacm loiskem o prmru 16mm, kter je zajitno roubem. Uren pro run frzovn, sren hrany a zdoben hran.</p>\\n<p>Specifikace:</p>\\n<p>- Loisko</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW iletky</p>', '_vyr_146583_BRIANI.jpg', 0, '1921.89', '2135.43', '58345026800', '_vyrn_146583_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03');
