(7761, 147, '584 Falcovac frza iletkov, sada - d10-16 D26x19,5 L70 S=8 HW', '584 Falcovac frza iletkov, sada - d10-16 D26x19,5 L70 S=8 HW', '<p> Pro falcovn inejobtnjch dl podle ablony.<br /> HW tvrdokovov, iletkov bity.<br /> Koprovac loiska s uputm naele frzy.</p>\\n<p> Prodlouen pracovn vka<br /><br />Briani falcovac frza je dodvna se sadou loisek 3ks. Pi frzovn falc vtch ne 12 mm provdjte vcensobn bry pomoc postupnho zvtovn hloubky.</p>\\n<p>Prmr nstroje 26mm:loiska 10mm, 13mm, 16mm / falc 8mm, 7,5mm, 5 mm</p>\\n<p>Prmr nstroje 32mm:loiska 10mm, 13mm, 16mm / falc 11mm, 9,5mm, 8 mm</p>\\n<p>Specifikace:</p>\\n<p>- Falcovn</p>\\n<p>- Run grzka</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW iletky</p>', '_vyr_147584_BRIANI.jpg', 0, '1799.66', '1999.62', '58426000800', '_vyrn_147584_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7762, 148, '585 Oezvac iletkov frza s hornm loiskem - D19x30 L68 S=8 HW', '585 Oezvac iletkov frza s hornm loiskem - D19x30 L68 S=8 HW', '<p>Frza Briani je urena pro pesn frzovn akoprovn podle ablony, kter je na horn stran materilu. Tento typ nstroje se d vyut i pro silnj materily a to pomoc loiska. Utradin pjen frzy dochz pi osten kezmenen eznho prmru proti loisku ato zpsobuje vznik zubu. iletkov frza tento jev eliminuje pomoc pesn ustavench vmnnch iletek, kter se navc daj otet apout a 4 bity ( plat u iletek 12x12x1,5mm ).</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- KOprovn, drkovn, oezvn</p>\\r\\n<p>- Loisko na stopce</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW iletky</p>', '_vyr_148585-T30_BRIANI.jpg', 0, '1405.27', '1561.41', '58519030800', '_vyrn_148585-T30_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:03'),
(7763, 149, '301 Upnac pouzdro s knickou 30 dosedac plochou, M10 - S10, L46 RH', '301 Upnac pouzdro s knickou 30 dosedac plochou, M10 - S10, L46 RH', '<p>- Vysok pesnost.<br />- Vysoce kvalitn tvrzen ocel.<br />- Rychl vmna vrtku.<br />- Naprost spolehlivost.<br />- Dokonal centrovn.<br />- Plynul rotace.<br />- Nahrazuje vrtk se zvitem.<br /><br />Upnac pouzdra nabzej modern zpsob vmny kolkovacch vrtk v kolkovacch a vyvrtvacch strojch. Tvo pechod mezi strojem a kolkovacmi vrtky. Pro sprvnou volbu upnacho pouzdra je dleit dosedac plocha, volba zvitu nebo prmru pouzdra.<br /><br />Centrovac konus 30 .<br />Pouit nastrojnch typu: Alberti (star model) Balestrini, Bilek, Busellato (star model), Schleicher, Vitap (star model).</p>\\n<p>- RH - pravotoiv proveden - bez drky po obvodu</p>\\n<p>- LH - levotoiv proveden - drka po obvodu</p>', '_vyr_149301DX_BRIANI.jpg', 0, '237.90', '264.33', '3011000008', '_vyr_149301DX_BRIANI.jpg', '_vyrp11_149301SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-396-0|2-372-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
(7764, 150, '303 Upnac pouzdro s vlcovou dosedac plochou d11, M10 - S10, L40 RH', '303 Upnac pouzdro s vlcovou dosedac plochou d11, M10 - S10, L40 RH', '<p>- Vysok pesnost.<br />- Vysoce kvalitn tvrzen ocel.<br />- Rychl vmna vrtku.<br />- Naprost spolehlivost.<br />- Dokonal centrovn.<br />- Plynul rotace.<br />- Nahrazuje vrtk se zvitem.<br /><br />Upnac pouzdra nabzej modern zpsob vmny kolkovacch vrtk v kolkovacch a vyvrtvacch strojch. Tvo pechod mezi strojem a kolkovacmi vrtky. Pro sprvnou volbu upnacho pouzdra je dleit dosedac plocha, volba zvitu nebo prmru pouzdra.<br /><br />Vlcov dosedac plocha D11x4mm.<br />Pouit nastrojch typu: Biesse (star model), Masterwood (Zangheri &amp; Boschetti), Morbidelli, Torwegge, Vitap (nov design), Weeke.</p>\\r\\n<p>- RH - pravotoiv proveden - bez drky po obvodu</p>\\r\\n<p>- LH - levotoiv proveden - drka po obvodu</p>', '_vyr_150303DX_BRIANI.jpg', 0, '237.90', '264.33', '3031000008', '_vyrn_150303DX_BRIANI.jpg', '_vyrp11_150303SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-396-0|2-372-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
