(7773, 161, 'Unec stopka - S=8mm, M12x1, L30mm, LT46mm', 'Unec stopka - S=8mm, M12x1, L30mm, LT46mm', '<p>Upnac a unec stopka pro nstroje s upevovacm zvitem M12x1. Pechod a redukce ze zvitovho upnut na upnut v kletin. Horn frzky nebo CNC stroje.</p>\\r\\n<p>Uren pro drkovac frzy, rybinov frzy nebo sukovnky a dal nstroje s upnacm zvitem m12x1.</p>', '101456_161__vyr_160Attacchi.jpg', 0, '399.00', '415.00', 'GZ710', '101456_161__vyrn_160Attacchi.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-0|2-1-11-311|2-1-11-312|2-1-16-0|2-1-16-333|2-5-293-0|2-5-293-373|2-5-293-375|14-0-0-0|14-610-0-0|14-610-620-0|14-610-621-0|14-615-0-0', NULL, '2021-01-10 15:44:03'),
(7774, 162, '2r Drkovac iletkov frza  D1630 L75 S8 Z2 HW', '2r Drkovac iletkov frza  D1630 L75 S8 Z2 HW', '<ul>\\n<li>Masivn konstrukce</li>\\n<li>Pesn ustaven iletky v lku</li>\\n</ul>\\n<p>Speciln geometrie ost pro opracovn irokho spektra materil. Konstrukce frzy nabz hloubku frzovn a 50 mm. Celou hloubku doporuujeme frzovat na vce prchod materilem. Vborn vyuit pi frzovn, formtovn a drkovn pomoc horn frzky a ablon. Lze pout pro run frzovn nebo na CNC obrbcch centrech.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Drkovn, oezvn</li>\\n<li>Run frzovn, CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_162GZ-2r.png', 0, '2160.00', '2400.00', 'GZ2551', '_vyrn_162GZ-2r.png', '_vyrp11_162GZ-2r-1.png', '_vyrp12_162GZ-2r-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:03'),
