(7780, 168, 'IGM Univerzln frzovac hlava MAN - D100x40-50 d30 OCEL', 'Univerzln frzovac hlava MAN - D100x40-50 d30 OCEL', '<p>Tlo nstroje je vyrobeno zkvalitn oceli nebo ztvrzen hlinkov slitiny (ALU) svysokou pevnost. Frza je vybavena upnacm systmem pro profilov noe a omezovae, kter umouj bezpen run posuv (MAN) materilu do ezu. Euro upnac systm zajiuje perfektn a pesn upnut no 40x4mm a50x4mm kd F026 aomezova F027. Upnac prmr d=30mm.<br /><br /><strong>Parametry:</strong><br />Otky pro D100mm 58008400 ot./min., pro D120mm 51007400 ot./min., run posuv materilu MAN.<br /><br /><strong>Noe a omezovae nejsou soust dodvky a objednvaj se zvl!</strong></p>', '_vyr_168pictureprovider.jpg', 0, '1078.00', '1198.00', 'F020-10030', '_vyrn_168pictureprovider.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-3-291-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:03'),
(7781, 169, 'IGM FK650 ablona pro spoj kuchyskch desek 650mm', 'IGM FK650 ablona pro spoj kuchyskch desek 650mm', '<p><strong>FK650 je urena pro frzovn spoj kuchyskch pracovnch desek vemi typy hornchfrzek. Systm dmyslnho a jasnho znaen jednotlivch operac kompletn zjednoduuje azrychluje prci se ablonou.<br /><br /> Tvrzen a odoln materil, kter se manipulac nepokrbe a nepraskne tak, jako ablony zplexiskla, prhlednch plast nebo MDF.<br /> Pro spoje 90 a 45, vetn ablon pro svrky a zaoblen roh.<br /> Extra doraz pro ku desek 600 mm umouje okamit pouit ablony bez zamen.<br /> Dodvno s jasnm a pehlednm nvodem k pouit.</strong><br /><br /><strong>Nstroje pro prci se ablonou:</strong><br /><strong>Horn frzku</strong>, doporuujeme radji o vkonu 1600W a vce. S lehkou a mlo vkonnou frzkou budete mt problms dodrenm pesnosti a kvality spoje.Doporuen frzky zde.<br /><strong>Koprovac krouek D 30 mm</strong>, ml by bt soust kad horn frzky, pokud jej nemte, doporuujeme nairedukn desku FRB170.<br /><str', '_vyr_169FK650.jpg', 0, '2687.00', '2985.00', 'FK650', '_vyrn_169FK650.jpg', '_vyrp11_169fk6501.jpg', '_vyrp12_169fk6502.jpg', '_vyrp13_169fk6503.jpg', 21, 1, 2, 0, '', 0, '4-107-385-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7782, 170, 'IGM ablona na pracovn desky + Frza iletkov ', 'ablona na pracovn desky + Frza iletkov ', '<p><strong>ablona FK650 + iletkov frza prmr 12mm HW</strong></p>\\n<p>- ablona pro spojovn prac. desek do hloubky 650mm<br />- Voliteln varianta s profi iletkovou frzou 12 HW<br />- Snadn pouit a vyuit i na kuchynch IKEA</p>\\n<p>FK650 je urena pro frzovn spoj kuchyskch pracovnch desek vemi typy hornchfrzek. Systm dmyslnho a jasnho znaen jednotlivch operac kompletn zjednoduuje azrychluje prci se ablonou.<br /><br /> Tvrzen a odoln materil, kter se manipulac nepokrbe a nepraskne tak, jako ablony zplexiskla, prhlednch plast nebo MDF.<br /> Pro spoje 90 a 45, vetn ablon pro svrky a zaoblen roh.<br /> Extra doraz pro ku desek 600 mm umouje okamit pouit ablony bez zamen.<br /> Dodvno s jasnm a pehlednm nvodem k pouit.<br /><br />Nstroje pro prci se ablonou:<br />Horn frzku, doporuujeme radji o vkonu 1600W a vce. S lehkou a mlo vkonnou frzkou budete mt problms dodrenm pesnosti a kvality ', '_vyr_170FK650-nastroj.jpg', 0, '4250.00', '4722.00', 'FK650-set', '_vyrn_170FK650-nastroj.jpg', '101456_170__vyrp11_169fk6501.jpg', '101456_170__vyrp12_169fk6502.jpg', '101456_170__vyrp13_169fk6503.jpg', 21, 1, 2, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:03'),
(7783, 171, '357 Vrtk kolkovac neprchoz POWER  D=527 S=1027 L=57,5  HW,  RH', '357 Vrtk kolkovac neprchoz POWER  D=527 S=1027 L=57,5  HW,  RH', '<ul>\\n<li>Tlo vrtku z vysoce kvalitn tvrzen oceli.</li>\\n<li>HW hlava s pesn vycentrovanm stedicm hrotem.</li>\\n<li>HW zub s pedezy a vodcm hrotem v radilnm podbrouenm.</li>\\n<li>2 spiralov drky.</li>\\n<li>Vlcov upnac stopka s unec plochou a roubem pro nastaven dlky.</li>\\n<li>Pesn brouen stopka pro pesn upnut ve stroji.</li>\\n<li>RH = pravotoiv proveden, oznaeno ernou barvou vrtku</li>\\n<li>LH = levotoiv proveden, oznaeno ervenou barvouvrtku</li>\\n<li>HW = tvrdokovov pika nstroje</li>\\n<li>Vrtky POWER = vkonnostn ada vrtk s lep istotou opracovn</li>\\n</ul>\\n<p></p>\\n<p><u>Pouit:</u></p>\\n<ul>\\n<li>Na vrtacch strojch a kolkovakch pro vrtn neprchozch otvor do DTD, MDF, lamina, HPL a plast.</li>\\n<li>Ml otvory do masivnho deva.</li>\\n</ul>', '_vyr_171357DX_BRIANI.jpg', 0, '440.00', '489.00', '3570502729', '_vyrn_171357DX_BRIANI.jpg', '_vyrp11_171357SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
