(7798, 186, '352 Zhlubnk s upnac stopkou 45 pro vrtk ady 337  d=2 D=10 L=40 S=10 HW, RH', '352 Zhlubnk s upnac stopkou 45 pro vrtk ady 337  d=2 D=10 L=40 S=10 HW, RH', '<ul>\\n<li>Tlo zhlubnku z vysoce kvalitn tvrzen oceli.</li>\\n<li>2 precizn brouen HW bity (Z2).</li>\\n<li>Pesn upnut vrtku ve stedovm otvoru pomoc vlastn stopky s plokou a zajitn ervkem.</li>\\n</ul>\\n<p></p>\\n<p><u>Pouit:</u></p>\\n<ul>\\n<li>Vrtn a sren hran prodnho deva, DTD, MDF, HPL, plast a LTD.</li>\\n<li>Sraen hrany pod hlem 45.</li>\\n<li>Pro vrtky 337 a 337C se 4 drkami.</li>\\n</ul>', '_vyr_186352B_BRIANI.jpg', 0, '776.00', '862.00', '3520200028', '_vyrn_186352B_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-372-0-0|2-372-393-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7799, 187, '323 Sukovnk roubovac vmnn  D=20 S=M121 L=30 HW, RH', '323 Sukovnk roubovac vmnn  D=20 S=M121 L=30 HW, RH', '<ul>\\n<li>roubovac verze sukovnku Briani nabz vnitn zvitov upnut M12x1.</li>\\n<li>Po naroubovn unaec stopky a upnut do stroje me bt neustle upnut ve vrtace ve stejn pozici bez zmny hloubky vrtn.</li>\\n<li>Naroubovn sukovnk dosedne pesn do stejn pozice jako vymnn kus a proto nemuste znovu nastavovat hloubku na stroji.</li>\\n<li>M 2 pedezvac hroty, centrovac hrot a 2 ezn zuby.</li>\\n<li>Vechny hroty jsou z tvrdokovu urenho pro vrtn do mkkho a tvrdho deva, lamina, DTD a HPL.</li>\\n</ul>\\n<p></p>\\n<p><u>Pouit:</u></p>\\n<ul>\\n<li>Pro stacionrn vrtaky a run frzky.</li>\\n<li>Pro unaec stopku 321 a 322.</li>\\n</ul>', '_vyr_187B-323.png', 0, '695.00', '772.00', '3232000028', '_vyrn_187B-323.png', '_vyrp11_187B-323-1.png', '_vyrp12_187B-323-2.png', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7800, 188, '324 Sukovnk run  D=8 S=1060 L=90 HW, RH', '324 Sukovnk run  D=8 S=1060 L=90 HW, RH', '<ul>\\n<li>Sukovnk m 2 pedezvac hroty, centrovac hrot a 2 ezn zuby.</li>\\n<li>Hrot z tvrdokovu urenho pro vrtn do mkkho a tvrdho deva, lamina, DTD a HPL.</li>\\n<li>Kvalitn a pesn nstroj.</li>\\n<li><strong>Prmr 8 - 14mm je dodvn jako vrtk s HW pikou.</strong></li>\\n</ul>\\n<p></p>\\n<p><u>Pouit:</u></p>\\n<ul>\\n<li>Nejpouvanj sukovnk.</li>\\n<li>Ideln sukovnk pro vrtn do lamino desek a kuchyskch dvek.</li>\\n<li>Pro run i stacionrn vrtaky.</li>\\n</ul>', '_vyr_188B-324.png', 0, '625.00', '694.00', '3240800028', '_vyrn_188B-324.png', '_vyrp11_188B-324-1.png', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7801, 189, '329 Vrtk neprchoz pro run vrtn  D=560 S=5 L=90 HW, RH', '329 Vrtk neprchoz pro run vrtn  D=560 S=5 L=90 HW, RH', '<ul>\\n<li>Run tvrdokovov vrtk pro run vrtn do tvrdho a mkkho deva, lamina , devotsky.</li>\\n<li>Dlouh ivotnost ost.</li>\\n</ul>\\n<p></p>\\n<p><u>Pouit:</u></p>\\n<ul>\\n<li>Extra dlouh vrtn otvor a 200mm.</li>\\n</ul>', '_vyr_189B-329.png', 0, '708.00', '787.00', '3290500028', '_vyrn_189B-329.png', '_vyrp11_189B-329-1.png', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-35-0|2-5-35-367|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7802, 190, '7080 Frza na V drku pro Alucobond  a=90 d=3 D=20 T=8,8 S=8x35 HW', '7080 Frza na V drku pro Alucobond  a=90 d=3 D=20 T=8,8 S=8x35 HW', '<p>Kompozitn panely ALUCOBOND plus lze formovat velice snadno pomoc V-drkovac frzy Briani. Technika nazvan frzovn a skldn umouje vrobcm vytvet tvary rzn geometrie a velikosti. Horn frzkou vyfrzujte V-drku jej dno se dotk vnjho obalu. Nedoten vnj deska me bt nyn run ohnuta s istou lini koprujc vyfrzovanou drku. Vnj rdius ohnut desky zvis na tvaru drky a jej hloubce. Drku je mon frzovat jak CNC tak i horn frzkou. Metodu frzovn a skldn je mon pout na vechny dostupn povrchov pravy kompozitnch panel ALUCOBOND plus.</p>', '_vyr_1907080.png', 0, '1419.00', '1577.00', '70800900800', '_vyrn_1907080.png', '_vyrp11_1907080-1.png', '_vyrp12_1907080-2.png', '_vyrp13_1907080-3.png', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:04'),
(7803, 191, '570 Zaoblovac frza iletkov oboustrann, sada  D=41 T=15 S=1240 L=90 H=40', '570 Zaoblovac frza iletkov oboustrann, sada  D=41 T=15 S=1240 L=90 H=40', '<p>Rdiusov frza s dvma tvdokovovmi bity s rdiusovm profilem. Ideln pro zaoblovn hran tvrdho deva a DTD, LTD nebo MDF desek s nalepenou ABS hranou. Pro tloutku desky maximln 50mm. Vka fazety pi pouit 45 HW iletky 6mm. Upnac stopka S=12 nebo 16mm pro spolehliv upnut v CNC. Dodvno jako sada s iletkami R2, R3, R4, R5 a hel 45.</p>', '_vyr_191570_BRIANI.jpg', 0, '6327.00', '7030.00', '57000101200', '_vyrn_191570_BRIANI.jpg', '_vyrp11_191570_WORKING.jpg', '_vyrp12_191570_WORKING_A.jpg', '_vyrp13_191570_WORKING_B.jpg', 21, 1, 1, 0, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:04'),
(7804, 192, '571 Popisovac frza iletkov, sada  D=17 T=8,3 S=830  ', '571 Popisovac frza iletkov, sada  D=17 T=8,3 S=830  ', '<ul>\\n<li>Frza pro gravrovn a frzovn V drek.</li>\\n<li>Ureno pro CNC obrbn deva, lamina a HPL.</li>\\n<li>Masivn tlo nstroje s pesnm vyvenm.</li>\\n</ul>\\n<p></p>\\n<p>Frza s vmnnmi iletkami s jednm bitem, urenm k V drkovn tvrdho deva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobr upnut na CNC strojch pi vysokch otkch.</p>\\n<p></p>\\n<p>SPECIFIKACE:</p>\\n<ul>\\n<li>Popisovac, hlov</li>\\n<li>CNC</li>\\n<li>MEC, MAN</li>\\n<li>Z1</li>\\n<li>HW iletky. Dodvno jako sada s iletkami 92, 60, R3, R4, R5.</li>\\n</ul>', '_vyr_192571_BRIANI.jpg', 0, '4349.00', '4832.00', '57100000800', '_vyrn_192571_BRIANI.jpg', '_vyrp11_192571_BRIANI_TECH.jpg', '_vyrp12_192571_SPARE_PARTS.jpg', '_vyrp13_192571_WORKING.jpg', 21, 1, 1, 0, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:04'),
