(7816, 204, 'ODSAVA PILIN ZIPPER ZI ASA550, HADICE A ROZDVOJKA ZD', 'ODSAVA PILIN ZIPPER ZI ASA550, HADICE A ROZDVOJKA ZD', '<h1 id=\\\"h1-fig\\\">Odsava prachu a pilin ZIPER</h1>\\n<p><strong>Odsava prachu</strong> a pilin <strong>ZIPER</strong> je spolehliv zazen, kter <strong>odsv piliny</strong> a podobn devn odpad od mench devoobrbcch stroj. Vhodou tohoto pstroje je, e <strong>nedochz ke zbytenmu odvtrvn tepla</strong>. Stojan odsavae je opaten <strong>velkmi koleky</strong> a zajituje tak mobilitu zazen. Oproti podobnm odsavam pilin m tento <strong>spodn st vyrobenou z trubkovho rmu</strong>, kter se nekrout a na rmu m velk pojezdov kola.</p>\\n<p>Pstroj m siln motor s <strong>vkonem 550 W</strong> s 2850 otkami za minutu. Odpadn vak m objem <strong>65 litr</strong>. Cel stroj v 26 kilogram a rozmry balen jsou <strong>900  540  390 mm</strong>.</p>\\n<p>Odsava je vhodn pro vtinu mench stroj, jako <strong>hoblovky s protahem typu KDR301, KDR302</strong>, <strong>Holzmann HOB260</strong>, <strong>kotouovm pilm KDR101</strong>, <s', '_vyr_181_vyr_872ASA50.jpg', 0, '2907.50', '3135.00', '02a', '_vyrn_181_vyr_872ASA50.jpg', '', '', '', 21, 1, 1, 0, '9,12E+12', 0, '3-62-398-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7817, 205, 'AKUMULTOROV ROUBOVK VRTAKA S PKLEPEM HOLZMANN AKS 45IND', 'AKUMULTOROV ROUBOVK VRTAKA S PKLEPEM HOLZMANN AKS 45IND', '<h3 style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">AKUMULTOROV ROUBOVK VRTAKA S PKLEPEM HOLZMANN AKS45IND</span></h3>\\n<p><span style=\\\"font-size: 14pt;\\\">Firma Holzmann Vm nabz AKU roubovk s pklepem. Tento stroj m bezkartov motor, dky ktermu vydr a 10x dle, ne bn motory a udruje se o 60 % vy vkon. Nstroj upnete rychloupnacm sklidlem a mete zat pracovat. Tento roubovk usnaduje prci se devem, ocel i betonem a to dky vrtacmu vkonu 22 mm (devo), 8 mm (ocel), 8 mm (beton). Na prci Vm svt LED dioda. Soust balen jsou dv baterie, nabjeka a ve je dodno v plastovm pepravnm kufku.</span></p>', '_vyr_182_vyr_3502003_aks45ind.jpg', 0, '2549.70', '0.00', 'HMAKS45IND', '_vyrn_182_vyr_3502003_aks45ind.jpg', '', '', '', 21, 1, 1, 4, '9,12E+12', 0, '3-59-0-0', NULL, '2021-01-10 15:44:04'),
