(7819, 207, 'LAMELOVAC FRZKA HOLZMANN PJ 100A', 'LAMELOVAC FRZKA HOLZMANN PJ 100A', '<h3>LAMELOVAC FRZKA HOLZMANN PJ100A</h3>\\n<p>Pedstavujeme Vm lamelovac frzku z produkce firmy Holzmann. Frzka jezvlt konstruovan pro snadn a bezpen drkovn desek, avak nen vhodn ji pouvat pro zsmolky! Me provdt jakkoliv typ spojen rychle a pesn dky pedn ploce, kter me bt nastavena ve vce a hlu bez pouit nstroj. Stroj pichz vybaven kanlem a vakem pro sbr prachu. Soust frzky je tvrdokovov frza s maximln hloubkou frzovn 19 mm. Jej pln vybaven transportn kufk ji peduruje pro prci mimo dlnu.</p>\\n<p></p>\\n<div></div>\\n<p></p>', '_vyr_184_vyrp11_4101PJ100PROa.jpg', 0, '1560.90', '0.00', 'HMPJ100A', '_vyrn_184_vyrp11_4101PJ100PROa.jpg', '_vyrp11_184_vyrp11_4101PJ100PROa.jpg', '_vyrp12_184_vyrp12_1305fraese_pj100b.jpg', '_vyrp13_184_vyrp13_1305fraese_pj100e.jpg', 21, 1, 1, 4, '9,12E+12', 0, '3-60-0-0|3-60-416-0', NULL, '2021-01-10 15:44:04'),
