(7825, 215, 'KOTOUOV STOLN PILA HOLZMANN TS 200', 'KOTOUOV STOLN PILA HOLZMANN TS 200', '<h1 id=\\\"h1-fig\\\">Kotouov stoln pila HOLZMANN TS200</h1>\\n<p><strong>Kotouov stoln pila</strong> od vrobce preciznch stroj <strong>Holzmann Maschinen</strong> je<strong> zkladnm modelem kotouov pily</strong>. Jej vhodou je <strong>vborn pomr cena/vkon</strong>. Pstroj m velmi<strong> robustn a pevn stl</strong>, kter je vyroben <strong>z litiny</strong> a zaruuje stabilitu cel pily. Samozejm nechyb ani <strong>prodlouen stolu</strong>. S pstrojem se <strong>lehce manpuluje</strong> a pracuje, je velmi jednodue nastaviteln. <strong>Pilov agregt je naklopiteln a na 45 stup</strong>. Soust je tak <strong>podln pravtko</strong> s doladnm a <strong>pn pravtko</strong> s dorazem.</p>\\n<h2 id=\\\"h2-fig\\\">Standardn vbava:</h2>\\n<ul>\\n<li>Tvrd kovov kotou 200 mm</li>\\n<li>Podln pravtko</li>\\n<li>Pn pravtko</li>\\n<li>Ochrann kryt</li>\\n<li>Podstavec</li>\\n</ul>\\n<h2 id=\\\"h2-fig\\\">Psluenstv:</h2>\\n<ul>\\n<li>Odsava pilin<', '_vyr_192_vyr_1337TS200.jpg', 0, '16791.80', '0.00', '2HLMTS200', '_vyrn_192_vyr_1337TS200.jpg', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7826, 216, 'KOTOUOV STOLN PILA HOLZMANN TS 250 - 400V', 'KOTOUOV STOLN PILA HOLZMANN TS 250 - 400V', '<h1 id=\\\"h1-fig\\\">Kotouov stoln pila HOLZMANN TS 250 400 V</h1>\\n<p><strong>Kotouov stoln pila HOLZMANN TS 250</strong> m oproti modelu kotouov pily HOLZMANN TS 200 s a 250 mm nstrojem vrazn <strong>masivnj konstrukci a monost motoru i na napt 400 V</strong>. Tento pstroj se perfektn hod do jakkoli dlny. <strong>Litinov stl</strong> tohoto stroje je velmi robustn a stabiln. Nesm chybt tak ani <strong>prodlouen stolu</strong>. Pila m tu vhodu, e je velice <strong>jednodue nastaviteln</strong> a lehce se s n manipuluje.<strong> Pilov agregt je naklopiteln a na 45 stup</strong>. Soust je samozejm <strong>podln pravtku s doladnm</strong> a <strong>pn pravtko s dorazem</strong> pro pesnj prci.</p>\\n<p>Zde mete zhldnout podrobn a snadno pochopiteln <strong>nvod</strong> k sestaven tto pily ve va dln. Pro vce informac mete navtvit nae strnky<a href=\\\"https://aparatea.cz/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"', '_vyr_1935238_1742__vyr_1418TS250.jpg', 0, '21569.00', '0.00', '2HLMTS250400', '_vyrn_1935238_1742__vyr_1418TS250.jpg', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7827, 217, 'Swanson - helnk Speed Square 7\\\" (17,7mm) pouze palcov stupnice', 'Swanson - helnk Speed Square 7\\\" (17,7mm) pouze palcov stupnice', '<p>Pouze v palcov verze. pout jako plonk,helnk,rsovn a opora pi ezn. Velk vhoda je v jeho velikosti kdy se vejde do kapse i za opasek.</p>\\n<p>Ideln helnm pro devostavby emerickho proveden.</p>', '_vyr_19418408_s0101.jpg', 0, '446.00', '0.00', 'S0101', '_vyrn_19418408_s0101.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7828, 218, 'Swanson - vodovha tropedo magnetick podsvcen 22cm', 'Swanson - vodovha tropedo magnetick podsvcen 22cm', '<p>Vodovha z jednoho kusu eloxovanho hlnku je jedn strany osazena tymi silnmi magnety a na stran druh opatena lbkem pro men na trubkch.</p>\\n<p>Plochy jsou pro vt pesnost frzovny. Je opatena prhledy na libely i z hrany vodovhy. Stupnice v mm/inch v rozsahu 0-18cm(0-7inch)</p>\\n<p>Til libely pro pesn men 0/90/45 s pesnost lahviky libely 0,29.</p>\\n<p>Podsvcen automaticky zhasne po 3 min. a je napjeno 2xAAA lnky</p>', '_vyr_19517190_tll049m-300.jpg', 0, '812.00', '0.00', 'TLL049M', '_vyrn_19517190_tll049m-300.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7829, 219, 'Swanson - protiskluzov pravtko s pesnm mtkem', 'Swanson - protiskluzov pravtko s pesnm mtkem', '<p>Swanson -Savage je jednoduch profilov pravtko s pesnou stupnic pro rsovn,men a hlavn ezn noem. Protiskluzov podloka zabrn posunu po materilu a tvar profilu zabrn sklouznut noe a ppadnmu poezn.</p>', '_vyr_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', 0, '640.00', '0.00', 'SVE121', '_vyrn_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7830, 220, 'Swanson - sloupkov magnetick vodovha', 'Swanson - sloupkov magnetick vodovha', '<ul>\\r\\n<li>\\r\\n<p>Magnetick psky nebo stahovac guma pro upevnn na sloupek</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Zhotoven z houevnatho kompozitnho materilu</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Tou nejlep volbou pro kovov kolky</p>\\r\\n</li>\\r\\n<li><span style=\\\"font-size: 10pt;\\\">Sloupky , zbradl ,kolky nebo tyky k rajatm ve bude snadno rovn nebo kolm</span></li>\\r\\n</ul>', '_vyr_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', 0, '155.00', '0.00', 'PL001M', '_vyrn_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:04'),
(7831, 221, 'C306 Vrtk kolkovac neprchoz S8 L55,5 HW - D3x18 S=8x20 L55,5 P', 'C 306 Vrtk kolkovac neprchoz S8 L55,5 HW - D3x18 S=8x20 L55,5 P', '<p><strong> Tlo vrtku z vysoce kvalitn tvrzen oceli. <br /> HM hlava s pesn vycentrovanm stedicm hrotem. <br /> 2 precizn brouen HM bity (Z2). <br /> 2 HM zuby s pedezy a radilnm podbrouenm (V2). <br /> 4 spiralov drky. <br /> Vlcov upnac stopka s unec plochou a roubem pro nastaven dlky. <br /> Baleno v plastov krabice po 1 kuse. <br /> Ekonomick balen po 5 kusech. <br /> Vrtac hlava pro vrtn istch neprchozch otvor s plochm dnem. <br /> Pesn brouen stopka pro pesn upnut ve stroji. <br /> Teflonov povrch pro lep odvod tsek. </strong><br /><br />Pouit: navrtacch strojch akolkovakch pro vrtn neprchozch otvor doDTD, MDF, lamina aplast.</p>', '_vyr_221C30603021.jpeg', 0, '315.00', '350.00', '306.030.21', '_vyrn_221C30603021.jpeg', '_vyrp11_221C30603021-1.jpeg', '', '', 21, 1, 1, 0, '6,64E+11', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
