(7851, 255, 'C311 Xtreme Flat Vrtk kolkovac neprchoz S10 L70 HWM - D5x30 S=10x30 L70 P', 'C311 Xtreme Flat Vrtk kolkovac neprchoz S10 L70 HWM - D5x30 S=10x30 L70 P', '<p><strong> Nadprmrn kvalitn ocel pro vysokou odolnost a dlouhou ivotnost<br /> Spirlov st z tvrdokovu HWM pikov kvality<br /> 2 bity (Z2) + 2 zuby s pedezy a radilnm podbrouenm (V2)<br /> 2 spiralov drky<br /> Vlcov upnac stopka s unaec plochou a roubem pro nastaven dlky<br /> Doporuen rychlost 1-4 m/min. - 6000 ot./min</strong><br /><br />Pouit:<br />Ideln na devotsku, MDF, HDF a laminty. Vhodn pro prchoz otvory na tenkch deskch - s monost vch otek a posuvovch rychlost. Pouit v upnacch pouzdrech na kolkovacch strojch.</p>', '_vyr_255C31105071.jpeg', 0, '482.40', '536.00', '311.050.71', '_vyrn_255C31105071.jpeg', '_vyrp11_255C31105071-1.jpeg', '', '', 21, 1, 5, 0, '6,64E+11', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7852, 257, '310 Xtreme Vrtk kolkovac neprchoz S10 L57,5 HWM - D1,3x5 S=10x30 L57,5 P-L', '310 Xtreme Vrtk kolkovac neprchoz S10 L57,5 HWM - D1,3x5 S=10x30 L57,5 P-L', '<p><strong> Tlo vrtku zvysoce kvalitn tvrzen oceli. <br /> HM hlava spesn vycentrovanm stedicm hrotem. <br /> 2 precizn brouen HM bity (Z2). <br /> 2 HM zuby spedezy aradilnm podbrouenm (V2). <br /> 2 spiralov drky. <br /> Vlcov upnac stopka sunec plochou aroubem pro nastaven dlky. <br /> Baleno v plastov krabice po 1 kuse. <br /> Ekonomick balen po 5 kusech. <br /> Vrtac hlava pro vrtn istch neprchozch otvor s plochm dnem. <br /> Pesn brouen stopka pro pesn upnut ve stroji. <br /> Prmyslov kvalita jemnozrnho tvrdokovu na tvrd materily. <br /> Radiusov podbrouen pro vysokou produktivitu. <br /><br />Celotvrdokovov tlo vsazen do stopky. </strong><br />Pouit: navrtacch strojch, CNC strojch akolkovakch, pro vrtn neprchozch otvor s monost vch otek a posuvovch rychlost.<br />Masivn devo, DTD, MDF, LTD aplasty.</p>', '_vyr_257C31001320.jpeg', 0, '279.00', '310.00', '310.013.20', '_vyrn_257C31001320.jpeg', '_vyrp11_257C31001320-1.jpeg', '', '', 21, 1, 5, 0, '', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
