(7873, 297, 'Cr Oezvac iletkov frza  D1912 L55 S6 HW', ' Cr Oezvac iletkov frza  D1912 L55 S6 HW', '<ul>\\n<li>Masivn konstrukce</li>\\n<li>Pesn ustaven iletky v lku</li>\\n<li>Nejpouvanj iletkov proveden oezvac frzy</li>\\n<li>Monost dokoupen menho loiska</li>\\n</ul>\\n<p>Frza urena pro pesn lcovac frzovn a koprovn podle ablony nebo ofrzovan hrany, kter je vespod. U tradin pjen frzy dochz pi osten ke zmenen eznho prmru proti loisku a to zpsobuje vznik zubu. iletkov frza tento jev eliminuje pomoc pesn ustavench vmnnch iletek, kter se navc daj otet a pout a 4 bity. Pro frzovn Corianu je mon dokoupit rovn nebo kuelov loisko s plastovm kroukem, kter zabezpe pesn veden po materilu.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Loisko spodn</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_297GZ-Cr.png', 0, '990.00', '1100.00', 'GZ2534', '_vyrn_297GZ-Cr.png', '_vyrp11_297GZ-Cr-1.png', '_vyrp12_297GZ-Cr-2.png', '_vyrp13_297GZ-Cr-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:04'),
(7874, 298, '2Cr Falcovac iletkov frza  D4412 L57 S8 HW', ' 2Cr Falcovac iletkov frza  D4412 L57 S8 HW', '<ul>\\n<li>Pro falcovn i nejobtnjch dl podle ablony nebo hrany dlce.</li>\\n<li>HW tvrdokovov iletky</li>\\n<li>Koprovac loisko na ele frzy.</li>\\n</ul>\\n<p>Gamma Zinken falcovac frza je dodvna se zkladnm loiskem 13mm pro frzovn 12,5 mm falcu. K tto frze je mon dokoupit tyi velikosti loisek. Pi frzovn falc vtch ne 12 mm provdjte vcensobn sbry pomoc postupnho zvtovn hloubky.</p>', '_vyr_298GZ-2Cr.png', 0, '1327.50', '1475.00', 'GZ2763', '_vyrn_298GZ-2Cr.png', '_vyrp11_298GZ-2Cr-1.png', '_vyrp12_298GZ-2Cr-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:04'),
(7875, 299, 'CrS Oezvac iletkov frza s hornm loiskem  D1930 L68 S8 HW', ' CrS Oezvac iletkov frza s hornm loiskem  D1930 L68 S8 HW', '<p>Falcovac frza Gamma Zinken je urena pro pesn frzovn a koprovn podle ablony, kter je na horn stran materilu. Tento typ nstroje se d vyut i pro silnj materily a to pomoc loiska. U tradin pjen frzy dochz pi osten ke zmenen eznho prmru proti loisku a to zpsobuje vznik zubu. iletkov frza tento jev eliminuje pomoc pesn ustavench vmnnch iletek, kter se navc daj otet a pout a 4 bity ( plat u iletek 12x12x1,5mm ).</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Koprovn, drkovn, oezvn</li>\\n<li>Loisko na stopce</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_299GZ-CrS.png', 0, '1327.50', '1475.00', 'GZ2431', '_vyrn_299GZ-CrS.png', '_vyrp11_299GZ-CrS-1.png', '_vyrp12_299GZ-CrS-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:04'),
(7876, 300, 'CrD Oezvac iletkov frza s hornm a spodnm loiskem  D1912 L55 S6 HW', ' CrD Oezvac iletkov frza s hornm a spodnm loiskem  D1912 L55 S6 HW', '<p>Gamma Zinken oezvac frza s hornm a spodnm loiskem. Dvoustrann iletky upnuty pevnostnmi Torx rouby. Pro pesn lcovac frzovn horn frzkou nebo ve frzovacm stolku.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Loisko horn a spodn</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HZ iletky</li>\\n</ul>', '_vyr_300GZ-CrD.png', 0, '1237.50', '1375.00', 'GZ2814', '_vyrn_300GZ-CrD.png', '_vyrp11_300GZ-CrD-1.png', '_vyrp12_300GZ-CrD-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-318|14-0-0-0|14-611-0-0|14-611-628-0', NULL, '2021-01-10 15:44:04'),
(7877, 301, '4r hlov iletkov frza  D2610,8 L47 S6 22', ' 4r hlov iletkov frza  D2610,8 L47 S6 22', '<p>hlov frza Gamma Zinken je urena pro oezvn a sren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian. Frza je bez loiska. Uren pro CNC a run frzovn pomoc pravtka.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_301GZ-4r.png', 0, '1237.50', '1375.00', 'GZ2539', '_vyrn_301GZ-4r.png', '_vyrp11_301GZ-4r-1.png', '_vyrp12_301GZ-4r-2.png', '_vyrp13_301GZ-4r-4.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:04'),
(7878, 302, '6Cr Zaoblovac iletkov frza vypoukl  D31,519,5 L60 S8 R=5', ' 6Cr Zaoblovac iletkov frza vypoukl  D31,519,5 L60 S8 R=5', '<p>Vypoukl frza Gamma Zinken je urena pro ozdobn sren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.</p>\\n<p>Frza je osazena spodnm loiskem. Uren pro CNC ( po odroubovn loiska ) a run frzovn pomoc loiska.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN MEC</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_302GZ-6Cr.png', 0, '1755.00', '1950.00', 'GZ2768', '_vyrn_302GZ-6Cr.png', '_vyrp11_302GZ-6Cr-1.png', '_vyrp12_302GZ-6Cr-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:04'),
(7879, 303, 'C2Sr hlov iletkov frza  D2610,8 L55 S6 22 HW', ' C2Sr hlov iletkov frza  D2610,8 L55 S6 22 HW', '<p>hlov frza Gamma Zinken je urena pro oezvn, sren a drkovn hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian.</p>\\n<p>Frza je vybavena koprovacm loiskem, kter je zajitno roubkem. Nstroj umouje frzovat V drku do hrany materilu. Uren pro run frzovn.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>Loisko</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW iletky</li>\\n</ul>', '_vyr_303GZ-C2Sr.png', 0, '1237.50', '1375.00', 'GZ2545', '_vyrn_303GZ-C2Sr.png', '_vyrp11_303GZ-C2Sr-1.png', '_vyrp12_303GZ-C2Sr-2.png', '_vyrp13_303GZ-C2Sr-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:04'),
(7880, 304, 'Prr Vrtac frza iletkov na rozety  D52 L90 ', ' Prr Vrtac frza iletkov na rozety  D52 L90 ', '<p>Ideln nstroj pro vytven ndhernch ozdobnch ornament kruhovho tvaru (rozet) na vrtace. Tlo nstroje je vyrobeno z pevn oceli, m 2 precizn tvrdokovov HM bity. Vlcov stopka s temi pravidelnmi plokami, pro pevn upnut ve vrtace.</p>\\n<p>Pouit: ve stojanov vrtace s nzkmi otkami.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>Pravotoiv proveden.</li>\\n<li>Maximln otky: 1800 ot/min.</li>\\n</ul>', '_vyr_304GZ-PRr.png', 0, '2137.50', '2375.00', 'GZ2931', '_vyrn_304GZ-PRr.png', '_vyrp11_304GZ-PRr-1.png', '_vyrp12_304GZ-PRr-2.png', '_vyrp13_304GZ-PRr-3.png', 21, 1, 0, 1, '', 0, '2-5-0-0|2-5-424-0|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7881, 305, 'Cgf Oezvac frza s upnnm M12  D1925 L60 SM121 ', ' Cgf Oezvac frza s upnnm M12  D1925 L60 SM121 ', '<p>Oezvac frza se zvitovm upnnm je ideln pro oezvn silnch materil, zvs na dvech nebo oknech pomoc ablony nebo hrany. Tato frza se umst na unaec stopku dky zvitu M12x1 a dky unaes stopce je mon nstroj prodlouit na celkovou dlku a 132 mm. Dky HW bitm jsou vhodn na masiv, devn kompozity, plasty a laminty. Me bt pouvna na obrbn v CNC frzch a runch frzkch. Upnac stopku pro upnut v kletin je nutno objednat zvl.</p>', '_vyr_305C-gf-web.jpg', 0, '922.50', '1025.00', 'GZ515', '_vyrn_305C-gf-web.jpg', '_vyrp11_305GZ-Cgf-1.png', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:04'),
(7882, 306, 'C2gf Oezvac frza se stedovm loiskem a upnnm M12  D1925 L90 SM121 ', ' C2gf Oezvac frza se stedovm loiskem a upnnm M12  D1925 L90 SM121 ', '<p>Oezvac frza se zvitovm upnnm je ideln pro oezvn silnch materil, zvs na dvech nebo oknech pomoc ablony nebo hrany. Tato frza se umst na unaec stopku dky zvitu M12x1 a dky unaes stopce je mon nstroj prodlouit na celkovou dlku a 160 mm. Dky HW bitm jsou vhodn na masiv, devn kompozity, plasty a laminty. Me bt pouvna na obrbn v CNC frzch a runch frzkch. Upnac stopku pro upnut v kletin je nutno objednat zvl.</p>', '_vyr_306C2-gf-web.jpg', 0, '1237.50', '1375.00', 'GZ516', '_vyrn_306C2-gf-web.jpg', '_vyrp11_306GZ-C2gf-1.png', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:04'),
(7883, 307, '1 Drkovac frza krtk  D1114 L50 S8 HSS', ' 1 Drkovac frza krtk  D1114 L50 S8 HSS', '<ul>\\n<li>Frzy pro drkovn</li>\\n<li>Snadn vytvoen drky nebo vezu</li>\\n</ul>\\n<p>Gamma Zinken drkovac frza je urena pro vechny druhy prac. Vyznauje se kvalitnm ostm, kter vyfrzuje dokonalou drku. Pro frzovn podle ablony lze pout koprovac loiska na stopce. Frza m HW nebo HSS tlo s dlouhou ivotnost, je precizn naostena. Dky konstrukci je vhodn pro frzovn mkkho a tvrdho deva, lepenho deva. Nstroj v proveden HW je vhodn tak pro obrbn DTD, lamina , MDF, HPL a Corianu.</p>', '_vyr_3071-web.jpg', 0, '427.50', '475.00', 'GZ46', '_vyrn_3071-web.jpg', '_vyrp11_307GZ-1-1.png', '_vyrp12_307GZ-1-2.png', '', 21, 1, 2, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:04'),
