(7885, 309, 'PSC Drkovac frza na okenn tsnn  D310 L60 S6 ', ' PSC Drkovac frza na okenn tsnn  D310 L60 S6 ', '<ul>\\n<li>Pro frzovn drek pro okenn a dven tsnn.</li>\\n<li>Speciln spirlov vybrouen bit</li>\\n<li>HW celotvrdokovov tlo nstroje.</li>\\n</ul>', '_vyr_309PSC-web.jpg', 0, '697.50', '775.00', 'GZ1286', '_vyrn_309PSC-web.jpg', '_vyrp11_309GZ-PSC-1.png', '_vyrp12_309GZ-PSC-2.png', '', 21, 1, 0, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:04'),
(7886, 314, 'C375 Vrtk kolkovac prchoz S10 L70 HW - D5x40 S=10x20 L70 P', 'C375 Vrtk kolkovac prchoz S10 L70 HW - D5x40 S=10x20 L70 P', '<p><strong> Vrtac hlava pro vrtn istch prchozch otvor. <br /> Pesn brouen stopka pro pesn upnut ve stroji. <br /> Teflonov povrch pro lep odvod tsek. <br /> Proveden stejn jako u vrtk neprchozch. <br /> Rozdl je ve speciln vybrouen vrtac hlav pro prchoz otvory. <br /> Vrt ist prchoz otvor bez vytrhvn materilu. <br /> 4 spirlov drky. </strong><br /><br />Pouit: navrtacch strojch, CNC strojch akolkovakch, pro vrtn prchozch otvor do DTD, MDF, lamina a plast. Maximln tlouka vrtanho materilu je 35 mm.</p>', '_vyr_314C37505011.jpeg', 0, '271.80', '302.00', '375.050.11', '_vyrn_314C37505011.jpeg', '_vyrp11_314C37505011-1.jpeg', '', '', 21, 1, 5, 0, '', 0, '2-372-0-0|2-7-0-0|2-7-303-0|2-372-392-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7887, 316, 'C378 Vrtk kolkovac prchoz se zhlubnkem S10 L70 HW - D5x35 D2=16 S=10x20 P', 'C378 Vrtk kolkovac prchoz se zhlubnkem S10 L70 HW - D5x35 D2=16 S=10x20 P', '<p><strong> Vrtac hlava pro vrtn istch prchozch otvor. <br /> Pesn brouen stopka pro pesn upnut ve stroji. <br /> Teflonov povrch pro lep odvod tsek. <br /> Proveden stejn jako u vrtk neprchozch. <br /> Rozdl je ve speciln vybrouen vrtac hlav pro prchoz otvory. <br /> Vrt ist prchoz otvor bez vytrhvn materilu. <br /> 2 spirlov drky. </strong><br /><br />Pouit: pro vrtn a zahlubovn v masivnm dev, plastu a laminu. Vhodn pro vysok rychlosti.</p>', '_vyr_316C37805211.jpeg', 0, '418.50', '465.00', '378.052.11', '_vyrn_316C37805211.jpeg', '_vyrp11_316C37805211-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-372-0-0|2-372-392-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7888, 317, 'Titebond III Ultimate Lepidlo na devo D4 - 237ml', 'Titebond III Ultimate Lepidlo na devo D4 - 237ml', '<p><strong> Extrmn vododoln vysokopevnostn lepidlo.<br /> Ideln pro vnitn i venkovn pouit. <br /> Odolnost proti vod D4<br /> Vynikajc pevnost - siln poten lepivost.<br /> Prodlouen doba fixace.<br /> Pouiteln i za nich teplot.<br /> Dobe brousiteln a lakovateln.<br /> Univerzln - lep devo, devovlknit desky, vysokotlak - laminty a devotskov desky.<br /> Snadn itn vodou.</strong><br /><br />Titebond III je extrmn vododoln lepidlo pro vnitn i venkovn pouit, ocenn 1 mstem srovnvacch test americkho asopisu Fine Woodworking 2007. Bylo navreno jako speciln lepidlo na devo, kterm je mono nahradit pouvn polyuretanovch lepidel, kter jsou nepochybn flexibilnj, ale tak tko odstraniteln z nad a pedevm z rukou. Titebond III vytvo mimodn silnou vazbu se devem, m del otevenou dobu a vt viskozitu ne konvenn disperzn lepidla. Udr integritu i pi nich teplotch. Vyznauje se ', '_vyr_317123-141_01_web.jpg', 0, '130.00', '145.00', '123-1413', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_03_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_04_web.jpg', 21, 1, 1, 1, '37083014136', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7889, 318, 'Titebond II Premium Lepidlo na devo D3 - 237ml', 'Titebond II Premium Lepidlo na devo D3 - 237ml', '<p><strong> Vysokopevnostn vododoln lepidlo.<br /> Ideln pro vnitn a venkovn pouit.<br /> Odolnost proti vod D3.<br /> Siln poten lepivost a rychle tuhnouc.<br /> Ideln pro vysokofrekvenn lepen a lisy za tepla.<br /> Spoj je silnj ne pevnost deva.<br /> Vynikajc odolnost proti vtin rozpoutdel.<br /> Dobe brousiteln a pelakovateln.<br /> Univerzln - lep devo, devovlknit desky, vysokotlak - laminty a devotskov desky.<br /> Snadn itn vodou.</strong><br /><br />Titebond II Premium je vysokopevnostn vododoln lepidlo, kter spluje psnou americkou normu ANSI Typ 2 specifikace pro odolnost proti vod. Lep vechny venkovn devn konstrukce vetn venkovnho devnho nbytku. Titebond II Premium poskytuje silnou poten lepivost v krtk dob, vysokou pevnost a vynikajc brousitelnost. Titebond II Premium je snadno pouiteln, netoxick, odoln proti povtrnostnm vlivm. Lepidlo lze snadno oistit navlhenm hadk', '_vyr_318123-5003.jpg', 0, '92.00', '102.00', '123-5003', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5003/123-5003_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5003/123-5003_03_web.jpg', '', 21, 1, 1, 1, '37083050035', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7890, 319, 'Titebond Original Lepidlo na devo D2 - 237ml', 'Titebond Original Lepidlo na devo D2 - 237ml', '<p><strong> Vysokopevnostn disperzn lepidlo.<br /> Pouit pouze v interiru.<br /> Krat fixan doba.<br /> Rychle zasych - zkrcen asu lepen.<br /> Spoj je silnj ne pevnost deva.<br /> Vynikajc odolnost proti vtin rozpoutdel.<br /> Dobe brousiteln a pelakovateln.<br /> Univerzln - lep devo, devovlknit desky, vysokotlak laminty a devotskov desky.<br /> Snadn itn vodou.</strong><br /><br />Titebond Original je nejlep disperzn lepidlo, kter lze pout pro vechny vysocepevnostn spoje deva, lamint, DTD desek, ke, ltky a porznch materil. Vynikajc nap. pro lamelov spoje, pera a drky, sprovky, protoe poskytuje silnou poten lepivost v krtk dob, m minimalizuje upnac dobu. Je velmi oblben u truhl. Lepidlo lze snadno oistit navlhenm hadkem. Po zaschnut je dobe brousiteln. Je netoxick, bez rozpoutdel a vodou editeln do 5 %. Pi zaht znovu zmkne.<br /><br /><em> Typ: Alifatick disperzn l', '_vyr_319123-5063.jpg', 0, '85.00', '85.00', '123-5063', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5063/123-5063_02_web.jpg', '', '', 21, 1, 1, 1, '37083050639', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7891, 320, 'Titebond Cold Press Veneer Lepidlo na devo - 946ml', 'Titebond Cold Press Veneer Lepidlo na devo - 946ml', '<p><strong> Speciln disperzn lepidlo pro dhovn za studena.<br /> Minimalizuje prsaky lepidla skrz dhu.<br /> Spoj je silnj ne pevnost deva.<br /> Stedn doba monte 15-20 minut.<br /> Lepen devn dhy na masivn devo, MDF nebo devotsku.<br /> Pouit pouze v interiru.</strong><br /><br />Disperzn lepidlo Titebond Cold Press for Veneer je vysoce kvalitn a sporn alternativa pro velkoplon lepen dh na ploch povrchy ke kontaktnm lepidlm. Je speciln navreno pro dhovn za studena, pro nalepen devn dhy na masivn devo, devotskov desky, MDF, pekliky a jin materily na bzi deva. Nabz stedn dlouhou montn dobu a neobsahuje dn kodliv nebo rav vpary typick pro vtinu kontaktnch lepidel. Pomh tak zabrnit prsaku pes oteven pry dhy a surovou nezpracovanou dhu. Vynikajc odolnost proti vtin rozpoutdel, je neholav a snadno se ist vodou.<br /><br /><em> Typ: Modifikovan Polyvinyl acett PVA<br /> Pouit', '_vyr_320123-5175.jpg', 0, '199.00', '217.00', '123-5175', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5175/123-5175_02_web.jpg', '', '', 21, 1, 1, 1, '37083051759', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7892, 321, 'Titebond Extend Lepidlo na devo - 473ml', 'Titebond Extend Lepidlo na devo - 473ml', '<p><strong> Vysokopevnostn disperzn lepidlo.<br /> Pouit pouze v interiru.<br /> Del fixan doba ne Titebond Original.<br /> Spoj je silnj ne pevnost deva.<br /> Zven odolnost proti vym teplotm.<br /> Vynikajc odolnost proti vtin rozpoutdel.<br /> Dobe brousiteln a pelakovateln.<br /> Univerzln - lep devo, devovlknit desky, vysokotlak laminty a devotskov desky.<br /> Snadn itn vodou.</strong><br /><br />Disperzn lepidlo na devo s prodlouenou dobou monte m stejn vlastnosti jako Titebond Original. Poskytuje vak vce asu pro lepen sloitjch sestav. Pouit v interirech, zvlt v exponovanch stech, kter jsou vystaveny vym teplotm jako kuchysk linky, obklady raditor a pod.<br /><br />Pouit: devo, devovlknit desky, MDF, peklika, vysokotlak lamint a devotskov desky, ltka, ke.<br /><br /><em> Typ: Disperzn lepidlo PVA<br /> Pouit: Interir<br /> Doba oteven: max. 15 minut<br /> Celko', '_vyr_321123-9104.jpg', 0, '149.00', '161.00', '123-9104', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-9104/123-9104_02_web.jpg', '', '', 21, 1, 1, 1, '37083091045', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7893, 322, 'Titebond Liquid Hide Klihov lepidlo na devo - 118ml', 'Titebond Liquid Hide Klihov lepidlo na devo - 118ml', '<p><strong> Pipraveno k okamitmu pouit.<br /> Typ - glutinov klih s psadami.<br /> Vynikajc brousitelnost a odolnost proti teen.<br /> Vhodn pro devo a ltky.<br /> Pouit pouze v interiru.<br /> Umouje rozebrateln spoj po zaht.<br /> Dlouh doba fixace pro precizn mont.<br /> Nevhodn pro dlouh skladovn po oteven nutno spotebovat.</strong><br /><br />Titebond Liquid Hide Glue je prvn klihov lepidlo, kter se nabz v tekutm stavu pipravenm k pouit. Nevyaduje dn ohev a mchn. Profesionlov pouvaj Titebond Liquid Hide pro vjimenou pevnost, dlouhou montn dobu, prunost a jedinen penos zvuku v nezkreslen podob.<br /><br />Poskytuje vynikajc odolnost proti teen, nabz skvlou brousitelnost a lze je povrchov upravovat lakovnm a pod.. Jeho citlivost na vy teplotu umouje snadnou demont st, co je zsadn pnos pro restaurovn nbytku nebo opravu hudebnch nstroj. Ideln pro vechny restaurtorsk prce', '_vyr_322123-5012.jpg', 0, '94.00', '92.00', '123-5012', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5012/123-5012_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5012/123-5012_03_web.jpg', '', 21, 1, 1, 1, '37083050127', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7894, 323, 'Titebond No-run, No-drip Lepidlo na devo - 473ml', 'Titebond No-run, No-drip Lepidlo na devo - 473ml', '<p><strong> Vysokopevnostn disperzn lepidlo.<br /> Pouit pouze v interiru.<br /> Velmi krtk fixan doba.<br /> Spoj je silnj ne pevnost deva.<br /> Zven odolnost proti vym teplotm.<br /> Vynikajc odolnost proti vtin rozpoutdel.<br /> Dobe brousiteln a pelakovateln.<br /> Univerzln - lep devo, devovlknit desky, vysokotlak laminty a devotskov desky.<br /> Snadn itn vodou.</strong><br /><br />Disperzn lepidlo s nejrychlej fixac, velmi rychle usych. Ideln pro lepen napklad okrasnch lit a dalch projekt poadujcch rychl lepen bez stkn. Snadn k pouit, rychl fixace, kter vak dostaten dovoluje vyrovnn dl. Vynikajc pro porzn i polo-porzn materily.<br /><br />Pouit: devo, devovlknit desky, MDF, peklika, vysokotlak lamint a devotskov desky, ltka, ke.<br /><br /><em> Typ: Disperzn lepidlo PVA<br /> Pouit: Interir<br /> Doba oteven: max. 3-5 minut<br /> Celkov montn doba:', '_vyr_323123-2404.jpg', 0, '138.00', '151.00', '123-2404', '', '', '', '', 21, 1, 1, 1, '37083024043', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7895, 324, 'Titebond II Dark Lepidlo na devo tmav D3 - 237ml', 'Titebond II Dark Lepidlo na devo tmav D3 - 237ml', '<p>Titebond II Dark je obarven verze lepidla Titebond Premium II do barvy tmavho hndho deva. Je to vysokopevnostn vododoln lepidlo, kter spluje psnou evropskou normu DIN EN 204/ D3 pro pevnostn odolnost proti vod. Po zaschut m hndou barvu, a proto je vhodn vude tam, kde se pouvaj tmav odstny deva.<br />Lep vechny venkovn devn konstrukce vetn venkovnho devnho nbytku. Titebond II Premium poskytuje silnou poten lepivost v krtk dob, vysokou pevnost a vynikajc brousitelnost. Titebond II Premium je snadno pouiteln, odoln proti povtrnostnm vlivm. Lepidlo lze snadno oistit navlhenm hadkem.<br /><br /><em> Typ: Polyvinyl acett PVA<br /> Pouit: Interir a exterir<br /> Doba oteven: max. 5 minut<br /> Celkov montn doba: 10 - 15 minut<br /> pln zaschnut: 24 hodin<br /> Pracovn a skladovac teplota : 10 - 30C<br /> Vhodn pro: devo, devotsku, tkaniny, ke<br /> Skupina namhn: DIN EN 204 / D3</em></p>', '_vyr_324123-3703.jpg', 0, '92.00', '104.00', '123-3703', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-3703/123-Dark_2_web.jpg', '', '', 21, 1, 1, 1, '37083037036', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7896, 325, 'Titebond Quick & Thick Lepidlo na devo - 237ml', 'Titebond Quick & Thick Lepidlo na devo - 237ml', '<p><strong> Tikrt vt pevnost spoje.</strong><br /><strong><strong> Prhledn barva po vytvrzen.</strong><br /><strong> Dvakrt rychlej doba fixace.</strong><br /><strong> Ideln lepidlo pro domc a emesln pouit.</strong><br /><strong> Vypluje mrn trhliny a mezery.</strong><br /><strong> Vynikajc odolnost proti vtin rozpoutdel.</strong><br /><strong> Dobe brousiteln a pelakovateln.</strong><br /><strong> Univerzln - lep devo, devovlknit desky, vysokotlak laminty a devotskov desky.</strong><br /><strong> Snadn itn vodou, netoxick a neholav.</strong></strong><br /><br />Disperzn lepidlo s nejrychlej fixac, a maximln pevnost vynik svmi vlastnostmi nad ostatn lepidla. Ideln pro lepen napklad okrasnch lit a dalch projekt poadujcch rychl lepen bez stkn v interiru. Snadn k pouit, rychl fixace, kter vak dostaten dovoluje vyrovnn dl. Vynikajc pro porzn i polo-porzn materily. Lepidlo nen vho', '_vyr_325123-2403.jpg', 0, '82.00', '92.00', '123-2403', '', '', '', '', 21, 1, 1, 1, '37083024036', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7897, 326, 'IGM Tavn lepidlo pro olepovaky - balen 1kg', 'Tavn lepidlo pro  olepovaky - balen 1kg', '<p>Speciln vyvinut tavn lepidlo v granulch pro  manuln olepovaky hran. Je prodn barvy, m nzkou viskozitu, rychl taven a vysokou lepivost. Lepidlo je uren pro lepen hran z materil ABS, PVC, PP, melamin, polyester nebo dha. Doporuujeme nastavit teplotu na  olepovace na hodnotu cca 140 podle teploty v dln.<br /><br />Doporuen pracovn teplota, pi aplikaci vlekem: 120 -140C, manuln olepovaky 120C - 140C.<br /><br /><em>Vlastnosti:<br /> nzk viskozita<br /> nzk aplikan teplota <br /> rychle ntavn <br /> velmi dobr smivost <br /> vysoce vydatn lepidlo</em></p>', '_vyr_326M967-1.jpg', 0, '220.00', '244.00', 'M967-1', '', '', '', '', 21, 1, 1, 1, '8,59E+12', 0, '5-0-0-0|5-387-0-0', NULL, '2021-01-10 15:44:04'),
(7898, 327, 'Pr no -  40x4mm HSS', 'Pr no -  40x4mm HSS', '<p><strong> Ureno pro frzovac hlavy od , CMT, Pilana, Flury, Guhdo atd.<br /> Pesn otvory pro kvalitn umstn ve frzovac hlav.<br /> Nabzme v ce 40 mm nebo 50 mm.<br /> Vyrobeno z legovan nstrojov oceli.<br /> Pesn vybrouen.</strong></p>\\n<p>Univerzln profilov noe jsou uren pro univerzln frzovac hlavy s euro upnacm systmem. Dky jednoduchmu upnacmu systmu, mete bhem chvilky zmnit profil frzovn na sv frzovac hlav. Pesn ustavovac otvory pro kolky maj prmr 6 mm a jsou v roztei 24 mm. Dodvno v pru (2ks), baleno v blistru.</p>\\n<p>Celkov nabdka univerzlnch no obsahuje tm 200 standardnch profil. irok nabdka uspokoj i nronho zkaznka. Univerzln profilov noe nejsou uren pro sriovou vrobu, ale jako dostupn pomoc pi zakzkov a individuln vrob.</p>\\n<p><strong></strong></p>\\n<p><strong>TECHNICK INFORMACE:</strong></p>\\n<ul>\\n<li>Rozmry univerzlnho profilovho noe jsou 40x4 mm</li>\\n<li>Materi', '_vyr_327par.png', 0, '267.90', '282.00', '690.000', '_vyrn_327par.png', '', '', '', 21, 1, 1, 1, '', 0, '22-0-0-0|22-671-0-0|22-671-826-0', NULL, '2021-01-10 15:44:04'),
