(8102, 539, 'CMT CHROME Pilov kotou na lamino, DTD a MDF - D300x3,2 d30 Z96 HM', 'CMT CHROME Pilov kotou na lamino, DTD a MDF - D300x3,2 d30 Z96 HM', '<p>Nov pilov kotou s chromovanm povrchem, kter redukuje ulpvn zbytk lepidla a pryskyice na tle kotoue. M nov tlumc drky vyplnn oranovm polyuretanem pro snen vibrac a hlunosti. Trapzov zuby z extra tvrdho tvrdokovu pro ezn lamina, devotskovch desek a MDF. Vysok ivotnost. Pro pily s pedezem.</p>', '_vyr_539C28169612M.jpeg', 0, '1533.00', '1703.00', 'C28169612M', '_vyrn_539C28169612M.jpeg', '_vyrp11_539C28169612M-1.jpeg', '_vyrp12_539C28168010M-2.jpeg', '', 21, 1, 1, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:06'),
(8103, 542, 'ATS Diamantov frza dvouzub Z2+1 - D8x15 S=12 RH', 'ATS Diamantov frza dvouzub Z2+1 - D8x15 S=12 RH', '<p><strong>TECHNICK DAJE:</strong></p>\\n<ul>\\n<li><span id=\\\"result_box\\\" class=\\\" lang=\\\"><span class=\\\"alt-edited\\\"> tlo z kvalitnho materilu DENSIMETU</span></span></li>\\n<li>dva diamantov zuby</li>\\n<li>vka diamantovho pltku 3 mm<span id=\\\"result_box\\\" class=\\\" lang=\\\"></span></li>\\n</ul>\\n<p></p>\\n<p><strong>POUIT:</strong></p>\\n<p>Pro drkovn v materilech: HPL, MDF, HDF, laminovan desky, pekliky a vododoln pekliky.</p>\\n<p><strong>VHODY:</strong> Vysok posuv, kvalitn odvod tsek, dokonal povrch obroben plochy, tich provoz. Na obrobek nezanechvaj stopky, nejastj pouit na MDF.</p>\\n<p></p>\\n<p><em>Graf a data maj informan charakter. Mohou se mnit v zvislosti na druhu prce</em></p>\\n<p><em>a zpracovvanch materilech.</em></p>', '_vyr_542AT2.png', 0, '4552.94', '4500.00', 'ATS081510R', '_vyrn_542AT2.png', '_vyrp11_542ATS-2.png', '_vyrp12_542ATS-1.png', '101456_542__vyrp13_541AT2-3.png', 21, 1, 1, 1, '', 0, '2-7-46-0|2-1-11-0|2-1-11-311|2-7-0-0|7-0-0-0|7-419-0-0|7-419-436-0|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8104, 543, 'Universln upnac ppravek ITA tools - pro ISO30', 'Universln upnac ppravek ITA tools - pro ISO30', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Rychl upnut<span></span>HSKnebo <strong>ISO</strong> hlav</li>\\n<li>Uiten pi vmn nstroje</li>\\n<li>Rychl upnut a pevn fixace hlavy</li>\\n<li>Loiskov systm</li>\\n<li>Snadn manipulace</li>\\n<li>Prmr<span></span><strong>50 mm</strong></li>\\n</ul>\\n<h3>POPIS:</h3>\\n<p>Je uren pro rychl upnut HSK nebo ISO hlav pi vmn nstroje. Hlavn vhodou je rychl upnut a fixace hlavy. Hlava se vkld do ppravku, kde dmysln systm loisek zafixuje jej polohu proti pootoen.</p>', '_vyr_543183-ISO_183-ISO-405.jpg', 0, '5236.16', '5817.96', '183-ISO', '_vyrn_543183-ISO_183-ISO-405.jpg', '_vyrp11_543183-ISO_183-ISO-105.jpg', '', '', 21, 1, 5, 0, '', 0, '2-8-0-0|2-8-309-0', NULL, '2021-01-10 15:44:06'),
(8105, 544, 'Universln upnac ppravek ITA tools - pro HSK63', 'Universln upnac ppravek ITA tools - pro HSK63', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Rychl upnut <strong>HSK</strong> nebo ISO hlav</li>\\n<li>Uiten pi vmn nstroje</li>\\n<li>Rychl upnut a pevn fixace hlavy</li>\\n<li>Loiskov systm</li>\\n<li>Snadn manipulace</li>\\n<li>Prmr <strong>63 mm</strong></li>\\n</ul>\\n<h3>POPIS:</h3>\\n<p>Je uren pro rychl upnut HSK nebo ISO hlav pi vmn nstroje. Hlavn vhodou je rychl upnut a fixace hlavy. Hlava se vkld do ppravku, kde dmysln systm loisek zafixuje jej polohu proti pootoen.</p>', '101456_544__vyr_543image002.jpg', 0, '5236.16', '5817.96', '183-HSK', '101456_544__vyrn_543image002.jpg', '_vyrp11_544122094901_368429857600304_5019688759285334979_n.jpg', '', '', 21, 1, 9, 0, '', 0, '2-8-0-0|2-8-309-0', NULL, '2021-01-10 15:44:06'),
(8106, 547, 'CMT Industrial Pilov kotou na lamino a DTD - D250x3,2 d30 Z80 HM', 'CMT Industrial Pilov kotou na lamino a DTD - D250x3,2 d30 Z80 HM', '<p>Osvden kotou strapzovm zubem a expanznmi drkami. Uren pro vysoce kvalitn ezy do lamina a devotsky. Vysok ivotnost tvrdokovovch zub. Pro pily s pedezem.</p>', '_vyr_547C28108010M.jpg', 0, '1427.00', '1586.00', 'C28108010M', '_vyrn_547C28108010M.jpg', '_vyrp11_547C28108010M-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:06'),
(8107, 548, 'CMT Industrial C283 Pilov kotou na lamino bez pedezu - D300x3,2 d30 Z96 HM', 'CMT Industrial C283 Pilov kotou na lamino bez pedezu - D300x3,2 d30 Z96 HM', '<p>Speciln konstrukce sextra ikmmi zuby pro doclen jemnjho ezu oboustrann povrchov upravench materil, jako lamina nebo dhy, na kotouovch pilch nebo velkch zkracovacch pilch. Perfektn povrch spodn hrany pi pouit tohoto kotoue. Vysok ivotnost tvrdokovovch zub. Vhodn pro vertikln pily. Pro lamino, DTD, MDF, pekliku a pn ezy deva.</p>', '_vyr_548C28309612M.jpeg', 0, '1738.00', '1932.00', 'C28309612M', '_vyrn_548C28309612M.jpeg', '_vyrp11_548C28309612M-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:06'),
(8108, 549, 'CMT Sada kotou na lamino - D300 d30 Z96 + D100 d20 Z20 HM', 'CMT Sada kotou na lamino - D300 d30 Z96 + D100 d20 Z20 HM', '<p>Nejlevnj sady kvalitnch CMT kotou uren k dlen laminotskovch materil. Hlavn kotou s trapzovm zubem a skldan pedezov kotou.</p>', '_vyr_549FA-300100.jpg', 0, '2370.00', '2499.00', 'FA-300100', '_vyrn_549FA-300100.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-423-0-0', NULL, '2021-01-10 15:44:06'),
(8109, 550, 'CMT Sada kotou na lamino - D300 d30 Z96 + D120 d20 Z24 HM', 'CMT Sada kotou na lamino - D300 d30 Z96 + D120 d20 Z24 HM', '<p>Nejlevnj sady kvalitnch CMT kotou uren k dlen laminotskovch materil. Hlavn kotou s trapzovm zubem a skldan pedezov kotou.</p>', '_vyr_550FA-300100.jpg', 0, '2370.00', '2499.00', 'FA-300120', '_vyrn_550FA-300100.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-423-0-0', NULL, '2021-01-10 15:44:06'),
(8110, 551, 'CMT Sada na ornamenty, frza 3D S=8mm, ablona KLASIK s rmem', 'CMT Sada na ornamenty, frza 3D S=8mm, ablona KLASIK s rmem', '<p>Vhodn sada obsahuje frzu na ornamenty a ablonu nazsuvky s rmem s klasickm vzorem A. Za zvhodnnoucenu zskte nejpouvanj vzor a frzu na ornamenty.Kdykoliv si mete dokoupit dal vzory a rmy z nanabdky.<br /><br />Ornamenty upadly dlouh lta v zapomnn. Nyn jsou vakopt v kurzu a jejich renesanci napomh i snadnj vrobapomoc uniktn ablony CRCS znaky CMT.S tmto ppravkem mete vyrobit krsn rozety, rohovornamenty na dvee nebo rmy, ornamenty na kuchyskdvka, ornamenty na ela postel nebo skn. Nbytek zmasivu ozdoben ornamenty zav nyn renesanci a protose podvejme jak to vechno funguje.<br /><br /><strong>Jak frzovn ornament funguje?</strong><br />1. Pipevnterm na dl.<br />2. Umstteablonu a pifrzovnkoprujtevezy.<br />3. Pemstteablonu aopakujtepostup.<br />4. Hotovornament</p>', '_vyr_551CRCS-START1.jpeg', 0, '3020.00', '3357.00', 'CRCS-START1', '_vyrn_551CRCS-START1.jpeg', '_vyrp11_551CRCS-START1-1.jpeg', '_vyrp12_551CRCS-START1-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-0-0-0|4-107-0-0|4-107-385-0', NULL, '2021-01-10 15:44:06'),
(8111, 552, 'CMT Multifunkn oscilan pila 300W', 'CMT Multifunkn oscilan pila 300W', '<p><strong>Ideln pomocnk pi brouen, dlen, strhnut koberce, vyznut otvoru, ezn deva nebo plast, zaezvn trubek, ezn hebk.</strong><br /><br /><strong> Rychloupnac systm nstavc.<br /> Dodvno s rukojet a odsvnm.<br /> Vkonn motor 300 W.<br /> Elektronick zmna otek.<br /> Praktick dren stroje.<br /> Bohat nabdka psluenstv pro irok pouit.</strong><br /><br />CMT multifunkn oscilan pila m vkonn 300 wattov motor s regulovatelnou rychlost otek, umoujc irok vyuit nap oborm. Robustn konstrukce pevodovky umouje lep penos sly na nstroj. Rychloupnac systm usnaduje vmnu nstavc.<br /><br /> Typ: CMT11<br /> Doporuen pouit: emeslnk<br /> Pkon: 300W<br /> Volnobn otky: 1100021000 ot./min<br /> Vibrace: 19,7m/s<sup>2</sup><br /> Typ otvoru upnut: Universln<br /> Amplituda: 1,5m/s<sup>2</sup><br /> Hmotnost: 1,2 kg<br /><br /><strong></strong></p>\\n<h3>Soust balen:</h3>\\n<p> ', '_vyr_552CMT11.jpg', 0, '2004.00', '2226.00', 'CMT11', '', '_vyrp11_552CMT11-1.jpg', '_vyrp12_552CMT11-2.jpg', '_vyrp13_552CMT11-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-417-0', NULL, '2021-01-10 15:44:06'),
(8112, 553, 'CMT10 Nov Oezvac frzka 550W, kletiny 8mm a 6mm', 'CMT10 Nov Oezvac frzka 550W, kletiny 8mm a 6mm', '<p><span>Jedinen konstrukce frzky m ergonomick tvar pro lep prci jednou rukou. Motor m 32000 ot./min a poskytuje dostatenou slu i pro vt bry materilu. Je vybavena uniktnm prhlednm otonm krytem, kter kopruje povrch a dky ktermu vdy perfektn vidte na prci. Integrovan odsvac hubice umouje pipojit frzku k odsvn. Pesn hloubka se jednodue nastavuje otenm zkladny, piem 1 otka je 2 mm a pesn nastaven lze odetat na stupnici s noniusem s rozlienm 0,05 mm. Soust balen je zkladna s nastavitelnm frzovacm pravtkem, koprovac krouek D10 mm, 2 kle pro jednoduchou vmnu frzy, 2 kletiny o prmru 8 a 6 mm a nvod k obsluze. To ve v pepracnm kufku.</span></p>', '_vyr_553CMT10N.jpg', 0, '2061.00', '2290.00', 'CMT10N', '', '_vyrp11_553CMT10N-1.jpg', '_vyrp12_553CMT10N-2.jpg', '', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8113, 554, 'CMT 7E Horn frzka 2400 W, kletina 8 a 12mm', 'CMT 7E Horn frzka 2400 W, kletina 8 a 12mm', '<p><strong> Elektronick regulace rychlosti s mkkm startem 8000 a 20000 ot./min.<br /> Odnmateln pruina zdvihu pro snadn nastaven hloubky frzovn pi prci ve frzovacm stolku.<br /> Snadno pstupn uhlky.<br /> Bezpenostn kryt vypnae s ochranou proti zapnut.<br /> Bon vtrac otvory zamezuj pronikn prachu do motoru.<br /> Revolverov doraz pro rychl pednastaven hloubek ezu.<br /> Jednoduch nastaven vky frzovn ve frzovacm stolku.<br /> Pepnn mezi volnou a pevnou polohou zdvihu frzky.<br /> Ochrann kryty.<br /> Multifunkn pracovn deska pro snadn frzovn.<br /> Rychl upevnn a odstrann multifunkn pracovn desky.<br /><br />U obou typ CMT frzek lze nastavit vku frzovn ve frzovacm stolku shora pomoc run kliky.</strong><br /><br /><em> Typ: CMT7E<br /> Doporuen pouit: emeslnk<br /> Pkon: 2400W<br /> Volnobn otky: 800020000 ot./min<br /> Max. zdvih: 68 mm<br /> Max. prmr otvoru ve stolku: 79 m', '_vyr_554CMT7E.jpg', 0, '7306.00', '7690.00', 'CMT7E', '', '_vyrp11_554CMT7E-1.jpg', '_vyrp12_554CMT7E-2.jpg', '_vyrp13_554CMT7E-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8114, 555, 'CMT 8E Horn frzka 1000 W, kletina 8 a 12mm', 'CMT 8E Horn frzka 1000 W, kletina 8 a 12mm', '<p><strong> Elektronick regulace rychlosti s mkkm startem 8000 a 20000 ot./min.<br /> Snadno pstupn uhlky.<br /> Bezpenostn kryt vypnae s ochranou proti zapnut.<br /> Bon vtrac otvory zamezuj pronikn prachu do motoru.<br /> Revolverov doraz pro rychl pednastaven hloubek ezu.<br /> Jednoduch nastaven vky frzovn ve frzovacm stolku.<br /> Rychl upevnn a odstrann multifunkn pracovn desky.<br /> Pepnn mezi volnou a pevnou polohou zdvihu frzky.<br /> Ochrann kryty.<br /> Multifunkn pracovn deska pro snadn frzovn.</strong><br /><br /><strong>U obou typ CMT frzek lze nastavit vku frzovn ve frzovacm stolku shora pomoc run kliky.</strong><br /><br /><em> Typ: CMT8E<br /> Doporuen pouit : emeslnk<br /> Pkon: 1000 W<br /> Volnobn otky: 800020000 ot./min<br /> Max. zdvih: 59 mm<br /> Max. prmr nstroje pi max. zaten: 50 mm<br /> Max. prmr otvoru ve stolku: 77,5 mm<br /> Kletiny v balen: 8 a ', '_vyr_555CMT8E.jpg', 0, '5310.00', '5900.00', 'CMT8E', '', '_vyrp11_555CMT8E-1.jpg', '_vyrp12_555CMT8E-2.jpg', '_vyrp13_555CMT8E-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8115, 556, 'CMT Frzovac stolek', 'CMT Frzovac stolek', '<p><strong> Lehk stabiln konstrukce.<br /> Pravtko a ptlaky v zkladn vbav.<br /> Upnut vech typ frzek.<br /> Velk pracovn plocha.</strong><br /><br />CMT frzovac stl byl navren pro emeslnky a kutily, kterm vyhovuje standardn proveden pracovnho vybaven. Frzovac stl roziuje vyuit a monosti runch frzek. Dky zkuenostem znaky CMT frzovac stolek nabz ideln kombinaci ceny a uitnch vlastnosti. Pracovn plochu tvo MDF lamintov deska o velikosti 80x60x2,5cm. Pohodlnou pracovn vku 90cm zajiuje stojan z pevn oceli s vkov stavitelnma nohama.<br />Stedov deska je pipravena pro upnut a vyuit CMT hornch frzek. Pesto je mon upnout vechny frzky libovolnch znaek a model na trhu.<br /><br /><em> Doporuen pouit: emeslnk<br /> Rozmr pracovn plochy: 800 x 600mm<br /> Rozmry frzovacho pravtka: 840-900 x 75mm<br /> Maximln prmr frzy pod stolkem: 95mm<br /> Odsvn: 57mm<br /> Dlka x ka x vka: 900 x 6', '_vyr_556C99911000.jpeg', 0, '8806.00', '9784.00', 'C99911000', '_vyrn_556C99911000.jpeg', '_vyrp11_556C99911000-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '4-427-0-0', NULL, '2021-01-10 15:44:06'),
(8116, 557, 'CMT Industrio Frzovac stolek', 'CMT Industrio Frzovac stolek', '<p>INDUSTRIO je frzovac stolek uren pro kadodenn profesionln pouit.Konstrukce stolu umouje upnut nstroj do prmru 89mm. Je rozdlenna ti sti, kter mohou bt zakoupeny samostatn. Velkou vhodou je vloenvkov nastaviteln upnac deska frzky z tvrzenho plastu. Na desce stoluje integrovan profil s dvmi T drkami pro pesn veden psluenstv neboVmi vyroben posuvn ablony.<br /><br /><strong>CMT INDUSTRIO stolek obsahuje vechny zobrazen komponenty vyjma:</strong><br /> Elektrickho STOP vypnae<br /> Zahnutho kle na horn frzku<br /> Zobrazen stopkov frzy tyto produkty lze objednat samostatn.<br />Tyto produkty lze objednat samostatn</p>', '_vyr_557C99950001.jpeg', 0, '14960.00', '16630.00', 'C99950001', '_vyrn_557C99950001.jpeg', '_vyrp11_557C99950001-1.jpeg', '_vyrp12_557C99950001-2.jpeg', '_vyrp13_557C99950001-3.jpeg', 21, 1, 1, 0, '', 0, '4-427-0-0', NULL, '2021-01-10 15:44:06'),
(8117, 558, 'CMT Spojovac ppravek Pocket-Pro', 'CMT Spojovac ppravek Pocket-Pro', '<ul>\\n<li>CMT vrtac ppravek Pocket-Pro je uren pro rychl, jednoduch a pesn spojovn nbytku, korpus a rm.</li>\\n<li>Umouje tvoit pevn, slep spoje v deskch o tlouce 12,7  40 mm, to ve s neuvitelnou rychlost a pesnost.</li>\\n</ul>\\n<p><br />Hlavn vhodou vrtacho ppravku Pocket-Pro je uniktn lisovan tlo s tvrzenmi vrtacmi pouzdry a dvoudln zmkov konstrukce. Posunem nahoru a dol jednodue nastavte tlouku vrtanho materilu na stupnici po 1,6mm, ani byste museli vyvrtvat testovac otvory nebo cokoliv mit. Jestli ji mte zkuenost s podobnmi vrtacmi ppravky, pak vm nkter vlastnosti pijdou znm, Pocket-Pro ovem nabz mnoh dal vhody.<br /><br />Napklad:</p>\\n<ul>\\n<li>Nkter ppravky vyaduj rozebrn, pokud chcete nastavit jinou tlouku obrobku. Pocket-Pro ale sta posunout nahoru nebo dol po stupnici od 12,7mm a po 40mm a tak nastavit poadovanou tlouku spojovanho materilu.</li>\\n<li>Jin ppravky vyaduj neust', '_vyr_558CPPJ-002.jpeg', 0, '2061.00', '2290.00', 'CPPJ-002', '_vyrn_558CPPJ-002.jpeg', '_vyrp11_558CPPJ-002-1.jpeg', '_vyrp12_558CPPJ-002-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-0-0-0|4-107-0-0|4-107-384-0', NULL, '2021-01-10 15:44:06'),
(8118, 559, 'JET JRT-1 Frzovac stolek', 'JET JRT-1 Frzovac stolek', '<p>Frzovac stolek pro pesn frzovn stopkovmi frzami vtch prmr.Je vybaven bezpenostnm vypnaem s monost pipojen horn frzky svkonem a 1600W.<br /><br />Soust stolku je prav a lev rozen stolu na dlku 1030mm , frzovacpravtko s ochrannm odklopnm krytem, ptlan doraz a pokosov pravtko.Stolek je uren pro umstn na stl nebo podstavec.<br /><br /> Typ: JRT-1<br /> Doporuen pouit: Kutil<br /> Bezpenostn vypna: 230 V, 50 - 60 Hz, max. 1600 W<br /> Rozmr stolu ze slitiny: 610 x 360mm<br /> Prodlouen pracovn plochypedn a zadn: 210 x 360mm<br /> Rozmry frzovacho pravtka: 540-610 x 75mm<br /> Maximln prmr frzy podstolkem: 50mm<br /> Odsvn: 70mm (57mm)<br /> Dlka x ka x vka: 1030 x 360 x 410mm<br /> Hmotnost: 10 kg</p>', '_vyr_559JRT-1M.jpeg', 0, '2417.00', '2545.00', '121-JRT-1M', '_vyrn_559JRT-1M.jpeg', '', '', '', 21, 1, 1, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:06'),
(8119, 560, 'JET JRT-2 Frzovac stolek s litinovm stolem', 'JET JRT-2 Frzovac stolek s litinovm stolem', '<p><strong><span style=\\\"line-height: 1.6;\\\"> Otvor v desce stolu pro snadnou zmnu zdvihu frzky.<br /> Upevovac otvory pro frzku CMT7E.<br /> Pracovn stl z litiny.<br /> Rozen pracovn plochy z ocelovho plechu.<br /> Nastaviteln frzovac pravtko</span></strong>.<br /><br /><span style=\\\"line-height: 1.6;\\\">Frzovac stolek JRT-2 je vhodn pro rzn znaky runch frzek. Z vrobyjsou pedpipraven upnac otvory pro run frzku CMT7E, kterjevybavenasnadnm systmem zdvihu z horn strany stolu.Stedov deska stolu je konstruovna tak, aby se dala jednodueodmontovat pro vytvoen otvor pro libovolnou run frzku.Dleitou vhodou stolku je vrchn deska z litiny, kter je lep ne jinmaterily pouvan na frzovacch stolcch. Hmotnost stolku je ve srovnns konkurennmi stolky tm dvojnsobn, co m pozitivn vliv jakna pracovn pohodl a tak kvalitu frzovn. Stl je opaten pohyblivmhlovm pravtkem, kter je vedeno v T drce stolu, a nas', '_vyr_560JRT-12M-2.jpeg', 0, '3724.00', '3920.00', '121-JRT-2M', '_vyrn_560JRT-12M-2.jpeg', '_vyrp11_560JRT-12M-3.jpeg', '_vyrp12_560JRT-12M-4.jpeg', '_vyrp13_560JRT-12M-5.jpeg', 21, 1, 1, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:06'),
(8120, 561, 'IGM FD300 Cinkovac ppravek 305mm vetn rybinov frzy 12,7mm', 'IGM FD300 Cinkovac ppravek 305mm vetn rybinov frzy 12,7mm', '<h3>Snadno arychle vyrobte elegantn spoje. Vhodn pro vechny typy hornch frzek.</h3>\\n<ul>\\n<li>Dv velikosti ppravku.</li>\\n<li>Pevn ocelov tlo.</li>\\n<li>Pesn laserem ezan ablona z 4mm pozinkovanhoocelovho plechu.</li>\\n<li>Masivn drky ablony.</li>\\n<li>Robustn ocelov ptlaky</li>\\n<li>Jednoduch nastaven a pouvn.</li>\\n<li>ablony pro minirybinu, epov spoj a otevenou rybinujsou k dispozici jako psluenstv.</li>\\n<li>Speciln chytn otvory pro umstn doraz na ablon.</li>\\n</ul>\\n<p><br /> Cinkovac ppravek je uren pro vrobu polokrytch rybinovch spoj pomoc run frzky a stopkov frzy. Polokrytrybinov spoje se nejastji pouvaj na zsuvkch z masivnho deva. Dky volitelnm ablonm lze ppravek rozit navrobu rzn typ spoj, jako jsou epov spoje, oteven rybinov spoje, kter vyuijete pro vrobu nbytku z masivnhodena, perkovnice nebo pracovn bedny z masivnho deva. Robustn ptlaky bezpen upnou i vt', '_vyr_561FD300.jpeg', 0, '2716.00', '3018.00', 'FD300', '_vyrn_561FD300.jpeg', '_vyrp11_561FD300-1.jpeg', '_vyrp12_561FD300-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:06'),
