(8122, 563, 'IGM Fachmann Digitln hlomr +-- 180, rozlien na 0,1', 'IGM Fachmann Digitln hlomr +-- 180, rozlien na 0,1', '<p><strong> Men hl v rozmez +/-180 s rozlienm 0,1.<br /> Vybaven automatickm vypnnm.<br /> Monost uzamen hodnoty.<br /> Vododoln.<br /> Zabudovan magnet.</strong><br /><br />Vybaven monost uzamen seln hodnoty hlu. Vod odoln digitln hlomr umouje mit hly v rozmez +/-180 srozlienm na 0,1. Digitln hlomr je vybaven autovypnnm, je mal a m zabudovan magnet, pomoc kterho mete velmi snadno zmit napklad hel naklopen pilovho kotoue na Va pile.</p>', '_vyr_563FDU-001.jpeg', 0, '801.00', '890.00', 'FDU-001', '_vyrn_563FDU-001.jpeg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:06'),
(8123, 564, 'IGM Fachmann Digitln hlomr s ramenem 0- 220, rozlien na 0,05', 'IGM Fachmann Digitln hlomr s ramenem 0- 220, rozlien na 0,05', '<p><strong> Velk dobe iteln displej.<br /> hlomr a vodovha v jednom.<br /> Men hl v rozmez 0 - 225.<br /> Rozlien 0,05.<br /> 270mm pravtko.</strong><br /><br />Tento digitln hlomr s ramenem je mc nstroj s mnoha funkcemi. Velmi snadno mete zmit hel a pomoc pravtka dlky 270 mm narsovat zrove rysku ezu. iteln velk displej Vm uke pesn hel v rozmez 0 - 225 s rozlienm na 0,05. hlomr slou zrove jako vodovha, obsahuje jednu libelu.</p>', '_vyr_564FDU-002.jpeg', 0, '831.00', '923.00', 'FDU-002', '_vyrn_564FDU-002.jpeg', '_vyrp11_564FDU-002-1.jpeg', '_vyrp12_564FDU-002-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:06'),
(8124, 566, 'Virutex vrtac ppravek pro systm 32mm, 215x320 mm', 'Virutex vrtac ppravek pro systm 32mm, 215x320 mm', '<p style=\\\"font-size: 20px;\\\"><strong>Popis vrobku:</strong></p>\\n<p>Nenahraditeln polohovac zazen, uiten pro vrobu vitrn a vrobu nbytku. Pesnost dvoustrannho veden je zachovna i po otoen zazen. Umouje vyvrtvat otvory v roztei 32 mm od sebe, do vnitnch st korpus, dvek a dal montn prce, jako jsou chytky, pojezdy, podpry, police a dal. Rozmry nstroje jsou320 x 215 mm a v0,35 kg.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit. </p>', '_vyr_566PMT111.jpg', 0, '3304.00', '3670.00', 'PMT111', '_vyrn_566PMT111.jpg', '_vyrp11_566PMT111-1.jpg', '_vyrp12_566PMT111-2.jpg', '_vyrp13_566PMT111-3.jpg', 21, 1, 1, 0, '', 0, '4-497-498-0|4-497-0-0', NULL, '2021-01-10 15:44:06'),
