(8127, 569, 'IGM Flexibiln ablona pro frzovn oblouk a kivek - 2000x18x18mm', 'IGM Flexibiln ablona pro frzovn oblouk a kivek - 2000x18x18mm', '<p><strong>Pro rychlou a snadnou vrobu oblouk, tvarovch lit, stol a podobn.</strong><br /><br />Vynikajc ppravky pro rychl a pesn vytvoen ablony pro tvarov frzovn. Jsouvyrobeny z flexibilnho materilu, kter mete vytvarovat do poadovan podoby a potjej vruty pipevnte k budouc ablon. ablonu pipevnte k obrbnmu dlci a pomockoprovacho loiska na stopkov frze nebo frzovac hlav koprujete poadovan tvar.</p>', '_vyr_569FLF-121200.jpeg', 0, '3045.00', '3383.00', 'FLF-182000', '_vyrn_569FLF-121200.jpeg', '_vyrp11_569FLF-121200-1.jpeg', '_vyrp12_569FLF-121200-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0', NULL, '2021-01-10 15:44:06'),
(8128, 570, 'Virutex vrtac ppravek pro systm 32mm, 215x810 mm', 'Virutex vrtac ppravek pro systm 32mm, 215x810 mm', '<p style=\\\"font-size: 20px;\\\"><strong>Popis vrobku:</strong></p>\\n<p>Nenahraditeln polohovac zazen, uiten pro vrobu vitrn i nbytku. Pesnost dvoustrannho veden je zachovna i po otoen zazen. Umouje vyvrtvat otvory v roztei 32 mm od sebe, do vnitnch st korpus, dvek a dal montn prce, jako jsou chytky, pojezdy, podpry, police a dal. Rozmry nastroje jsou810 x 215 mm a v1,20 kg. Soust standartn vbavy je vrtk o prmru 5 mm, drk, ztka, dv ramena s kalenmi pouzdry, 3 nhradn rouby, prodlouen.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % o', '_vyr_570PMT111T.jpg', 0, '5430.00', '0.00', 'PMT111T', '_vyrn_570PMT111T.jpg', '_vyrp11_570PMT111T-1.jpg', '_vyrp12_570PMT111T-2.jpg', '_vyrp13_570PMT111T-3.jpg', 21, 1, 1, 1, '', 0, '4-497-498-0|4-497-0-0', NULL, '2021-01-10 15:44:06'),
(8129, 571, 'Virutex Run mechanick naneka lepidla', 'Virutex EM25D run mechanick naneka lepidla', '<p><span class=\\\"bullet-line\\\">Run mechanick naneka lepidla.</span></p>\\n<p><span class=\\\"bullet-line\\\"><br /></span><span class=\\\"bullet-line\\\">Je konstruovna k istmu, rychlmu a efektivnmu nanen lepidla pedevm na vt plochy.<br /></span><span class=\\\"bullet-line\\\">Je vybavena dvma nanecmi vlci:<br /></span><span class=\\\"bullet-line\\\">                     <strong>Spodnm</strong> - ten umouje nanet lepidlo odvalovnm naneky po dlci.<br /></span><span class=\\\"bullet-line\\\">                     <strong>Hornm</strong> - ten umouje nanet lepidlo unenm dlce po nanece, kter je uchycena do stojanu.</span></p>\\n<p><span class=\\\"bullet-line\\\"><br /></span><span class=\\\"bullet-line\\\">Naneka je velice praktickm pomocnkem a u v truhlsk vrob tak i v alounictv apod.</span></p>\\n<div class=\\\"parameters--row\\\">\\n<div class=\\\"parameters-column--title\\\">ka spodnho vlce: 122 mm</div>\\n</div>\\n<', '_vyr_571EM25D.jpg', 0, '3341.00', '3713.00', 'EM25D', '_vyrn_571EM25D.jpg', '_vyrp11_571EM25D-1.jpg', '_vyrp12_571EM25D-2.jpg', '_vyrp13_571EM25D-3.jpg', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06');
INSERT INTO `products` (`id`, `productId`, `name`, `secondName`, `description`, `picture`, `available`, `price`, `secondPrice`, `productnumber`, `previewPicture`, `gallery0`, `gallery1`, `gallery2`, `vat`, `vatlevel`, `amountInStock`, `avaibilityId`, `ean`, `unsaleable`, `categories`, `changedAt`, `dt`) VALUES
(8130, 572, 'CMT C512 Sukovnk run - D14 L90 S=10x60 HM P', 'CMT C512 Sukovnk run - D14 L90 S=10x60 HM P', '<p>Osvden sukovnk CMT m 2 pedezvac hroty, centrovac hrot a 2 ezn zuby.<br />Vechny hroty jsou z tvrdokovu urenho pro vrtn do mkkho i tvrdho deva.<br />Vborn i pro vrtn do lamino desek.<br />Kvalitn a pesn nstroj.<br />Pro run i stacionrn vrtaky.</p>', '_vyr_57225805696-_-_-o.jpg', 0, '719.00', '797.00', 'C51214011', '_vyrn_57225805696-_-_-o.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C51214011/C51214011_2_web.jpg', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:06'),
(8131, 573, 'CMT C513 Sukovnk run - D15 L120 S=13x50 HM P', 'CMT C513 Sukovnk run - D15 L120 S=13x50 HM P', '<p>Masivn sukovnk CMT ady C513 m dlouhou masivn stopku o prmru 13 mm.<br />M 2 pedezvac hroty, centrovac hrot a 2 ezn zuby.<br />Vechny hroty jsou z tvrdokovu urenho pro vrtn do mkkho i tvrdho deva.<br />Vborn i pro vrtn do lamino desek.<br />Masivn nstroj pro stacionrn vrtaky.</p>', '_vyr_57325805696-_-_-o.jpg', 0, '1223.00', '1359.00', 'C51315011', '_vyrn_57325805696-_-_-o.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C51315011/C51315011_2_web.jpg', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:06'),
(8132, 574, 'IGM A8 Tlakov dvkova lepidla, ocelov, 8 kg', 'A8 Tlakov dvkova lepidla, ocelov, 8 kg', '<h4>Cena / proveden.</h4>\\n<p><strong>Dvkova s tlakovou ndobou z kvalitn oceli pro mal a stedn dlny.<br />Vborn pomr ceny a proveden.</strong><br /><br /><em> Tlakov ndoba: Ocel<br /> Kapacita npln: 8 kg<br /> Maximln tlak: 5 bar<br /> Hmotnost: 14 kg<br /> Rozmry (D x  x V): 20 x 20 x 65 cm</em><br /><br />Kvalitn a bezproblmov tlakov dvkovae lepidla razantn sniuj pracovn as pi lepen nebo stkn lepidel a barev v porovnn s klasickm zpsobem aplikace. Jsou ureny pro disperzn vodou editeln lepidla (PVA) pro vysokopevnostn spoje deva. Se speciln dvkovac nebo stkac pistol lze aplikovat tak PUR lepidla nebo stkat lepidla a barvy na bzi rozpoutdel, i vodou editeln. Dvkovae jsou spolehliv, efektivn a snadno se udruj. V nabdce je irok mnostv nstavc a trysek pro lepen kolkovch, epovch nebo lamelovch spoj, pro drky, na plochy a mnoho dalch een. Podvejte se na video, jak dvkovae funguj. Pro vyrb i', '_vyr_574136-9001.jpg', 0, '13567.00', '13159.99', '136-9001', '', '', '', '', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06'),
(8133, 575, 'IGM Run nanaeka lepidla 74 mm se stojnkem', ' Run nanaeka lepidla 74 mm se stojnkem', '<p><strong> Jednodue a rovnomrn nan lepidlo na lepen plochy.<br /> ka pnovho vleku 74 mm.<br /> Pro disperzn vodou editeln lepidla.<br /> Vyrobeno z plastovho vlisku, vetn odkldacho stojnku.<br /> Nhradn vleek je soust dodvky.</strong><br /><br />Jednoduch a ekonomick nanaeka lepidla je vyroben z plastu a je uren pro krtkodob kutilsk pouit. Soust dodvky jsou 2 pnov vleky.<br /><br /><em> Rozmry balen (DxxV): 13x15x20 cm<br /> Rozmry produktu (DxxV): 13x24x20 cm<br /> Hmotnost: 0,63 kg</em><br /><br /><strong>Pouit:</strong> Vyjmte nhradn vleek z vaniky. Naroubujte rukoje na vaniku. Nalejte disperzn lepidlo do vaniky. <br />Pka ve voln pozici  maximln dvka lepidla, pka pitaen  minimln dvka lepidla.</p>', '_vyr_575146-1002.jpg', 0, '400.00', '430.00', '146-1002', '', '_vyrp11_575146-1002-1.jpg', '_vyrp12_575146-1002-2.jpg', '_vyrp13_575146-1002-3.jpg', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06'),
(8134, 576, 'DD Drkovac frza dvoustupov  d610 D107 L40 S6 HSS', ' DD Drkovac frza dvoustupov  d610 D107 L40 S6 HSS', '<ul>\\n<li>Pro frzovn drek pro okenn a dven tsnn.</li>\\n<li>Speciln dvoustupov vybrouen bit</li>\\n<li>HSS tlo nstroje.</li>\\n</ul>\\n<p>Gamma Zinken drkovac frza je urena pro vechny druhy prac. Vyznauje se kvalitnm ostm, kter vyfrzuje dokonalou dvou drku v masivnm dev. Pro frzovn podle ablony nebo pravtka.</p>', '_vyr_576DD-web.jpg', 0, '427.50', '475.00', 'GZ99', '_vyrn_576DD-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:06'),
(8135, 577, '2LTT Drkovac frza prodlouen  D L S ', ' 2LTT Drkovac frza prodlouen  D L S ', '<ul>\\n<li>Frzy pro pm zavrtn</li>\\n<li>Po zavrtn mete frzovat poadovanou vku ezu</li>\\n<li>Snadn vytvoen drky nebo vezu</li>\\n</ul>\\n<p>Gamma Zinken drkovac frza se zvrtnm HM zubem jse urena pro vechny druhy prac vetn zavrtvn domaterilu. HW zavrtvac zub usnaduje zavrtvn domkkho atvrdho deva, DTD, lamino desek, MDF a HDF.Nstroj s prodlouenm tlem. Zavrtvac HM bit naosten pro hlubok zavrtn domaterilu.</p>', '_vyr_5772TTL-web.jpg', 0, '810.00', '900.00', 'GZ1083', '_vyrn_5772TTL-web.jpg', '_vyrp11_5772LTT-1.png', '_vyrp12_5772LTT-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8136, 578, 'C2 Oezvac frza se stedovm loiskem  D1315/15 L60 S6 HW', ' C2 Oezvac frza se stedovm loiskem  D1315/15 L60 S6 HW', '<p>Frza je urena pro pesn ofrzovn pesah a nklik na materilu podle stedovho materilu. Vhodou tohoto typu oezvac frzy je monost zvolit jakou st nstroje potebujete vyuvat. Mon vyut jako nstroj k oezvn se spodnm, hornm nebo stedovm loiskem.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Vyut na materil od 15mm do 30mm nebo od 25mm do 50mm.</li>\\n<li>Oezvac frza se stedovm loiskem s minimln vzdlenost mezi bity je 10 mm.</li>\\n</ul>', '_vyr_578C2-web.jpg', 0, '1012.50', '1125.00', 'GZ913', '_vyrn_578C2-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:06'),
(8137, 579, 'G1 Vyezvac frza na otvory  D615 L60 S6 HW', ' G1 Vyezvac frza na otvory  D615 L60 S6 HW', '<ul>\\n<li>Uniktn aasov sporn frza.</li>\\n<li>Oezvnhorn desky</li>\\n<li>HM celotvrdokovov tlo nstroje.</li>\\n</ul>', '_vyr_579G1-web.jpg', 0, '630.00', '700.00', 'GZ156', '_vyrn_579G1-web.jpg', '_vyrp11_579G1-1.png', '_vyrp12_579G1-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-319|14-0-0-0|14-611-0-0|14-611-629-0', NULL, '2021-01-10 15:44:06'),
(8138, 580, 'G2 Vyezvac frza na otvory  D615 L70 S6 HW', ' G2 Vyezvac frza na otvory  D615 L70 S6 HW', '<ul>\\n<li>Uniktn aasov sporn frza.</li>\\n<li>Oezvn doln ahorn desky najednou.</li>\\n<li>HM celotvrdokovov tlo nstroje.</li>\\n</ul>', '_vyr_580G2-web.jpg', 0, '765.00', '850.00', 'GZ158', '_vyrn_580G2-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-319|14-0-0-0|14-611-0-0|14-611-629-0', NULL, '2021-01-10 15:44:06'),
(8139, 581, 'NC1 hlov frza bez loiska  30 D2110 L50 S6 HW', ' NC1 hlov frza bez loiska  30 D2110 L50 S6 HW', '<p>hlov frza Gamma Zinken je urena pro oezvn a sren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian. Frza je bez loiska. Uren pro CNC a run frzovn pomoc pravtka.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW</li>\\n</ul>', '_vyr_581NC1-web.jpg', 0, '720.00', '800.00', 'GZ149', '_vyrn_581NC1-web.jpg', '_vyrp11_581NC1-1.png', '_vyrp12_581NC1-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:06'),
(8140, 582, 'CS Oezvac a hlov frza  45D19/2411 L50 S6 ', ' CS Oezvac a hlov frza  45D19/2411 L50 S6 ', '<p>Oezvac a hlov frza Gamma Zinken je urena pro oezvn a sren hran na irokm spektru materil devo, DTD, lamino, HPL nebo Corian. Uren pro CNC po odroubovn loiska a run frzovn.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW</li>\\n</ul>', '_vyr_582CS-web.jpg', 0, '855.00', '950.00', 'GZ152', '_vyrn_582CS-web.jpg', '_vyrp11_582CS-1.png', '_vyrp12_582CS-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:06'),
(8141, 583, 'N Dlabac a srovnvac frza  D1920 L50 S6 HW', ' N Dlabac a srovnvac frza  D1920 L50 S6 HW', '<p>Dlabac a srovnvac frza Gamma Zinken je ideln pro polon frzovac nap. Dlaby, panty apod. Frza je vhodn na irok spektru materil devo, DTD, lamino, HPL nebo Corian.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW</li>\\n</ul>', '_vyr_583N-web.jpg', 0, '697.50', '775.00', 'GZ148', '_vyrn_583N-web.jpg', '_vyrp11_583N-1.png', '_vyrp12_583N-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8142, 584, 'Bvr Drkovac frza dvoustupov  d2,23 D65 L50 S6 HW', ' Bvr Drkovac frza dvoustupov  d2,23 D65 L50 S6 HW', '<ul>\\n<li>Pro frzovn drek ozdobnch a dekorativnch lit.</li>\\n<li>Speciln dvoustupov vybrouen bit.</li>\\n<li>HWM tlo nstroje.</li>\\n</ul>\\n<p>Gamma Zinken drkovac frza je urena k vyfrzovn drek pro vloen dekorativnch a ozdobnch lit. Vyznauje se kvalitnm ostm, kter vyfrzuje dokonalou dvou drku v masivnm dev. Ideln pro frzovn podle ablony nebo pravtka.</p>', '_vyr_584DD-web.jpg', 0, '855.00', '950.00', 'GZ3687', '_vyrn_584DD-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:06'),
(8143, 585, 'IP Frza na spojen sprovky  D1630 L50 S6 ', ' IP Frza na spojen sprovky  D1630 L50 S6 ', '<ul>\\n<li>Pro frzovn spoj v masivnm devu.</li>\\n<li>SV zuby pro pevn spojen.</li>\\n<li>HW zuby nstroje.</li>\\n</ul>\\n<p>Gamma Zinken frza na spoje je urena k vyfrzovn spoj pro spojovn deva na ku. Vyznauje se kvalitnm ostm, kter vyfrzuje dokonal spoj v masivnm dev. Ideln pro frzovn ve frzovacm stolku nebo podle pravtka.</p>', '_vyr_585IP-web.jpg', 0, '1012.50', '1125.00', 'GZ949', '_vyrn_585IP-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-338|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:06'),
(8144, 586, 'OvvO Stopkov drkovac frza  D1213 L70 S8 ', ' OvvO Stopkov drkovac frza  D1213 L70 S8 ', '<p>Stopkov frza Gamma Zinken pro Sytem OVVO 1240.</p>', '_vyr_586GZ-4142.png', 0, '877.50', '975.00', 'GZ4142', '_vyrn_586GZ-4142.png', '_vyrp11_586GZ-4142-1.png', '_vyrp12_586GZ-4142-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8145, 587, '3 Frza pro rybinov spoj  D1115 L50 S6 7 HW', ' 3 Frza pro rybinov spoj  D1115 L50 S6 7 HW', '<ul>\\n<li>Pro frzovn rybinovch spoj.</li>\\n<li>Masivn krek nstroje</li>\\n<li>HW zuby nstroje</li>\\n</ul>\\n<p>Gamma Zinken frza na rybonov spoje je perfektn zpracovan nstroj pro rybinov (cinkov) spoj, kter bv vzvou pro profesionly i amatry. Rybinov frzy dodvme v nkolika velikostech. Rybinov frzy jsou konstruovny tak, aby vechny vtin oblbenm ppravkm, vetn systm , Leigh, DeWalt, TREND, FESTO, BOSCH atd.</p>', '_vyr_5873-web.jpg', 0, '652.50', '725.00', 'GZ130', '_vyrn_5873-web.jpg', '_vyrp11_5873-1.png', '_vyrp12_5873-2.png', '_vyrp13_5873-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-16-0|2-1-16-331|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:06'),
(8146, 588, '3C Frza pro rybinov spoj s loiskem  D1010 L50 S6 10 HW', ' 3C Frza pro rybinov spoj s loiskem  D1010 L50 S6 10 HW', '<ul>\\n<li>Pro frzovn rybinovch spoj.</li>\\n<li>Masivn krek nstroje.</li>\\n<li>HW zuby nstroje.</li>\\n</ul>\\n<p>Gamma Zinken frza na rybonov spoje je perfektn zpracovan nstroj pro rybinov (cinkov) spoj, kter bv vzvou pro profesionly i amatry. Rybinov frzy dodvme v nkolika velikostech. Rybinov frzy jsou konstruovny tak, aby vechny vtin oblbenm ppravkm, vetn systm , Leigh, DeWalt, TREND, FESTO, BOSCH atd. Nstroj je pro snadn pouit vybaven loiskem.</p>', '_vyr_5883C--web.jpg', 0, '832.50', '925.00', 'GZ2923', '_vyrn_5883C--web.jpg', '_vyrp11_5883C-1.png', '_vyrp12_5883-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-16-0|2-1-16-334|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:06'),
(8147, 589, 'C2S hlov frza na Corian  D3225 L57 S12 15 HW', ' C2S hlov frza na Corian  D3225 L57 S12 15 HW', '<p>Tato frza je urena pro spojen horn pracovn desky a umyvadla nebo dezu Corianu pod hlem 15.</p>\\n<p>Frza je vybavena loiskem s ochranou proti pinn materilu. Uren pro run horn frzky. Frzuje tak velmi dobe jakkoliv materily ze deva nebo devnch materil. Ideln pro vrobu kuchyskch dez nebo koupelnovch umyvadel.</p>', '_vyr_589C2S-K-web.jpg', 0, '1237.50', '1375.00', 'GZ3273', '_vyrn_589C2S-K-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-351-0|14-0-0-0|14-618-0-0', NULL, '2021-01-10 15:44:06'),
(8148, 590, '7CK Rdiusov frza na Corian  D5025 L60 S12 15 R=12,7 HW', ' 7CK Rdiusov frza na Corian  D5025 L60 S12 15 R=12,7 HW', '<p>Frza je urena k zaoblen a zaznut hrany umyvadla po jeho sestaven. Me bt pouita s frzkou, kter pedfrzuje zkosen hrany umyvadla s miskou. Je vybavena loiskem s ochranou proti pinn materilu. Uren pro run horn frzky.</p>', '_vyr_5907C-K-web.jpg', 0, '1687.50', '1875.00', 'GZ3274', '_vyrn_5907C-K-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-351-0|14-0-0-0|14-618-0-0', NULL, '2021-01-10 15:44:06'),
(8149, 591, '4 eln hlov frza  D2518 L50 S6 32 HW', ' 4 eln hlov frza  D2518 L50 S6 32 HW', '<p>Frza se zkosenm je urena pro spojen masivu a konstruknch prvk. eln hlov frzy mohou bt pouity pro ikm frzovn nebo pro vrobu kovch spoj dvou materil. Tento spoj vm umon vytvoit rm a pedlen panel nebo dvench pek.</p>', '_vyr_5914-web.jpg', 0, '877.50', '975.00', 'GZ134', '_vyrn_5914-web.jpg', '_vyrp11_5914-1.png', '_vyrp12_5914-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8150, 592, '6 Drkovac frza se zaoblenm dnem  D814 L50 S6 R=4 HW', ' 6 Drkovac frza se zaoblenm dnem  D814 L50 S6 R=4 HW', '<p>Frza se zaoblenm dnem Vm umon vytvoit rytiny do jakhokoliv deva nebo devnho vrobku. Nabzme kompletn vbr prmr a eznch hloubek, abyste doshli poadovanho vsledku. S pouitm frzovacho stolku mete frzovat a do hloubky 25 mm a vytvoit zaoblenou drku a 40mm. Vt prmry frz je mon osadit hornm loiskem, pot mete pouit vlastn ablonu nepravidelnho tvaru.</p>', '_vyr_5926-web.jpg', 0, '562.50', '625.00', 'GZ137', '_vyrn_5926-web.jpg', '_vyrp11_5926-1.png', '_vyrp12_5926-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8151, 593, '6/2SC Zaoblovac frza vypoukl  D2511 L50 S6 R=4 HW', ' 6/2SC Zaoblovac frza vypoukl  D2511 L50 S6 R=4 HW', '<p>Zaoblovac vypoukl frza Gamma Zinken je ideln pro vrobu hran s ozdobnm profilem. Frzuje bn profil s jemnm hornm osazenm, nebo dvma osazenmi a to pouze vmnou loiska Dodv nbytku zvltn vzhled.</p>\\n<ul>\\n<li>Tlo nstroje z prvotdn oceli.</li>\\n<li>HW tvrdokovov bity.</li>\\n<li>Povrch nstroje s nepilnavou vrstvou.</li>\\n</ul>', '_vyr_5936-2SC-web.jpg', 0, '877.50', '975.00', 'GZ2438', '_vyrn_5936-2SC-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8152, 594, '6CS Zaoblovac frza vypoukl  D2314 L50 S6 R=5 HW', ' 6CS Zaoblovac frza vypoukl  D2314 L50 S6 R=5 HW', '<p>Zaoblovac vypoukl frza Gamma Zinken je ideln pro vrobu hran s ozdobnm profilem. Vyfrzujete jemn ozdobn profil, kter dodv nbytku zvltn vzhled.</p>\\n<p></p>\\n<ul>\\n<li>Tlo nstroje z prvotdn oceli.</li>\\n<li>HW tvrdokovov bity.</li>\\n<li>Povrch nstroje s nepilnavou vrstvou.</li>\\n</ul>', '_vyr_5946SC-web.jpg', 0, '742.50', '825.00', 'GZ140', '_vyrn_5946SC-web.jpg', '_vyrp11_5946SC-1.png', '_vyrp12_5946SC-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8153, 595, '7 Zaoblovac frza vydut  D1811 L50 S6 R=5 HW', ' 7 Zaoblovac frza vydut  D1811 L50 S6 R=5 HW', '<p>Zaoblovac vydut frza Gamma Zinken je ideln pro frzovn oblch tvar nebo kulatin. Jednoduchou pravou vky nebo hloubky ezu zmnte hloubku a tvar profilu. Mete pout na frzovacch stolech nebo v run frzce podle pravtka. Pouit: Je univerzln, umouje vyrbt krsn okraje, hrany a lity. Pouijte tyto frzy pro vrobu irok kly jednoduchch a dvojitch okrajovch profil a zaoblen.</p>', '_vyr_5957-web.jpg', 0, '652.50', '725.00', 'GZ141', '_vyrn_5957-web.jpg', '_vyrp11_5957-1.png', '_vyrp12_5957-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-323|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8154, 596, '7V Rdiusov frza eln  D88 L50 S6 R=4 HW', ' 7V Rdiusov frza eln  D88 L50 S6 R=4 HW', '<p>irok nabdka profilovch frz Gamma Zinken je urena pro vrobce sknk a nbytku. Kad profilov frza me bt upravena pro vrobu profil pouhou zmnou hloubky. Ideln nstroj pro ozdobn frzovn el dvek.</p>\\n<p>Pouit: Pro klasick jednoduch nebo dvojit okraj hrany. Ideln pro vytven dekoranch efekt na deskch, dvech a zsuvkch.</p>', '_vyr_5967V-web.jpg', 0, '720.00', '800.00', 'GZ741', '_vyrn_5967V-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8155, 597, '7BA Frza na hrany stolu a madla zbradl  D4212 d=13 L55 S8 ', ' 7BA Frza na hrany stolu a madla zbradl  D4212 d=13 L55 S8 ', '<p>Zaoblovac frza Gamma Zinken dopluje sestavu na zbradl a hrany stol. Elipsovit radiusov vse se skvle hod pro zbradl s prvky funkcionalismu.</p>\\n<p>Frzy na zbradl a hrany stol s pozvolnm rdiusovm zaoblenm Vm umon vyrbt krsn a funkn zbradl nebo ndhern hrany rustiklnch stol.</p>\\n<p>VTato iroko-profilov frza pi frzovn ubr velk mnostv materilu a vytv velk mnostv pilin. Pro snadnj a bezpenj prci doporuujeme frzovat ve frzovacm stolku.</p>', '_vyr_5977BA-web.jpg', 0, '1237.50', '1375.00', 'GZ1898', '_vyrn_5977BA-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-322|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8156, 598, '2/7 Frza drkovac se zaoblenm hrany  D12/2035 h1=35 L73 S8 R = 3 HW', ' 2/7 Frza drkovac se zaoblenm hrany  D12/2035 h1=35 L73 S8 R = 3 HW', '<p>Drkovac frza se zaoblenm frza Gamma Zinken nabz jedinen vyuit pro vce operac.</p>\\n<p>Frza dky sv konstrukci drkovac sti a zaoblovac sti nabz jedinen vyuit pi drkovn a oezvn se zaoblenm horn hrany.</p>\\n<p>Tato vceelov drkovac frza je praktickm nstrojem. Je urena pro frzovn masivnho deva, lamina, DTD, MDF, HPL nebo Corianu.</p>', '_vyr_598GZ-2-7.png', 0, '945.00', '1050.00', 'GZ3048', '_vyrn_598GZ-2-7.png', '_vyrp11_598GZ-2-7-1.png', '_vyrp12_598GZ-2-7-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|2-1-14-0|2-1-14-323|14-0-0-0|14-610-0-0|14-610-621-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8157, 599, '8 Frza profilov eln  D2013 L50 S6 R=3+3 HW', ' 8 Frza profilov eln  D2013 L50 S6 R=3+3 HW', '<p>Profilov frzy Gamma Zinken nabz jedinen vyuit pro vce operac.</p>\\n<p>Profilov frzy jsou uren pro vrobce sknk anbytku. Dodvme rzn profily nahrany stol, obloen dve nebo okrasn lity. Kad profilov frza me bt upravena pro vrobu dvou profil pouhou vmnou loiska.</p>\\n<p>profilov frzy jsou praktickm nstrojem k vrob ozdobnch prvk. Jsou ureny pro frzovn masivnho deva, lamina, DTD, MDF, HPL nebo Corianu.</p>', '_vyr_5998-web.jpg', 0, '742.50', '825.00', 'GZ144', '_vyrn_5998-web.jpg', '_vyrp11_5998-1.png', '_vyrp12_5998-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-330|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
