(8190, 632, 'S1 Kulov frza  D1211 L50 S8 R=6 HW', ' S1 Kulov frza  D1211 L50 S8 R=6 HW', '<p>Frza s kulovm bitem Gamma Zinken je jejdinenm nstrojem pro vrobu drek nebo ozdobnch drek. Touto frzou mete snadno vyrobit drky pro kabely, zvsn kovn, otvory pro zaven rmek nebo hlavy roub. Doporuujeme nejprve pedfrzovat drkovac frzou.</p>', '_vyr_632S1-web.jpg', 0, '832.50', '925.00', 'GZ3014', '_vyrn_632S1-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
