(8200, 644, 'HOLZMANN TS315VF2000 400V FORMTOVAC PILA', 'FORMTOVAC PILA HOLZMANN TS 315VF 2M STL 400 V', '<h1 id=\\\"h1-fig\\\">Formtovac pila HOLZMANN TS315VF2000 - 400 V</h1>\\n<p><strong>Formtovac pila HOLZMANN</strong> je vhodn pro<strong> ezn deva, plastu, papru a podobnho materilu</strong>, kter se opracovv jako devo. Nachz se zde <strong>robustn, lehce ovladateln podln pravtko</strong> s rychloupnaem s jemnm doladnm a tec lupou. Dle je pila opatena <strong>nklopnm a vkov penastavitelnm kotouem</strong> s pedezem, <strong>litinov stl</strong> s prodlouenm a rozenm s podprnou nohou, <strong>teleskopick hlovac pravtko</strong> s odklopnm dorazem. <strong>Vleek</strong>, kter je na podprnm rmu,<strong> usnaduje manipulaci</strong> s obrobkem.<strong> Stabilitu</strong> stroje zlepuje <strong>zeslen stojan</strong> v posuvnm stolu. <strong>ka ezu</strong> vpravo od kotoue <strong>je a 1220 mm</strong>.</p>\\n<h2 id=\\\"h2-fig\\\">Pednosti pily:</h2>\\n<ul>\\n<li>maximln prmr pilovho kotoue je 315 mm</li>\\n<li>pedez</li', '_vyr_644_vyr_4248TS-315VF.jpg', 0, '51317.30', '0.00', '12HLMTS315VF2000-400', '_vyrn_644_vyr_4248TS-315VF.jpg', '_vyrp11_6445238_4248__vyrd11_891484b57d95df0f7f3faf1a462d71ed17613160721600.jpg', '_vyrp12_6445238_4248__vyrd12_891529b372641dea9234bb09b3ed5d5dc4b13160716800.jpg', '_vyrp13_6445238_4248__vyrd13_891TS-315VF_det1.jpg', 21, 1, 1, 1, '9,12E+12', 0, '3-62-0-0|3-0-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
(8201, 645, 'HOLZSTAR DB1202 SOUSTRUH NA DEVO', 'SOUSTRUH NA DEVO HOLZSTAR DB 1202', '<div style=\\\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; font-weight: normal; margin: 8px;\\\">\\n<h2 style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">SOUSTRUH NA DEVO HOLZSTAR DB 1202</span></h2>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: medium;\\\">CENOV AKCE DO VYPRODN, V PPAD E NEN SKLADEM ZALETE DOTAZ EMAILEM</span></p>\\n<p><span style=\\\"font-size: medium;\\\"></span></p>\\n</div>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: medium;\\\">Ilustrativn foto: Soustruh na devo HOLZSTAR</span></p>\\n<table style=\\\"background-color: #3cb371; width: 100 %; border: 3px solid #000000; border-color: #000000; border-width: 3px;\\\" border=\\\"3\\\" frame=\\\"hsides\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"text-align: left; border: 1px solid #000000;\\\"><span style=\\\"font-size: medium;\\\"><', '_vyr_645_vyr_29855921202-1_800x490.jpg', 0, '51990.00', '0.00', 'BW5921202', '_vyrn_645_vyr_29855921202-1_800x490.jpg', '_vyrp11_645_vyrp12_29855921202-2_565x600.jpg', '_vyrp12_645_vyrp13_29855921202-3_500x533.jpg', '_vyrp13_645_vyrp14_29855921202-4_384x600.jpg', 21, 1, 1, 1, '', 0, '3-62-0-0|3-62-402-0', NULL, '2021-01-10 15:44:06'),
(8202, 646, 'HOLZMANN TS315F 1500 400V KOTOUOV PILA', 'KOTOUOV PILA HOLZMANN TS 315F 1500 400 V', '<h1 id=\\\"h1-fig\\\">Stoln kotouov pila HOLZMANN TS 315F 1500</h1>\\n<p><strong>Stoln kotouov pila HOLZMANN TS 315F 1500</strong> me bt skvlm pomocnkem ve va dln. Dky<strong> promylenm odsvacm vstupm umstnm z vrchu i spodu stroje</strong>, kter vs zbav pebytenho prachu, bude vae prce jednodu jako nikdy pedtm a doshnete perfektnch vsledk. <strong>Pilov kotou s prmrem 315 mm</strong> je jak hlov, tak vkov nastaviteln a doke ezat a do vky 100 mm. Vpravo mete ezat a do e 940 mm. Dlouhou ivotnost pily zajiuje mimojin <strong>stl vyroben z pevn ed litiny</strong>.<strong> Formtovac stl je dlouh 1500 mm</strong> a soust je tak podprn rm. Neme chybt ani<strong> vsuvn pn pravtko s dorazem</strong> nebo <strong>podln AL pravtko s pojezdem</strong> na masivn tyi. Celkov je tento pstroj velmi kvalitn a spolehliv.</p>\\n<h2 id=\\\"h2-fig\\\">Vbava:</h2>\\n<ul>\\n<li>Odsvac vstupy pro bezpranou prci<', '5238_4247__vyr_948TS315F-1500_LQ01.jpg', 0, '47417.30', '0.00', '2HLMTS315F1500-400', '_vyrn_6465238_4247__vyr_948TS315F-1500_LQ01.jpg', '_vyrp11_6465238_4247__vyrp114_9485940-big.jpg', '_vyrp12_6465238_4247__vyrp115_9485941-big.jpg', '_vyrp13_6465238_4247__vyrp111_9485935-big.jpg', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-0-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
