(8210, 654, 'HOLZSTAR HBS473 PSOV PILA', 'DOPRAVA ZDARMA PSOV PILA HOLZSTAR HBS 473', '<h1 id=\\\"h1-fig\\\">Psov pila HOLZSTAR HBS 473</h1>\\n<p>Tato velmi<strong> kompaktn psov pila na devo</strong> je vhodn pro <strong>nron hobby pouit</strong> a domc dlnu s uzavenm podstavcem. Tento pstroj zaruuje <strong>pesn ezn deva, plastu i neeleznch kov</strong>. Tuh svaovan <strong>konstrukce je velmi stabiln</strong> i pes to, e lon plocha je mal. Kvalitn <strong>masivn stl pily</strong> je z ed litiny s pesn brouenm povrchem a je pipevnn na kyvnm uloen.<strong> Sklon</strong> tohoto stolu je mon nastavit v rozsahu <strong>0-45</strong>. Samozejmost je <strong>pesn tkladkov veden pilovho psu nahoe i dole</strong> pro psy ky 6-25 mm. Vmna psu je snadn a rychl dky rychloupnac pce s vstednkem, beze zmny zkladnho nastaven. Nechyb ani<strong> hlinkov plonk s excentrickm rychloupnnm, lupou a pravtkem</strong>. Pstroj je v<strong> dvourychlostnm proveden 460 a 980 m/min</strong>.</p>\\n<h', '_vyr_654_vyr_2989HBS-473.jpg', 0, '30990.00', '0.00', 'BW5900473', '_vyrn_654_vyr_2989HBS-473.jpg', '', '', '', 21, 1, 1, 3, '', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
(8211, 655, 'HOLZSTAR HBS471 PSOV PILA', 'DOPRAVA ZDARMA PSOV PILA HOLZSTAR HBS 471', '<h1 id=\\\"h1-fig\\\">Psov pila HOLZSTAR HBS 471</h1>\\n<p><strong>Kompaktn psov pila na devo</strong> od kvalitnho vrobce <strong>HOLZSTAR</strong> je vhodn pro <strong>nron hobby</strong> pouit a domc dlnu s uzavenm podstavcem. Tuh svaovan konstrukce, kter je i pes malou lonou plochu velmi <strong>stabiln.</strong> Pilov ps m pesn tkladkov veden nahoe i dole pro psy, kter maj ku 6-25 mm. Pilov ps se tak pomoc rychloupnac pky s vstednkem snadn a rychle vmn a to beze zmny zkladnho nastaven. Pila zaruuje<strong> pesn ezn deva, plastu a dokonce i neeleznch kov</strong>. Soust pstroje je <strong>masivn a kvalitn stl vyroben z ed litiny</strong> s pesn brouenm povrchem, kter je pipevnn na kyvnm uloen. Sklon stolu si mete nastavit v rozsahu<strong> 0 a 45</strong>. Nechyb ani snadno nastaviteln hlinkov plonk s excentrickm rychloupnnm, pravtkem a lupou. Tento spolehliv stroj m dvourychlo', '_vyr_655_vyr_2990HBS-471.jpg', 0, '34990.00', '0.00', 'BW5900471', '_vyrn_655_vyr_2990HBS-471.jpg', '_vyrp11_2990HBS-471.jpg', '', '', 21, 1, 1, 3, '', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
