(8220, 664, 'HOLZMANN SSAT1000 ODSVAC BROUSC STL', 'ODSVAC BROUSC STL HOLZMANN SSAT1000', '<h1 id=\\\"h1-fig\\\">Odsvac brousc stl HOLZMANN SSAT1000</h1>\\n<p><strong>Odsvac stl HOLZMANN SSAT1000</strong> umouje <strong>bezpran brouen</strong>, take u nen potebn dn dal extrakn systm. Je <strong>vhodn pro devn sti</strong> vech rznch druh. Prodyn bon panely umouj tak brouen delch obrobk. Dky pogumovanm podprm stolu nehroz pokrbn obrobk. Dky velkmu povrchu filtru m stl <strong>vysok sac vkon</strong>.</p>\\n<p>Stroj obsahuje <strong>vestavn ventiltor</strong> a <strong>zasouvac sbra prachu</strong> na pedn stran pro snadnou likvidaci brusnho prachu. Filtrovan odpadn vzduch je na pracoviti recikulovn recikulac a zaruuje ist vzduch pi prci.</p>\\n<p>Podobn pstroje naleznete v sekci<a href=\\\"/Velke-stacionarni-stroje-c3_62_2.htm\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Velk stacionrn stroje.</a></p>\\n<p></p>', '_vyr_664_vyr_5257SSAT1000.jpg', 0, '18757.80', '0.00', 'HMSSAT1000', '_vyrn_664_vyr_5257SSAT1000.jpg', '', '', '', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
