(8227, 672, 'HOLZMANN ABS5000SE 400V ODSAVA PILIN', 'ODSAVA PILIN HOLZMANN ABS 5000SE - 400V', '<h1 in=\\\"h1-fig\\\">Odsava pilin HOLZMANN ABS 5000SE - 400V</h1>\\n<p>Odsava <strong>HOLZMANN ABS 5000SE</strong> je vkonn a univerzln zazen, kter se vyuv k <strong>odsvn prachu a devnch pilin</strong> pi prci s vtinou devoobrbcch stroj. Nedochz u nj ke zbytenmu odvtrvn tepla a dky dvou velkm vakm doke pojmout<strong> odpad o objemu a 260 litr</strong>. Odsava pohn<strong> svaen kovov rotor s 2950 otkami za minutu</strong>. <strong>Odsvac kapacita</strong> u tohoto pstroje je <strong>5000 m&#179;/h</strong>a vytv <strong>podtlak o velikosti 2500 Pa</strong>. Tak je zde <strong>motor s vkonem 2,2 kW</strong>. <strong>Napjec napt je 400 V</strong>.Solidn plechov konstrukce zajiuje optimln proudn vzduchu a ke snadn manipulaci slou<strong> integrovan podvozek</strong>. Stroj m<strong>vsok konstantn sac vkon</strong> (i pro trval provoz) a disponuje<strong> velkou plochou filtru</strong>. Tak je dky<strong>', '_vyr_672_vyr_4107ABS5000SE.jpg', 0, '11838.90', '0.00', '2HLMABS5000SE400V', '_vyrn_672_vyr_4107ABS5000SE.jpg', '_vyrp11_672_vyrp11_4107IMG_5767.jpg', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8228, 674, 'HOLZSTAR SAA3001 (230 V) ODSVAC ZAZEN', 'ODSVAC ZAZEN HOLZSTAR SAA 3001 (230 V)', '<h1 id=\\\"h1-fig\\\">Odsvac zazen HOLZSTAR SAA 3001 (230 V)</h1>\\n<p>Odsvac zazen <strong>HOLZSTAR SAA 3001</strong> je spolehliv pstroj uren k <strong>odsvn prachu, tsek, hoblin</strong> a dalho devnho odpadu pi prci s devoobrbcmi stroji. <strong>Vy sac vkon o velikosti 3910 m&#179;/h</strong> zajiuj <strong>kovov lopatky ventiltoru</strong>. Prmr odsvacho ntrubku je 150 mm a prmr odsvac trubice u rozdlovae je 3  100 mm.<strong> Pkon</strong> tohoto pstroje je <strong>2200 W</strong>. Cel stabiln <strong>konstrukce</strong> je vyrobena <strong>z masivnho ocelovho plechu</strong> (nejsou pouity <strong>dn plasty</strong>). Zazen je <strong>tich</strong>, v 59 kilogram a m vynikajc pomr <strong>cena/vkon</strong>.</p>\\n<p>Mete tak navtvit strnky<a href=\\\"/admin/itatools.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a>a<a href=\\\"/admin/aparatea.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a>', '_vyr_674_vyr_3048saa3001.jpg', 0, '10990.00', '0.00', 'BW5922301', '_vyrn_674_vyr_3048saa3001.jpg', '', '', '', 21, 1, 1, 0, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8229, 675, 'HOLZSTAR SAA3003 (400 V) ODSVAC ZAZEN', 'ODSVAC ZAZEN HOLZSTAR SAA 3003 (400 V)', '<h1 id=\\\"h1-fig\\\">Odsvac zazen HOLZSTAR SAA 3003 (400 V)</h1>\\n<p><strong>Odsvac zazen HOLZSTAR SAA 3003</strong> je zazen urn pro odsvn prachu, tsek a hoblin pi devoobrbcch pracch. Vborn se hod do va dlny, kter dky nmu bude uklizen a st.<strong>Kovov lopatky ventiltoru</strong> zaruuj <strong>vysok sac vkon o velikosti 3910 m&#179;/h</strong>. Zazen je oproti jinm<strong>tich</strong> a na vrobu jeho stabiln konstrukce byl pouit jen <strong>ocelov plech</strong>,<strong> </strong>kter je znmkou kvality (neobsahuje dn plasty). Pstroj m<strong>pkon 2200 W</strong>, prmr odsvac trubice trubice u rozdlovae je 3  100 mm a prmr odsvacho ntrubku je 150 mm.<strong> Elektrick pipojen</strong> je <strong>400 V </strong>acel zazen je s hmotnost 59 kilogram mobiln a lehce se s nm manipuluje. Tento vrobek je mezi nelepmi v pomru <strong>cena/vkon</strong>.</p>\\n<h2 id=\\\"h2-fig\\\">Doporuen psluenstv', '_vyr_6755238_3049__vyr_3048saa3001.jpg', 0, '10990.00', '0.00', 'BW5922303', '_vyrn_6755238_3049__vyr_3048saa3001.jpg', '', '', '', 21, 1, 1, 0, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8230, 676, 'HOLZMANN FAN2200 VENTILTOR', 'VENTILTOR HOLZMANN FAN 2200', '<h1 in=\\\"h1-fig\\\">Ventiltor HOLZMANN FAN 2200</h1>\\n<p><strong>Ventiltor HOLZMANN FAN 2200</strong> se slunm <strong>vkonem 4000 m&#179;</strong><span><strong>/h</strong> a <strong>vkonem motoru 2,2 kW</strong> je ten prav pstroj do va dlny. S <strong>naptm 400 V</strong> a hmotnost <strong>36 kilogram</strong>se ad mezi kvalitn produkty.</span></p>\\n<p>Mete tak navtvit webov strnky<a href=\\\"/admin/aparatea.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a>a<a href=\\\"/admin/itatools.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a></p>', '_vyr_676_vyr_4392FAN2200-4000.jpg', 0, '8874.90', '0.00', '1HMFAN2200', '_vyrn_676_vyr_4392FAN2200-4000.jpg', '_vyrp11_676_vyrp11_4392FAN2200-4000a.jpg', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8231, 677, 'HOLZMANN ABS1500FF 400V ODSAVA PRO KLID', 'ODSAVA PRO KLID HOLZMANN ABS 1500FF 400V', '<h1 id=\\\"h1-fig\\\">Odsava pro klid HOLZMANN ABS 1500 FF 400 V</h1>\\n<p><strong>Odsava HOLZMANN ABS 1500 FF 400 V</strong> je vestrann pstroj, kter slou k <strong>odsvn devnho materilu</strong> od vtiny devoobrbcch stroj a k klidu dlny. Zazen zbyten <strong>neodvtrv teplo</strong>. Odsava je opaten <strong>specilnm kazetovm filtrem</strong>. Velk <strong>filtran plocha 2,2 m&#178;</strong>tohoto filtru umouje vysok prchod odsvanho tepla. <strong>Odsvac kapacita</strong> je <strong>1500 m&#179;/h</strong>.<strong> Kolo ventiltoru</strong> je vyrobeno z velmi <strong>odoln oceli</strong>. Pstroj m<strong> pevnou konstrukci z ocelovch plech</strong>, kter v porovnn s plastovm krytem <strong>udruje statick nboje na minimu</strong>. Zazen zaruuje<strong> konstantn odsvac slu</strong> i bhem del innosti. Vznik <strong>podtlak</strong> o velikosti <strong>1020 Pa</strong>. Dky podstavci s koleky je odsava <strong>po', '_vyr_677_vyr_3398ABS1500FF.jpg', 0, '7886.00', '0.00', 'HMABS1500FF', '_vyrn_677_vyr_3398ABS1500FF.jpg', '_vyrp11_677_vyrp12_3398ABS1500FF_2.jpg', '_vyrp12_677_vyrp13_3398ABS1500FF_3.jpg', '_vyrp13_3398ABS1500FF_3.jpg', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8232, 678, 'HOLZMANN ABS3000SE 400V ODSAVA PILIN', 'ODSAVA PILIN HOLZMANN ABS 3000SE - 400V', '<h1 id=\\\"h1-fig\\\">Odsava pilin HOLZMANN ABS 3000SE- 400V</h1>\\n<p></p>\\n<p><strong>Odsava prachu a pilin HOLZMANN ABS 3000SE</strong> je ideln pstroj k odsvn devnch a jinch druh pilin od stroj obrbjcch devo s<strong> odsvac kapacitou 3000 m&#179;/h</strong>, <strong>podtlakem 1800 Pa</strong> a <strong>napjecm naptm 400 V</strong>. Velkou vhodou je, e odsava pi sv prci zbyten <strong>neodvtrv nahromadn teplo</strong>.</p>\\n<p>Stroj se skld z kvalitnho svaenho kovovho rotoru, filtranho vaku, <strong>velkch odpadnch vak</strong> o<strong> objemu 165 litr</strong> a <strong>rychloupnae</strong>, kter slou ke snadn vmn a manipulaci vak. V podstavci jsou tak vhodn zabudovan koleka pro snadnj pohyb s odsavaem. Zaruujeme <strong>konstantn sac vkon</strong> a vborn <strong>pomr ceny a vkonu</strong>.</p>\\n<p>Podobn stroje mete najt v sekci<a href=\\\"/Stroje-a-elektonaradi-c3-0-1-htm\\\" target=\\\"_blank\\\" rel=\\\"noop', '_vyr_6785238_4391__vyr_4104ABS3000SE.jpg', 0, '8874.90', '0.00', '2HLMABS3000SE400V', '_vyrn_6785238_4391__vyr_4104ABS3000SE.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8233, 679, 'HOLZMANN ABS3000SE 230V ODSAVA PILIN', 'ODSAVA PILIN HOLZMANN ABS 3000SE - 230V', '<h1 id=\\\"h1-fig\\\">Odsva pilin Holzmann ABS 3000SE - 230V</h1>\\n<p><strong>Odsava prachu</strong> a pilin <strong>HOLZMAN ABS</strong> <strong>3000SE</strong> je univerzln zazen uren k odsvn devnho odpadu od vtiny devoobrbcch stroj <strong>bez zbytenho odvtrvn tepla. </strong>Odsva je vybaven svaenm kovovm rotorem a m v podstavci zabudovan koleka, kter slou k lep manipulaci.</p>\\n<p>Pstroj m <strong>velk vkon</strong> pi malch nrocch na prostor a m tak <strong>velk odpadn vaky</strong> pro lep prci s rychloupnaem pro leh zachzen. Garantujeme <strong>konstatn sac vkon</strong> s vbornm pomrem <strong>cena/vkon</strong>.</p>\\n<p>Mete tak navtvit nae webov strnky <a href=\\\"https://www.aparatea.cz/#page\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a> a <a href=\\\"https://www.itatools.cz/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a>.</p>\\n<h2 id=\\\"h2-fig\\\">Vbava:</h2>\\n<ul>\\n<li>Kovov rotor</li>\\n<l', '_vyr_6795238_4391__vyr_4104ABS3000SE.jpg', 0, '8874.90', '0.00', '2HLMABS3000SE230V', '_vyrn_6795238_4391__vyr_4104ABS3000SE.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
