(8269, 728, 'HOLZMANN TS250F1600 230V KOTOUOV STOLN PILA', 'STOLN PILA HOLZMANN TS 250F - 1600 230 V', '<h1 id=\\\"h1-fig\\\">Stoln pila HOLZMANN TS 250F1600 230 V</h1>\\n<p><strong>Stoln pila TS 250F1600 230 V</strong> od pikovho vrobce HOLZMANN se pyn <strong>nejlepm pomrem cena/vkon</strong> v kategorii kotouovch pil. Je vhodn do kad dlny a jejm vbrem neudlte chybu. Jej <strong>litinov stl</strong> je velmi <strong>robustn a stabiln</strong>, samozejm nechyb ani jeho vhodn prodlouen. Namontovan <strong>kovov pilov kotou s prmrem 250 mm</strong> je zrukou pikovho ezn. Na jeho krytu je zabudovan tak odsvac vstup pro bezpranou prci.<strong> Formtovac stl o dlce 1600 mm</strong> m <strong>podprn rm se zabudovanm vlekem</strong> pro kvalitnj prci. Je zde i <strong>teleskopick pravtko</strong>. Tak si velmi snadno a pesn nastavte poadovanou vku ezu pilovho kotoue a hel ezu pomoc <strong>runho koleka</strong>. Soust je tak <strong>paraleln pravtko</strong>. Prach se odsv jak z hornho krytu kotoue, ta', '_vyr_728_vyr_4245h0425e.jpg', 0, '37534.50', '0.00', '2HLMTS250F1600', '_vyrn_728_vyr_4245h0425e.jpg', '_vyrp11_728_vyrp11_4245373000-big_36m192m.jpg', '_vyrp12_728_vyrp14_4245373004-big_332c365f.jpg', '_vyrp13_728_vyrp16_4245372998-big_833y888f.jpg', 21, 1, 1, 1, '9,12E+12', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:07'),
