(8273, 735, 'HOLZMANN BBM35MAN PNEUMATICK VRTAKA POUZDER DVENCH ZMK', 'PNEUMATICK VRTAKA POUZDER DVENCH ZMK HOLZMANN BBM35MAN', '<h2 style=\\\"text-align: center;\\\">PNEUMATICK VRTAKA POUZDER DVENCH ZMK HOLZMANN BBM35MAN</h2>\\n<p style=\\\"text-align: center;\\\"><strong>SPECILN PODZIMN AKCE OD 15.10. DO 15.12.2018 NEBO DO VYPRODN ZSOB</strong></p>\\n<p></p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: medium;\\\"><em>Ilustran obrzek</em><br /></span></p>\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\"><strong>Popis stroje:</strong></span></p>\\n<ul>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">n vrtac stroj m pneumatick podvn</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">vrtac vzor Blum, pestavba na Hettich Vrtac vzor s volitelnou hlavou Hettich je mon</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">ideln pro ambicizn hobby emeslnky a mal podniky</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">Prmr ezacho zvsu 35 mm</span><', '_vyr_735_vyr_5256BBM35MAN.jpg', 0, '10850.90', '0.00', 'HLM-BBM35MAN', '_vyrn_735_vyr_5256BBM35MAN.jpg', '_vyrp11_735_vyrp12_5256BBM35_bohrbild.jpg', '', '', 21, 1, 1, 1, '9,12E+12', 0, '3-61-0-0|3-61-413-0', NULL, '2021-01-10 15:44:07'),
(8274, 736, 'HOLZMANN ABS1500FF 230V ODSAVA PRO KLID', 'ODSAVA PRO KLID HOLZMANN ABS 1500FF 230 V', '<h1 id=\\\"h1-fig\\\">Odsava pro klid HOLZMANN ABS 1500FF 230 V</h1>\\n<p><strong>Odsava HOLZMANN ABS1500FF</strong> je univerzln <strong>zazen pro klid a odsvn pebytenho devnho odpadu</strong> (piliny, hobliny) po devozpracujc prci s vtinou stroj bez zbytenho odvtrvn tepla. Pstroj m <strong>speciln kazetov filtr</strong>, jeho 2,2 m&#178; velk plocha umonuje prchod velkho mnostv odsvanho vzduchu, a odoln <strong>kolo ventiltoru vyroben z oceli</strong>. Odsava m i bhem del innost konstantn odsvac slu. <strong>Odsvac kapacita je 1500 m&#179;/h</strong> a <strong>podtlak in 1020 Pa</strong>. Masivn <strong>konstrukce je vyrobena z ocelovch plech</strong>, kter udruj statick nboje na minimu (oproti plastovmu krytu). Dky rychloupnai je mon rychl vmna odpadnho vaku a podstavec s koleky zaruuje <strong>vysokou pohyblivost</strong>.</p>\\n<h2 id=\\\"h2-fig\\\">Standardn vbava:</h2>\\n<ul>\\n<li>Kovov rotor</li>\\n<li>Ry', '_vyr_7365238_3517__vyr_3398ABS1500FF.jpg', 0, '7886.00', '0.00', 'HMABS1500FF230', '_vyrn_7365238_3517__vyr_3398ABS1500FF.jpg', '_vyrp11_7365238_3517__vyrp12_3398ABS1500FF_2.jpg', '_vyrp12_7365238_3517__vyrp13_3398ABS1500FF_3.jpg', '', 21, 1, 1, 1, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:07'),
(8275, 739, 'CMT Industrial Pilov kotou na elezo - D136x1,5 d10 Z30 HM', 'CMT Industrial Pilov kotou na elezo - D136x1,5 d10 Z30 HM', '<p>Perfektn SUCH ezn na vech typech pil na kovy i na devo. Excelentn kvalita ezu. Speciln typ zub spolu s vbrovou kvalitou tvrdokovovch bit zaruuje dlouhou ivotnost.<br /><br />Ideln pro typy materilu:<br /> mkk a tvrd ocel, litina, profilovan litina, ocelov trubky a plechy<br /> profily pro hlinkov dvee a okna, sendviov panely s PVC povrchem<br /> sendvie s ocelovm povrchem, garov vrata, fasdn panely<br /> kovn nbytkov, atn tye, kovn na posuvn dvee a pod.<br /><br /><strong>Doporuen otky pro kotoue ady C226 </strong></p>\\n<p>Otky uveden na kotoui (MAX. RPM) jsou maximln konstrukn otky kotoue na volnobh, nejedn se o otky vhodn pro ezn.<br /><span style=\\\"color: #ff0000;\\\">Doporuen ezn otky naleznete ne v tabulce, tyto otky nepekraujte.</span><br />Vy ezn otky mohou zpsobit rychl otupen HM pilovch zub.</p>\\n<table border=\\\"1\\\" cellspacing=\\\"2\\\" cellpadding=\\\"2\\\">\\n<tbody>\\n<tr>\\n<td', '_vyr_739C22603005.jpeg', 0, '785.00', '872.00', 'C22603005', '_vyrn_739C22603005.jpeg', '_vyrp11_739C22603005-1.jpeg', '_vyrp12_739C22603005-2.jpeg', '', 21, 1, 1, 1, '6,64E+11', 0, '2-2-0-0|2-2-434-0', NULL, '2021-01-10 15:44:07'),
(8276, 740, 'CMT XTreme Pilov kotou na nerez ocel - D160x1,8 d20 Z40 HM', 'CMT XTreme Pilov kotou na nerez ocel - D160x1,8 d20 Z40 HM', '<p>Perfektn SUCH ezn na vech typech pil na kovy i na devo. Excelentn kvalita ezu. Speciln typ zub spolu s vbrovou kvalitou tvrdokovovch bit zaruuje dlouhou ivotnost.<br /><br />Ideln pro typy materilu:<br /> mkk a tvrd ocel, litina, profilovan litina, ocelov trubky a plechy<br /> profily pro hlinkov dvee a okna, sendviov panely s PVC povrchem<br /> sendvie s ocelovm povrchem, garov vrata, fasdn panely<br /> kovn nbytkov, atn tye, kovn na posuvn dvee a pod.<br /> nerezov ocel se zvenou odolnost proti opoteben<br /></p>\\n<h4>Pilov kotoue na nerezovou ocel se zvenou odolnost proti opoteben.</h4>\\n<p><br /><strong>Doporuen otky pro kotoue ady C226 </strong><br />Otky uveden na kotoui (MAX. RPM) jsou maximln konstrukn otky kotoue na volnobh, nejedn se o otky vhodn pro ezn.<br /><span style=\\\"color: #ff0000;\\\">Doporuen ezn otky naleznete ne v tabulce, tyto otky nepekraujte.</span><br ', '_vyr_740C22654006H.jpeg', 0, '1052.00', '1169.00', 'C22654006H', '_vyrn_740C22654006H.jpeg', '_vyrp11_740C22654006H-1.jpeg', '_vyrp12_740C22654006H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-434-0', NULL, '2021-01-10 15:44:07'),
(8277, 741, 'CMT Pilov kotou na cementotskov desky - D160x2,2 d20 Z4 Diamantov', 'CMT Pilov kotou na cementotskov desky - D160x2,2 d20 Z4 Diamantov', '<p>Pilov kotou s knickm nebo rovnm diamantovm zubem pro dlen extra tvrdch materil jako jsou: DuPont Corian, cementotskov a cementovlknit desky (Cetris, Eternit, Swisspearl, Fermacell, Ivarplank, Hardieplank), MDF, DTD, termoplasty a sdrokarton, vhodn pro pokosov, zkracovac, run elektrick nebo akumultorov pily. Vysok ivotnost diamantovch zub.</p>', '_vyr_741C23616004H.jpeg', 0, '1058.00', '1176.00', 'C23616004H', '_vyrn_741C23616004H.jpeg', '_vyrp11_741C23616004H-1.jpeg', '_vyrp12_741C23616004H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-23-0', NULL, '2021-01-10 15:44:07'),
(8278, 742, 'CMT ITK Ultra tenk kotou pro AKU pily - D136x1,5 d20(+10) Z18 HM podln ez', 'CMT ITK Ultra tenk kotou pro AKU pily - D136x1,5 d20(+10) Z18 HM podln ez', '<p>CMT Ultra tenk kotoue ITK Vm poskytnou vhody kvalitnho nstroje, vysokou produktivitu a dobrou uitnou hodnotu. Jsou vyrobeny nejmodernjmi vrobnmi procesy, kter zaruuj vyvenost kotoue, pesnost naosten a dlouhou ivotnost ost.<br /><br />Doporuujeme CMT Stabiliztory pilovch kotou pro prmry od 200 mm a ve.<br /><br />Pilov kotoue pro podln ezy deva.<br /><br />POUIT: pro podln ezy, kde je kladen draz na co nejmen proez. MATERIL: mkk a tvrd devo, peklika.</p>', '_vyr_742C27113618H.jpeg', 0, '276.00', '307.00', 'C27113618H', '_vyrn_742C27113618H.jpeg', '_vyrp11_742C27113618H-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8279, 745, 'CMT XTreme Pilov kotou na lamino a DTD - D220x3,2 d30 Z63 HM', 'CMT XTreme Pilov kotou na lamino a DTD - D220x3,2 d30 Z63 HM', '<p>Nov standardn kotou strapzovmi negativ zuby pro extra jemn a ist ez oboustrann povrchov upravench materil, jako lamina nebo dhy, na kotouovch nebo vertiklnch pilch (nap. Striebig, Holzher) bez pedezu. Vysok ivotnost tvrdokovovch zub. Pro lamino, DTD, MDF, pekliku.</p>', '_vyr_745C28106309M.jpeg', 0, '1257.00', '1397.00', 'C28106309M', '_vyrn_745C28106309M.jpeg', '_vyrp11_745C28106309M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
(8280, 746, 'CMT Industrial Pilov kotou na lamino a DTD - D160x2,2 d20 Z40 HM', 'CMT Industrial Pilov kotou na lamino a DTD - D160x2,2 d20 Z40 HM', '<p>Osvden kotou strapzovm zubem a expanznmi drkami. Uren pro vysoce kvalitn ezy do lamina a devotsky. Vysok ivotnost tvrdokovovch zub. Pro pily s pedezem.</p>', '_vyr_746C28116040H2.jpeg', 0, '596.00', '662.00', 'C28116040H2', '_vyrn_746C28116040H2.jpeg', '_vyrp11_746C28116040H2-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8281, 747, 'CMT CHROME Pilov kotou na lamino, DTD a MDF - D250x3,2 d30 Z80 HM', 'CMT CHROME Pilov kotou na lamino, DTD a MDF - D250x3,2 d30 Z80 HM', '<p>Nov pilov kotou s chromovanm povrchem, kter redukuje ulpvn zbytk lepidla a pryskyice na tle kotoue. M nov tlumc drky vyplnn oranovm polyuretanem pro snen vibrac a hlunosti. Trapzov zuby z extra tvrdho tvrdokovu pro ezn lamina, devotskovch desek a MDF. Vysok ivotnost. Pro pily s pedezem.</p>', '_vyr_747C28168010M.jpeg', 0, '1251.00', '1390.00', 'C28168010M', '_vyrn_747C28168010M.jpeg', '_vyrp11_747C28168010M-1.jpeg', '_vyrp12_747C28168010M-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
(8282, 748, 'CMT Pilov kotou pro velkoplon pily - D300x4,4 d30 Z60 16 HM', 'CMT Pilov kotou pro velkoplon pily - D300x4,4 d30 Z60 16 HM', '<p>Pro formtovn jednotlivch desek nebo desek ve stohu na horizontlnch velkoplonch pilch. Pro materil oboustrann laminovan devotsky nebo MDF desky.<br /><br /><strong>Pklady unaecch dr: </strong><br />p / d1 / t mm<br />p = poet unaecch otvor<br />d1 = prmr unaecch otvor<br />t = rozte unaecch otvor<br /><br />Pilov kotooue maj proveden unaecch otvor sdruen do skupin COMBI3, COMBI5 a COMBI7.<br /><br /><strong>COMBI3</strong><br />2/7/42 mm<br />2/9/46,4 mm<br />2/10/60 mm<br /><br /><strong>COMBI5</strong><br />2/7/110 mm<br />2/8,4/130 mm<br />2/14/110 mm<br />4/9/100 mm<br />4/19/120 mm<br /><br /><strong>COMBI7</strong><br />2/10/80 mm<br />1/11/85 mm<br />2/11/115 mm<br />2/11/148 mm<br />2/14/100 mm<br />2/14/125 mm<br />2/19/120 mm</p>', '_vyr_748C28206012M.jpeg', 0, '2031.00', '2257.00', 'C28206012M', '_vyrn_748C28206012M.jpeg', '_vyrp11_748C28206012M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0', NULL, '2021-01-10 15:44:07'),
(8283, 749, '283 Pilov kotou na lamino bez pedezu - D220x3,2 d30 Z64 HM', '283 Pilov kotou na lamino bez pedezu - D220x3,2 d30 Z64 HM', '<p>Speciln konstrukce sextra ikmmi zuby pro doclen jemnjho ezu oboustrann povrchov upravench materil, jako lamina nebo dhy, na kotouovch pilch nebo velkch zkracovacch pilch. Perfektn povrch spodn hrany pi pouit tohoto kotoue. Vysok ivotnost tvrdokovovch zub. Vhodn pro vertikln pily. Pro lamino, DTD, MDF, pekliku a pn ezy deva.</p>', '_vyr_749C28306409M.jpeg', 0, '1280.00', '1422.00', '283.064.09M', '_vyrn_749C28306409M.jpeg', '_vyrp11_749C28306409M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:07'),
