(8285, 757, 'CMT Industrial C287 Pilov kotou na lamino bez pedezu - D160x2,6 d20 Z34 HM', 'CMT Industrial C287 Pilov kotou na lamino bez pedezu - D160x2,6 d20 Z34 HM', '<p>Nov standardn kotou svydutmi zuby pro jemn a ist ez oboustrann povrchov upravench materil, jako lamina nebo dhy, na kotouovch nebo vertiklnch pilch (nap. Striebig, Holzher) bez pedezu. Pro lamino, DTD, MDF, pekliku a pn ezy deva.</p>', '_vyr_757C28703406H.jpeg', 0, '851.00', '946.00', 'C28703406H', '_vyrn_757C28703406H.jpeg', '_vyrp11_757C28703406H-1.jpeg', '_vyrp12_757C28703406H-2.jpeg', '_vyrp13_757C28703406H-3.jpeg', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:07'),
(8286, 759, 'CMT Pilov kotou pro elektronad, podln ez - D150x20 Z12 HM', 'CMT Pilov kotou pro elektronad, podln ez - D150x20 Z12 HM', '<p>CMT pilov kotoue pro elektronad jsou vysoce kvalitn nstroje pro kad typ run elektrick nebo bateriov pily, zkracovacch pil a dalch nad do prmru pilovho kotoue 235 mm. Jsou vyrobeny nejmodernjmi vrobnmi procesy, kter zaruuj vyvenost kotoue, pesnost naosten a dlouhou ivotnost ost. Jsou vyrbny z kvalitnch celosvtov ovench materil a prbn kontrolovny ve vrobnm procesu.</p>', '_vyr_759C29015012H.jpeg', 0, '286.00', '318.00', 'C29015012H', '_vyrn_759C29015012H.jpeg', '_vyrp11_759C29015012H-1.jpeg', '_vyrp12_759C29015012H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
