(8288, 763, 'CMT Pilov kotou pro elektronad, finln ez - D120x1,8 d20 Z36 HM Industrial', 'CMT Pilov kotou pro elektronad, finln ez - D120x1,8 d20 Z36 HM Industrial', '<p>CMT pilov kotoue pro elektronad jsou vysoce kvalitn nstroje pro kad typ run elektrick nebo bateriov pily, zkracovacch pil a dalch nad do prmru pilovho kotoue 235 mm. Jsou vyrobeny nejmodernjmi vrobnmi procesy, kter zaruuj vyvenost kotoue, pesnost naosten a dlouhou ivotnost ost. Jsou vyrbny z kvalitnch celosvtov ovench materil a prbn kontrolovny ve vrobnm procesu.</p>', '_vyr_763C29212036H.jpeg', 0, '702.00', '780.00', 'C29212036H', '_vyrn_763C29212036H.jpeg', '_vyrp11_763C29212036H-1.jpeg', '_vyrp12_763C29212036H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8289, 768, 'CMT Super XTreme Pilov kotou na lamino a DTD - D250x3,2 d30 Z78 HM', 'CMT Super XTreme Pilov kotou na lamino a DTD - D250x3,2 d30 Z78 HM', '<p>Maximln vkon pi ezn lamina bez pedezu. Speciln geometriem zub. Tvrdost pltk KCR05, pevnost 2500 N/mm<sup>2</sup> a bon hzivost do 0,05 mm. Pro lamino, DTD, MDF, pekliku.</p>', '_vyr_768C29507810M.jpeg', 0, '1643.00', '1826.00', 'C29507810M', '_vyrn_768C29507810M.jpeg', '_vyrp11_768C29507810M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
