(8291, 778, 'CMT Contractor Pilov kotou na devo - D160x2,2 d20 Z24 HM', 'CMT Contractor Pilov kotou na devo - D160x2,2 d20 Z24 HM', '<p>Kotoue s tvrdokovovmi zuby Contractor jsou ureny pro bn ezn stavebnch materilu jako je mkk devo, OSB, peklika bez vtch nrok na kvalitu ezu.</p>\\n<p>Jedn se o ekonomick kotou s vynikajcm pomrem vkonu a ceny. Vhodn obchodn balen Masterpack po 10 ks, prmr 250 po 5ks pro obchody nebo vt vroby jako jsou paletrny, stavebn nebo tesask podniky. Po jednom kuse jsou kotoue dodvny nebalen, pouze s plastovou ochranou zub a ttkem s rovm kodem. Jsou ureny pro run okrun pily, kotouov nebo pokosov pily. Skvl cena, kter odpovd kvalit produktu.</p>\\n<p></p>\\n<p><span style=\\\"font-size: 18px;\\\"><span style=\\\"color: #ff0000;\\\"><strong>Ideln na stavby nebo hobby pouit.</strong></span></span></p>', '_vyr_778C-K16024H-X10.jpeg', 0, '179.00', '199.00', 'C-K16024H-X10', '_vyrn_778C-K16024H-X10.jpeg', '_vyrp11_778C-K16024H-X10-1.jpeg', '_vyrp12_778C-K16024H-X10-2.jpeg', '', 21, 1, 5, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8292, 779, 'JET 10-20 Plus Vlcov bruska', 'JET 10-20 Plus Vlcov bruska', '<p><strong> Monost dokoupit kartovac vlec.<br /> Plynul regulace posuvu.<br /> Staviteln stupnice pro odeet vky.<br /> Pesn veden agregtu.<br /> Vnitn ebrovn vlce pro lep odvod tepla.<br /> Snadn vmna brusnho psu.<br /> Masivn zavsen vlce.</strong><br /><br />Stoln vlcov bruska JET 10-20 spojuje vkon, praktinost a nroky na minimln prostor. Vkonn motor 1300 W, regulovateln posuv a pesn veden agregtu nabzej brouen desek tlouky 3 a 75 mm. ka dlce je max. 255 mm na jeden prchod nebo 505 mm na dva prchody strojem. Elektronick regulece posuvu plynule mn posuv pro dosaen dokonalho povrchu. Vnitn ebrovn duralovho brusnho vlce zajiuje odvod tepla a dky tomu nedochz k splen povrchu brouenho materilu.<br /><br />Pokud jste kutil nebo emeslnk, ocente kvalitu a pesnost s jakou je stroj vyroben a zrove monosti, kter Vm nabdne.<br /><br /><em> Typ: 10-20 Plus<br /> Doporuen pouit: emeslnk<br />', '_vyr_779jet-10-20.jpeg', 0, '21200.00', '22410.00', '121-1020M', '_vyrn_779jet-10-20.jpeg', '_vyrp11_779jet-10-20-2.jpeg', '_vyrp12_779jet-10-20-3.jpeg', '_vyrp13_779jet-10-20-4.jpeg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8293, 780, 'IGM PD80 Ohraovac-oezvac frzka na ABS hranu', 'PD80 Ohraovac-oezvac frzka na ABS hranu', '<p><strong></strong><br /><br />PD80 oezvac a ohraovac frzka je urena pro precizn zaoblen nebo zkosen nbytkovch hran z PVC, ABS nebo dhy a vech hran devnch nebo plastovch dl i desek.<br /><br />Jedinen konstrukce frzky dv vynikajc stabilitu dky vodc zkladn s madlem . Motor m 30000 ot./min a poskytuje dostatenou slu i pro vt bry materilu. Je vybavena uniktnm prhlednm otonm krytem, kter kopruje povrch a dky ktermu vdy perfektn vidte na prci. Integrovan odsvac hubice umouje pipojit frzku k odsvn. Ve spodn sti krytu je umstno pibrovn koprovacho loiska. Tm se eliminuje pokrbn nebo otlaen dlce od roztoenho loiska. Pesn hloubka se jednodue nastavuje otenm zkladny, piem 1 otka je 2 mm a pesn nastaven lze odetat na stupnici s noniusem s rozlienm 0,05 mm. Ve stroji je vestavn cidlina pro sren ostrch hran. Soust balen je tvrdokovov zaoblovac radiusov frza R2mm, montn kle', '_vyr_780PD-80.png', 0, '4753.00', '4900.00', '142-PD80', '_vyrn_780PD-80.png', '', '', '', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:07'),
(8294, 857, 'JET AFS-1000B Filtr vzduchu', 'JET AFS-1000B Filtr vzduchu', '<p><strong> Vkonn motor.<br /> Vhodn pro mont na strop.<br /> Dlkov ovldn.<br /> Ti rychlosti motoru 12, 15, 20 m<sup>3</sup>/min.<br /> Ti nastaven asovn 2, 4 a 8 hodin.</strong><br /><br />Filtran jednotka s vkonnm motorem 200 W. Filtr vzduchu je uren pro vt vrobn dlny. Ideln umstn filtranho zazen je alespo 2 metry nad zem na ocelovch zvsech. Vzduch je nahnn pes elektrostatick pedfiltr do vnitnho skldanho filtru a zpt do dlny. innost filtrovn je 98  % vech stic o velikosti 5 mikron a 85  % vech stic o velikosti 1 mikron. Dlkov ovldn m ti nastaven otek motoru a ti rzn asov nastaven 2, 4 a 8 hodin.Vhodou filtranho zazen je spora energi za vytpn, jeliko pi fitrovn nedochz k ochlazovn venkovnm vzduchem. Voliteln psluenstv je uhlkov filtr.<br /><br /><strong>Tie ist a filtruje vzduch pi prci. innost 98  % u stic 5 mikron a 85  % u stic 1 mikron.</strong><br /><br /><', '_vyr_857AFS-1000.jpg', 0, '9250.00', '9737.00', '121-AFS-1000BM', '_vyrn_857AFS-1000.jpg', '_vyrp11_857AFS-1000-1.jpg', '_vyrp12_857AFS-1000-2.jpg', '', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8295, 941, 'JET 31A Kombinovan bruska', 'JET 31A Kombinovan bruska', '<p><strong>&nbsp;Pevn konstrukce z litiny a svaen oceli.<br />&nbsp;Ps lze polohovat a zajistit v&nbsp;libovolnm rozmez hlu od 0 do 90.<br />&nbsp;Indexace naklopen psu v pozici 0, 45 a 90.<br />&nbsp;Pesn brouen litinov stoly s drkami.<br />&nbsp;Stl brusnho kotoue lze naklonit v&nbsp;rozmez od -15do +45.<br />&nbsp;Litinov stoly zaruuj pesn brouen.<br />&nbsp;Jednoduch vmna brusnch ps.<br />&nbsp;300 mm vyven kotou zaruuje kvalitn brouen.<br />&nbsp;Vhodn pro upnut brusiva se suchm zipem.</strong><br /><br />Kombinovan bruska JET je urena pro profesionln pouit a pln konkuruje jinm vrobcm prmyslovch stroj. Kombinovan brusku je stabiln a pesn dky vysoce kvalitnm litinovm stolm a podstavci z lisovan oceli. Pesn brouen stolky lze jednodue nastavit tak, aby mezi brusivem a stolkem byla minimln mezera, a tm byla prce se strojem maximln bezpen. Stl brusnho kotoue je opaten T-drkou pro pesn', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C99001111/c990.5_freza-na-vyplne_1_web.jpg', 0, '31554.29', '33132.00', '121-31AM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C99001111/c990.5_freza-na-vyplne_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-31AM/121-31AM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-31AM/121-31AM_02_web.jpg', '', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8296, 942, 'JET 719A Dlabaka ostrohrann', 'JET 719A Dlabaka ostrohrann', '<p><strong>&bull; Snadn&eacute; spou&scaron;tn&iacute; a zved&aacute;n&iacute; vetene je zaji&scaron;tno masivn&iacute;m hebenem, ozuben&yacute;m kolem v kombinaci s rybinov&yacute;m veden&iacute;m a plynov&yacute;m p&iacute;stem.<br />&bull; Bon&iacute; hloubkov&yacute; doraz pro pesnou hloubku.<br />&bull; Rychloup&iacute;nac&iacute; svr&aacute;k pro rychl&eacute; upnut&iacute; a uvolnn&iacute; d&iacute;lce.<br />&bull; V&yacute;konn&yacute; motor.<br />&bull; Oton&yacute; agreg&aacute;t o 180 &deg;, umouje vrt&aacute;n&iacute; z&aacute;mk v ji hotov&yacute;ch dve&iacute;ch.<br />&bull; Pesn&eacute; rybinov&eacute; veden&iacute;, pracovn&iacute; deska z MDF, posuv stolu ve dvou os&aacute;ch, podstavec s &uacute;lon&yacute;m prostorem a d&eacute;lkov&yacute; doraz pro s&eacute;riovou v&yacute;robu.</strong><br /><br />Profesion&aacute;ln&iacute; ostrohrann&aacute; dlabaka JET 719A m&aacute; robusn&iacute; litinov&yacute; stl a podstavec s &uacute;lon&yacute;m prosto', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 0, '26623.81', '27955.00', '121-719A-M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_02_web.jpg', '', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8297, 943, 'JET DC-1100A Odsava pilin a prachu', 'JET DC-1100A Odsava pilin a prachu', '<p><strong> Technologie oddlovn stic s innost a 98  %.<br /> Rozboka v zkladn vbav.</strong><br /><br />Robustn a dobe vybaven odsvac zazen uren pro odsvn a dvou stroj. Motor a speciln konstruovan dmychadlo pro vysok vkon a tich chod bez vibrac. Odsava je opaten vysoce innm ventiltorem a uniktn technologi Vortex Cone, kter udruje vysok vkon a zabrauje pedasnmu zanen filtru. Rychl instalace. tyi koleka umouj celkovou pohyblivost. Dodv se s pti pytli na odpad a filtranm vakem na stice o velikosti nad 30 mikron. Tento filtr je navc vybaven ovldac klikou, kterou otte vnitnmi lopatkami a istte tak filt zevnit bez poteby demonte, tm snadno udrte vkon odsavae na maximum. Hadice nen soust dodvky.<br /><br /><strong>Vortex Cone  jedinen technologie pro vysok odsvac vkon</strong><br />Eliminuje zanesen filtru a nsledn zdravotn problmy pi runm itn. Odstrauje nhl pokles vkonu k', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 0, '10871.43', '11415.00', '121-DC-1100A', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_03a_web.jpg', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8298, 944, 'JET DC-1100CK Odsava pilin a prachu s mikrofiltranm nstavcem', 'JET DC-1100CK Odsava pilin a prachu s mikrofiltranm nstavcem', '<p><strong> Technologie oddlovn stic s innost a 98  %.<br /> Rozboka v zkladn vbav.</strong><br /><br />Robustn a dobe vybaven odsvac zazen uren pro odsvn a dvou stroj. Motor a speciln konstruovan dmychadlo pro vysok vkon a tich chod bez vibrac. Odsava je opaten vysoce innm ventiltorem a uniktn technologi Vortex Cone, kter udruje vysok vkon a zabrauje pedasnmu zanen filtru. Rychl instalace. tyi koleka umouj celkovou pohyblivost. Dodv se s pti pytli na odpad a s mikrofiltranm nstavcem na stice o velikosti nad 2 mikrony. Tento filtr je navc vybaven ovldac klikou, kterou otte vnitnmi lopatkami a istte tak filt zevnit bez poteby demonte, tm snadno udrte vkon odsavae na maximum. Hadice nen soust dodvky.<br /><br /><strong>Vortex Cone  jedinen technologie pro vysok odsvac vkon</strong><br />Eliminuje zanesen filtru a nsledn zdravotn problmy pi runm itn. Odstrauje nhl pokle', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 0, '166031.43', '174333.00', '121-DC-1100CKM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8299, 945, 'JET DC-1900A Odsava pilin a prachu dvoupytlov', 'JET DC-1900A Odsava pilin a prachu dvoupytlov', '<p><strong>&bull; V&yacute;kon&yacute; motor a efektivn&iacute; obn&eacute; kolo ventil&aacute;toru umouj&iacute; maxim&aacute;ln&iacute; proudn&iacute; vzduchu.<br />&bull; Unik&aacute;tn&iacute; technlogie &bdquo;Vortex Cone&ldquo; eliminuje zanesen&iacute; filtru.<br />&bull; Rychloup&iacute;n&aacute;n&iacute; odpadn&iacute;ho pytle umouje snadnou a rychlou v&yacute;mnu.<br />&bull; Monost volby ods&aacute;vac&iacute;ch vstup 3x 100 mm nebo 1x 200 mm.<br />&bull; tyi oton&aacute; koleka pro snadn&yacute; pohyb po d&iacute;ln.<br />&bull; Technologie oddlov&aacute;n&iacute; &aacute;stic s &uacute;innost&iacute; a 98  %.<br />&bull; Rozboka v z&aacute;kladn&iacute; v&yacute;bav.</strong><br /><br />Vysoce v&yacute;kon&yacute; odsava s monost&iacute; pipojen&iacute; v&iacute;ce stroj. S prtokem vzduchu 2900 m<sup>3</sup>/h, snadno zvl&aacute;dne a 3 stroje. Robustn&iacute; konstrukce, tich&yacute; chod a &uacute;inn&eacute; proveden&iacute; bude vyhovovat v', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 0, '22847.62', '23990.00', '121-DC-1900AT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8300, 946, 'JET DC-900A Odsava pilin a prachu', 'JET DC-900A Odsava pilin a prachu', '<p>Dobe vybaven&eacute; ods&aacute;vac&iacute; za&iacute;zen&iacute; uren&eacute; pro stroje s men&scaron;&iacute; produkc&iacute; odpadu. Motor a speci&aacute;ln konstruovan&eacute; dmychadlo pro vysok&yacute; v&yacute;kon a tich&yacute; chod bez vibrac&iacute;. Rychl&aacute; instalace. tyi koleka umouj&iacute; celkovou pohyblivost. Dod&aacute;v&aacute; se odpadn&iacute;m pytlem a filtran&iacute;m vakem na &aacute;stice o velikosti nad 30 mikron. Hadice je sou&aacute;st&iacute; dod&aacute;vky. Plechov&aacute; turb&iacute;na.<br /><br /><em>&bull; Typ: DC-900A<br />&bull; Doporuen&eacute; pouit&iacute;: Kutil<br />&bull; P&iacute;kon / V&yacute;kon (230 V): 750 / 550 W<br />&bull; Prtok vzduchu (hadice 100 mm): 900 m<sup>3</sup>/h<br />&bull; Objem odpadn&iacute;ho vaku: 55 l<br />&bull; Max. podtlak: 1050 Pa<br />&bull; Pipojovac&iacute; hrdlo: 100 mm<br />&bull; Velikost &aacute;stic: 30 mikron<br />&bull; D&eacute;lka x &scaron;&iacute;ka x v&yacute;&scaron;ka: ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 0, '5254.29', '5517.00', '121-DC-900AM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8301, 947, 'JET DDS-225 Dvouvlcov bruska 635mm', 'JET DDS-225 Dvouvlcov bruska 635mm', '<p><strong> Robustn konstrukce stroje vhodn pro nepetrit provoz.<br /> Pesn nastavovac systm druhho vlce, umouje nastavit rozdl oproti prvnmu vlci.<br /> Rychl vmna brusnho psu pomoc chytrch klips.<br /> Brusn ps ky 75 nebo 100 mm.<br /> Pogumovan ptlan vlce zajiuj perfektn vsledky brouen.<br /> Zdvih stolu na tyech zvitovch tych.<br /> Pogumovan ps a dv rychlosti posuvu.<br /> br na jeden prchod a 1,5 mm.<br /> Umonuje finln pravu povrchu na jeden prchod.<br /> Pesnost roviny brouen do 0,2 mm v cel ce.</strong><br /><br />Dvouvlcov bruska JET ady DDS je urena pro finln povrchovou pravu nbytkovch dlc, stavebnch prvk nebo k egalizaci materilu. Bruska pat svm provedenm do ady profesionlnch stroj, je uren pro prmyslov provoz a kadodenn pouit.<br /><br />Dvouvlcov bruska m pevnou a silnou ocelovou konstrukci a vkonn motor. Dva 152 mm brusn vlce jsou vyrobeny z pesn opracovan', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 0, '93831.43', '98523.00', '121-DDS-225', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_2a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_2_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8302, 948, 'JET DDS-237 Dvouvlcov bruska 940mm', 'JET DDS-237 Dvouvlcov bruska 940mm', '<p><strong>&bull; Robustn&iacute; konstrukce stroje vhodn&aacute; pro nepetrit&yacute; provoz.<br />&bull; Pesn&yacute; nastavovac&iacute; syst&eacute;m druh&eacute;ho v&aacute;lce, umouje nastavit rozd&iacute;l oproti prvn&iacute;mu v&aacute;lci.<br />&bull; Rychl&aacute; v&yacute;mna brusn&eacute;ho p&aacute;su pomoc&iacute; chytr&yacute;ch klips.<br />&bull; Brusn&yacute; p&aacute;s &scaron;&iacute;ky 75 nebo 100 mm.<br />&bull; Pogumovan&eacute; p&iacute;tlan&eacute; v&aacute;lce zaji&scaron;uj&iacute; perfektn&iacute; v&yacute;sledky brou&scaron;en&iacute;.<br />&bull; Zdvih stolu na tyech z&aacute;vitov&yacute;ch ty&iacute;ch.<br />&bull; Pogumovan&yacute; p&aacute;s a dv rychlosti posuvu.<br />&bull; &Uacute;br na jeden prchod a 1,5 mm.<br />&bull; Umonuje fin&aacute;ln&iacute; &uacute;pravu povrchu na jeden prchod.<br />&bull; Pesnost roviny brou&scaron;en&iacute; do 0,2 mm v cel&eacute; &scaron;&iacute;ce.</strong><br /><br />Dvouv&aacute;lcov&aacute; bru', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 0, '141957.14', '149055.00', '121-DDS-237T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_02_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07');
