(8303, 949, 'JET JBG-200 Dvoukotouov bruska', 'JET JBG-200 Dvoukotouov bruska', '<p><strong>&bull; Kvalitn&iacute; zakrytovan&aacute; loiska.<br />&bull; Litinov&yacute; kryt motoru.<br />&bull; Nastaviteln&eacute; oprky pro n&aacute;stroje.<br />&bull; Nastaviteln&yacute; bezpenostn&iacute; &scaron;t&iacute;t.<br />&bull; Osvtlen&iacute; pracovn&iacute; plochy.</strong><br /><br />Masivn&iacute; dvoukotouov&aacute; bruska s dostaten&yacute;m&nbsp;v&yacute;konem a vynikaj&iacute;c&iacute;m designem. 200 mm prmr brusn&yacute;ch kotou. N&aacute;stroj je pi brou&scaron;en&iacute; schovan&yacute;&nbsp;za ochrann&yacute;m &scaron;t&iacute;tem nastaviteln&yacute;m do libovoln&eacute; polohy. Pro&nbsp;snadn&eacute; brou&scaron;en&iacute; je bruska vybavena pracovn&iacute;m osvtlen&iacute;m.&nbsp;Bruska se dod&aacute;v&aacute; s dvma brusn&yacute;mi kotoui s rznou&nbsp;hrubost&iacute; (hrub&yacute; a jemn&yacute;).<br /><br /><em>&bull; Typ: JBG-200<br />&bull; Doporuen&eacute; pouit&iacute;: Profesion&aacute;ln&iacute; v&yacute;roba<br />&bull; P&iacute;', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 0, '5100.00', '5355.00', '121-JBG-200', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_02_web.jpg', 'JET JBG-200 Dvoukotouov bruska', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8304, 950, 'JET JBM-5 Stoln ostrohrann dlabaka', 'JET JBM-5 Stoln ostrohrann dlabaka', '<p><strong>&bull; Pesn&eacute; veden&iacute; zdvihu s tlumiem.<br />&bull; Nastaviteln&yacute; hloubkov&yacute; doraz dlab&aacute;n&iacute;.<br />&bull; Nastaviteln&eacute; pod&eacute;ln&eacute; prav&iacute;tko.<br />&bull; Vertik&aacute;ln&iacute; upnut&iacute; obrobku.<br />&bull; Pracovn&iacute; stl z litiny s MDF deskou.</strong><br /><br />Stoln&iacute; ostrohrann&aacute; dlabaka JBM-5 je urena pro z&aacute;kladn&iacute; v&yacute;robu dlab se spolehlivost&iacute; a pesnost&iacute; odpov&iacute;daj&iacute;c&iacute; profesion&aacute;ln&iacute;mu stroji. I pes men&scaron;&iacute; monosti dlaban&eacute; hloubky a maxim&aacute;ln&iacute;ho prmru dl&aacute;ta je stroj dobr&yacute;m pomocn&iacute;kem pi v&yacute;rob dlab. Stoln&iacute; dlabaka je kompaktn&iacute;, mobiln&iacute; a snadno pouiteln&aacute; na jak&eacute;mkoli m&iacute;st v d&iacute;ln nebo na mont&aacute;i, Propracovan&eacute; mechanismy pom&aacute;haj&iacute; usnadnit pr&aacute;ci. K dispozici je plynov', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 0, '8380.95', '8800.00', '121-JBM-5', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8305, 951, 'JET JBOS-5 Oscilan vlekov bruska', 'JET JBOS-5 Oscilan vlekov bruska', '<p><strong>&bull; Oscilan&iacute; pohyb pro dokonal&yacute; povrch obrobku a del&scaron;&iacute; ivotnost brusn&eacute;ho pap&iacute;ru.<br />&bull; Naklopen&iacute; litinov&eacute;ho stolu a 45&deg;.<br />&bull; V z&aacute;kladn&iacute; v&yacute;bav vetena o prmru 6, 12, 16, 38 a 50 mm.<br />&bull; Z&aacute;sobn&iacute;k na redukn&iacute; stedov&eacute; krouky.<br />&bull; Z&aacute;sobn&iacute;k na brusn&eacute; v&aacute;leky.<br />&bull; Ods&aacute;vac&iacute; hubice 100 mm ze zadn&iacute; strany stroje.</strong><br /><br />Velmi univerz&aacute;ln&iacute; bruska s oscilac&iacute; a pln sklopn&yacute;m stolem. Je ide&aacute;ln&iacute; pro v&scaron;echny druhy dokonovac&iacute;ch prac&iacute; v d&iacute;ln. Oscilan&iacute; pohyb brusky usnaduje pr&aacute;ci a z&aacute;rove sniuje rychl&eacute; opoteben&iacute; brusn&eacute;ho pap&iacute;ru. Litinov&yacute; stl lze sklopit a do 45 &deg;. JBOS-5 bruska je vhodn&aacute; pro kadou d&iacute;lnu. Dod&aacute;v&aacute; se', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 0, '11340.00', '11907.00', '121-JBOS-5M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8306, 952, 'JET JBS-22 Kartov bruska, kart hrubost 46', 'JET JBS-22 Kartov bruska, kart hrubost 46', '<p><strong> Sand Smart System  automatick snen rychlosti posuvu pi peten stroje.<br /> Plynule nastaviteln posuv 03 m/min.<br /> Digitln odeet vky stolu.<br /> Prodluovac stoly v zkladn vbav stroje.<br /> Snadn zmna mezi kartovnm, brouenm a dobruovnm profilovanch dlc.<br /> Monost dovybavit pti typy kart pro irok monosti struktur povrch.<br /> Monost zmny na plnohodnotnou vlcovou brusku vmnou karte za brusn vlec.<br /> Masivn konstrukce a kola pro snadnou manipulaci.<br /> Agregt pohnn pes klnov emen.</strong><br /><br />Kartovac bruska JET je uren k vytven imitace starho deva zvraznnm struktury vlken pomoc kartovacho vlce. S dal vbavou umouje snadnou zmnu mezi kartovnm, brouenm a dobruovnm profilovanch dlc. Mete tak brousit lity a vpln s hloubkou profilu a 15 mm nebo egalizovat (sjednotit) tlouku dlc. Je to uniktn vceelov kartovac stroj. Kartovac brusk', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 0, '80173.33', '84182.00', '121-JBS22MA', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
