(8313, 959, 'JET JDR-34 Radiln vrtaka stoln', 'JET JDR-34 Radiln vrtaka stoln', '<p><strong> Indukn 600W motor pro dlouhodob chod.<br /> Litinov stl s naklpnm +/- 90 .<br /> Naklpc vrtac hlava.<br /> Ocelov sloup prmru 62 mm.<br /> Rychloupnac sklidlo s ochrannou vrstvou 116 mm.<br /> Odklpc bezpenostn tt proti odltajcm tskm.<br /> Maximln kapacita vrtn 410 mm.<br /> Laserov k ukazuje bod vrtn.</strong><br /><br />Radiln stoln vrtaka JET JDR-34 m vkonn indukn motor o pkonu 600 W uren pro dlouhodob chod stroje. Vrtac veteno se zdvihem 80 mm je pohnn emenem s monost volby 5-ti stup otek od 500 do 2500 ot./min. Je vybaveno rychloupnacm sklidlem s ochrannou vrstvou s kapacitou 116 mm. M prhledn oton bezpenostn kryt proti odltajcm tskm s bezpenostnm odpojenm proudu pi vmn nstroj. Sloup vrtaky je z masivn oceli prmru 62 mm. Litinov stl m rozmr 220 x 220 mm a lze jej naklopit na ob strany a do svisl polohy tzn. +/- &nbsp;90 . Maximln kapacita vrtn je 41', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 0, '10201.91', '10712.00', '121-JDR-34', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
