(8315, 961, 'JET JOSS-S Oscilan vlekov bruska', 'JET JOSS-S Oscilan vlekov bruska', '<p><strong> Optimln pracovn vka zajiujc pohodl pi prci.<br /> Stabiln a pevn stojan s integrovanm lonm prostorem.<br /> 10 brusnch veten s prmry v rozsahu 6100 mm s rychlou mont.<br /> Kvalitn loiska zajiuj vysokou pesnost vetena.<br /> Pevodovka v olejov lzni zaruuje dlouhou ivotnost.<br /> Pravideln oscilace poskytuje hladk povrch obrobku.<br /> Velk litinov stl umouje brouen rozmrnch dlc.<br /> Nastaviteln hel pracovnho stolu.<br /> Jednoduch vmna vetene - pouze jednm klem.<br /> Flexibiln kryt pro zven inku odsvn.<br /> Rychl a snadn naklopen stolu -15  a +45 .<br /> Vybrouen kadho hlu.<br /> Uzamykn vetene.<br /> Optimalizovan odsvn.</strong><br /><br />Nov verze univerzln profesionln brusky s oscilac a pln sklopnm stolem je urena pro profesionln brouen hran zakivench dlc.<br /><br />Bruska m modernizovan oscilan uloen, kter zlepuje kvalitu a innost brou', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 0, '36812.38', '38653.00', '121-JOSS-SM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8316, 962, 'JET JPT-10B Srovnvac a tloukovac frzka stoln s podstavcem', 'JET JPT-10B Srovnvac a tloukovac frzka stoln s podstavcem', '<p><strong> Srovnvac ka 254 mm.<br /> Vkonn motor 1,5 kW.<br /> Pesn srovnvac stoly a dlouh stl protahu.<br /> Jednoduch pechod od srovnvn k tloutkovn.<br /> Naklopen oprnho pravtka 90- 45.<br /> Vhodn pro pevoz na monte.</strong><br /><br />Celkov velikost a kompaktnost stroje umouje irok pouit vude tam, kde byste se s klasickm strojem nikdy nedostali. JET JPT-10B m pevnou a stabiln konstrukci, pesn srovnvac stoly a dlouh stl protahu. Dky odsvacmu krytu, bezpenostnm krytm a pojistce na motoru je stroj vhodn pro kadou kutilskou dlnu a tak na pevoz na monte. Vhodou frzky je stabiln plechov podstavec opaten gumovmi nohami.<br /><br /><em> Typ: JPT-10B<br /> Doporuen pouit: Kutil<br /> Pkon (230 V): 1,5 kW<br /> Otky: 9000 ot./min.<br /> Prmr vlce: 45 mm<br /> </em> <em>Rychlost posuvu protahovn</em> <em>: 6 m/min.<br /> Poet iletek na vlci: 2 ks<br /> Max. br pi srovnvn: 3 mm<br /> Ma', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 0, '9943.81', '10441.00', '121-JPT-10B', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8317, 963, 'JET JPT-310HH Srovnvac a tloukovac frzka, iletkov vlec', 'JET JPT-310HH Srovnvac a tloukovac frzka, iletkov vlec', '<p><strong>Modely JPT-310HH a 410HH maj speciln vlec osazen tvrdokovovmi iletkami sestavenmi do spirly.</strong><br /><br /><strong> iletkov hoblovac vlec se 4 spirlovmi drkami.<br /> Tvrdokovov vmnn iletky a s 20 krt del ivotnost.<br /> 4 vysoce pesn ezn hrany se zaoblenm na kad iletce.<br /> Vysok kvalita opracovanho povrchu bez vytrhvn.<br /> spora a 40  % provoznch nklad na hoblovn 1 metru.<br /> Snen spoteba energie.<br /> Vkonn motor 2,2 kW vkonu.<br /> Dlouh masivn litinov srovnvac stl.<br /> Jednoduch pechod od srovnvn k tloukovn.<br /> Souasn odklpn obou srovnvacch stol pouze jednou rukou.<br /> Nastaven vky vstupnho i vstupnho stolu.</strong><br /><br />Pohodln pouze jednou rukou lze zvednout litinov stl. Pechod od srovnvn k tloutkovn neme bt jednodu. Se svm dlouhm stolem a pesnm pravtkem je zde pesnost standardem, stejn jako vdy vborn povrch dky iletkov', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 0, '71600.00', '75180.00', '121-JPT-310HH-T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8318, 964, 'JET JPT-310 Srovnvac a tloukovac frzka', 'JET JPT-310 Srovnvac a tloukovac frzka', '<p><strong> Dlouh masivn litinov srovnvac stl.<br /> Jednoduch pechod od srovnvn k tloukovn.<br /> Souasn odklpn obou srovnvacch stol.<br /> Nastaven vky vstupnho i vstupnho stolu.<br /> 3-noov hoblovac hdel.</strong><br /><br />Pohodln pouze jednou rukou lze zvednout litinov stl. Pechod od srovnvn k tloutkovn neme bt jednodu. Se svm dlouhm stolem a pesnm pravtkem je zde pesnost standardem, stejn jako vdy vborn povrch dky 3 noov hlav. Nastaven vky vstupnho stolu pomoc excentrick pky je jednoduch a snadn. Monost nastaven vky vstupnho stolu excentrem. Odsvac hubice udruje stroj ist pi pipojen k vhodnmu systmu odsvn. Stroj pro profesionln dlny nebo drby i kutily s irokm rozsahem pouit.<br /><br /><strong>Stroje pro profesionln dlny nebo drby i kutily s irokm rozsahem pouit.</strong><br /><br /><em> Typ: JPT-310<br /> Doporuen pouit: Profesionln vroba<br /> Pkon / ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 0, '50466.67', '52990.00', '121-JPT-310T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
