(8320, 966, 'JET JPT-410 Srovnvac a tloukovac frzka', 'JET JPT-410 Srovnvac a tloukovac frzka', '<p><strong> Dlouh masivn litinov srovnvac stl.<br /> Jednoduch pechod od srovnvn k tloukovn.<br /> Souasn odklpn obou srovnvacch stol.<br /> Nastaven vky vstupnho i vstupnho stolu.<br /> 3-noov hoblovac hdel.</strong><br /><strong> ka srovnvn 407 mm.<br /> Vkonn motor 3 kW vkonu.</strong><br /><br />Pohodln pouze jednou rukou lze zvednout litinov stl. Pechod od srovnvn k tloutkovn neme bt jednodu. Se svm dlouhm stolem a pesnm pravtkem je zde pesnost standardem, stejn jako vdy vborn povrch dky 3 noov hlav. Nastaven vky vstupnho stolu pomoc excentrick pky je jednoduch a snadn. Monost nastaven vky vstupnho stolu excentrem. Odsvac hubice udruje stroj ist pi pipojen k vhodnmu systmu odsvn. Stroj pro profesionln dlny nebo drby i kutily s irokm rozsahem pouit.<br /><br /><strong>Stroje pro profesionln dlny nebo drby i kutily s irokm rozsahem pouit.</strong><br /><br />', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 0, '66657.14', '69990.00', '121-JPT-410T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_03_web.jpg', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8321, 967, 'JET JSG-64 Kombinovan bruska', 'JET JSG-64 Kombinovan bruska', '<p><strong>&bull; Rychl&eacute; napnut&iacute; a uvolnn&iacute; brusn&eacute;ho p&aacute;su.<br />&bull; &Uacute;hlov&eacute; prav&iacute;tko veden&eacute; v T-dr&aacute;ce.<br />&bull; Sklopn&eacute; rameno s brusn&yacute;m p&aacute;sem.<br />&bull; Pracovn&iacute; stl z lit&eacute;ho hlin&iacute;ku.</strong><br /><br />Kombinovan&aacute; bruska JSG-64 je urena pro obasn&eacute; pouit&iacute; v truhl&aacute;sk&eacute; d&iacute;ln a do kutilsk&yacute;ch d&iacute;len. Bruska je vhodn&aacute; pro men&scaron;&iacute; d&iacute;lce, ela, hrany a ploch&eacute; &aacute;sti, zaoblov&aacute;n&iacute; hran, odstraov&aacute;n&iacute; star&yacute;ch n&aacute;tr. Jednotku s brusn&yacute;m p&aacute;sem mete nastavit v libovoln&eacute;m sklonu. Pi horizont&aacute;ln&iacute;m naklonn&iacute; mete brousit velk&eacute; plochy. V t&eacute;to poloze vyuijete p&iacute;nou zar&aacute;ku nad p&aacute;sem. Je-li jednotka nastavena vertik&aacute;ln, me zar&aacute;ka slouit jako opr', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 0, '3920.95', '4117.00', '121-JSG-64', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8322, 968, 'JET JSG-96 Kombinovan bruska', 'JET JSG-96 Kombinovan bruska', '<p><strong>&bull; Brusn&yacute; kotou prmru 230 mm.<br />&bull; Litinov&yacute; stl s dorazy na 45 &deg; a 90 &deg;.<br />&bull; &Scaron;&iacute;ka p&aacute;su 150 mm.<br />&bull; Podprn&yacute; stl s grafitovou podlokou.<br />&bull; Integrovan&eacute; ods&aacute;v&aacute;n&iacute; v&yacute;vod 100 mm.<br />&bull; P&aacute;sov&aacute; bruska naklopiteln&aacute; vertik&aacute;ln&iacute; a vodorovn.</strong><br /><br />Kombinovan&aacute; bruska m&aacute; brusn&yacute; kotou z poloviny uzaven a jako opra slou&iacute; pesn brou&scaron;en&yacute; litinov&yacute; stl, kter&yacute; mete nakl&aacute;nt o 45 &deg;. Stl je opaten dvma T-dr&aacute;kami, kter&eacute; vyuijete pro prav&iacute;tko nebo hrot. Integrovan&eacute; ods&aacute;v&aacute;n&iacute; je opateno hrad&iacute;tky, aby bylo ods&aacute;v&aacute;n&iacute; &uacute;inn&eacute;. Bruska me b&yacute;t upevnna p&iacute;mo na pracovn&iacute; stl nebo na voliteln&yacute; podstavec s &uacute;lon&yacute;m prost', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 0, '13320.00', '13986.00', '121-JSG-96M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8323, 969, 'JET JSMS-10L Pokosov pila s pojezdem a laserem', 'JET JSMS-10L Pokosov pila s pojezdem a laserem', '<p><strong> 9 pedvoleb hl kosu.<br /> HM pilov kotou v cen.<br /> Siln motor s brzdou.<br /> Laser pro oznaen ezu.<br /> Vhodn i pro laminty.<br /> ist ezy mkkho i tvrdho deva.<br /> Rozen stolu a na 103 cm v cen.</strong><br /><br />Pokosov pila JSMS-10L o hmotnosti 18 kg, avak robustn konstrukce. Je to vynikajc pomocnk, bezpen a s vynikajcmi ezy za vech okolnost. Pila eze pesn a ist mkk i tvrd devo a laminty dky 1500W motoru s brzdou. M laser, kter Vm ozna ez. Je vybavena HM kotouem. Rozen stolu poskytuje podporu dlc a v dlce 1030 mm.<br /><br /><strong>Vysoce kvalitn, oblben pokosov pila s kompaktnmi rozmry a s vynikajc eznou kapacitou 305x90 mm.<br />Devt pedvoleb pozic nabz vechny potebn hly kosu pro truhlsk a tesask prce.&nbsp;</strong><br /><br /><em>&nbsp;</em><em>Typ: JSMS-10L</em><br /><em>&nbsp;</em><em>Doporuen pouit: emeslnk</em><br /><em>&nbsp;</em><em>Pkon (230 V): ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 0, '5900.00', '6195.00', '121-JSMS-10LM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8324, 970, 'JET JSMS-12L Pokosov pila s pojezdem a laserem', 'JET JSMS-12L Pokosov pila s pojezdem a laserem', '<p><strong> HM pilov kotou v cen.<br /> Siln motor s brzdou.<br /> Laser pro oznaen ezu.<br /> Vhodn i na laminty.<br /> ist ezy mkkho i tvrdho deva.<br /> Rozen stolu a na 730 mm v cen.<br /> Pracovn stl z litho hlinku.<br /> Vsuv agregtu ve vlekovm veden.<br /> Prmr kotoue 305 mm.</strong><br /><br />Jet JSMS-12L zakracovac a pokosov pila je vybavena 305 mm velkm pilovm kotouem a monost vsuvu agregtu ve vlekovm veden. Dky kapacit ezu mete pilu pouit v dln i na monti nebo na stavb k ezn podlahovch lit, obloek, stnovch panel. Vkon motoru je dostaten vysok, abyste zvldli ezat rzn druhy materil.<br /><br />Stl lze otoit na levou a pravou stranu, v kad poloze jej mete zafixovat, a je vybaven stop-zpadkami. Naklpn se provd naklopenm na levou stranu. V maximln poloze jsou koncov dorazy, kter je mon nastavit. Pro zjednoduen ezn je stroj vybaven laserovm navdcm paprskem.<br /><br', '_vyr_97023.jpg', 0, '8528.57', '8955.00', '121-JSMS-12LM', '_vyrn_97023.jpg', '_vyrp11_97024.jpg', '_vyrp12_97025.jpg', '_vyrp13_97026.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8325, 971, 'JET JSS-16MA Vyezvac lupnkov pila stoln', 'JET JSS-16MA Vyezvac lupnkov pila stoln', '<p><strong> Pracovn stl s naklopenm a 45.<br /> Ofuk pracovn plochy pro snaz a pesn ez.<br /> Siln komuttorov motor.<br /> Litinov zkladna pro lep stabilitu a snen vibrac.</strong><br /><br />Elektrick lupnkov pila nebo-li dekuprka JET je vybavena vkonnm komuttorovm DC motorem s plynulou regulac kmit (550-1.600 / min). Proto s n lze snadno ezat irokou klu materil a do tlouky 50 mm. Prmr odsvac hubice pro pipojen k odsavai je 35 mm. Velkorys stl (410 x 254 mm) s maximln kou ezu 510 mm je mon naklpt a na 45 pro hlov ezn. Pila je dodvna s kolkovm upnnm pilovch list. Uvolovac ovldac kolo umouje rychlou a snadnou vmnu. Ventiltor pomh udret msto ezu ist a dobe viditeln. Dky tk litinov zkladn je stroj stabiln a m minimln vibrace.<br /><br /><em> Typ: JSS-16<br /> Doporuen pouit : Kutil<br /> Pkon (230 V): 90 W<br /> Kmity pilovho listu: 550 - 1600 / min<br /> Dlka pilovh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 0, '3514.29', '3690.00', '121-JSS-16MA', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8326, 972, 'JET JSSG-10 Bruska na nstroje', 'JET JSSG-10 Bruska na nstroje', '<p><strong> Brusn kotou 250 mm.<br /> Regulace otek.<br /> Bohat psluenstv v zkladu.<br /> Velk vbr volitelnho psluenstv.</strong><br /><br />Velmi inn bruska pro brouen nad a nstroj. Spodn st brusnch&nbsp;kotou je ve vodn ndrce, m se zajiuje chlazen a eliminuje peht.&nbsp;Robustn a siln motor s plynulou regulac otek 90 - 150 ot./min.<br /><br />Spodn st brusnho kamene je ponoena ve vodn lzni. Jak se brusn kmen ot,&nbsp;prbn pivd vodu na brouen povrch, a tm je chlazen a eliminuje se tak riziko&nbsp;pehvn materilu. Bruska m 90 - 150 ot./min., a 160 W motor. Otky motoru se&nbsp;mohou regulovat. Pokud je brusn kotou prmru 250 mm, nastavte brusku na ni&nbsp;otky 90 ot./min. Bhem asu se bude brusn kmen obruovat a jeho prmr se zmen,&nbsp;pak pouijte regulaci otek pro dosaen optimln obvodov rychlosti a otky zvyte.<br /><br /><em> Typ JSSG-10M<br /> Doporuen pouit Profesion', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 0, '7499.05', '7874.00', '121-JSSG-10M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8327, 973, 'JET JTS-10 Stoln pila s podstavcem', 'JET JTS-10 Stoln pila s podstavcem', '<p><strong> Vlastn podstavec v cen.<br /> Siln motor s brzdou.<br /> Naklpn a vkov nastaven kotoue.<br /> hlov pravtko.<br /> Paraleln pravtko.<br /> Rozen stolu vlevo, vpravo a zadn.<br /> HM pilov kotou v cen.<br /> Staviteln vka ezu a 80 mm.</strong><br /><br />Tato vysoce oblben stoln pila je vybavena 1500W motorem s brzdou a ve spojen s prmrem kotoue 254 mm dv impozantn vku ezu a 80 mm. Vechny funkce, kter najdete ve vych adch pil jsou na JET JTS-10. Nastaviteln vka ezu, hlov ezn 045 a hlov pravtko, paraleln pravtko, rozen stolu a 40 zubov HM pilov kotou. Dodvna vetn stolu - podstavce.<br /><br /><em> Typ: JTS-10<br /> Doporuen pouit: Kutil<br /> Pkon (230 V): 1,5 kW<br /> Kotou x upnn: 254 x 30 mm<br /> Otky: 4500 ot./min.<br /> Naklopen kotoue: 045<br /> Max. vka ezu pi 45: 55 mm<br /> Max. vka ezu pi 90: 80 mm<br /> Maximln ka ezu: 410 mm<br /> Velikost', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 0, '5837.14', '6129.00', '121-JTS-10M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_2_web.jpg', 'JET JTS-10 Stoln pila s podstavcem', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8328, 974, 'JET JTS-254 Mobiln kotouov pila s podstavcem', 'JET JTS-254 Mobiln kotouov pila s podstavcem', '<p><strong> Pohodln nastaven naklopen pilovho kotoue.<br /> Jednoduch nastaven hloubky ezu.<br /> Pesn hlinkov stl s vozkem.<br /> Integrovan podln pravtko s monost naklopen.<br /> hlov pravtko s monost upevnn k posuvnmu vozku.<br /> Rukoje a kola pro snadnou manipulaci a pepravu.<br /> Sklopn podstavec.</strong><br /><br />JET JTS-254 je pln vybaven kompaktn stroj pro prci na stavbch, na montch nebo pro kutilskou prci se devem. Inteligentn konstrukce kombinuje pesnost, produktivitu a jednoduchost s minimlnmi rozmry. Dky rukojeti a kolekm lze s pilou jednodue manipulovat a pevet v aut na monte.<br /><br />Pro ezn pod hlem a pro prci s malmi obrobky je na pile nastaviteln hlov pravtko, kter je mono upevnit k posuvnmu vozku. Tato kombinace posuvnho vozku a hlovacho pravtka nabz pohodln a pesn zakracovn.<br /><br />Podln pravtko zajiuje integrovan mechanizmus, kter slou tak pro rozen p', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 0, '13853.33', '14546.00', '121-JTS-254M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8329, 975, 'JET JTS-315SP Kotouov pila - 230V', 'JET JTS-315SP Kotouov pila - 230V', '<p><strong> Posuvn stl pro pesn ezy v cen.<br /> Zadn pdavn stl v cen.<br /> Brzdn indukn motor.<br /> Excentrick upnn podlnho pravtka.<br />&nbsp;Pesn veden podprnho stolu na esti loiskch.<br />&nbsp;Odsvn z vrchu a zespod kotoue.</strong><br /><br />Pila z pozinkovan oceli pro pouit v dln nebo na stavb. Nohy lze sloit pro pepravu v dodvce nebo v osobnm automobilu. I kdy pily tohoto typu jsou obvykle pouvny pro rozezvn, lze snadno provdt pesn zakrcen bu kolmo nebo pod hlem pomoc posuvnho stolu s vozkem (dodvny jako standard). Mezi dal funkce tto vynikajc pily pat brdn indukn motor, zadn odkldac pdavn stl, odsvn nad a pod kotouem a voliteln rozen stolu o bon pdavn stl.<br /><br />JTS-315 SP je k dispozici v proveden 230 V a 400 V. Standardn je pila dodvna se zadnm pdavnm stolem, 315 mm HM pilovm kotouem, kter lze sklopit a na 47, pravtkem pro podln ezy, posuvnm st', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 0, '12972.38', '13621.00', '121-JTS-315SPM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_2_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_3_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07');
