(8330, 976, 'JET JTS-315SP Kotouov pila - 400V', 'JET JTS-315SP Kotouov pila - 400V', '<p><strong> Posuvn stl pro pesn ezy v cen.<br /> Zadn pdavn stl v cen.<br /> Brzdn indukn motor.<br /> Excentrick upnn podlnho pravtka.<br />&nbsp;Pesn veden podprnho stolu na esti loiskch.<br />&nbsp;Odsvn z vrchu a zespod kotoue.</strong><br /><br />Pila z pozinkovan oceli pro pouit v dln nebo na stavb. Nohy lze sloit pro pepravu v dodvce nebo v osobnm automobilu. I kdy pily tohoto typu jsou obvykle pouvny pro rozezvn, lze snadno provdt pesn zakrcen bu kolmo nebo pod hlem pomoc posuvnho stolu s vozkem (dodvny jako standard). Mezi dal funkce tto vynikajc pily pat brdn indukn motor, zadn odkldac pdavn stl, odsvn nad a pod kotouem a voliteln rozen stolu o bon pdavn stl.<br /><br />JTS-315 SP je k dispozici v proveden 230 V a 400 V. Standardn je pila dodvna se zadnm pdavnm stolem, 315 mm HM pilovm kotouem, kter lze sklopit a na 47, pravtkem pro podln ezy, posuvnm st', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 0, '12972.38', '13621.00', '121-JTS-315SPT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_2_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_3_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8331, 977, 'JET JTS-600XL Formtovac kotouov pila', 'JET JTS-600XL Formtovac kotouov pila', '<p><strong> Dlka formtovacho stolu 1300 mm.<br /> Pevn a stabiln konstrukce stroje.<br /> Masivn litinov drk pilovho agregtu.<br /> Litinov ovldac kola.<br /> Snadn obsluha a jednoduch drba.<br /> Pevn a pesn formtovac stl z eloxovanho, extrudovanho hlinku.<br /> Pesn hlovn na hlavnm pravtku dky otonm dorazm.<br /> Brouen masivn litinov stl s bonm a zadnm rozenm.<br /> Odsvn z vrchu a zespod kotoue.<br /> Pravtko 2200 mm s posuvnm dorazem.<br /> Monost naklopen na 45 .<br /> Vlonk pro pesn ezn v zkladn vbav.<br /> Velk snadno iteln stupnice naklopen kotoue a 45 .<br /> Podln pravtko s integrovanm jemnm nastavenm.</strong><br /><br />Formtovac kotouov pila JET JTS-600XL je profesionln stroj, kter je uren pro pesn ezn deva a velkoplonch materil s dlkou ezu na formtovacm vozku a 1300 mm. Dky kompaktnosti je vhodn do mench a stednch dlen nebo jako doplkov stroj', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 0, '48180.95', '50590.00', '121-JTS-600XLT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8332, 978, 'JET JTS-600X Formtovac kotouov pila', 'JET JTS-600X Formtovac kotouov pila', '<p><strong> Pesn brouen a rovn litinov stl.<br /> Masivn litinov drk pilovho agregtu pro pesn ezy.<br /> Jednoduch nastaven pomoc litinovch ovldacch kol.<br /> Podln pravtko s integrovanm jemnm nastavenm.<br /> Posuvn formtovac stl z masivnho eloxovanho hlinku.<br /> Pravtko 2200 mm na vlonku 460x600mm pro dlouh dlce.<br /> Uzamykateln vypna proti neoprvnn manipulaci.<br /> Odsvac hubice 100 mm pro odvod prachu a tsek.</strong><br /><br />Kotouov pila se zkracovacm vozkem JTS-600X m robustn podstavec, paraleln pravtko, siln motor, zkracovac posuvn stl 1000 x 255 mm s vlonkem a 80 mm hloubku ezu. Velmi snadno si porad s masivnm devem a deskovm&nbsp;materilem. Tento stroj zvldne vechny poadavky v mal a stedn dln, na drb nebo v kutilsk dln.<br /><br />Snadno lze pesouvat po dln pomoc mobilnho podstavce (nen soust stroje obj.kd 121 - 708118).<br />Ke stroji je mon dokoupit pesn hlov', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 0, '36180.95', '37990.00', '121-JTS-600XT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8333, 979, 'JET JWBS-14Q Psov pila', 'JET JWBS-14Q Psov pila', '<p><strong> Pka pro rychl povolen psu.<br /> Paraleln pravtko a helnk v zkladn vbav.<br /> Pesn a nastaviteln veden psu.<br /> Naklopen stolu -10  a 45 .</strong><br /><br />Psov pila JET JWBS-14Q je urena pro stedn tkou prci. M dv rychlosti, lit vyven kola, zamykn, super litinov stl, kter mete naklonit od -10  a +45 . Paraleln pravtko, kter je fixovno na pedn a zadn stran stolu, sah mrn nad stl z litiny. Pilov ps je veden nad a pod stolem mezi loisky a vleky, kter mu poskytuj velmi pesn veden, co vede k ideln kvalit ezu a prodluuje ivotnost pilovho psu. Stroje jsou vybaveny bezpenostnmi vypnai, elektromechanickou motorovou brzdou a snadno pstupnm uvolnnm psu pi jeho vmn.&nbsp;Tyto pily jsou ureny pro profesionln dlnu, kde je poadovna pesnost a kvalita prce.<br /><br />Pro snadn pesouvn tchto stroj po dln doporuujeme nkup mobilnho podstavce, dky nmu lze se strojem posouva', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 0, '28523.81', '29950.00', '121-JWBS-14QM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8334, 980, 'JET JWBS-9 Psov stoln pila na devo', 'JET JWBS-9 Psov stoln pila na devo', '<p><strong> Pilov ps e 6 mm v zkladu<br /> Robustn stl z litho hlinku<br /> Pesn hlovac pravtko<br /> Naklopen stolu a 45<br /> Osvtlen stolu</strong><br /><br />Mal psov pila pro bn pesn prce m skvle vyven unec kola. Robustn stl stroje lze naklpt na 45. Stroj je vybaven tichm induknm motorem 350W a osvtlenm pracovnho prostoru. Maximln vka ezu je 80 mm. Dodvna vetn pesnho pokosovho pravtka s hlinkovm profilem s naklopenm +/- 60.<br /><br /><em> Typ: JWBS-9<br /> Doporuen pouit: Kutil<br /> Pkon (230 V): 350 W<br /> Dlka psu: 1510 mm<br /> Rychlost psu: 670 m/min.<br /> ka psu min. / max.: 6 / 10 mm<br /> Max. ka ezu: 230 mm<br /> Max. vka ezu: 80 mm<br /> Rozmry stolu: 300 x 300 mm<br /> Naklopen stolu: 0 a 45<br /> Prmr kola: 240 mm<br /> Odsvn: 50 mm<br /> Dlka x ka x vka: 480 x 450 x 730 mm<br /> Hmotnost: 17 kg</em></p>', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 0, '4030.48', '4232.00', '121-JWBS-9M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8335, 981, 'JET JWDS-1632 Vlcov bruska', 'JET JWDS-1632 Vlcov bruska', '<p><strong> Technologie Sandsmart prbn kontroluje zaten stroje a automaticky upravuje rychlost psu.<br /> Rovinnost psu jednodue upravte otoenm kola na bon stran stroje a to bez pouit nad.<br /> Systm naklonn stolu je navc vybaven dorazem pro rychl nvrat do pvodn polohy.<br /> Odsvac kryt vytv odsvac kanl, kter kopruje tvar vlce a smuje tak tsky a prach pmo do odsvn.</strong><br /><br />Pedstavujeme zcela nov navrenou vlcovou brusku JET JWDS. Siln motor nabz vce ne dost vkonu na zvldnut jakhokoliv brouen. Inovativn systm nastaven rovinnosti stolu vi brusnmu vlci umouje jednoduchou pravnu sklonu podle typu brouen a poadavku na finln vsledek. Naklonn stolu jednodue nastavte pootoenm kola. Regulace pro plynulou zmnu rychlosti posuvu umouje zvolen optimln rychlosti pro ideln vsledek, zatmco technologie Sandsmart prbn monitoruje zaten stroje a zabrauje tak peten motor. Pesn k', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 0, '29935.24', '31432.00', '121-JWDS-1632M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
