(8337, 983, 'JET JWL-1221VS Soustruh na devo', 'JET JWL-1221VS Soustruh na devo', '<p><strong>&bull; Elektronick&aacute; plynul&aacute; regulace ot&aacute;ek 60&ndash;3600 ot./min.<br />&bull; Zptn&yacute; chod a digit&aacute;ln&iacute; displej ot&aacute;ek.<br />&bull; Siln&yacute; 730 W motor se zptn&yacute;m chodem.<br />&bull; Pln litinov&aacute; konstrukce s extra &scaron;irok&yacute;m loem 17 cm.<br />&bull; Litinov&yacute; kon&iacute;k s poohybov&yacute;m trap&eacute;zov&yacute;m &scaron;roubem Acme.<br />&bull; Mimo&aacute;dn stabiln&iacute; a bez vibrac&iacute;.<br />&bull; Nov&yacute; syst&eacute;m nap&iacute;n&aacute;n&iacute; p&aacute;su, vdy perfektn&iacute; a rychl&aacute; zmna.<br />&bull; Ergonomicky um&iacute;stn&eacute; ovl&aacute;dac&iacute; prvky po prav&eacute; ruce.<br />&bull; Indexace 24 pozic vetene po 15 &deg;.</strong><br /><br />JET JWL-1221VS je kompaktn&iacute; revolun&iacute; soustruh nov&eacute; generace pln&yacute; unik&aacute;tn&iacute;ch konstrukn&iacute;ch e&scaron;en&iacute;, kter&eacute; usnadn&iacute; a zp&iacute', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 0, '21239.05', '22301.00', '121-JWL-1221VS', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_03.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8338, 984, 'Sada JET JWL-1221VS Soustruh + JET Podstavec', 'Sada JET JWL-1221VS Soustruh + JET Podstavec', '<h1 style=\\\"font-weight: bolder; font-stretch: normal; font-size: 22.496px; line-height: normal; font-family: Arial, Helvetica, sans-serif; color: #000000;\\\"><span style=\\\"color: #ff0000;\\\">+ ZDARMAPodstavec</span></h1>\\n<p style=\\\"margin: 0px auto; line-height: 20px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 11.84px;\\\"><strong style=\\\"font-size: 11.84px;\\\"></strong><a href=\\\"http://www..cz/jet-podstavec-pro-soustruh-jwl-1221vs\\\">JET Podstavec pro soustruh JWL-1221VS</a></p>\\n<p><br /><br /><strong> Elektronick plynul regulace otek 603600 ot./min.<br /> Zptn chod a digitln displej otek.<br /> Siln 730 W motor se zptnm chodem.<br /> Pln litinov konstrukce s extra irokm loem 17 cm.<br /> Litinov konk s poohybovm trapzovm roubem Acme.<br /> Mimodn stabiln a bez vibrac.<br /> Nov systm napnn emenu, vdy perfektn a rychl zmna.<br /> Ergonomicky umstn ovldac prvky po prav ruce.<br /> Indexace 24 pozic veten', '_vyr_984716JO4hN-FL-_SX425_.jpg', 0, '25113.10', '30469.00', '121-JWL-1221VS-S1', '_vyrn_984716JO4hN-FL-_SX425_.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/00_121-JWL-1221VS-S1_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/121-JWL-1221VS_02_web.jpg', 21, 1, 0, 1, '', 0, '3-62-402-0', NULL, '2021-01-10 15:44:07'),
(8339, 985, 'JET JWL-1440VS Soustruh na devo', 'JET JWL-1440VS Soustruh na devo', '<p><strong> Pln litinov konstrukce s extra irokm loem.<br /> Litinov vetenk se ot o 360  se 7 pednastavenmi pozicemi.<br /> Pozice v 0, 30, 60, 90, 120, 180, a 270  pro maximln variabilitu a optimln uivatelsk komfort.<br /> Plynul regulace otek 2802500 ot./min.<br /> Vylepen uzamen pozice a prodlouen zdvih oprky.<br /> Trapzov kluzn zvit konku typu Acme pro vrtac operace.<br /> Vylepen uzamen konku.<br /> Snadno iteln displej s ukazatelem otek.<br /> Voliteln prodlouen loe o 508 mm a litinov podstavec (2 nohy).<br /> CE certifikace.</strong><br /><br />JWL-1440VS je druhou spnou generac robustnch soustruh JET stedn velikosti, kter vynikaj robustn litinovou konstrukc, dostatkem sly, pesnosti a flexibility, kter je pi soustruen deva potebn. Veteno je uloeno v masivnch loiscch a je pohnno 750 W motorem s plynulou regulac otek a s digitlnm ukazatelem na LCD displeji. Veteno lze indexovat po 10 ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 0, '349191.43', '366651.00', '121-JWL-1440VS', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8340, 987, 'JET JWL-1640EVS Soustruh na devo', 'JET JWL-1640EVS Soustruh na devo', '<p><strong> Pln litinov konstrukce s extra irokm loem.<br /> Posuvn litinov vetenk se ot o 360  se 7 pednastavenmi pozicemi.<br /> Prodlouen uloen vetene s dvojitmi loisky.<br /> Zdokonalen uzamykac mechanismus konku.<br /> Trapzov kluzn zvit konku typu Acme pro hladk a pesn pohyb.<br /> Bezzvitov uzamykn konku klnovm systmem.<br /> Elektronick plynul regulace otek 40-3200 ot/min.<br /> 36 poloh indexovn.<br /> Zajitn vetenku pstupn z pedn strany soustruhu.<br /> Drk nstroj umstn na noze pod vetenkem.<br /> Prakticky umstn digitln displej zobrazen otek.<br /> Gumov odkldac plocha na vrchn stran vetenku.<br /> CE certifikace.</strong><br /><br />Soustruh JWL-1640VS s plynule nastavitelnmi otkami je vybaven pikovmi funkcemi, kter jej vrazn odliuj od ostatnch soustruh ve stejn kategorii. Posuvn vetenk je oton o 360 stup se 7 pednastavenmi pozicemi. To umouje zvolit nejpoh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 0, '52404.76', '55025.00', '121-JWL-1640EVSM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_05_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_06_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8341, 989, 'JET JWL-1840EVS Soustruh na devo', 'JET JWL-1840EVS Soustruh na devo', '<p><strong> Pln litinov konstrukce s extra irokm loem.<br /> Posuvn litinov vetenk se ot o 360  se 7 pednastavenmi pozicemi.<br /> Prodlouen uloen vetene s dvojitmi loisky.<br /> Zdokonalen uzamykac mechanismus konku.<br /> Trapzov kluzn zvit konku typu Acme pro hladk a pesn pohyb.<br /> Bezzvitov uzamykn konku klnovm systmem.<br /> Elektronick plynul regulace otek 40-3200 ot/min.<br /> 36 poloh indexovn.<br /> Zajitn vetenku pstupn z pedn strany soustruhu.<br /> Drk nstroj umstn na noze pod vetenkem.<br /> Prakticky umstn digitln displej zobrazen otek.<br /> Gumov odkldac plocha na vrchn stran vetenku.<br /> CE certifikace.</strong><br /><br />Soustruh JWL-1840VS s plynule nastavitelnmi otkami je vybaven pikovmi funkcemi, kter jej vrazn odliuj od ostatnch soustruh ve stejn kategorii. Posuvn vetenk je oton o 360 stup se 7 pednastavenmi pozicemi. To umouje zvolit nejpoh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 0, '66234.29', '69546.00', '121-JWL-1840EVSM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8342, 990, 'JET JWP-12 Tloukovac frzka stoln', 'JET JWP-12 Tloukovac frzka stoln', '<h2><span style=\\\"color:#FF0000;\\\">+ ZDARMA 2 sady no HSS na mkk a tvrd devo</span><br /><span style=\\\"line-height: 1.2; font-size: 13px;\\\">(Jedna sada no ZDARMA je upnut v hoblovacm vlci.)</span></h2><p><strong> Vkonn motor<br /> br materilu a 2,5 mm<br /> Masivn veden agregtu<br /> Dvounoov vlec</strong><br /><br />Hoblovac vlec je osazen 2ks hoblovacch iletek HSS. Otky a vhodn rychlost posuvu zajiuj vynikajc povrch opracovn. Stroj je vybaven ochranou proti peten s bezpenostn pojistkou. Maximln tlouka materilu je 153 mm a maximln ka 318 mm. Sklopn nstavce stolu s vleky na koncch poskytuj podporu pro dlouh dlce.<br />Kryt hoblovacho vlce umouje pipojen odsvacho zazen.<br /><br /><strong>Dky vkonnmu motoru tloukovac frzy JET je mon br materilu a 2,5 mm pi jednom protaen.</strong><br /><br /><em> Typ: JWP-12<br /> Doporuen pouit: emeselnk<br /> Pkon (230V): 1,8 kW<br /> Otky: 9000 o', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 0, '8476.19', '8900.00', '121-JWP-12M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_04_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8343, 991, 'JET OES-80CS Oscilan hranov bruska', 'JET OES-80CS Oscilan hranov bruska', '<p><strong> Brouen v horizontln nebo vertikln poloze a libovolnm hlu.<br /> Oscilace 50 kmit/min zabezpeuje perfektn povrch.<br /> Robustn litinov stl s jednoduchm pestavenm.<br /> Pogumovan povrch hnacho vlce.<br /> Vkov nastaviteln stl.<br /> Podstavec s lonm prostorem.<br /> Pka pro rychl napnut psu.<br /> Mal hlov pravtko v zkladn vbav.<br /> Vodc T-drka.<br /> Podkladov grafitov deska.<br /> Stl pro brouen tvarovch dlc v zkladn vbav.</strong><br /><br />Hranov oscilan bruska slou k brouen hran a rdius. Bruska umouje plynul naklpn brusnho psu, brouen v horizontln nebo vertikln poloze. Brusn ps osciluje 50 kmit / min bez krbanc na povrchu materilu. Masivn litinov stl me bt snadno pesouvn nahoru nebo dol, take lze vyut celou plochu brusnho psu. Pohnn vlec je pogumovan, co zajiuje maximln penos sly na brusn ps. Napnn a oscilaci lze jednodue sedit. Zklad s', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 0, '26950.48', '28298.00', '121-OES-80CST', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_04a_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8344, 1030, 'Spirlov hrubovac frza V elo (D=16; I=55; S=16; Z=3) RH, DIA potahovan', 'Spirlov hrubovac frza V elo (D=16; I=55; S=16; Z=3) RH, DIA potahovan', '<div style=\\\"caret-color: #000000; color: #000000; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; margin: 0px; font-stretch: normal; font-size: 11px; line-height: normal; font-family: \\\'Lucida Sans\\\';\\\">\\n<div><span style=\\\"font-size: 16px;\\\"><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/nadia.jpg\\\" alt=\\\"\\\" width=\\\"303\\\" height=\\\"92\\\" /></span></div>\\n<div><span style=\\\"font-size: 16px;\\\">DIA Spirlovfrzy:</span></div>\\n<div><span style=\\\"font-size: 16px;\\\">Diamantovpovlak (DLC) je vsledkem procesu PECVD, kter je jednou z nejnovjch technologi povlakovn. Celkov tlouka povlaku 1 mikron dosahuje velmi odolnho povrchu a nekorozn prosted. Z provedench test vyplvaj velmi dobr vsledky, kter potvrzuj zv', '_vyr_1030celo.jpg', 0, '6493.65', '7215.00', '195.163.11XTR', '_vyrn_1030celo.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-11-313|2-0-0-0|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-597', NULL, '2021-01-10 15:44:07'),
(8345, 1035, 'Freud LU3D Pilov kotou na lamino a DTD - D300x3,2 d30 Z96 HM', 'Freud LU3D Pilov kotou na lamino a DTD - D300x3,2 d30 Z96 HM', '<p>Pilov kotou Freud s chromovanm povrchem, kter redukuje ulpvn zbytk lepidla a pryskyice na tle kotoue. M ideln tlumc drky vyplnn ervenm polyuretanem pro snen vibrac a hlunosti. Trapzov zuby z extra tvrdho tvrdokovu pro ezn lamina, devotskovch desek a MDF. Vysok ivotnost. Pro pily s pedezem.</p>\\n<p></p>', '_vyr_1035FLU3D.jpg', 0, '1720.00', '2150.00', 'FLU3D0600', '_vyrn_1035FLU3D.jpg', '_vyrp11_1035FLU3D-1.jpg', '_vyrp12_1035FLU3D-2.jpg', '_vyrp13_1035FLU3D-4.jpg', 21, 1, 5, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-419-0-0', NULL, '2021-01-10 15:44:07'),
(8346, 1036, 'Freud LI16 Pedezov Pilov kotou dvoudln - D120x2,8-3,6 d20 Z12+12 HM', 'Freud LI16 Pedezov Pilov kotou dvoudln - D120x2,8-3,6 d20 Z12+12 HM', '<p>Pedezov pilov kotou pro ezn oboustrann laminovanch desek (LTD). Pouv se spolu s pilovm kotouem LU3D.</p>\\n<p>Pedezvac pilov kotou - dvoudln - pro doclen vy kvality ezu na spodn ploe oboustrann povrchov upravovanch materil. (Laminovan devotskov desky apod.) Pro formtovac pily bez monosti vkovho nastaven pedezovho zazen. Maximln hloubka ezu 2 mm. Proez pedezovho kotoue se nastavuje pomoc distannch krouk. Doporuen nastaven proezu je o cca 0,3 mm vt ne proez formtovacho kotoue.<br /><br />ka zubu: 2,8 - 3,6 mm.<br />Zuby: hel ela 11.</p>', '_vyr_1036FLI16.jpg', 0, '1376.00', '1720.00', 'FLI16MAA3', '_vyrn_1036FLI16.jpg', '101456_1036__vyrp11_537C28970020H-1.jpeg', '', '', 21, 1, 1, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|2-2-21-357|7-0-0-0|7-419-0-0', NULL, '2021-01-10 15:44:07'),
