(8378, 1071, 'Virutex Olepovaka hran 1500W', 'Virutex Olepovaka hran 1500W, rm max. 40,5mm, min. 4,5mm', '<p><span style=\\\"font-family: verdana, geneva;\\\"><strong>Olepovaka hran</strong></span></p>\\n<p><span style=\\\"padding: 0px; margin: auto; border: 0px; outline: 0px; font-weight: normal; font-style: normal; font-size: 14px; font-family: verdana, geneva; vertical-align: baseline; caret-color: #000000; color: #000000; font-variant-caps: normal; letter-spacing: normal; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none;\\\">Olepovaka je urena pro lamino hranu snanesenm lepidlem. Umouje olepovn rovnch itvarovch dlc anavc ivystouplch falc. as naht je men ne 1minuta. M integrovan nky na odstihnut psky, staviteln kletiny na rzn tlouky desek. Protoe konstrukce tohoto strojku je velmi lehk aergonomick, pracuje se snm snadno i po deldobu. M speciln reimy pro olepen rmu dve a olepen hornho povrchu se tymi monostmi o', '_vyr_1071AG98E_AG98E.jpg', 0, '7187.00', '7986.00', 'AG98E', '_vyrn_1071AG98E_AG98E.jpg', '_vyrp11_1071AG98E_ag98ed1.jpg', '_vyrp12_1071AG98E_ag98ed2.jpg', '_vyrp13_1071ag98fil1-1.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:08'),
