(8391, 1086, 'Virutex PC81U Multifunkn svrka', 'Virutex PC81U Multifunkn svrka', '<div>Multifunkn svrku vyuijete na uchycen, pitlaen hrany na rovnou nebo zakivenou desku. Mete ji tak pout jako hlovou svrku, anebo k peprav. Siln hlinkov tlo svrky je vybaven protiskluzovou rukojet a pogumovanmi ptlaky pro prci s jemnmi povrchy.</div>\\n<div></div>\\n<div></div>\\n<div><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICK SPECIFIKACE:</span></div>\\n<ul>\\n<li>ka materilu k uchycen: 0-46 mm</li>\\n<li>Hmotnost: 0,65 kg</li>\\n</ul>\\n<div>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono', '_vyr_10863479.jpg', 0, '1957.00', '2175.00', 'PC81U', '_vyrn_10863479.jpg', '', '', '', 21, 1, 1, 1, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:08'),
(8392, 1087, 'Virutex SVN450 vakuov upnac systm', 'Virutex SVN450 vakuov upnac systm', '<p><strong>SVN450 vakuov upnac systm</strong></p>\\n<p><span lang=\\\"cs\\\">Upnac vakuov systm s monost naklopen pevn sti,sestvajc ze zkladnho modulu SVN250 namontovanho nanaklonn zkladn a distribunm bloku.Dky monosti naklonn stroje je umonno strojn zpracovn roviny i hranbez optovn instalace.Systm je vybaven distribunm blokem, kter umouje pipojen a ty dalch modul SVN470 nebo SVN250, suzavracm ventilem a rychlospojkou pro pipojenk externmu pvodu stlaenho vzduchu.<span>Standardn vybaven zahrnuje svorky ve tvaru psmene L pro mont nstroje na pracovn plochu a sadu tsnicch prvk.Jako voliteln vybaven je mon zakoupit sadu 4 roub (0999102) pro pipevnnk zkladn ikmho modulu.</span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICK SPECIFIKACE:</span></span></p>\\n<ul>\\n<li>Pracuje s kompresorem</li>\\n<li>Nklon stolu: 0 -90 </li>\\n</ul>\\n<p><span style=\\\"text-decoration: ', '_vyr_1087SVN450_SVN450.jpg', 0, '8465.00', '9406.00', 'SVN450', '_vyrn_1087SVN450_SVN450.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:08'),
(8393, 1088, 'Virutex AB111N - Lamelovac frzka 900W', 'Virutex AB111N - Lamelovac frzka 900W', '<p style=\\\"box-sizing: content-box; margin: 0px 0px 0.5em; padding: 0px; line-height: 1.5em; text-align: left; caret-color: #4e4e4e; color: #4e4e4e; font-family: Arial, serif; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; background-repeat: unset unset;\\\"><span style=\\\"font-family: verdana, geneva;\\\">Frzka AB111N je zvlt konstruovan pro snadn a bezpen drkovn desek. Me provdt jakkoliv typ spojen rychle a pesn dky pedn ploce, kter me bt nastavena ve vce a hlu bez pouit nstroj. AB111N pichz vybavena kanlem a vstupem odsvn. Jej pln vybaven transportn kufk ji peduruje pro prci mimo dlnu. </span></p>\\n<p style=\\\"box-sizing: content-box; margin: 0px 0px 0.5em; padding: 0px; line-height: 1.5em; text-a', '_vyr_1088AB111N.jpg', 0, '8165.00', '8595.00', 'AB111N', '_vyrn_1088AB111N.jpg', '_vyrp11_1088AB111N2.jpg', '_vyrp12_1088AB111N3.jpg', '_vyrp13_1088AB111N5.jpg', 21, 1, 1, 1, '', 0, '3-480-828-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:08'),
