(8406, 1132, 'CAUL falcovac iletkov frza 125x30x30 Z4+4', 'CAUL falcovac iletkov frza 125x30x30 Z4+4', '<p>Frzovac hlava pro spojovn a drkovn.<br />Hladk povrchov prava a dlouh ivotnost dky HW iletkm.</p>\\n<p>Frzovac hlava pro pouit pi drkovn a dalcovn.<br />Konstrukce s vmnnmi bity uloenmi axiln, pedezov noe.<br />Pevn, stabiln ocelov tlo zaruuje dlouhou ivotnost profesionlnho nstroje.<br />ist ez.</p>', '_vyr_1132TB-01-1.png', 0, '3400.00', '4250.00', 'TB0101 ', '_vyrn_1132TB-01-1.png', '_vyrp11_1132TB-01-2.png', '_vyrp12_1132TB-01-3.png', '_vyrp13_1132TB-01-4.png', 21, 1, 1, 0, '', 0, '2-3-29-0|2-3-0-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:08'),
(8407, 1133, 'CAUL frzovac hlava, srovnvac a hoblovac 100x110x30 Z30', 'CAUL 100x110x30 Z30', '<p>Stdav HW bity pro rychl a velk odstrann materilu s perfektn povrchovou pravou.</p>\\n<p>Noe jsou speciln uspodn pro snadn nastaven a usazen v lku frzovac halyvy.</p>\\n<p>POUIT:<br />Hlava je vyroben z masivnho ocelovho tla, je urena pro vkonnostn hoblovn povrchu masivnho deva. Uspodn iletek umouje br velkho mnostv materilu. <br />Ureno pro strojn obrbn v profesionlnch strojch.</p>\\n<p>Max otky 10 500 ot/min.</p>', '_vyr_1133TP10-1.png', 0, '12092.00', '15115.00', 'TP1001', '_vyrn_1133TP10-1.png', '_vyrp11_1133TP10-2.png', '_vyrp12_1133TP10-3.png', '_vyrp13_1133TP10-4.png', 21, 1, 1, 0, '', 0, '2-3-0-0|2-3-29-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:08'),
