(8410, 1138, 'Hoblovac n 310x35x3 HLS', 'Hoblovac n 310x35x3 HLS', '<p>Pesn hoblovac noe jsou zrukou pesn , rychl a kvalitn prce na Vaich hoblovkch a protahovakch. Jsou vhodn tak pro kombinovan stroje. Nae hoblovac noe jsou vyrobeny pouze z jakostnch ocel a broueny s maximln pelivost tak, aby splovali nejpsnj kritria jakosti. Naobrbn devnch desek a hranol, na mkk devo</p>', '_vyr_1138hoblovaci-nuz-310x35x3-5811-hls-original.jpg', 0, '274.00', '395.00', '', '_vyrn_1138hoblovaci-nuz-310x35x3-5811-hls-original.jpg', '_vyrp11_1138hoblovaci-nuz-310x35x3-5811-hls-original.jpg', '_vyrp12_1138hoblovaci-nuz-310x35x3-5811-hls-original-2.jpg', '', 21, 1, 1, 1, '', 0, '2-0-0-0', NULL, '2021-01-10 15:44:08'),
