(8475, 1205, '2TTgf Drkovac frza se upnnm M12 - D18x25 L63 S=M12x1 HW', '2TTgf Drkovac frza se upnnm M12 - D18x25 L63 S=M12x1 HW', '<p>- Ureno pro kovn na bezfalcov dvee</p>\\n<p>- Ideln pro vrobu otvor pro kovn Tectus, BACA PROTECT</p>\\n<p>- HW bity pro maximln vdr a vkon</p>\\n<p>Drkovac frza se zvitovm upnnm je ideln pro frzovn hlubokch otvor, zvs na bezfalcovch dvech pomoc ablony a jinho stavebnho kovn napklad znaku Tectus. Tato frza se umst na unaec stopku dky zvitu M12x1 a dky unaes stopce je mon nstroj prodlouit na celkovou dlku a 132 mm. Dky HW bitm jsou vhodn na masiv, devn kompozity, plasty a laminty. Me bt pouvna na obrbn v CNC frzch a runch frzkch. Upnac stopku pro upnut v kletin je nutno objednat zvl.</p>\\n<p>- Tectus 210/240 - Prmr nstroje 16mm, ezn hloubka 25mm nebo 35mm</p>\\n<p>- Tectus 310/340 - Prmr nstroje 24mm, ezn hloubka 25mm nebo 35mm</p>\\n<p>- BAKA PROTECT 3D - Prmr nstroje 20mm, ezn hloubka 25mm nebo 35mm</p>', '_vyr_106GZ-2TTgf-1,jpg', 0, '1012.50', '1125.00', 'GZ1140', '_vyrn_106GZ-2TTgf-1,jpg', '', '', '', 21, 1, 2, 0, '', 0, '0-0-0-0', NULL, '2021-01-10 15:44:08'),
