(8588, 1319, '8PB Frza na vpln - D65x17 S=12 HW', '8PB Frza na vpln - D65x17 S=812 HW', '<p>POZOR: Frzy pouvejte pi nich otkch mezi 10000 a12000 ot./min. Pro bezpen apesn dosaen poadovanho profilu doporuujeme ti a pt prchod. Vkon frzky mus bt nejmn 1500W.<br /><br />Pouit: Pro vrobu vpln dvek, dve azsuvkovch el. Nutno pout frzovac stolek. Doporuujeme n frzovac stolek, kter byl testovn pro toto pouit.</p>', '_vyr_658PB-web.jpg', 0, '1840.00', '2300.00', 'GZ1796', '_vyrn_658PB-web.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|7-0-0-0|7-422-0-0|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:09'),
