(8590, 1329, 'Pedezov kotou konick Freud - D150x4,3 d45 Z36 ', 'Pedezov kotou konick Freud - D150x4,3 d45 Z36 ', '<p>TCT Kruhov epel pro bodov pekliky, vcevrstv, devotskov, laminovan a bi-laminovan panely.</p>\\n<p>Pouv se na panelovch strojch s monost nastaven vetena vertikln, v kombinaci s velikost pilovho kotoue.</p>', '_vyr_13312.jpg', 0, '1149.00', '1436.00', '', '_vyrn_13312.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-0-0-0|2-7-0-0|2-7-47-0', NULL, '2021-01-10 15:44:09'),
(8591, 1334, 'Univerzln frzovac hlava 120x52x30 2z 3560 OCEL/MAN', 'Univerzln frzovac hlava 120x52x30 2z 3560 OCEL/MAN', '<p>Tlo nstroje je vyrobeno zkvalitn oceli. Frza je vybavena upnacm systmem pro profilov noe a omezovae, kter umouj bezpen run posuv (MAN) materilu do ezu. Euro upnac systm zajiuje perfektn a pesn upnut<a href=\\\"https://www.pilanamarket.cz/noze/profilove-noze/\\\">no 40 x 4mm a50 x 4mm aomezova</a>.</p>\\n<p><strong>Parametry:</strong></p>\\n<ul>\\n<li>Otky 51007400 ot./min.,</li>\\n<li>run posuv materilu MAN</li>\\n<li>pro 2 profilov noe a 2 omezovae</li>\\n<li>upnac prmr d=30mm.</li>\\n</ul>\\n<p><strong>Noe a omezovae nejsou soust dodvky a objednvaj se zvl!</strong></p>', '_vyr_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', 0, '1338.00', '1410.00', '', '_vyrn_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', '_vyrp11_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', '_vyrp12_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original--1.jpg', '', 21, 1, 1, 1, '', 0, '2-3-291-0|2-0-0-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:09'),
(8592, 1335, 'Univerzln frzovac hlava Vapos 100x40x30 4z OCEL/MAN', 'Univerzln frzovac hlava Vapos 100x40x30 4z OCEL/MAN', '<p>Tlo nstroje je vyrobeno zkvalitn oceli. Frza je vybavena upnacm systmem pro profilov noe a omezovae, kter umouj bezpen run posuv (MAN) materilu do ezu. Euro upnac systm zajiuje perfektn a pesn upnut<a href=\\\"https://www.pilanamarket.cz/noze/profilove-noze/\\\">no 40 x 4mm a50 x 4mm aomezova</a>.</p>\\n<p><strong>Parametry:</strong></p>\\n<ul>\\n<li>Otky 51007400 ot./min.,</li>\\n<li>run posuv materilu MAN</li>\\n<li>pro 4 profilov noe a 4 omezovae</li>\\n<li>upnac prmr d=30mm.</li>\\n</ul>\\n<p><strong>Noe a omezovae nejsou soust dodvky a objednvaj se zvl!</strong></p>', '_vyr_1337bezpecnostni-frez-hlava.jpg', 0, '2199.00', '0.00', '', '_vyrn_1337bezpecnostni-frez-hlava.jpg', '_vyrp11_133727802-0-univerzalni-frezovaci-hlava-na-vymenne-noze.jpg', '_vyrp12_1337univerzalni-frezovaci-hlava-120x52x30-4z-3560-4-ocel-mec-original.jpg', '', 21, 1, 1, 1, '', 0, '2-3-291-0|2-0-0-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:09'),
(8593, 1336, 'Pokosov pila STACO 560mm', 'Pokosov pila STACO 560mm', '<pre id=\\\"tw-target-text\\\" class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Peklad\\\" data-fulltext=\\\"&quot;\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\" tabindex=\\\"0\\\">Pokosov pila se stolem z odlitku a nastavitelnou pokosnic.\\n\\nSe speciln vytvrzenou vymnitelnou epel s extra jemnmi univerzlnmi zuby a roubem <br />s rozprnm epem pro snadnou vmnu epele a pro zajitn pesnho ezu.\\n\\nRychl upnut materilu pomoc rychloupnacho systmu.\\n\\nNastaven hl pokosnice po 5 v hlech 45, 55, 60, 70, 75, 90, -75, -70, -60, -55 a - 45 stup.<br /><br /></span></pre>', '_vyr_133871-zTMYcNgL-_SX450_.jpg', 0, '1125.00', '1250.00', '', '_vyrn_133871-zTMYcNgL-_SX450_.jpg', '', '', '', 21, 1, 1, 1, '', 0, '4-109-0-0|4-0-0-0', NULL, '2021-01-10 15:44:09'),
(8594, 1337, 'Bezdrtov nabjeka MINIBATT Fi80', 'Bezdrtov nabjeka MINIBATT Fi80', '<pre class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Peklad\\\" data-fulltext=\\\"\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\" tabindex=\\\"0\\\">MINIBATT Fi80 je prvn bezdrtov nabjeka bateri s technologi Medium Power, <br />dky tomu instalace me bt viditeln nebo neviditeln, v jakmkoliv nbytku nebo pracovnm stole, <br />pro nabjen vech typ zazen 5V a 9V. Snadn a rychl instalace. <br />Balen neobsahuje napjec adaptr, kter je teba objednat zvl. <br /><br />Technick specifikace<br /></span></pre>\\n<ul>\\n<li>Druh Cvky: Single Coil QI STANDARD: Version 1.2</li>\\n<li>Metoda nabjen: One by One</li>\\n<li>Vstupn napt: 5 V  9 V</li>\\n<li>Vstupn proud: 1.6A max.</li>\\n<li>Bezdrtov vstup: 5W  10W</li>\\n<li>Nabjec vzdlenost: 8-12 mm</li>\\n<li>Efektivnost nabjen: 9 V-80% // 5 V-72%</li>\\n<li>Pracovn frekfence: 110-205KHz</li>\\n<li>Pracovn plocha: 324 mm</li>\\n<li>Rozmry: &#248; 80 x 16 mm</li>\\n<li></li>\\n</ul>', '_vyr_1339fi80-1.jpg', 0, '1266.00', '0.00', '', '_vyrn_1339fi80-1.jpg', '_vyrp11_1339fi80-1.jpg', '_vyrp12_1339fi80-3.jpg', '_vyrp13_1339fi80-3.jpg', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8595, 1338, 'Napjec jednotka pro bezdrtov nabjeky MINIBATT', 'Napjec jednotka pro bezdrtov nabjeky MINIBATT', '<p>Napjec jednotka pro Fi80 bezdrtovou nabjku.</p>', '_vyr_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', 0, '594.00', '0.00', '', '_vyrn_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', '_vyrp11_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', '_vyrp12_1340MB-ADP-1-USB_minibattqc2-jgd5pfva.jpg', '', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8596, 1339, 'Bezdrtov nabjeka MINIBATT FS80 QI ', 'Bezdrtov nabjeka MINIBATT FS80 QI ', '<p>miniBatt Fs80 je stylov bezdrtov nabjeka, kter je integrovna do jakhokoliv kusu nbytku s jednou indukn cvkou</p>\\n<p>a rychlm nabjenm s maximlnm vstupem 10 W, kompatibilnm se vemi bezdrtovmi zazenmi Qi,</p>\\n<p>vetn zazen iPhone 8 / 8plus, iPhone X nebo Samsun</p>\\n<pre id=\\\"tw-target-text\\\" class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Peklad\\\" data-fulltext=\\\"&quot;\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\" tabindex=\\\"0\\\">Video s instalac<br /> <br /><video width=\\\"657\\\" height=\\\"329\\\" controls=\\\"controls\\\">\\n<source src=\\\"http://minibatt.com/wp-content/uploads/downloads/Fs80%20tutorial.mp4\\\" type=\\\"video/mp4\\\" /></video><br /></span></pre>', '_vyr_1341fs80-B.jpg', 0, '1080.00', '0.00', '', '_vyrn_1341fs80-B.jpg', '_vyrp11_1341fs80-B.jpg', '_vyrp12_1341fs80-B2.jpg', '_vyrp13_1341MB-FS80_1.jpg', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8597, 1340, 'Falcovac frza se kmmi zuby Fink 5/4E 125x50x30 ALU', 'Falcovac frza se kmmi zuby Fink 5/4E 125x50x30 ALU', '<p>Frzy jsou osazeny 4 pedezy pro ostr rohy a4 ubracmi ikmmi zuby. Upnac prmr d=30mm. Z Duralu</p>\\n<p></p>\\n<p>ikm zuby 4, pedezy 4, otky 56008000 ot./min., run posuv materilu MAN.</p>', '_vyr_13435-4.jpg', 0, '3825.00', '0.00', '', '_vyrn_13435-4.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-3-0-0|2-3-29-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:09'),
(8598, 1341, 'Vpov frza CAUL 210x12x30 Z2', 'Vpov frza CAUL 210x12x30 Z2', '<p>Pozor pouze ilustran foto, m pouze 2 noe.</p>\\n<p>Profesionln vplov frza Caul se 2 noi. Pro vrobu vpln nbytku, skovch a interirovch dve z tvrdho a mkkho deva.</p>', '_vyr_1344TA_03-800x600.jpg', 0, '10207.00', '11340.00', '', '_vyrn_1344TA_03-800x600.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-3-0-0', NULL, '2021-01-10 15:44:09'),
(8599, 1342, 'Virutex Run hoblk 900W', 'Virutex Run hoblk - 900W 82 mm ', '<p><strong>GR120P Run hoblk</strong></p>\\n<p><span lang=\\\"cs\\\">Stroj uren pro zpracovn dl z masivnho deva se specializac na zpracovn koncovch povrch dve a dalch dl.Charakteristickm rysem tohoto modelu je monost nejen prohlouben, ale tak rozen falcu v jednom bru. Je vybaven elektronickmi systmy pro vestrannost a bezpenost. Vzhledem k promylenmu uspodn ovldacch prvk amonosti vvodu hoblin na obou stranch je stejn vhodn jak pro pravky, tak pro levky.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span></p>\\n<p><span lang=\\\"cs\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li><span lang=\\\"cs\\\">Dvojit izolace</span></li>\\n<li><span lang=\\\"cs\\\">Pkon: 900 W</span></li>\\n<li><span lang=\\\"cs\\\">ka hoblovn: 82 mm</span></li>\\n<li><span lang=\\\"cs\\\">Hloubka bru: 0-4 mm</span></li>\\n<li><span lang=\\\"cs\\\">Max. hloubka drkovn: 25 mm</span></li>\\n<li><span lang=\\\"cs\\\">Rychlost bez zaten: 12500/min</span></li>\\n<li><span', '_vyr_1342gr120p.jpg', 0, '9023.00', '10025.00', 'GR120P', '_vyrn_1342gr120p.jpg', '_vyrp11_1342gr120p_1.jpg', '_vyrp12_1342gr120p_2.jpg', '_vyrp13_1342gr120p_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8600, 1343, 'Virutex Run hoblk 1200W 80 mm', 'Virutex Run hoblk 1200W 80 mm', '<p><strong>CE24E Run hoblk</strong></p>\\n<p>Tento hoblk je uren pro dlouhodobou prci a velkzaten pi nejvych nrocch na kvalitu povrchu. Celkryt tla je vyroben z jednoho segmentu hlinkov slitiny.Plocha hoblku je 455 mm dlouh. Vkon 1 200 Wzajiuje perfektn a bezchybn chod v tchnejnronjch operacch pi nejvtm zaten. Stroj je vybaven otonmi karbidovmi noi a ppojkou k odsvn a je dodvn v praktickm transportnm kufku.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 1200 W</li>\\n<li>ka bru: 80 mm</li>\\n<li>br: 0-3 mm</li>\\n<li>Max. drkovac hloubka: 22 mm</li>\\n<li>Otky: 13100 o/min</li>\\n<li>Vha: 6 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obr', '_vyr_1343ce24e.jpg', 0, '10305.00', '11450.00', 'CE24E', '_vyrn_1343ce24e.jpg', '_vyrp11_1343ce24e_1.jpg', '_vyrp12_1343ce24e_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8601, 1344, 'Virutex Run hoblk 750W 82mm', 'Virutex Run hoblk 750W 82mm', '<p><strong>CE120P Run hoblk</strong></p>\\n<p><span lang=\\\"cs\\\"><span>Hoblk je uren pro zpracovn dl z masivnho deva, m vkonn motor a je vhodn pro prci v dln i na monti.</span></span>Hoblk je vybaven 316 mm dlouhou zkladnou a je perfektn vyven. Krom obvyklch aplikac je speciln konstruovn na srovnvn dve, nebo jinch masivnchdlc. <span lang=\\\"cs\\\">Stejn jako GR120P je hoblk vybaven elektronickmi systmy, jedinenm systmem prohlubovn a roziovnfalcu v jednom zbru, spnaem pro smr vyhazovn hoblin a elektronicky zenm vkonem pi rznch stupnch zaten. Na rozdl od GR120P je hoblkpipevnn na krat zkladnu, co vznamn snilo hmotnost nstroje.</span><span lang=\\\"cs\\\"><span>Pi vvoji hoblku byly obzvlt zohlednny ergonomick poadavky na profesionln pouit.</span></span>Je designovn pro pravky<br />i levky a pedevm pro pohodlnou dlouhodobou prci.<span lang=\\\"cs\\\">Hoblky CE120P a GR120P maj jedinenou sch', '_vyr_1344ce120p.jpg', 0, '6861.00', '7623.00', 'CE120P', '_vyrn_1344ce120p.jpg', '_vyrp11_1344ce120p_1.jpg', '_vyrp12_1344ce120p_2.jpg', '_vyrp13_1344ce120p_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8602, 1345, 'Virutex Run hoblk 700W', 'Virutex Run hoblk 700W', '<p><strong>CE35E Run hoblk</strong></p>\\n<p><span lang=\\\"cs\\\">Charakteristickm rysem tohoto modelu je jeho vysok vkon (700 W) s nzkou hmotnost, dky emu je tento modelideln pro prci v dln i mimo ni. Vysok rychlost oten nstroje v kombinaci se specilnm zpracovnm podeve o dlce 290 mm zajiuje nejvy kvalitu hoblovn. Rovina je vhodn pi prci jednou rukou, m jednoduch a pesn nastaven. Hoblk je vybaven vmnnmi oboustranmi tvrdokovovmi noi, kter pi vmn nepotebuj dal sezen. Stroj m vvod pro pipojen externho vysavae, co udruje pracovn plochu istou a vrazn se tm prodluuje ivotnost stroje. Hoblk je dodvn v pepravn krabici.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICK PARAMETRY:</span></s', '_vyr_1345ce35e.jpg', 0, '5805.00', '6450.00', 'CE35E', '_vyrn_1345ce35e.jpg', '_vyrp11_1345ce35e_1.jpg', '_vyrp12_1345ce35e_2.jpg', '', 21, 1, 3, 1, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8603, 1346, 'Virutex Hoblk na sren hran 700W', 'Virutex Hoblk na sren hran 700W', '<p><strong>CE89E Hoblk na sren hran</strong></p>\\n<p><span lang=\\\"cs\\\">Profesionln, lehk a vkonn hoblk speciln navren pro pravu rohovch zkosen. Dky speciln konstrukcipodeve je hoblk spolehliv zaloen na obrobku a m irokou klu regulace hloubky bru.Standardn dodac sada zahrnuje vymniteln oboustrann tvrdokovov noe, kter pi vmn nevyaduj dal sezen a vstup pro pipojen externho vysavae. To ve je dodvno v praktickm pepravnm kufru.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICK PARAMETRY:</span></span></p>\\n<ul>\\n<li><span lang=\\\"cs\\\">Dvojit izolace</span></li>\\n<li><span lang=\\\"cs\\\">Pkon: 700 W</span></li>\\n<li><span lang=\\\"cs\\\">ka bru (<span>90 ): 25 mm</span></span></li>\\n<li><span lang=\\\"cs\\\"><span>Hloubka bru: 0-12,5 mm</span></span></li>\\n<li>Otky: 16500 o/min</li>\\n<li>Hmotnost: 3,3 kg</li>\\n</ul>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Pek', '_vyr_1346ce89e.jpg', 0, '8458.00', '9398.00', 'CE89E', '_vyrn_1346ce89e.jpg', '_vyrp11_1346ce89e_1.jpg', '_vyrp12_1346ce89e_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8604, 1347, 'Virutex Profilovac frzka 1300W ', 'Virutex Profilovac frzka 1300W ', '<p><strong>FR98H Profilovac frzka</strong></p>\\n<p></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Ureno pro profilovn nosnk a krokv a tak pro simulaci kazetovch strop. <br />Sriov je doplnna dvma sadami frz a odpovdajcmi drky nstroj. <br />Pouitm dalch frz s rznmi profily zskte mnoho tvarovch variant. ka <br />vslednho profilu je nastaviteln v rozsahu 0 - 40 mm. Vodc kolejnice, <br />na kter spov obrobek, se me pohybovat vzhledem k frze. Dky tomu <br />je v zvislosti na sti frzy, na kter se provd zpracovn, mon zskat <br />rzn typy profil. Zazen je vybaveno dvma madly namontovanmi paraleln <br />a navzjem ve stejn rovni, co vm umouje pohodlnou prci na dlouhch <br />nosncch a na svislch prvcch. Dle m horn dradlo pro prci na vodorovnch povrch. <br /></span><span lan', '_vyr_1347fr98h.jpg', 0, '16508.00', '18342.00', 'FR98H', '_vyrn_1347fr98h.jpg', '_vyrp11_1347fr98h_1.jpg', '_vyrp12_1347fr98h_2.jpg', '_vyrp13_1347fr98h_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8605, 1348, 'Virutex Hoblk na srovnvn nklik 1300W ', 'Virutex Hoblk na srovnvn nklik 1300W ', '<p><strong>CE53S Hoblk na srovnvn nklik</strong></p>\\n<p>Speciln hoblk na srovnvn nklik. Je vybaven velkou oprnou plochou usnadujc dren roviny vi srovnvan sti. Obrb velice pesn a je snadno nastaviteln na poadovan br. Dky vkonu 1050 W nedochz k poklesu otek ani pi maximlnm bru a tm je zajitna dokonal kvalita povrchu. Plaz m velkou oprnou plochu, kter zajiuje spolehliv open nstroje a usnaduje prci. Stroj pracuje otonmi tvrdokovovmi noi.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 1050 W</li>\\n<li>ka bru: 55 mm</li>\\n<li>Otky: 11100 o/min</li>\\n<li>Vha 7,7 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virute', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', 0, '10560.00', '11733.00', 'CE53S', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/CE53S_ce53.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8606, 1349, 'Rdiusov hoblk 700W Virutex', 'Rdiusov hoblk 700W Virutex', '<p><strong>CE96H Rdiusov hoblk</strong></p>\\n<p><span lang=\\\"cs\\\">Profesionln hoblk pro hoblovn konvexnch a konkvnch povrch.Charakteristickm rysem tohoto modelu je podeevvyroben z pruinov oceli, kter umouje mnit jej geometriiv zvislosti na polomru zakiven obrobku.Souasnje mon pout hoblk na rovnm povrchu.Ideln pro prci v truhlsk dln, v lodnici nebo v tovrn na sudy.Hoblk je lehk a snadno pouiteln v dln i mimo ni.Dky designovm prvkm podeve mete pi pouit rustiklnch no doshnout efektu rustikln zpracovan plochy.Tento typ zpracovn je zvlt dleit provytven staroitnch interir a pouv se ke zpracovn sloup, strop a dalch prvk vnj vzdoby.Standardn je vybaven vymnitelnmi oboustrannmi tvrdokovovmi noi, kter pi vmn nevyaduj sezen, a adaptrempro pipojen externiho vysavae prachu. Dodv se v pepravnm kufku.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\', '_vyr_1349ce96h.jpg', 0, '9089.00', '10099.00', 'CE96H', '_vyrn_1349ce96h.jpg', '_vyrp11_1349ce96h_1.jpg', '_vyrp12_1349ce96h_2.jpg', '_vyrp13_1349ce96h_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8607, 1350, 'Hoblk DUO 700W Virutex', 'Hoblk DUO 700W Virutex', '<p><strong>CE223X Hoblk DUO</strong></p>\\n<p>Revolun DUO hoblk je zcela nov koncept vybaven vmnnmi vleky. Model je lehk a jednoduch s dvojm elem, dky emu lze nstroj rychle pevst na poadovan typ stroje. Nahrat hoblovac vleek brusnm - bude to trvat jen pr minut - a pokraujte v dokonovacch pracch. Hoblovac nstroj poskytuje vysoce kvalitn hoblovn, zatmco s brusnm vlekem mete pracovat s masivnm devem, umlm kamenem a syntetickmi materily. Hebky uvnit deva ji nejsou nepekonatelnou barirou, protoe budou broueny na stejnou rove jako zbytek povrchu.<span lang=\\\"cs\\\"><span>Pouit brusnho nstroje umouje vyuit hoblku CE223X DUO bhem restaurtorskch prac, napklad pro odstraovnstarch ntr, brouen opravnch vloek, zpracovatelskch materil, kter jsou heterogenn ve struktue, spoj,kde jsou devn vlkna vcesmrn, opravy surfovacch prken, zpracovn palub, trup lod atd.</span></span></p>\\n<pre class=\\\"tw-da', '_vyr_1350ce223x.jpg', 0, '12041.00', '13379.00', 'CE223X', '_vyrn_1350ce223x.jpg', '_vyrp11_1350ce223x_1.jpg', '_vyrp12_1350ce223x_2.jpg', '_vyrp13_1350ce223x_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8608, 1351, 'Run vlcov bruska 700W Virutex', 'Run vlcov bruska 700W Virutex', '<p><strong>CE23N Run vlcov bruska</strong></p>\\n<p><span>Tento nstroj je zvlt inn pro odstraovn starch ntr na velkch plochch.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Dky speciln konstrukci me bruska zpracovvat tenk a kehk obrobky, jako i zpracovvat obrobky kolmo k devnm vlknm bez rizika tpen na vstupu.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Bruska se pouv pro restaurtorsk prce v truhlstv a je speciln navrena pro brouen mkkho a tvrdho deva, pekliky, <br />jako i materil, jako jsou sklenn vlkno, uhlkov vlkno, vinyl a polyester.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Me bt pouita pro brouen konc devotsky ped nanesenm okrajovho materilu.Ideln pro lodnice, bednstv, tesastva jakkoliv ostatn aplikace, vyadujcrovinn brouen. Je lehk,a proto uiten pro prci v dlni mimo n. Je vybavena vmnnmibrusnmi vleky,', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 0, '9216.00', '10240.00', 'CE23N', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE23N_ce23n_d7.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8609, 1352, 'Vlcov bruska na obloukov dlce 700W Virutex', 'Vlcov bruska na obloukov dlce 700W Virutex', '<p><strong>CE123N Vlvov bruska na obloukov dlce</strong></p>\\n<p><span>Nstroj je uren k odstraovn epoxidovch pryskyic, oetovn kombinovanch povrch a materil, jako je Kevlar.Ideln pro lodnice, bednstv, tesastva jakkoliv ostatn aplikace, vyadujcrovinn i obloukov brouen.Charakteristickm rysem tohoto modelu je podeev vyroben z pruinov oceli, kter umouje zmnit jej geometrii v zvislostina polomru zakiven obrobku.Je vybavenavmnnmi brusnmi vleky, kternevyaduj zvltn nastaven. Stroj jetak vybaven pipojenm na odsvn. Je lehk a proto uiten pro prci v dln i mimo ni. Bruska je dodvna v praktickm kufku.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 700 W</li>\\n<li>ka zkladny: 81 mm</li>\\n<li>Otky:', 'https://b2b-itatools.pl:443/Obrazki/CE123N_CE123N v. 2.jpg', 0, '10007.00', '11119.00', 'CE123N', 'https://b2b-itatools.pl:443/Obrazki/CE123N_CE123N v. 2.jpg', '_vyrp11_1352ce123n_1.jpg', '_vyrp12_1352ce123n_2.jpg', '_vyrp13_1352ce123n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8610, 1356, 'Virutex Brusn vleek Zrnit 60 - oxid zirkoniit', 'Virutex Brusn vleek Zrnit 60 - oxid zirkoniit', '<p>Nhradn brusn vleek se zrnitost 60G. Vhodn do brusek CE23N, CE123N, CE223X od firmy Virutex.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', 0, '0.00', '0.00', '2345514', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-504-0', NULL, '2021-01-10 15:44:09'),
(8611, 1357, 'Run psov bruska s odsvnm Virutex ', 'Run psov bruska s odsvnm 1200W Virutex 420 m/min', '<p><strong>LB31EA Run psov bruska s odsvnm</strong></p>\\n<p>Vynikajc, velkoplon a opravdu vkonn psov bruska s integrovanm systmem odsvn prachu. Stroj je uren k hrubmu a stednmu brouen velkch ploch. Velk brusn plocha zvyuje produktivitu a vytv hladk povrch bez nedoucch stop. Pohyb brusnho psu je rovnobn s vlkny, proe se netvo \\\"chloupky\\\", tud jsou dokonovac prace jet jednodu.<span lang=\\\"cs\\\">Bruska jeopatena ztkami z karbid wolframu,aby se zabrnilo rychlmu opotebovn a systmem pro nastaven polohy brusnho psu.Vmna brusnho materilu seprovd bez pdavnho nstroje. Bruska je opatena odsvacm vakem a monost pipojen externho odsvn, kter umouje pracovat obsluze pohodln a vistm prosted, m se prodluuje ivotnost stroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=', '_vyr_1357lb31ea.jpg', 0, '9614.00', '10683.00', 'LB31EA', '_vyrn_1357lb31ea.jpg', '_vyrp11_1357lb31ea_1.jpg', '_vyrp12_1357lb31ea_2.jpg', '_vyrp13_1357lb31ea_3.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8612, 1358, 'Tfzov psov bruska Virutex', 'Tfzov psov bruska 900W Virutex', '<p><strong>AF11 Tfzov psov bruska</strong></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Vysoce vkonn psov bruska s tfzovm asynchronnm motorem vm umon provdt <br />tvrdou prci bez jakchkoli problm s drbou. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Ureno pro hrub a stedn brouen velkch ploch <br />s velkm odstrannm materilu. Pi zmn schmatu zapojen lze stroj pipojit k jednofzov sti.<br /></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Velk nosn plocha zajiuje efektivn odstraovn materilu a zabrauje pokrbn. <br /></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Stroj je vybaven systmem pro nastaven polohy brusnho psu a zarky karbidu wolframu <br />brn pokozen tla stroje pi brouen brusnho psu ped sezenm (po jeho vmn). <br /></span><span lang=\\\"', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 0, '12495.00', '13883.00', 'AF11', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_af11d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_af11d2.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8613, 1359, 'Oscilan bruska Virutex', 'Oscilan bruska Virutex 370W', '<p><strong>LR46L Oscilan bruska</strong></p>\\n<p>Vibran stroj s pmm pohonem je uren pro vysokou kvalitu letn a dokonovacch prac. Vysok vkon a dobr vyven zaruuje poadovanou rove kvality a vyhb se pebrouen. Zanechv hladk povrch bez nedoucch dsledk brouen.Jej ergonomickkonstrukce s neklouzavm povrchemumouje prci bez navy a je lehceovladateln.<span lang=\\\"cs\\\">Modely RTE46L, RTE146L, RT188N, LR46L a LRE46L jsou vybaveny novou innou ochranou loisek proti mikroipm, kter chrn mechanismus ped pokozenm.Speciln podeev zajiuje odolnost proti opoteben. Stroj m nov systm pro odstraovn prachua sbrae prachu,co pomh zvyovat ivotnost abrazivnch materil a umstn sacch otvor umouje pouvat vtinu standardnch brusiv.Stroj je vybaven pedn rukojet, kter slou k spolehlivjmu a pohodlnjmu ovldn nstroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\"', '_vyr_1359rl46l.jpg', 0, '5584.00', '6204.00', 'LR46L', '_vyrn_1359rl46l.jpg', '_vyrp11_1359rl46l_1.jpg', '_vyrp12_1359rl46l_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8614, 1360, 'Mini oscilan bruska s rotac Virutex ', 'Mini oscilan bruska s rotac Virutex 180W', '<p><strong>LRE84H Mini oscilan bruska s rotac</strong></p>\\n<p><span><span lang=\\\"cs\\\">Model pat do tdy lehkch brusek pro letn a dokonovac prce. Dky nzk hmotnosti, ergonomickmu designu a relativn vysokmu vkonu je mon pracovatjednou rukou, co poskytuje pohodl a sniuje nacu obsluhy. Zahrnuje extra zkladnu s delta tvarem pro brusn listy na such zip, take lze stroj pout k oetentko pstupnch povrch, jako jsou rmy, aluzie, atd.Charakteristickm rysem modelu LRE84H je elektronick nastavovac systm, kter umoujezvolit optimlnreim zpracovn pro rzn typy materil, a brzdov systm,kter zabrauje zrychlen pi volnobhu. Pomoc volitelnho disku lze pevst na rotan oscilan brusku. Stroj je vybaven vestavnm systmem pro odtraovn prachu.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span></span></p>\\n<', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 0, '3698.00', '4109.00', 'LRE84H', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_lr84a.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_lr84b.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8615, 1361, 'Vceelov bruska Virutex', 'Vceelov bruska Virutex 180W', '<p><strong>LRT84H Vceelov bruska</strong></p>\\n<p><span lang=\\\"cs\\\"><span>Vceelov stroj pro dokonovn brouen zajiuje vibran a oscilan (excentrick) brusn pohyb. Tento model m k dispozici 3 zkladny. Prvn zkladna (vibran) m tzv. delta-tvar dky nmu lze velice snadno brousit i obtn brousiteln msta jako jsou vnitn rohy, lamely apod. Druh zkladna je kruhov (rotan-vibran) vybaven Velcro systmem. Excentr kombinac dvou pohyb vytv dokonale hladk povrch bez krbanc. Tet zkladna (vibran)m klasickobdlnkov tvar a lze na nj osadit jak Velcro papry tak klasick brusn papr.Dky sv kompaktnosti a nzk hmotnosti lze stroj pouvat i ve svislch oblastech a pi prci nad hlavou. Stroj je vybaven vestavnm systmempro odstraovn prachu a sbraem prachu.Bruska je vybavena elektronickm seizovacm systmem, kter umouje zvolit optimln reim zpracovn pro rzn typy materil, a brzdovm systmem,kter zabrauje petoen nez', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 0, '3826.00', '4251.00', 'LRT84H', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_lrt84haa.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_lrt84hab.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8616, 1363, 'Run excentrick bruska Virutex', 'Run excentrick bruska Virutex 350W ', '<p></p>\\n<p>Vysok vkon a vyvenost tto robustn bruskyumouje uivateli doshnout perfektnch vsledk pibrouen a letn pedevm velkch lakovanch ploch.Vibran-rotan systm zajiuje povrch bez jakchkolinedoucch stop po brouen. Ergonomick designs pednm madlem a neklouzav povrch umouje veliceefektivn a pohodlnou prci. Stroj je vybaven nezbytnouelektronickou regulac otek a brzdou proti petoenstroje pi nezatenm bhu. Tento stroj je vybaven 4mmoscilac, kter je urena pedevm k jemnmu a extrajemnmu brouen povrch urench k letn. Brusn plocha je upnna Velcro systmem. Tyto brusky maj nov systm ochrany proti prachu a integrovansbr prachu, kter umouje pouitstandardnch brusiv a desek. Ergonomick design sprotiskluzovmi povrchy usnaduje prci.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 350 W</li>\\n<li>Prmr kotoue: 150 mm</li>\\n<li>Otky: 4000 - 8000 ot/', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 0, '9370.00', '10411.00', 'RTE46L', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_rte46ld1.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_rte46ld5.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8617, 1364, 'Run excentrick bruska Virutex', 'Run excentrick bruska Virutex 350W', '<p><strong>RTE146L</strong></p>\\n<p>Vysok vkon a vyvenost tto robustn bruskyumouje uivateli doshnout perfektnch vsledk pibrouen a letn pedevm velkch lakovanch ploch.Vibran-rotan systm zajiuje povrch bez jakchkolinedoucch stop po brouen. Ergonomick designs pednm madlem a neklouzav povrch umouje veliceefektivn a pohodlnou prci. Stroj je vybaven nezbytnouelektronickou regulac otek a brzdou proti petoenstroje pi nezatenm bhu. Tento stroj je vybaven 4mmoscilac, kter je urena pedevm k jemnmu a extrajemnmu brouen povrch urench k letn. Brusn plocha je upnna Velcro systmem a stroj je vybaven vestavnm odsvnm.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 350 W</li>\\n<li>Prmr kotoue: 150 mm</li>\\n<li>Otky: 4000 - 8000 ot/min</li>\\n<li>Prmr oscilace: 4 mm</li>\\n<li>Vha: 2,6 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\"', '_vyr_1364RTE146L_RTE146L-v--2.jpg', 0, '5318.00', '5909.00', 'RTE146L', '_vyrn_1364RTE146L_RTE146L-v--2.jpg', '_vyrp11_1364RTE146L_rte84hc.jpg', '_vyrp12_1364RTE146L_rte84hb.jpg', '_vyrp13_1364RTE146L_rte84ha.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8618, 1365, 'Run frzka 750W Virutex', 'Run frzka 750W Virutex', '<p><strong>FR192N Run frzka</strong></p>\\n<p>Lehk frzka na irok pouit od ohraovan hran, pesdrkovn a zahlubovn a po frzovn kruhovcha rovnch drek za pomoci standardnho psluenstv. Je vybavena elektrickm regultorem otek, specilnm systmem, kter pi rznm zaten udruje stejn otky. Soust produktu jsou dva typy nstroje, ppravek na frzovn rovnch a kruhovch drek, vodc loisko a servisn kl.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 750 W</li>\\n<li>Max. velikost nstroje: 25 mm</li>\\n<li>Upnac pouzdro: 6 mm</li>\\n<li>Otky: 14000 - 30000 ot/min</li>\\n<li>Vha: 1,8 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto o', '_vyr_1365fr192n.jpg', 0, '5264.00', '6183.00', 'FR192N', '_vyrn_1365fr192n.jpg', '_vyrp11_1365fr192n_1.jpg', '_vyrp12_1365fr192n_2.jpg', '_vyrp13_1365fr192n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09');
