(8619, 1366, 'Run frzka s otonou hlavou 750W Virutex', 'Run frzka s otonou hlavou 750W Virutex', '<p><span style=\\\"font-size: 16px;\\\"><strong><span style=\\\"font-family: verdana, geneva;\\\">FR292R Run frzka s otonou hlavou</span></strong></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span style=\\\"font-size: 14px;\\\"><span style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Jedin frzka, kter umouje mont podl roviny nebo na konci panelu s pmm <br />nebo hlovm zkosenm bez vmny frzy. Dky jedinenmu sklopnmu a jemnmu <br />seizovacmu systmu vznikaj pi prci s frzkou dal monosti a irok zkladna <br />umouje efektivn zen frzovacho procesu. Frzka je vybavena novm vkonnm <br />motorem (750 W) a elektronickm dicm systmem, kter udruje stle stejn <br />otky i pi vym zaten. M vstup pro pipojen k externmu vysavai, kter zamezuje <br />rozptylu prachu, m prodluuje ivotnost stroje. S naklonnou frzkou je proces prce s <br />konickou frzou leh a vsledk', '_vyr_1366fr292r.jpg', 0, '9023.00', '10025.00', 'FR292R', '_vyrn_1366fr292r.jpg', '_vyrp11_1366fr292r_1.jpg', '_vyrp12_1366fr292r_2.jpg', '_vyrp13_1366fr292r_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8620, 1367, 'Run frzka na hrany 750W Virutex', 'Run frzka na hrany 750W Virutex', '<p><strong>FR156N Run frzka na hrany</strong></p>\\n<p>FR165N je rdiusov ohraovac frzka s pouitm na PVC a dhy. Je vybavena frzou s polomrem 3 mm a loiskem(1140106). Nstroje s jinmi polomry jsou k dostn jako zvltn psluenstv. Frzka m siln motor s elektronickou regulac otek. Dle je vybavena systmem, kter zajist stejn otky pi rznm zaten nstroje. Nstroj je tak osazen ppojkou na odsvn zbytku materilu a temi rznmi oprnmi zkladnami (s otvorem o prmru 20, 30 a 36 mm) pro osazen rznmi nstroji.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Vkon: 750 W</li>\\n<li>Upnac pouzdro: 8 mm</li>\\n<li>Otky: 14000 - 30000 ot/min</li>\\n<li>Vha: 1,6 kgy<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (v', '_vyr_1367fr156n.jpg', 0, '5915.00', '6573.00', 'FR156N', '_vyrn_1367fr156n.jpg', '_vyrp11_1367fr156n_1.jpg', '_vyrp12_1367fr156n_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8621, 1368, 'Frzka na hrany 750W Virutex', 'Frzka na hrany 750W Virutex', '<p><strong>FR256N Frzka na hrany</strong></p>\\n<p></p>\\n<p>Rdiusov ohraovac frzka pro hrany z PVC a dhy. Je vybavena frzou s polomrem 2 mm a loiskem(1140123). Nstroje s jinmi polomry jsou k dostnjako zvltn psluenstv. M siln motora elektronickou regulaci otek. Tak je vybavenasystmem, kter zajist stejn otky motoru pi rznmzaten nstroje. Dle je osazena ppojkou na odsvna temi rznmi oprnmi zkladnami (s otvoremprmru 20, 36 a 30mm) pro osazen strojku rznminstroji. Soust produktu je oezvac hlava s vt plochou a madlem pro lep stabilitu CA56G a pepravn kufk.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span><br />Pkon: 750 W<br />Upnac pouzdro: 8 mm<br />Otky : 14 000  30 000 ot/min<br />Vha: 1,6 Kg</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl ', '_vyr_1368fr256n.jpg', 0, '8072.00', '8969.00', 'FR256N', '_vyrn_1368fr256n.jpg', '_vyrp11_1368fr256n_1.jpg', '_vyrp12_1368fr256n_2.jpg', '_vyrp13_1368fr256n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8622, 1369, 'Horn frzka 1010W Virutex', 'Horn frzka 1010W Virutex', '<p><strong>FR277R Horn frzka</strong></p>\\n<p><strong></strong></p>\\n<p><span>Mlad z hlediska vkonu a nejleh v ad univerzlnch frzek, uren ke zpracovn masivnho deva, devotskovch desek a plast. Konstrukce frzy zajiuje vysokou pesnost a stabilitu zpracovn. Bon draz a seizova hloubky frzovn jsou vybaveny systmy jemnho doladn. Vodic tye jsou uzaveny speciln gumovou vrstvou, kter zabrauje jejich zneitn. Promylen uspodn ovldacch prvk a ergonomick design dradel zaruuj snadn pouvn a bezpenost pracovnk. Pomoc 3 polohov ve se stv snadnj rychl prava frzovn. Ideln stroj pro vspravu suk, prci se ablonou, ezn ep pomoc nstroje PL 11, vytven drek, atd. Stroj m tak vvod s ppojkou k externmu vysavai prachu, piveden na horn st frzky pro lep viditelnost pi prci.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 0, '7021.00', '7801.00', 'FR277R', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_fr277r_d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_fr277r_d3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8623, 1370, 'Ohraovac rohov frzka 750W Virutex', 'Ohraovac rohov frzka 750W Virutex', '<p><strong>FR217S Ohraovac rohov frzka</strong></p>\\n<p>Frzka speciln vytvoen k obrbn vnitnch rdius v mst styku bon plochy se dnem i pdou, a to u produkt z umlho kamene (Corian, Rausolid, atd.). Stroj je vybaven speciln oporou, kter slou k udren konstantn vzdlenosti od bon plochy i k bezpenmu a snadnmu pouit frzky. Frzka je vybavena silnm motorem o 750 W, elektronickou regulac rychlosti a systmem, kter udruje konstantn otky i pi vym zaten. Stroj m tak vvod k pipojen externho vysavae, kter zajiuje ist pracovn prostor, m prodluuje ivotnost stroje. Produkt se prodv s dvma frzami R5 a R10. Upnacm pouzdrem (8 mm) a transportnm kufrem.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span><br />Pkon: 750 W<br />Max. velikost nstroje: 20 mm<br />Upnac pouzdro: 8 mm<br />Otky : 14 000  30 000 ot/min<br />Vha: 1,6 Kg</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobe', '_vyr_1370fr217s.jpg', 0, '10117.00', '11241.00', 'FR217S', '_vyrn_1370fr217s.jpg', '_vyrp11_1370fr217s_1--1.jpg', '_vyrp12_1370fr217s_2.jpg', '_vyrp13_1370fr217s_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8624, 1373, 'Drkovac frzka na okna Virutex', 'Drkovac frzka na okna Virutex', '<p><strong>RA17VB Drkovac frzka na okna</strong></p>\\n<p>Inovovan run frzka uren pro drkovn, vborn pro drkovn novch i starch devnch oken a dve pro instalaci silikonovho tsnn.Vybaven 3mm nstrojem s dvojitou hlavou, dvma vymnitelnmi vodtky, bon plokou, ppojkou na odsvn a pepravnm pouzdrem. Soust balen je drkovac frzka na okna,kombinovan dvoustrann vrtk 3 mm,ploka pro polodrky 45,ploka pro rovn drky,vmnn vodtko,hloubkov midlo,servisn kle,transportn kufk, ve kterm je ve uloeno.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 630 W</li>\\n<li>Upnac kletiny: 6 mm</li>\\n<li>Rychlost bez zaten: 28000/min</li>\\n<li>Hmotnost: 1,95 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ', '_vyr_1373386_imatge_m.jpg', 0, '8791.00', '9767.00', 'RA17VB', '_vyrn_1373386_imatge_m.jpg', '_vyrp11_1373387_imatge_m.jpg', '_vyrp12_1373388_imatge_m.jpg', '_vyrp13_1373389_imatge_m.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8625, 1374, 'Zazen pro ezn okennch rm Virutex ', 'Zazen pro ezn okennch rm Virutex 1700W ', '<p><strong>RV7OU Zazen pro ezn okennch rm</strong></p>\\n<p><span>RV70U je navren pro oezn devnch okennch rm a pro pouit pi obnov nebo vmn celch okennch blok. Pro prci na oknech</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">je stroj vybaven specilnm pilovm listem 30 zub z tvrdokovu a nastavitelnm elnm vedenm, kter se pouv jako nosn zkladna pro ezn.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Zkladn konstrukce umouje zpracovn ve vech tyech rozch.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Nov RV70U usnaduje vmnu oken, zachovv pvodn velikost nebo v je v ppad nutnosti i zvtuje.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Je tak nezbytnm nstrojem pro instalaci hlinkovch nebo devnch oken.<span lang=\\\"cs\\\">V</span><span lang=\\\"cs\\\">e standardn vbav je diamantov ezac kotou uren pro ezn stavebnc materil D.180, eln hran', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 0, '20179.00', '22421.00', 'RV70U', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_maletin_rv70u.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u foto1.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8626, 1376, 'Rohov frzka 750W Virutex ', 'Rohov frzka 750W Virutex ', '<p><strong>FR817T Rohov frzka</strong></p>\\n<p>Frzka se pouv k odfrzovn rdius zstvajcch v rozch po pebrouen parketovch podlah. K frzovn v rozch u osazench desek slou pdavn koprovac zazen, kter je v ele stroje nad frzou a zabrauje pokozen desky. Frzka spluje evropsk standardy, m dvojitou izolaci, regultor otek, vstup tsek a hubici k odsvn tsek. Je dodvna v praktickm<br />pepravnm kufku.</p>\\n<p></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 550 W</li>\\n<li>Otky: 30000 ot/min</li>\\n<li>Vha: 1,9 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run', '_vyr_1376333.jpg', 0, '9575.00', '10639.00', 'FR817T', '_vyrn_1376333.jpg', '_vyrp11_1376327.jpg', '_vyrp12_1376328.jpg', '_vyrp13_1376329.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8627, 1377, 'Kotouov pila Virutex 1200W', 'Kotouov pila Virutex 1200W', '<p><strong>SR74K Kotouov pila</strong></p>\\n<p>Vkonn motor (1 200 W) umouje ezat do hloubky a 51 mm.hel nastaviteln do 45. Hloubkov ezy a sklon lze nastavit pomoc mikrometrickho mtka. Stroj je vybaven tpacm noem, paralelnm vodtkem, ochranou pilovho kotoue a bezpenost proti nhodnmu sputn. Dodvno s ppojkou pro odsvn.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1.200 W</li>\\n<li>Vkon: 1.200 W</li>\\n<li>Prmr kotoue: 153 mm</li>\\n<li>Hloubka ezu 90: 51 mm</li>\\n<li>Hloubka ezu pi 45: 34 mm</li>\\n<li>Rychlost bez zaten: 5.000/min</li>\\n<li>Hmotnost: 3,4 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn op', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 0, '2499.00', '2777.00', 'SR74K', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_sr74kd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_sr74kd2.jpg', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:09'),
(8628, 1378, 'Kotouov pila Virutex 1400W', 'Kotouov pila Virutex 1400W', '<p><strong>SR90J Kotouov pila</strong></p>\\n<p>Kotouov pila SR90J nabz profesionln vjimen vlastnosti z hlediska vkonu, ovladatelnosti a bezpenosti. Dky kompaktn struktue a irok oprn zkladn je pila snadno ovladateln a vhodn pro dlouhodob provoz. Mete provdt ezy do hloubky a 70 mm,s monost regulace hloubky i hlu.Pila je vybavena ochrannm krytem pilovho kotoue s automatickm vratnm mechanismem a vstupem pro pipojen externho vysavae. Tento peliv design m vysokou ergonomickou rove. Soust dodvky je tak velk pomocn rukoje, kter vm umon pracovat v naprosto bezpench podmnkch se stabilitou a komfortem, tvrdokovov kotou a servisn kl.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1.400 W</li>\\n<li>', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 0, '6004.00', '6671.00', 'SR90J', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_sr90jd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_sr90jd2.jpg', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:09'),
(8629, 1379, 'Sklopn pokosov laserov pila Virutex', 'Sklopn pokosov laserov pila 1500W Virutex', '<p><strong>TM33W Sklopn pokosov laserov pila</strong></p>\\n<p>Penosn sklopn pokosov pila s vysokou pesnost i velkou kapacitou ezu pro max. prezy. Pila je vybavena hornm stolem s plynulm nastavenm pro pomocn prce, celkovm bezpenostnm systmem spoutn motoru, pipojenm pro vnj odsvn, blokovacm zazenm pro snadnou vmnu kotoue a hlavu je mon naklopitod 0 do 45. Pila je odhlunna s emenovou transmis se zajitnm napnn. Je vybavena kotouem se 40-ti tvrdokovovmi zuby, prmr 300 mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>pkon: 1.500 W</li>\\n<li>prmr pilovho kotoue: 300 mm</li>\\n<li>rychlost bez zaten: 3700 ot./min</li>\\n<li>hmotnost: 20 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) prod', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', 0, '20406.00', '22673.00', 'TM33W', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/TM33W_portada foll tm33w_1_recortar mesa de madera.jpg', 21, 1, 1, 0, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8630, 1380, 'Sklopn pokosov pila Virutex', 'Sklopn pokosov pila1100W Virutex', '<p><strong>TM43L Sklopn pokosov pila</strong></p>\\n<p><span>Penosn pokosov pila vyznaujc se vysokou frekvenc oten disku, co zajiuje vysoce kvalitn ez. Pouv se ke zpracovn profil deva a MDF hlavn pro vysokou pesnost a jemn ezn. Hlava me bt naklonna pod hlem od 0 do 45. Pila je posazena na otonm stole s hlem natoen od -45 do + 45 s fixac nkolika hl a monost nastaven nestandardnch hl natoen stolu. Souprava obsahuje horn stl s podlnm vedenm.<span lang=\\\"cs\\\">Zabezpeovac systm zahrnuje vestavnou kotouovou brzdu, ochranu proti nhodnmu nastartovn dky proudovmuperuovai napjen a pojistku, kter chrn motor ped peptm, a tak ochranu pilovho kotoue, kter zajiujebezpenost pracovnk.</span></span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1.100 W</li>\\n<li>Rychlost bez zaten: 5 500 / min</li>\\n<li>Prmr pilov', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 0, '20290.00', '22544.00', 'TM43L', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_tm43ld1.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_tm43ld2.jpg', 21, 1, 1, 1, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8631, 1381, 'Sklopn pokosov pila Virutex', 'Sklopn pokosov pila 1200W Virutex', '<p><strong>TM72C Sklopn pokosov pila</strong></p>\\n<p>Velice vkonn a pesn pokosov pila. Proez a 150 mm. Hlava me bt naklonna od 0  do 45 . Je vybavena nastavitelnm hornm stolkem vetn nastavitelnho paralelnho pravtka. Integrovan bezpenostn kryt spolu s elektro-brzdou zajiuje bezpenou prci. Konektor pro extern odsvn prachu. Tvrdokovov pilov list 48Z. Vkonn, pesn a bezpen pila. Soust standardn vbavy je imbus 8 mm, devn doraz, posuvnk, instruktn manul a bezpenostn instrukce.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 1200 W</li>\\n<li>Prmr pilovho kotoue: 300 mm</li>\\n<li>Otky: 3000/min</li>\\n<li>Vha: 30 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obro', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 0, '28958.00', '32176.00', 'TM72C', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_tm72cd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_tm72cd2.jpg', 21, 1, 1, 1, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8632, 1382, 'Virutex Kapovac nky', 'Virutex Kapovac nky, max. tlouka hrany 1,8mm', '<p><strong>Kapovac nky</strong></p>\\n<p>Kapovac nky se pouvaj k lcovmu sthn prodn dhy. Stroj je uren pro stacionrn pouit na pracovnm stole. Velk ka ezu umouje zpracovn obrobku a do ky 145 mm a dky vodcmu pravtku je pesn ezn provdno v hlu 0 - 45.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>ka ezu (90): 145 mm</li>\\n<li>ka ezu do 45: 90 mm</li>\\n<li>Max. hloubka ezu: 1,8 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 0, '9113.00', '10125.00', 'U78', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_u78d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_u78d2.jpg', 21, 1, 1, 0, '', 0, '3-480-490-0', NULL, '2021-01-10 15:44:09'),
(8633, 1383, 'ezaka na lamino Virutex', 'ezaka na lamino Virutex', '<p><strong>CO15L ezaka na lamino</strong></p>\\n<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">ezaka je urena pro zpracovn materilu na psy. Model se vyznauje vysokou rychlost a snadnou obsluhou.<br /> Dky pouit tvrdokovovch no je dosaeno istho ezu bez tsek a odpadu. Stroj je mon pout na plast a prodn dhu.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">K nastaven ky ezanho psu se pouv milimetrov stupnice a samotn sezen se provd ve dvou fzch: pedbn, dky odnmateln matici ve vodicm pravtku, se pravtko rychle pohybuje a potebn velikost se jemn vylad pomoc mikrometrickho roubu.</span><span lang=\\\"cs\\\"><span style=\\\"font-family: verdana, geneva;\\\">Pi pouit zazen pro stacionrn instalaci me bt ezaka namontovna na pracovn stl nebo jinou pracovn plochu.</span><br /><span style=\\\"font-family: verdana, geneva;\\\"> V tomto proveden se n pouv v ppad, kdy je vhodnj pohybovat ', 'https://b2b-itatools.pl:443/Obrazki/CO15L_CO15L.jpg', 0, '2977.00', '3308.00', 'CO15L', 'https://b2b-itatools.pl:443/Obrazki/CO15L_CO15L.jpg', '_vyrp11_1383co15l-1.jpg', '_vyrp12_1383co15l-2.jpg', '_vyrp13_1383co15l-3.jpg', 21, 1, 1, 1, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:09'),
(8634, 1384, 'Zaezvac nky Virutex ', 'Zaezvac nky Virutex ', '<p><strong>MC3 ezac nky</strong></p>\\n<p><span>ezaka je urena pro ezn vech typ PVC profil pro dekoraci interiru, napklad po instalaci okennch blok a rolet. Umouje oznout profil podle dlky, ky nebo dokonce pokosov ezy v jakmkoli hlu bez zbytenho sil. ezaka nevyaduje dnou drbu, m kompaktn rozmry a je pohodln pi peprav, co ji peduruje k pouit nejen v dln, ale i mimo ni.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Max. ka ezu: 120 mm</li>\\n<li>Max. hloubka ezu: 4 mm</li>\\n<li>Hmotnost: 8,5 kg</li>\\n<li>Rozmry: 370 x 270 x 220 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosr', 'https://b2b-itatools.pl:443/Obrazki/MC3_mc33.jpg', 0, '11176.00', '12418.00', 'MC3', 'https://b2b-itatools.pl:443/Obrazki/MC3_mc33.jpg', '_vyrp11_1384mc3-1.jpg', '_vyrp12_1384mc3-2.jpg', '', 21, 1, 1, 1, '', 0, '3-480-490-0', NULL, '2021-01-10 15:44:09'),
(8635, 1385, 'Virutex Mechanick naneka lepidla', 'Virutex Mechanick naneka lepidla, vleek 122mm', '<p><strong>Mechanick naneka lepidla</strong></p>\\n<p>Run naneka lepidla uren pro nanen vinylovho lepidla na velk plochy.Vybaven dorazovm zazenm pro zastaven vtoku lepidla pi uvolnn vleku.<span>Rovn vrobce pichz s podprou, na kterou je naneka odkldna, m udruje pracovn plochu a stroj v istot.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Technick specifikace:</span></p>\\n<ul>\\n<li><span>ka spodnho vlce:</span><span>122 mm</span></li>\\n<li><span>Hmotnost: 1 kg</span></li>\\n</ul>', '_vyr_1385lepidlo1.jpg', 0, '2955.00', '3284.00', 'EM26D', '_vyrn_1385lepidlo1.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM26D_EM26D.jpg', '', '', 21, 1, 1, 1, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8636, 1386, 'Virutex Mechanick naneka lepidla', 'Virutex Mechanick naneka lepidla, nanec vlce o ce 180mm/92mm', '<p><strong>EM125T Mechanick naneka lepidla</strong></p>\\n<p>Run naneka lepidla pro lepen velkch ploch pomoc<br />disperznho lepidla. Je vybavena spouovm uzavracm<br />systmem pro zastaven toku lepidla. Navc je vybavena<br />stojanem pro odkldn naneky a k zachovn istho<br />pracovnho prostoru. Tak je vybavena hornm vlcem<br />pro nanen lepidla na men dlce. Spodn vlec m<br />ku 180 mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Technick parametry:</span></p>\\n<ul>\\n<li>ka spodnho vlce: 180 mm</li>\\n<li>ka hornho vlce: 92 mm</li>\\n<li>hmotnost: 1,4 kg</li>\\n</ul>', '_vyr_1386lepidlo2.jpg', 0, '4451.00', '4945.00', 'EM125T', '_vyrn_1386lepidlo2.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM125T_EM125T.jpg', '', '', 21, 1, 1, 0, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8637, 1387, 'Virutex Mechanick naneka lepidla', 'Virutex Mechanick naneka lepidla 180mm, 2polyuretanov + pnov vleky', '<p><strong>EM 126T Mechanick naneka lepidla</strong></p>\\n<p>Run naneka pro lepen velkch ploch pomoc vinylovho lepidla.<br />Doln ka vlce: 180 mm. Vybavena vypnacm zazenm pro zastaven<br />toku lepidla. Dodv se tak s oporou, pro odloen stroje, m se udruje pracovn<br />plocha a stroj ist. Bez hornho vlce.</p>\\n<p>TECHNICK PARAMETRY:</p>\\n<ul>\\n<li>ka spodnho vlce: 180 mm</li>\\n<li>Hmotnost: 1,4 kg</li>\\n</ul>\\n<p></p>', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', 0, '4222.00', '4691.00', 'EM126T', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', '', '', 21, 1, 1, 1, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8638, 1388, 'Virutex Olepovaka hran', 'Virutex Olepovaka hran 1500W, rm max. 50mm', '<p><strong>Olepovaka hran</strong></p>\\n<p>Olepovaka je urena pro lamino hranu s ji nanesenm lepidlem. Umouje olepovn rovnch i tvarovch dlc. as naht je men ne 1 minuta. M integrovan kapovac nky, staviteln kletiny na rzn tlouky desek. Protoe konstrukce tohoto strojku je velmi lehk a ergonomick, pracuje se s nm velmi snadno i del dobu.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Vkon : 1500W</li>\\n<li>Max. ka olepen: 50mm</li>\\n<li>Dodvka vzduchu: 400l/min</li>\\n<li>Vha: 2,7kg</li>\\n<li>Teplota: I. 300C / II. 525C</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Viru', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 0, '6690.00', '7433.00', 'AG98F', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_ag98fd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_ag98fd2.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8639, 1389, 'Virutex Olepovaka hran', 'Virutex Olepovaka hran 1500W na 1-3mm tlust dhy', '<p><strong>Olepovaka hran</strong></p>\\n<p>Olepovaka hran AG98R je urena k olepovn hran pomoc hran s ji nanesenm lepidlem. Ja uzpsobena k prci s hranou z PVC, polyesteru, melaminu, nebo devnch dh tlouky do 1 mm, ppadn pedem nastihan psky do 3 mm. <span lang=\\\"cs\\\">Me bt pouita pro zpracovn zakivench dl.</span>M staviteln kletiny na rzn tlouky desek, co zajiuje spolehliv obrbn. Dvojit systm podavae hrany dv monost si vybrat neperuenou hranu ky 1 - 50 mm, nebo pout vodtko pro pedezan hrany do ky 25 mm. Protoe konstrukce tohoto strojku je velmi lehk a ergonomick, pracuje se s nm velmi snadno i del dobu.<span lang=\\\"cs\\\">Jako dal zazen se pro zven ivotnosti a zlepen kvality provdn prce je vhodn pout uvolovac aerosol, kter zabrauje pilepen lepidla k pracovnm stem nstroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" d', 'https://b2b-itatools.pl:443/Obrazki/AG98R_AG98R.jpg', 0, '8293.00', '9214.00', 'AG98R', 'https://b2b-itatools.pl:443/Obrazki/AG98R_AG98R.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/AG98R_ag98r_aplacando_cam.jpg', '_vyrp13_1389ag98r-1.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8640, 1390, 'Virutex Olepovaka hran+sada (AG98F, AU93, RC21E)', 'Virutex Olepovaka hran+sada (AG98F, AU93, RC21E)', '<p><strong>AG52F Olepovaka hran+sada (AG98F, AU93, RC21E)</strong></p>\\n<p><span>Sada pro olepovn hran i s kompletnm zaitnm.Soust balen je olepovaka, kter je urena pro lamino hranus ji nanesenm lepidlem. Umouje olepovn rovnch i tvarovch dlc.as naht je mn ne 1 minuta. M integrovan kapovac nkyna odstihnut hrany, staviteln kletiny na rzn tloukydesek. Dle jsou v sad obsaeny run oezvaka a kapovaka.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Pkon: 1500W - 220W</li>\\n<li>Maximln ka hrany (tlouka 1 mm): 50mm</li>\\n<li>Maximln ka hrany (tlouka 3 mm): 25mm</li>\\n<li>Teplota l:300C II:525C</li>\\n<li>Hmotnost: 2,8 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovs', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', 0, '7463.00', '8293.00', 'AG52F', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8641, 1391, 'Virutex Manuln olepovaka', 'Virutex Manuln olepovaka', '<p><strong>PEB200 Manuln olepovaka</strong></p>\\n<p>Penosn manuln olepovaka hran.<span lang=\\\"cs\\\">Stroj je uren pro lepen hran z PVC,ABS, melamin, lemovac plast a prodn dha, pedem naezan na poadovanou dlku.Umouje zpracovat zakiven (konkvn i konvexn), kulat a rovn dly s vkou 10 a 62 mm a tloukouhranovho materilu od 0,4 do 3 mm.<span>Jednoduch a rychl pizpsoben tlouce panelu a hran, jako i automatick podvn hranypomoc vodicho systmu pro polohovn hranovho materilu na lisovacm vlci a motorickm ptlanmvlci, zajiuje rychl a kvalitn lepen hranovho materilu.Nastavovac mechanismus umouje zmnit tlouku nanesen lepic vrstvy.Je to velmi praktick v dln (protoe m schopnost pracovat se zavenm) a na mst, dky velkokapacitn ndobna lepidlo s teflonovm povlakem (Teflon).Model PEB200 nem elektronickou regulaci teploty a posuvu. Stroj je zasln v pepravn tace.</span></span></p>\\n<pre class=\\\"tw-data', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', 0, '38423.00', '42692.00', 'PEB200', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', '_vyrp12_1391peb250-1.jpg', '_vyrp13_1391peb250-4.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8642, 1392, 'Virutex Manuln olepovaka', 'Virutex Manuln olepovaka', '<p><strong>PEB250 Manuln olepovaka</strong></p>\\n<p><span lang=\\\"cs\\\">Olepovaka nov generace s ndobou na lepidlo. Stroj je uren k lepen hran z PVC, ABS, melaminu,lamina a prodn dhy, pedem naezan na poadovanou dlku.Umouje zpracovat zakiven (konkvn i konvexn), kulat a pmoar dly s vkou 10 a 62 mma tloukou hranovy od 0,4 do 3 mm.Stroj je velmi praktick v dln k malosriov vrob i dky tomu, e je schopen pracovat se zavenm.Tomuto modelu olepovaky byl zven obsah ndoby na lepidlo s teflonovm povlakem (Teflon).Jednoduch a rychlpizpsoben tlouce panelu i hran, jako i automatick podvn hranovho materilu pomoc vodichosystmu pro polohovn psky na lisovacm vlci a motorickm ptlanm vlci,zajiuje rychl a kvalitnlepen hrany. Stroj jevybaven elektronickou regulac teploty apostupnm nastavovnm rychlostilepen od 2 do 6 m/min, co vm umon pout ir klu lepidel a zlepit kvalitu lepen.Nastavovac mechan', '_vyr_1392vir-peb250-1-540-1.jpg', 0, '48927.00', '54364.00', 'PEB250', '_vyrn_1392peb250.jpg', '_vyrp11_1392peb250-1.jpg', '_vyrp12_1392peb250-2.jpg', '_vyrp13_1392peb250-3.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8643, 1393, 'Virutex Stl na manuln olepovaky', 'Virutex Stl na manuln olepovaky', '<p><strong>MEB100 Stl na manuln olepovaku</strong></p>\\n<p>Stl na manuln olepovaky umouje<br />snadnj manipulaci s manuln olepovakou.<br />Velk povrch stolu zvyuje monosti prce.<br /><br /></p>', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 0, '6956.00', '7729.00', 'MEB100', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_506.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_507.jpg', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:09'),
(8644, 1394, 'Run oezvaka hran Virutex', 'Run oezvaka hran Virutex do 0,6mm', '<p><strong>AU93 Run oezvaka hran</strong></p>\\n<p>Run oezvaka hran je dvoubit a oezv ob protilehl hrany najednou a to do e 40mm a to bez nutnosti dalch dokonovacch operac. Na vet ku lze pout rozloenou oezvaku na kadou stranu hrany zvl. M snadno vymniteln a velice odoln noe. Pouit je primrn nn opracovn melaminovch hran.</p>\\n<p><span style=\\\"font-family: verdana, geneva;\\\"><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span><br /></span></p>\\n<ul>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. ka hrany: 40 mm</span></li>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. tlouka hrany: 0,6 mm</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj o', 'https://b2b-itatools.pl:443/Obrazki/AU93_AU93.jpg', 0, '309.00', '344.00', 'AU93', 'https://b2b-itatools.pl:443/Obrazki/AU93_AU93.jpg', '_vyrp11_1394au93-1.jpg', '', '', 21, 1, -2, 1, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:09'),
(8645, 1395, 'Cidlina-oezva hran do 1,5mm Virutex', 'Cidlina-oezva hran do 1,5mm Virutex', '<p style=\\\"font-size: 20px;\\\"><strong>RP28 Cidlina-oezva hran</strong></p>\\n<p>Pro dokonovac prce pi olepovn Vme zde nabzme kombinovan nstroj cidliny a oezvae hrany. Poskytuje profesionln proveden, kter odstrauje zbytky lepidla, i nadbytenou hranu. Hranu je mon oezvat do pesahu 1,5 mm. Nstroj je vyroben z vysokopevnostn oceli, dky emu m dlouhou ivotnost.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', '_vyr_1395108_imatge_m.jpg', 0, '603.00', '670.00', 'RP28', '_vyrn_1395108_imatge_m.jpg', '_vyrp11_1395109_imatge_m.jpg', '_vyrp12_1395110_imatge_m.jpg', '', 21, 1, 0, 1, '', 0, '4-497-502-0', NULL, '2021-01-10 15:44:09'),
