(8648, 1398, 'Kapovac klet Virutex', 'Kapovac klet do 3mm a max. ky 55mm', '<p><strong>RC321S Kapovac klet</strong></p>\\n<p>Umouje perfektn, ist a kvalitn zaznut hrany na obou koncch desky. Nen teba dnch dalch dokonovacch operac. Kapovaka je vybavena otonmi noi. Pouv se k zaznut hrany z PVC, melaminu, polyesteru, dhy atd. maximln ky 45mm a tlouky 3mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Max. tlouka hrany pi i 55 mm: 1 mm</li>\\n<li>Max. tlouka hrany pi i 45 mm: 2 mm</li>\\n<li>Max. tlouka hrany pi i 25 mm: 3 mm<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn', '_vyr_1398rc321s.jpg', 0, '2443.00', '2714.00', 'RC321S', '_vyrn_1398rc321s.jpg', '_vyrp11_1398rc321s_hoto1.jpg', '_vyrp12_1398rc321s_hoto2.jpg', '_vyrp13_1398rc321s_hoto3.jpg', 21, 1, 1, 1, '', 0, '3-480-494-0', NULL, '2021-01-10 15:44:09'),
