(8715, 1469, 'Diamantov frzovac hlava 80x30x45 Z3+3 ', 'Diamantov frzovac hlava 80x30x45 Z3+3 ', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Vka bitu PCD 4,5mm</li>\\n<li>Poet naosten 5-6 x</li>\\n<li>Symetrick zuby</li>\\n<li>Aretan drky u hlavnho otvoru 4x8 mm (DKN)</li>\\n<li>Bez vybrn tla</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/dgm.jpg\\\" alt=\\\"\\\" width=\\\"489\\\" height=\\\"89\\\" /></p>\\n<h3>POUIT:</h3>\\n<p>Finln dokonen hrany materilu ped olepovnm hranou nebo nklikem na olepovacch strojch s mechanickm posuvem. Vhodn pro LTD, MDF a DTD.</p>\\n<p></p>\\n<h3>KOMPLETN SPECIFIKACE VECH VROBK V TTO PRODUKTOV AD:</h3>\\n<table border=\\\"5\\\" cellpadding=\\\"6\\\" cellspacing=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td rowspan=\\\"2\\\">\\n<div><strong>D</strong><span></span></div>\\n<div>mm</div>\\n<div><strong></strong></div>\\n</td>\\n<td rowspan=\\\"2\\\">\\n<div><b>F</b></div>\\n<div>mm</div>\\n<div><b></b></div>\\n</td>\\n<td rowspan=\\\"2\\\">\\n<div><b>I</b></div>\\n<div>mm</div>\\n<div><b></b></div>\\n</td>\\n<td rowspan=\\\"2\\\"><strong>Z</strong><strong></strong></td>\\n<td rowspan=\\\"2\\\"><strong>TYP</', '_vyr_1469DGM-080030045-SSA4_DGM-SYM-A_2-ITA.jpg', 0, '12456.90', '12456.90', 'DGM.080030045.SSA4', '_vyrn_1469DGM-080030045-SSA4_DGM-SYM-A_1-ITA.jpg', '_vyrp11_1469DGM-080030045-SSA4_DGM-SYM-A_2-ITA.jpg', '_vyrp12_1469DGM-080030045-SSA4_DGM-SYM-A_1-ITA.jpg', '_vyrp13_1469frolep3.jpg', 21, 1, 2, 4, '', 0, '10-473-0-0|10-0-0-0|10-473-787-0|10-473-787-789', NULL, '2021-01-10 15:44:10'),
(8716, 1472, 'Pedezov kotou dvoudln - D125x2,8-3,6 d20 Z12+12 HW', 'Pedezov kotou dvoudln - D125x2,8-3,6 d20 Z12+12 HW', '<p>Pilov kotou od znaky Stehle vynik nmeckou kvalitou. pikovpedezov dvoudln pilov kotou pro pily s pedezovm agregtem. Je osazen HW zuby z extra tvrdho nmeckho tvrdokovu pro ezn lamina, devotskovch desek, MDF a HPL nebo kompakt. Vysok ivotnost a vdr.</p>', '101456_1472__vyr_68predrez-Stehle.jpg', 0, '1834.00', '2037.00', 'S58110206', '101456_1472__vyrn_68predrez-Stehle.jpg', '101456_1472_101456_68__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:10'),
