(8890, 1674, 'Formtovac pila ABG Basic 220', 'Formtovac pila ABG Basic 220', '<h1 id=\\\"h1-fig\\\">ABG Basic 220</h1>\\n<p>Pevn a stabiln konstrukce rmu a <strong>2 samostatn motory</strong> pro pohon hlavnho kotoue (5HP) a pedezu (0,75HP) jsou spolen s pojezdovm stolem o dlce 2200 mm zkladem formtovacch pil ABG Basic 220. Pln<strong> uspokoj poadavky kad truhlsk dlny</strong> zabvajc se zakzkovou vrobou nbytku, kter pro sv poteby hled doplkov stroj zejmna<strong> na ppravu dlc do rozmru skovch dve a bok</strong>. Pln ji ocen i kad <strong>zanajc truhl</strong>.</p>\\n<p>Pojezdov stl je uloen na<strong> kulikov kleci</strong>, kter se pohybuje ve tveici ocelovch psk. Na tto pile<strong> lze ezat kotouem s maximlnm prmrem 355mm</strong>, pedez m prmr 120 mm. <strong>Hlavn pilov kotou se ot rychlost 4000 ot./min.</strong>, <strong>pedez 8000ot./min</strong>. Maximln proez s kotouem 305 mm je 90mm resp. 62mm pi naklopen na 45<sup>o</sup>, <strong>naklpn a zdvih kotou je', '_vyr_1674basic-260-stin-maly.png', 0, '89900.00', '99900.00', 'ABGBA220', '_vyrn_1674basic-260-stin-maly.png', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-0-0-0|3-62-0-0', NULL, '2021-01-10 15:44:11'),
(8891, 1675, 'Formtovac pila ABG Basic 260', 'Formtovac pila ABG Basic 260', '<h1 id=\\\"h1-fig\\\">Formtovac pila ABG Basic 260</h1>\\n<p>Zkladnm vybavenm <strong>formtovacch pil ABG Basic 260</strong> jsou pevn a stabiln konstrukce rmu,<strong> 2 samostatn motory</strong>, kter pohn hlavn kotou (5 HP) a pedez (0,75 HP), a<strong> pojezdov stl dlouh 2600 mm</strong>. Pstroje se hod do kad dlny zabvajc se vrobou nbytku na zakzku. Jsou vhodn hlavn<strong> k pprav dlc do rozmru skovch dve a bok</strong>. Pily tak ocen zanajc truhli.<br />Ve tveici ocelovch psk se pohybuje<strong> kulikov klec</strong>, na kter je uloen <strong>pojezdov stl</strong>. Hlavn pilov kotou se ot rychlost 4000 ot./min., pedez 8000 ot./min. Mete ezat <strong>kotouem s maximlnm prmrem 355 mm</strong>, <strong>pedez m prmr o velikosti 120 mm</strong>. Maximln proez s kotouem 305 mm je 90 mm (pi naklonn na 45).<strong> Naklpn a zdvih kotou funguje manuln</strong>. Pesnost ezu zajiuje pevn ', '_vyr_1675basic-260-stin-maly--1.png', 0, '99900.00', '109900.00', 'ABGBA260', '_vyrn_1675basic-260-stin-maly--1.png', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-0-0-0|3-62-0-0', NULL, '2021-01-10 15:44:11'),
(8892, 1682, 'Dlabaka Virutex FC116U', 'Dlabaka Virutex FC116U', '<p>Tato dlabaka byla speciln navrena pro rychl a precizn dlaby na dvech a dalch produktech. Dky specilnmu upevovacmu systmu je mon dlabn dve, kter u jsou zaveny, a to bez pokozen okolnho materilu. Rychl men a prava umouj zhotoven nkolikansobnho dlabu v rekordnm ase. Monost vydlabat otvor pro zadlabac zmek je zajitna zmnou bitu. Vhodou je tak velk dlabac hloubka a 125mm.</p>\\n<p></p>\\n<p>Technick informace:</p>\\n<p>Vkon:  1100W</p>\\n<p>Otky:    23.000 ot/m</p>\\n<p>Hloubka dlabu: 0-125mm</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % oprav', '_vyr_1682FC116U_fc116u_bd1.jpg', 0, '27477.00', '30530.00', 'FC116U', '', '_vyrp11_1682FC116U_fc116u_bd1.jpg', '_vyrp12_1682FC116U_fc116u_demo.jpg', '_vyrp13_1682FC116U_fc116u_pta_cerr.jpg', 21, 1, 1, 2, '', 0, '3-480-829-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:11'),
(8893, 1683, 'AKU roubovk Virutex ATB40', '', '<h4><strong>Popis:</strong></h4>\\n<p>Kompaktn, praktick, multifunkn a lehk AKU roubovk, kter Vm usnadn prci mimo dlnu a na montch. Vhodou tohoto roubovku je rychloupnac sklidlo, kter umouje vmnu nstroje bez jakkoli poteby utahovacch kl.<br /><br />roubovk disponuje elektronicky nastavitelnou rychlost s 2 rznmi reimy.</p>\\n<p>roubovk m zabudovan LED svtlo, kter se nachz v pedn sti stroje a umouje optimln osvtlen pracovnho prostoru. Dky tomu lze vrtat a roubovat i v tko osvtlench mstech.</p>\\n<h4></h4>\\n<h4><img src=\\\"https://www.virutex.es/img/productes/158_equipo.jpg?1584435804\\\" alt=\\\" width=\\\" 250=\\\" height=\\\"200\\\" style=\\\"float: right;\\\" /></h4>\\n<h4><strong>Balen:</strong></h4>\\n<p>Soust balen jsou 2 originln Li-Ion baterie a rychlonabjeka. Dky n lze dobt akumultor u <strong>pouze za 1 hodinu.</strong></p>\\n<p>Ve mete pohodln pepravit v penosnm kufku.</p>', '_vyr_1683ATB40_ATB40_mag.jpg', 0, '2228.00', '2475.00', 'ATB40', '', '_vyrp11_1683ATB40_ATB40_mag.jpg', '_vyrp12_1683ATB40_ATB40-en-maletin_mag.jpg', '', 21, 1, 2, 1, '', 0, '3-480-484-0', NULL, '2021-01-10 15:44:11'),
(8894, 1686, 'Horkovzdun pistole Virutex', 'Horkovzdun pistole Virutex PD52X 1500W 300/525 C', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\"><span lang=\\\"cs\\\">Horkovzdun pistole s elektronickou regulac teploty, <span>kter vm umouje pracovat ve dvou teplotnch <br />reimech a pouvat tento nstroj pro irokou klu prac. Je to ideln nstroj pro odstraovn barev a lak. <br /></span></span><span lang=\\\"cs\\\">Je tak vhodn pro tvarovn a svaovn plast, odstraovn obtisk, smrovn vodi, rozmrazovn <br />vodovodnch linek a mnoho dalch! Tento nstroj me pracovat s vtinou psluenstv dostupnch na trhu.<br /></span><br /><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></span></pre>\\n<ul>\\n<li class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\">Pkon: 1500 W</span></li>\\n<li class=\\\"', '_vyr_1686PD52X_PD52X.jpg', 0, '2444.00', '2715.00', 'PD52X', '_vyrn_1686PD52X_PD52X.jpg', '_vyrp11_1686442.jpg', '', '', 21, 1, 2, 1, '', 0, '3-480-496-0', NULL, '2021-01-10 15:44:11'),
(8895, 1687, 'Pmoar pila Virutex ', 'Pmoar pila Virutex 650W', '<p>Vkonn a vysoce pesn profesionln nstroj. Pila je vybavena protiskluzovou rukojet a mechanismem pro vmnu pilovho listu. Stroj zanechv pesn ez bez tsek a to na dev, eleznch i neelznch kovech, plastech, aj. Stroj je vybaven mechanismem, kter umouje naklonnou zkladnu a to v rozsahu<span lang=\\\"cs\\\"><span>0 - 45, jako i elektronickou regulac rychlosti, kter zajiuje bezpenost pracovnka, a vstupem propipojen externho sbrae prachu. Je vhodn pro prci jednou rukou a pro zakiven ezy.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"><span style=\\\"font-family: verdana, geneva;\\\"></span></span></pre>\\n<p><span></span><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Pkon: 650 W</span></li>\\n<li><span>Max. hloubka ezu (devo): 100 mm</span></li>\\n<li><span>Rychlost bez zaten: 500 - 3000/min</spa', '_vyr_1687SC324Y_sc324y.jpg', 0, '5658.00', '6287.00', 'SC324Y', '_vyrn_1687SC324Y_sc324y.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-480-488-0', NULL, '2021-01-10 15:44:11'),
(8896, 1688, 'Virutex SVN250 vakuov upnac systm', 'Virutex SVN250 vakuov upnac systm', '<p><strong>SVN250 vakuov upnac systm</strong></p>\\n<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Ureno pro upevnn obrobk s hladkmi a neporznmi povrchy pomoc vakua. <br />Obrobky zstvaj pevn pipevnn, bez jakchkoli znmek po upnut na jejich povrchu.  <br />Monost opravy velkch i malch kus v rznch polohch.<br />Upevovac sla umouje pohodlnou a snadnou prci.\\nPvod vzduchu se provd pomoc rychlospojky. Dky sv kompaktn velikosti je velmi <br />univerzln a praktick pro prci v dln i mimo ni. Je mon fixovat kusy ve svisl <br />nebo vodorovn poloze. Ideln pro nkolik operac, jako je oez, lamelovn... Sac desku\\nje mon rozdlit na men sekce pomoc sady pryovch spoj dodvanch se zazenm,  <br /><span lang=\\\"cs\\\">co umouje upevnn malch kus .</span>Pomoc nkolika SVN250 je mon opravit velk panely<br', '_vyr_1688SVN250_SVN250.jpg', 0, '2138.00', '2376.00', 'SVN250', '_vyrn_1688SVN250_SVN250.jpg', '_vyrp11_1688SVN250_svn250_f2.jpg', '_vyrp12_1688SVN250_SVN250_vertical.jpg', '', 21, 1, 0, 2, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:11'),
(8897, 1689, 'Vysava Virutex 27L', 'Vysava Virutex 27L', '<p>Profesionln vysava na prach a kapaliny s nzkou hmotnost, dky kter je snadno penosn. Ideln pro prci mimo dlnu nebo pro mal dlny. Speciln uren pro pipojen stroj a elektrickho nad. Dky sv sle umouje prci v pohodlnjch a bezpenjch podmnkch.Je vybaven zsuvkou pro pipojen elektrickho nad a m speciln zapnac systm, kter aktivuje vysava pi zapnut nstroje, kter je zapojen, a zastav jej o nkolik sekund pozdji ne nstroj. Vybaven dvojitm potrubnm pipojenm umoujcm pipojen dvou stroj najednou.</p>\\n<p>TECHNICK SPECIFIKACE:</p>\\n<ul>\\n<li>Pkon: 1.200 W</li>\\n<li>Objem ndoby: 27 l</li>\\n<li>Chlazen: obtok</li>\\n<li>Voda pl. Vac: 2,200 mm. H2O</li>\\n<li>Dodvka vzduchu: 170 m&#179; / h</li>\\n<li>Zsuvka pro pipojen elektrickho nad max .: 1 500 W</li>\\n<li>Dlka kabelu: 8 m</li>\\n<li>Speciln filtr pro jemn prach</li>\\n<li>Polyesterov filtr</li>\\n</ul>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro', '_vyr_168975.jpg', 0, '8984.00', '9982.00', 'AS182K', '_vyrn_168975.jpg', '_vyrp11_168975.jpg', '_vyrp12_1689246.jpg', '_vyrp13_1689247.jpg', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8898, 1690, 'Vysava Virutex 72L 2 motory', 'Vysava Virutex 72L 2 motory', '<p>Profesionln vysava na prach a kapaliny s nzkou hmotnost, dky kter je snadno penosn. Ideln pro prci mimo dlnu nebo pro mal dlny. Speciln uren pro pipojen stroj a elektrickho nad.Dky sv sle umouje prci v pohodlnjch a bezpenjch podmnkch. Je vybaven zsuvkou pro pipojen elektrickho nad a m speciln zapnac systm, kter aktivuje vysava pizapnut nstroje, kter je zapojen, a zastav jej o nkolik sekund pozdji ne nstroj. Vybaven dvojitm potrubnm pipojenm umoujcm pipojen dvou stroj najednou. Vybaven dvma motory s vysokm sacm vkonem.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Pkon: 2.300 W</li>\\n<li>Objem ndoby: 72 l</li>\\n<li>Chlazen: obtok</li>\\n<li>Voda pl. Vac: 2,200 mm. H2O</li>\\n<li>Dodvka vzduchu: 340 m&#179; / h</li>\\n<li>Zsuvka pro pipojen elektrickho nad max .: 2 000 W</li>\\n<li>Dlka kabelu: 8 m</li>\\n<li>Speciln filtr pro jemn prach</li>\\n', '_vyr_169076.jpg', 0, '0.00', '0.00', 'AS382L', '_vyrn_169076.jpg', '101456_1690__vyrp11_168975.jpg', '101456_1690__vyrp12_1689246.jpg', '101456_1690__vyrp13_1689247.jpg', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8899, 1692, 'Vysava Virutex tda M', 'Vysava Virutex tda M', '<p>Sbra prachu na vechny druhy prachu, devn tpky nebo nebezpen minerln materily. Filtr tdy M pro minerln a devn prach MAK&gt; 0,1 mg / m3. Vybaven automatickou tepakou filtru. Dky vysokmu sacmu vkonu umouje prci v pohodlnjch a bezpenjch podmnkch.Vybaven zsuvkou pro pipojen elektrickho nad, m elektronick spna na systmu, kter aktivuje vysava pi zapnut nstroje, kter je k nmu pipojen, a zastav jej o nkolik sekund pozdji ne nstroj, a zastav jej o nkolik sekund pozdji ne nstroj,aby umonil vysavai vyst zbvajc prach ve stroji.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Pkon: 1400 W</li>\\n<li>Zsuvka pro pipojen elektrickho nad max .: 2400 W</li>\\n<li>Objem ndoby: 21 l</li>\\n<li>Dodvka vzduchu: 215 m3 / h</li>\\n<li>Hmotnost: 12 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vr', '_vyr_1692143.jpg', 0, '12356.00', '13729.00', 'ASM582T', '_vyrn_1692143.jpg', '_vyrp11_1692143.jpg', '_vyrp12_1692456.jpg', '_vyrp13_1692457.jpg', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11');
INSERT INTO `products` (`id`, `productId`, `name`, `secondName`, `description`, `picture`, `available`, `price`, `secondPrice`, `productnumber`, `previewPicture`, `gallery0`, `gallery1`, `gallery2`, `vat`, `vatlevel`, `amountInStock`, `avaibilityId`, `ean`, `unsaleable`, `categories`, `changedAt`, `dt`) VALUES
(8900, 1693, 'Virutex Podezvac frzka na dvee ', 'Podezvac frzka na dvee Virutex 1300W', '<p>Speciln navren pro ezn dve, zrubn, zkladnch desek a sokl, je ideln pro instalatry parket nebo jinch podlahovch krytin, jako jsou koberce, keramika atd. Je vybavena vkonnm motorem, kter umouje ist a pesn ez snadno a rychle. Vka a hloubka ezu jsou nastaviteln po milimetrech. Hloubka ezu umouje ezn dve najednou. Zahrnuje hubici pro sbr prachu a trubku pro pipojen k vysavai.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1.300 W</li>\\n<li>Hloubka ezu: 0-47 mm</li>\\n<li>Minimln vka ezu: 8 mm</li>\\n<li>Maximln vka ezu: 35 mm</li>\\n<li>Rychlost bez zaten: 5 000/min</li>\\n<li>Hmotnost: 5,6 kg</li>\\n</ul>\\n<ul>\\n<li style=\\\"list-style-type: none;\\\"></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p><span>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtov', '_vyr_1693RZ270S_RZ270S.jpg', 0, '15740.00', '17488.00', 'RZ270S', '_vyrn_1693RZ270S_RZ270S.jpg', '_vyrp11_1693RZ270S_RZ270S.jpg', '_vyrp12_1693193.jpg', '_vyrp13_1693194.jpg', 21, 1, 2, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8901, 1694, 'Kombinovan frzka Virutex', 'Kombinovan frzka Virutex', '<p>Stroj o nzk hmotnosti navren pro nkolik druh loh. Poskytuje vynikajc povrchovou pravu pi oezvn lamintu.Je velmi uiten pro vrobu vlisk, prci s vysokou stabilitou a pesnost. Ideln pro vytvoen vybrn pro umstn pantpomoc specilnch ablon Virutex.</p>\\n<p>Jeho velk sla mu umouje vyrbt falc na dvech nebo oknech se specifickm volitelnm bitem. Monost snadnho a pesnho proveden pravch nebo kruhovch slot s pouze psluenstvm, kter je soust standardn vbavy. FR192N je vybaven vkonnm motorem a elektronickou regulac otek, pro nastaven konstanty rychlosti nezvisle na pracovnm zaten.<span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malos', '_vyr_169433.jpg', 0, '6236.00', '6929.00', 'FR192VG', '', '_vyrp11_169433.jpg', '_vyrp12_169477.jpg', '_vyrp13_169478.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8902, 1695, 'Ponorn pila Virutex', 'Ponorn pila Virutex', '<p><span>Sada je urena pro pesn ezn devotsky. Design pily je siln a ergonomick, co dv spoustu monost vyuit stroje. Absence tsek bhem ezn je mon doshnout pouitm psky proti tpen na vodic kolejnici. Pila je namontovna na vodic litu, po kter kloue bez pdavnho vybaven a excentricita v zkladn pily vm umouje zvolit mezeru pi instalaci pily na litu, co je nezbytn pro zajitn striktn rovnho ezu.<span lang=\\\"cs\\\">Je teba poznamenat, e vodic pneumatika m krom psky proti tpen dv protiskluzov psky a technologick drkypro spojen dvou vodtek nebo pipojen vodtka k dlci pomoc svorek ve tvaru psmene L nebo membrnovchpsavek.Vkonn motor umouje ezat rzn typy materil obrobku. Pila je vybavena automatickm resetovacm ochrannm systmema systmem mkkho startu, rychlou brzdou pilovho kotoue, dorazem vetena, specilnm zazenm usnadujcm vmnupilovho kotoue a nastavenm hloubky ezu, adaptrem pro pip', '_vyr_169565.jpg', 0, '8779.00', '9755.00', 'SRI174T', '', '_vyrp11_1695208.jpg', '_vyrp12_1695209.jpg', '_vyrp13_1695210.jpg', 21, 1, 1, 4, '', 0, '3-480-495-0', NULL, '2021-01-10 15:44:11'),
(8903, 1696, 'Elektronick povrchov frzka Virutex', 'Elektronick povrchov frzka Virutex', '<p>Profesionln frzka na devo a plasty, vybaven elektronickm zenm rychlosti a elektronickm systmem, <br />kter udruje rychlost konstantn nezvisle na pracovn zti. Vysok pesnost a stabilita pi smrovn. <br />Rychl nastaven hloubky pomoc 6 pednastavench pozic. Motor o vkonu 1 800 W je vhodn pro tk a nepetrit <br />prce. Ideln pro oezvn hran, koprovn rybinovch sestav (s volitelnm rybinovm nstavcem PL11), <br />vytven zahlouben pro truhlsk kovn atd. Vybaveno jemnm nastavenm hloubky frzovn a bonho plotu <br />(dodv se jako standardn vbava). Blokovac systm hdele motoru pro snadnou vmnu bitu. <br />Je vybavena vvodem odsvn prachu pro ist a bezpen pracovn prostor.</p>\\n<p><span style=\\\"text-decoration: underline;\\\"></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Vkon: 1800 W</li>\\n<li>Upnac kletina: 12 mm</li>\\n<li>Hloubka fr', '_vyr_169644.jpg', 0, '10814.00', '12015.00', 'FRE160P', '', '_vyrp11_1696120.jpg', '_vyrp12_1696121.jpg', '_vyrp13_1696122.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8904, 1697, 'Elektronick frzka COMBI Virutex', 'Elektronick frzka COMBI Virutex', '<p>Elektronick frzka COMBI je multifunkn nstroj s vymnitelnmi frzovacmi a brusnmi hlavami. Vybaveno rychlm nastavenm hloubky pomoc 6 pednastavench pozic. Dle je monost jemnho nastaven hloubky frzovn a bonho plotu. Funkce COMBI umouje prci s odlinmi typy nejen frzovacch hlav, ale tak s hlavami brusnmi. Frzovac hlavy jsou opateny vvodem pro odsvn odebranho materilu.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Pkon: 1000 W</li>\\n<li>Upnac kletina: 8 mm</li>\\n<li>Rychlost bez zaten: 14000 - 27000/min</li>\\n<li>Hmotnost: 3,8 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov', '_vyr_1697144.jpg', 0, '8879.00', '9865.00', 'FR356Z', '', '_vyrp11_1697144.jpg', '_vyrp12_1697458.jpg', '_vyrp13_1697459.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8905, 1699, 'Osten bitu DIA nstroje 1mm', 'Osten bitu diamantovch nstroj 1mm', '<h1 style=\\\"text-align: center;\\\"><strong>Osten bitu DIA nstroje 1mm</strong></h1>\\n<p style=\\\"text-align: center;\\\">Laserov metoda funguje tak, e laser se zam na osten msto a odstran materil , kter nen v dopadu paprsku.<br />Mnostv odebranho materilu zvis na intenzit, pulsn a vlnov dlce laseru, stejn jako na samotnm<br />materilu. Tato oblast absorbuje laser, kter je v dosahu paprsku, m rozkld chemick vazby v dan oblasti.<br />Laserov osten je mnohem innj, spolehlivj a nkladov vhodnj metodou osten DIA bit.</p>\\n<p style=\\\"text-align: center;\\\"></p>\\n<p style=\\\"text-align: center;\\\">Osten se tuje po mm diamantovho pltku.</p>\\n<p style=\\\"text-align: center;\\\">Objednvku upravme podle ostench mm na danm nstroji.</p>\\n<p style=\\\"text-align: center;\\\"></p>\\n<p style=\\\"text-align: center;\\\">Objednejte telefonicky na sle<span></span><strong><span style=\\\"font-size: 16px;\\\">548 226 252</span>,</strong>osobn v na kan', '_vyr_1699Katalog-pro-Didika_Stranka_004_Obraz_0001.jpg', 0, '22.00', '25.00', 'DIA 1', '', '_vyrp11_1699Katalog-pro-Didika_Stranka_004_Obraz_0001.jpg', '_vyrp12_1699Katalog-pro-Didika_Stranka_004_Obraz_0002.jpg', '', 21, 1, 1000, 1, '', 0, '10-0-0-0|18-0-0-0', NULL, '2021-01-10 15:44:11'),
(8906, 1700, 'Virutex Frzka OVVO', 'Virutex Frzka OVVO 1000W', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span><br />Frzka OVVO je speciln navren pro vyznut slot k umstn automatickch konektor OVVO.<br /></span><span>Jej snadn pouit umouje rychlou a pesnou prci. Elektronick nastaven rychlosti umouje prci s rznmi materily. <br />Stroj disponuje jednoduchm nastavenm tlouky i hloubky bru, dky emu umouje nastaven <br />pro nkolik typ spojek bez nutn vmny nstroj. Tento model byl patentovn, proe je jedin na trhu.</span><br /><br /><span style=\\\"text-decoration: underline;\\\">Technick specifikace</span>:</span></pre>\\n<ul>\\n<li><span>Vkonn 1000 W motor s elektronikou pro nastaven rychlosti a udren konstantn rychlosti pod zatenm.</span></li>\\n<li><span>Manuln zasazen frzky pomoc zasouvacch zarek. Nen teba dn dal manipualce.</span></li>\\n<li><span>Monost oezvn v nkol', '_vyr_1700AB181VD_ab181vd-1.jpg', 0, '21899.00', '24332.00', 'AB181VD', '', '', '', '', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8907, 1701, 'Virutex Prmyslov vysava 1200 W 72l', 'Virutex Prmyslov vysava 1200 W 72l', '<p></p>\\n<p>Profesionln vysava na prach a kapaliny s nzkou hmotnost, dky kter je snadno penosn. Ideln pro prci mimo dlnu nebo pro mal dlny. Speciln uren pro pipojen stroj a elektrickho nad. Dky sv sle umouje prci v pohodlnjch a bezpenjch podmnkch. Je vybaven zsuvkou pro pipojen elektrickho nad a m speciln zapnac systm, kter aktivuje vysava pi zapnut nstroje, kter je zapojen, a zastav jej o nkolik sekund pozdji ne nstroj. Vybaven dvojitm potrubnm pipojenm umoujcm pipojen dvou stroj najednou.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Pkon:<span>1.200 W</span></li>\\n<li><span>Objem ndoby: 72 l</span></li>\\n<li><span>Chlazen: obtok</span></li>\\n<li><span>Voda pl. Vac: 2,200 mm. H2O</span></li>\\n<li><span>Dodvka vzduchu: 340 m&#179; / h</span></li>\\n<li><span>Zsuvka pro pipojen elektrickho nad max .: 2 000 W</span></li>\\n<li><span>Dlka kabelu: 8 m</', '_vyr_1701AS282K_AS282K-1.jpg', 0, '12715.00', '14128.00', 'AS282K', '', '', '_vyrp12_1701AS282K_AS282K_demo_Y-1.jpg', '', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8908, 1702, 'Virutex Frzka 1100W', 'Virutex Frzka 1100W', '<h2><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Virutex Frzka</span></h2>\\n<p><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj speciln navren pro tk prce pi frzovn falc. Je mon jej tak pout k obrbn lamintu. Pi pouit smrovac hlavy CA66F je stroj petransformovn na povrchovou frzku. Pi sle motoru o 1100 W je tak vyuit frzky rozeno k frzovn rybinovch spoj podle ablony PL11 i k dalm podobnm pracem</span></p>\\n<div class=\\\"text_producte\\\">\\n<p><span style=\\\"text-decoration: underline;\\\">Technick specifikace:</span></p>\\n<ul>\\n<li class=\\\"subtitol_producte\\\">dvojit izolace</li>\\n<li class=\\\"subtitol_producte\\\">pkon: 1100 W</li>\\n<li class=\\\"subtitol_producte\\\">upnac kletina: 6 mm</li>\\n<li class=\\\"subtitol_producte\\\">rychlost bez zaten:<span>23 000 / min</span></li>\\n<li class=\\\"subtitol_producte\\\"><span>hmotnost: 3,7 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vr', '_vyr_1702AS93_AS93-1.jpg', 0, '6480.00', '7200.00', 'AS93', '', '_vyrp11_1702AS93_as93d4-1.jpg', '_vyrp12_1702AS93_as93d2-1.jpg', '_vyrp13_1702AS93_as93d1-1.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8909, 1703, 'Virutex Prmyslov vysava 1200W such/mokr vysvn', 'Virutex Prmyslov vysava 1200W such/mokr vysvn', '<p><strong>Virutex Prmyslov vysava</strong></p>\\n<p><span lang=\\\"cs\\\">Odoln a kompaktn profesionln vysava na prach a kapaliny.Dky vysokmu sacmu vkonu umouje prci v pohodlnjcha bezpenjch podmnkch.Je vybaven zsuvkou pro pipojen elektrickho nad. Je vybaven elektronickm spnaem, kter aktivuje vysava, pi zapnut nstroje, a zastav se nkolik sekund po pipojenm stroji, aby vysava mohl vyst zbvajcprach ve stroji.Elektronick sezen speciln uren pro rotan oscilan brusky, aby se zabrnilo pilepovn stroje k obrobkubhem brouen v dsledku sacho vkonu.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICK SPECIFIKACE:</span></span></p>\\n<ul>\\n<li>vha: 13 kg</li>\\n<li>vkon: 1200 W</li>\\n<li>kapacita: 25 l</li>\\n<li>pro such a mokr vysvn</li>\\n<li>nen zabudovn automatick isti filtru</li>\\n<li>balen zahrnuje: paprov filtr a ek do vysavae</li>\\n<li>elektrick s: 210 - 240 V / 50 - ', '_vyr_1703ASC682_asc682-1.jpg', 0, '10781.00', '11979.00', 'ASC682', '', '', '', '', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8910, 1704, 'Virutex Automatick ezaka lamintu 180W', 'Virutex Automatick ezaka lamintu 180W', '<p><strong>Automatick ezaka lamintuVirutex </strong></p>\\n<p><span>Umouje ezat prouky z lamintu, plastu, dhy a jinch lehkch nekovovch materil.<span></span>Podvac systm pomoc pohyblivch pryovch vlek a exkluzivn systm ezn pomoc lopatek kol umouje ist ezy bez odpadu.<span></span>Je mon pracovat s lamintovmi deskami vech rozmr dky dobe dimenzovanmu stolu, kter poskytuje dobrou stabilitu pro dokonal ezy.<span></span>Nen nutn dn dal manipulace.</span><span>ezaka je vybavena rozprkami kol, specilnmi pro laminty.<span></span>Je tak vybavena pohyblivm ezacm vodtkem a stupnic pro snadn nastaven e ezn.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>pkon: 0,18 kW</li>\\n<li>rychlost podvn materilu: 13,6 m/min</li>\\n<li>max. tlouka ezu: 1.6 mm</li>\\n<li>min. dlka ezu: 185 mm</li>\\n<li>nastaviteln ka ezu: 16 - 635 mm</li>\\n<li>hmotnost: 44 kg</li>\\', '_vyr_1704CO49K_co49k_2012-1.jpg', 0, '52991.00', '58878.00', 'CO49K', '', '_vyrp11_1704CO49K_co49kd1-1.jpg', '_vyrp12_1704CO49K_co49kd2-1.jpg', '_vyrp13_1704CO49K_co49kdef1-1.jpg', 21, 1, 1, 0, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:11'),
(8911, 1705, 'Virutex Automatick olepovaka hran', 'Virutex Automatick olepovaka hran', '<p><strong>Virutex Automatick olepovaka hran</strong></p>\\n<p><span style=\\\"font-family: verdana, geneva;\\\"><span>Automatick olepovaka je urena pro pouit hrany z PVC, dhy, melaninu, ABS psky(soust 3D a sklennho efektu).Jednofzovou 220-240V olepovaku lze nastavit a uvst do provozu velice rychle.Samotn zahvn zabere pouze 5 minut.Nastaven teploty lepidla je zeno mikroprocesorem, kter zabrauje kolsn teploty.Olepovaka disponuje motorizovanm vlekem pro tlakov lepen, ten zajist dokonal olepovn hran od zatku panelu, dle je vybavena lepicm vlcem s polymerizanm zpracovnm, kter pomh sniovat spotebu lepidla<span lang=\\\"cs\\\">a umouje nanen tavnho lepidla na hrany s 3D a Glassefekty bez rizika pokozen zkladn vrstvy. Je teba si uvdomit, e pro prci shranovmi materily s 3D a Glass efekty se pouvaj speciln nzkoteplotn lepidla</span>..Lepic ndoba je potaen Teflonem pro snadn itn a drbu. Pomoc tto olepovaky', '_vyr_1705EB135_eb135-1.jpg', 0, '256578.00', '285086.00', 'EB135', '_vyrn_1705eb135.jpg', '_vyrp11_1705eb135_photo_3.jpg', '_vyrp12_1705eb135_photo_4.jpg', '_vyrp13_1705eb135_photo_5.jpg', 21, 1, 1, 1, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8912, 1706, 'Virutex Frzka pro mont pant', 'Virutex Frzka pro mont pant', '<p><strong>Virutex Frzka pro mont pant</strong></p>\\n<p>Speciln frzka pro instalaci vech druh zvs na rmy a kdla dve.Snadn mont 3 nebo 4 pant na dvee (vpravo nebo vlevo smr oteven), bez men a znaen.Dvojit hloubka ztky umouje vyvrtat ob hloubky pant zrove bez nutnosti mnit nstavec.Frzka je tak pipravena pro mont jakhokoli tradinho zvsu.</p>\\n<p>Nov a snadno nastaviteln upnac systm udruje frzku dokonale na dvech a rmu, ani by dolo k pokozen jeho povrchu. Mont nstavce je velmi rychl, je pevn a pipraven k pouit stisknutm do vnitku drku.Frzka je vybavena silnm motorem o vkonu 1 000 W, elektronickou regulac rychlosti a elektronickm systmem pro udren konstantn rychlosti pi zaten.</p>\\n<p>Mont skrytch zvsu delch ne 160 mm pouze ve 2 krocch.Mont derovch plech nad 152 mm.Distann sloupky pro drky vy ne 13 mm.</p>\\n<p>Kufk v cen.</p>\\n<p><span style=\\\"text-decoration: underline;\\', '_vyr_1706FR129VB_FR129VB-20v--202-1.jpg', 0, '17470.00', '19411.00', 'FR129VB', '', '_vyrp11_1706163.jpg', '_vyrp12_1706165.jpg', '_vyrp13_1706166.jpg', 21, 1, 1, 1, '', 0, '3-480-829-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:11'),
(8913, 1707, 'Virutex Povrchov frzka 1300W', 'Virutex Povrchov frzka 1300W', '<p><span style=\\\"font-size: 14px;\\\"><strong>Virutex Povrchov frzka</strong></span></p>\\n<p><span style=\\\"font-size: 14px;\\\"><strong></strong></span></p>\\n<p>Mdium v ad frzek, pokud jde o vkon a prakticky nejleh v ad. Je vybavena elektrickm seizovacm systmem, kter umouje zvolit optimln rychlost pro jakkoli druh zpracovvanho materilu a je urena ke zpracovn masivnho deva, devotskovch desek a plast. Konstrukce frzy zajiuje vysokou pesnost a stabilitu zpracovn. Bon draz a seizova hloubky frzovn jsou vybaveny systmem jemnho doladn. Vodc tye jsou uzaveny speciln gumovou vrstvou, kter<span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">zabrauje jejich zneitn. Promylen uspodn ovldacch prvk a ergonomick design dradel zaruuj snadn pouvn a bezpenost pracovnk. Pomoc 3polohov ve se stv snadnj rychl prava hloubky frzovn.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Ideln nst', '_vyr_1707fr278r.jpg', 0, '8143.00', '9048.00', 'FR278R', '_vyrn_1707fr278r.jpg', '_vyrp11_1707fr278r_1.jpg', '_vyrp12_1707fr278r_2.jpg', '_vyrp13_1707fr278r_3.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8914, 1708, 'Virutex Sklopn smrovac frzka 2100W', 'Virutex Sklopn smrovac frzka 2100W', '<div><span style=\\\"font-size: 14px;\\\"></span></div>\\n<div></div>\\n<div><span style=\\\"font-family: verdana, geneva; font-size: 14px;\\\"></span></div>\\n<div><span style=\\\"font-family: verdana, geneva; font-size: 14px;\\\">Profesionln frzka FR317VD je vylepen model se silnjm motorem, vychzejc z pvodn frzky FR317S. Frzka je urena pro prci s<span>materilem Corian<sup></sup>a s podobnmi materily. Je mono ji s vhodou pout jak pro vrobu novch vrobk, tak pro opravy pokozench nebo opotebovanch materl u zkaznka. Pro frzku je mono dokoupit rzn profesionln ppravky a doplky, nap. psavky, vodc pravtka a pod. Stroj je vybaven zarkou pi vertiklnm pohybu, pro frzovn spoj na pracovnch deskch Corian.Frzka disponuje velkou oprnou plochou pro oez hran. Hloubka ezu je mon nastavit s mikroskopickou pesnost. FR317VD je jedin frzka, kter je vybavena hydraulickm tlumiem ve vertiklnm pohybu a otonou hlavici se svislm pohybem. Sous', '_vyr_1708FRE317VD_125-1.jpg', 0, '25304.00', '28116.00', 'FRE317VD', '', '_vyrp11_1708FRE317VD_126-1.jpg', '_vyrp12_1708FRE317VD_127-1.jpg', '_vyrp13_1708FRE317VD_45-1.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8915, 1709, 'Run psov bruska Virutex', 'Run psov bruska 1200W Virutex 420 m/min', '<p><strong>Run psov bruska Virutex</strong></p>\\n<p><span>pikov psov bruska uren pro vyhlazen a hrub i stedn zbrouen velkch ploch.<span></span></span><span>Jej velk brusn plocha zvyuje produktivitu a vytv hladk povrch bez pokrbn.<span>Pohyb brusnch stic je rovnobn s vlkny, proe se netvo \\\"chloupky\\\" a dokonovac operace jsou tud jednodu. Bruska je</span></span><span>opatena ztkami z karbid wolframu, aby se zabrnilo rychlmu opotebovn a systmem pro nastaven polohy brusnho psu. Vmna brusnho materilu se provd bez pdavnho nstroje.<span>Bruska je opatena</span></span><span>ppojkou k vysavai, kter umouje obsluze pracovat pohodln a v istm prosted, m se prodluuje ivotnost stroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIF', '_vyr_1709LB31E_LB31E-20v--202-1.jpg', 0, '8774.00', '9748.00', 'LB31E', '', '_vyrp11_1709LB31E_lb31ed1-1.jpg', '_vyrp12_1709LB31E_lb31ed2-1.jpg', '_vyrp13_1709LB31E_lb31ed3-1.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8916, 1710, 'Run sdrokartonov bruska na nstavci Virutex', 'Sdrokartonov bruska na nstavci Virutex 550W d=225 mm', '<p><span>Ideln bruska pro male umoujc brouen stn a strop.<span></span></span><span>Umouje snadnj, rychlej a mn navn dokonovac prce.<span>Dky sv nzk hmotnosti a e</span></span><span>rgonomickmu designu je prce s touto bruskou o mnoho snaz</span><span>.<span>Relativn nzk hmotnost, promylen</span></span><span>vyven hmotnosti a velk brusn plocha, poskytuje snaz brouen s vysokm vkonem v nkolika rznch hlech. Umstn motoru v blzkosti brusnho kotoue zajiuje plnou kontrolu nad strojem, dky emu jdou pohodln brousit stny i stropy s plnou kontrolou nad manipulac.</span><span><span>Stroj disponuje v</span></span><span>elkou brusnou kapacitou a<span>e</span></span><span>lektronickou regulac rychlosti pro vbr nejvhodnj rychlosti pro brouen povrch a brusn papr a ochranou spnae proti prachu. Dle je soust produktu<span>t</span></span><span>ryska pro sbr prachu s bajonetovm konektorem,<span>trubka na sbr prachu', '_vyr_1710LPC97S_lpc97s_bodegon2-1.jpg', 0, '17260.00', '19178.00', 'LPC97S', '', '_vyrp11_1710LPC97S_lpc97s_estucado-1.jpg', '_vyrp12_1710LPC97S_lpc97s_fig2-1.jpg', '_vyrp13_1710LPC97S_lpc97s_fig8-1.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8917, 1711, 'Run sdrokartonov bruska Virutex', 'Run sdrokartonov bruska Virutex 1200W d=225mm ', '<p><strong>Run sdrokartonov bruska Virutex</strong></p>\\n<p><span>Stroj je zkrcenou verz LPC97S, co je vhodn pi detailnm brouen lehko pstupnch mst. Ideln pro male a dekoratry pro brouen stn a strop.<span>I pi velk brusn kapacit je bruska zkonstruovna tak, aby u</span></span><span>moovaka snadnj, rychlej a mn navnou prci.<span>Je vybavena e</span></span><span>lektronickou regulac rychlosti, co nm dv monost zvolit optimln rychlost v zvislosti na typu oetovanho povrchu i pouitm abrazivnm materilu. Standardn vbava obsahuje trysku pro pipojen hadice k odsavai prachu s b</span><span>ajonetovm konektorem a brusn kotou gr. 80. Stroj je dodvn v praktickm pepravm kufku.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>pkon: 1200 W</li>\\n<li>rychlost bez zaten: 650-1300 ot./min</li>\\n<li>prmr kotoue: 225 mm</li>\\n<li>hmotnost: 3,1 kg</li>\\n</ul>\\n<p><span style', '_vyr_1711LPM97S_lpm97s_bodegon-1.jpg', 0, '9813.00', '10904.00', 'LPM97S', '', '_vyrp11_1711LPM97S_lpm97s_caja-20elec2-1.jpg', '_vyrp12_1711LPM97S_lpm97s_maletin-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8918, 1713, 'Elektronick oscilan bruska Virutex', 'Elektronick oscilan bruska Virutex 370W 4 000-9 800/min', '<h1 style=\\\"text-align: center;\\\"><strong>Elektronick oscilan bruska Virutex</strong></h1>\\n<p style=\\\"text-align: center;\\\">Vysoce vkonn oscilan bruska pro letn a povrchovou pravu.Vkonn a vyven bruska umouje uivateli provdt vysoce kvalitn prci bez nutnosti jakhokoli manulnho zsahu.PUR deska, kter je standardn dodvan, je tm nerozbitn.Mobiln zkladna je vybavena pro pouit se suchm zipem.Tento stroj m nov systm ochrany proti prachu a integrovan sbr prachu, dky ktermu brusiva dle vydr.Dky ergonomickmu designu s protiskluzovmi povrchy a pedn rukojet, je stroj pohodln a prce s nm efektivn.Lze pout standardn brusiva.Zahrnuje elektronick ovldn rychlosti.</p>\\n<table style=\\\"border-color: #000000; margin-left: auto; margin-right: auto;\\\" border=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td>\\n<h3>Pro vrobek od svtov jedniky VIRUTEX:</h3>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kt', '_vyr_1713LRE46L_LRE46L-20v--202-1.jpg', 0, '5987.00', '6652.00', 'LRE46L', '', '_vyrp11_1713LRE46L_lr46ld1-1.jpg', '_vyrp12_1713LRE46L_lre46ld2-1.jpg', '', 21, 1, 4, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8919, 1714, 'Kotouov bruska Virutex', 'Kotouov bruska Virutex 700W d=173 mm', '<h1><strong>Kotouov bruska Virutex</strong></h1>\\n<p><span>Tento nstroj je speciln navren pro letn plech a mramoru.<span></span></span><span>Jeho 700W motor poskytuje dostaten vkon pro nronou prci.<span></span></span><span>Standardn vbava zahrnuje gumov disk a brusn kotou.</span></p>\\n<p>Nhradn brusn kotou si mete prohldnout <strong><a href=\\\"https://www.stopkovefrezy.cz/Brusny-kotouc-zrnitost-120-bez-otvoru-4591020-d1825.htm\\\">zde</a></strong>.</p>\\n<table style=\\\"border-color: #000000;\\\" border=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td>\\n<h3>Pro vrobek od svtov jedniky VIRUTEX:</h3>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez probl', '_vyr_1714PDE446L_PDE446L-20v--202-1.jpg', 0, '7552.00', '8391.00', 'PDE446L', '', '_vyrp11_1714PDE446L_pde446ld1-1.jpg', '_vyrp12_1714PDE446L_pde446ld2-1.jpg', '', 21, 1, 3, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8920, 1715, 'Olepovaka hran Virutex', 'Olepovaka hran Virutex 830W 120/200 C', '<p><strong>Olepovaka hran Virutex</strong></p>\\n<div><span style=\\\"font-size: 14px;\\\">Olepovaka se stacionrnm stolem.Pro PVC, ABS, melaminov, lamintov nebo dhov hrany. Je mon olepit rovn, kulat nebo tvarovan panely.Velmi praktick pro mal vrobn srie, zejmna na rovnch panelech.Snadn ovldn a rychl nastaven.</span><span style=\\\"font-size: 14px;\\\">Stl s prodlouenm elnm vedenm.Snadn nastaven tlouky hrany a panelu.</span><span style=\\\"font-size: 14px;\\\">Elektronick regulace rychlosti a teploty.</span><span style=\\\"font-size: 14px;\\\">Motorick oezvac jednotka pomoc kruhovch no.</span><span style=\\\"font-size: 14px;\\\">Ndr na lepidlo a posuvn zkladna pro psky je pokryta Teflonem pro snadn itn a drbu.</span><span style=\\\"font-size: 14px;\\\">Vybaven drkem vleku a automatickm eznm koncov psky.</span></div>\\n<div><span style=\\\"font-size: 14px;\\\">Olepovaka tak disponuje hornm ptlanm lisem. Soust balen je cidlina.</s', '_vyr_1715PEB250TRM_peb250trm-1.jpg', 0, '110514.00', '122794.00', 'PEB250TRM', '_vyrn_1715peb250trm.jpg', '_vyrp11_1715peb250trm-1.jpg', '_vyrp12_1715peb250trm-2.jpg', '', 21, 1, 1, 1, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8921, 1716, 'Drkovac frzka Virutex', 'Drkovac frza Virutex 1000W', '<p><strong>Drkovac frzka Virutex</strong></p>\\n<p><span>Silnj sestra drkovac frzky RA17VB.</span>Inovovan run frzka uren pro drkovn, vborn pro drkovn novch i starch devnch oken a dve pro instalaci silikonovho tsnn.Vybaven 3mm nstrojem s dvojitou hlavou, dvma vymnitelnmi vodtky, bon plokou, ppojkou na odsvn a pepravnm pouzdrem. Soust balen je drkovac frzka na okna,kombinovan dvoustrann vrtk 3 mm,ploka pro polodrky 45,ploka pro rovn drky,vmnn vodtko,hloubkov midlo,servisn kle,transportn kufk, ve kterm je ve uloeno.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1000 W</li>\\n<li>Upnac kletiny: 6 mm</li>\\n<li>Rychlost bez zaten: 14000 - 30000/min</li>\\n<li>Hmotnost: 1,95 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span>', '_vyr_1716RA17VG_RA17VB-20v--202-1.jpg', 0, '8791.00', '9767.00', 'RA17VG', '_vyrn_1716386_imatge_m.jpg', '_vyrp11_1716387_imatge_m.jpg', '_vyrp12_1716388_imatge_m.jpg', '_vyrp13_1716390_imatge_m.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8922, 1717, 'ezaka zrubn Virutex', 'ezaka zrubn Virutex 1700W 6500/min', '<p><strong>ezaka zrubn Virutex</strong></p>\\n<p><span>ezaka zrubn a okennch rm RMV70S se pouv k oznut rm dve a oken do tlouky 68 mm, co umouje zachovat jejich pvodn velikost.<span></span></span><span>M pilov list z tvrdho kovu, kter velmi rychle ee, zatmco se pohybuje po odnmatelnm vodtku, co zaruuje zen a stabiln ez.<span></span></span><span>Stroj je standardn dodvn s vodtkem pro oznut dvench rm a s psluenstvm potebnm pro oznut okennch rm, co je proces, kter nevyaduje veden, protoe RMV70S m nastavitelnou pedn hranu, kter inn vede stroj pi oezvn rmu.<span></span></span><span>RMV70S pichz s innm externm systmem sbru prachu, pro kter je standardn dodvna sbraka prachu kompatibiln s celou adou sbra prachu Virutex. Ve standardn vbav je ezaka zrubn Virutex, nvod a psluenstv pro oezvn zrubn, pedn hrana prooezvn oken, 30z MD epel pro oezvn deva.Trubice pr', '_vyr_1717rmv70u.jpg', 0, '50813.00', '56458.00', 'RMV70U', '_vyrn_1717rmv70u.jpg', '_vyrp11_1717rmv70u_1.jpg', '_vyrp12_1717rmv70u_2.jpg', '_vyrp13_1717rmv70u_3.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8923, 1718, 'Vertikln bruska Virutex (ne vyberte varianty)', 'Vertikln bruska Virutex 1000W', '<p><strong>Vertikln bruska Virutex</strong></p>\\n<p><span>Vertikln bruska Virutex, opaten upnac kletinou 6 mm je vhodn pro kovov a hrub povrchy.<span>Stroj je standardn pouvnpro odizolovn lemovacch a vstikovacch kanl.</span></span><span>Me bt pouita s vtinou standardnch brusnch doplk na trhu.<span>Bruska disponuje</span></span><span>elektronickou regulac rychlosti.Standardn nen vybavena isticm nstrojem.K dispozici s upnac kletinou &#216; 8 mm (obj. . 5600401)</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojit izolace</li>\\n<li>Pkon: 1000 W</li>\\n<li>Rychlost bez zaten: 14 000-30 000 ot./min</li>\\n<li>Upnac kletina: 6 mm</li>\\n<li>Hmotnost: 1,3 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte ', '_vyr_1718RO156N_RO156N-20v--202-1.jpg', 0, '6192.00', '0.00', 'RO156N', '', '_vyrp11_1718RO156N_ro156n_d1-1.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8924, 1719, 'Excentrick (rotan) bruska Virutex', 'Excentrick (rotan) bruska Virutex 900W (d = 7 mm)', '<p><strong>Rotan bruska Virutex</strong></p>\\n<p><span>Bruska je ideln pro brouen nebo letn devnch nebo kovovch povrch. Je vybavena vkonnm motorem o vkonu 800 W s elektronickm nastavenm rychlosti.<span></span></span><span>Je to nejvkonnj rotan oscilan bruska na trhu.<span></span></span><span>Jej velk sla a dobe vyven konstrukce umouje perfektn brousc vsledky s nzkou rovn vibrac. Oscilace poskytuje vysoce kvalitn brouen a v kombinaci s rotanm oscilanm pohybem zanechv povrchy hladk a bez nerovnosti pipraven pro lakovn i malovn.<span></span></span><span>Elektronick nastaven rychlosti umouje pizpsobit rychlost brouen vzhledem k brouenmu materilu k dosaen tch nejlepch podmnek k brouen. RT188N je profesionln stroj vybaven hlinkovm pouzdrem pevodovky a zakryt plastovm krytem s protiskluznou vrstvou.<span></span></span><span>Je tak vybaven bon rukojet, kterou lze namontovat na ob strany a</span><sp', '_vyr_1719RT188N_RT188N-20v--202-1.jpg', 0, '7851.00', '8723.00', 'RT188N', '', '_vyrp11_1719RT188N_RT188N_d1-1.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8925, 1720, 'Kotouov pila Virutex 1200W', 'Kotouov pila Virutex 1200W  5000/min', '<p><strong>Kotouov pila Virutex </strong></p>\\n<p><span>Kotouov pila s motorem o vkonu 1 200 W umouje ezat a do 55 mm</span><span>hloubky, s hlem ezu nastavitelnm do 45.<span></span></span><span>Hloubkov ezn a sklon jsou nastaviteln pomoc mikrometrick stupnice.<span></span></span><span>Pila je vybavena tak tpacm noem, paralelnm vedenm smru, ochranou pilovho kotoue a bezpenostn pojistkou proti nhodnmu sputn.<span>Pila je dodvna s ppojkou na sbr prachu</span></span><span>.</span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>dvojit izolace</span></li>\\n<li><span>pkon: 1200 W</span></li>\\n<li><span>prmr kotoue: 165 mm</span></li>\\n<li><span>hloubka ezu pi 90: 55 mm</span></li>\\n<li><span>hloubka ezu pi 45: 38 mm</span></li>\\n<li><span>rychlost bez zaten: 4700 ot./min</span></li>\\n<li><span>hmotnost: 4,2 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-dec', '_vyr_1720SR165_SR165-1.jpg', 0, '4455.00', '4950.00', 'SR165', '', '_vyrp11_1720SR165_SR165_a-1.jpg', '_vyrp12_1720SR165_SR165_b-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:11'),
(8926, 1725, 'Kartov bruska Virutex', 'Kartov bruska 1400W ', '<h1 style=\\\"text-align: center;\\\"><strong>Kartov bruska</strong></h1>\\n<p style=\\\"text-align: center;\\\">Run kartovaka ST62 pro pravu povrch deva, kovu a kamene. V rmci produktu je dodvn nylonov vlec, kter je uren k opracovn deva, letn kovu a mramoru. V ppad poteby vyrb firma Virutex serii vlc, kter jsou kompatibiln s tmto strojem, m jej uzpsobuj tak k zaiovn a uhlazovn kovovch povrch (kovov vleek), k sekrabvn starch ntr (vrstven vleek) i k letn nerezov oceli.</p>\\n<p style=\\\"text-align: center;\\\">Siln motor je ped prachem chrnn dvojitm pltm. Stroj dle obsahuje vvod odebranho materilu do externho vysavae, co zachov Vae pracovit v istot a vrazn tm prodloute ivotnost stroje. Tomu tak napomh uzaven kryt karte, kter zvyuje innost odsvn prachu. Dky 2 rychlostnm programm mete upravovat tm jakkoliv povrch. Vhodou tohoto stroje je tak rychl a snadn vmna vleku. Soust', '_vyr_1725_vyr_1508ST62_Satinadora-ST62_mag.jpg', 0, '9467.00', '10519.00', 'ST62', '', '_vyrp11_1725ST62_ST62-1-1.jpg', '', '', 21, 1, 4, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8927, 1726, 'Rohov dlto Virutex', 'Rohov dlto Virutex', '<p style=\\\"font-size: 20px;\\\"><strong>Rohov dlto</strong></p>\\n<p><span>Rohov dlto RC29M umouje ezat hrotem v rohovch stech, kter jste vybrali pro umstn pant, co dv pesn prav hel 90. Lze ezat polomry a 20 mm s hloubkou ezu 6 mm.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', '_vyr_1726RC29M_RC29M-1.jpg', 0, '2648.00', '2942.00', 'RC29M', '', '', '', '', 21, 1, 0, 0, '', 0, '4-497-500-0', NULL, '2021-01-10 15:44:11'),
(8928, 1727, 'Kapovac klet Virutex', 'Kapovac klet Virutex', '<p><span style=\\\"font-size: 14px;\\\">Poskytuje ist a pesnez bez pokozen panelu.Dky dvma upevovacm knoflkm zkracuje pebytek hrany</span>na obou koncch panelu.</p>\\n<p><span style=\\\"font-size: 14px;\\\">Krom ezu v pravch hlech umouje tak ist ez na otevench hlech do 120  a uzaven hly do 45 .</span><br /><span style=\\\"font-size: 14px;\\\">Pro ezn pebytku PVC, ABS, melaminu, dhy atp.</span></p>\\n<p><span style=\\\"font-size: 14px;\\\">Produkt je vybaven epelemi profesionln kvality, kter lze ostit.</span></p>', '_vyr_1727RC421_155-1.jpg', 0, '5729.00', '6366.00', 'RC421', '', '', '', '', 21, 1, 1, 1, '', 0, '4-109-0-0', NULL, '2021-01-10 15:44:11'),
(8929, 1746, 'Olepovaka hran Virutex', 'Olepovaka hran Virutex', '<p><strong>Olepovaka hran Virutex</strong></p>\\n<p><span><span lang=\\\"cs\\\">Stoln olepovaka hran pro obkldn dlcpedlepenou hranou do tlouky 1 mm (PVC, melamin, prodn dha).Snadn obsluha a snadn drba.Velmi rychl pprava na prci - mn ne 2 minuty.Doba zahvn je 30 sekund.Elektronick regulace teploty s integrovanm monitorovacm teplomrem.Automatick oezvn hrany.Nen nutn stlaenvzduch, ani sbra prachu.Je vybaven motorizovanm blokem pro odstraovn podlnch pesah hrany,urenm pro zpracovn rovnchobdlnkovch dlc.Demontujete-li jednotku pro odstrann podlnch pesah,oteve se vm monost lepen hrany nazakiven dlce, ale bez odstrann pesah podl ela.Jako dal zazen ke zven ivotnosti a zlepen kvality provdn prce se doporuuje pout antiadhezivn aerosol,kter zabrauje pilepen lepidla k pracovnm stem stroje.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10c%20retoque%20color.jpg', 0, '94869.00', '105410.00', 'EB10C', '', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10c%20retoque%20color.jpg', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10cd1.jpg', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10cd2.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:11'),
(8930, 1747, 'Automatick olepovaka hran Virutex EB140', '', '<h3><strong>Podrobnosti:</strong></h3>\\n<p>Olepovaka m k dispozici automatick podava psek s pneumatickm ezacm systmem, kter je vybaven tymi gumovmi vleky na pracovn desce, kter zajiuj dostaten ptlak na lepc vlce. Lepc vlce jsou samohybn a jejich nespornou vhodou je dokonal lepen ji od zatku olepovan desky. <em><strong>(Pro zajmavost: Tato technologie nyn ek na vyzen patentu, take pouvte uniktn systm)</strong></em><em><strong></strong></em></p>\\n<h4><strong>Olepovn:</strong></h4>\\n<p>Olepovac stroj je uren pro hrany ve velikosti 3 m, lze ho dle poteby nastavit na poadovan provoz. Dky vysoce kvalitn povrchov prav zamezte nedoucmu opotebovan olepovanho materilu. V rmci ovldn je mon pm nastaven oezvacch bit a vodcho zazen pomoc digitlnch mi.<span>Souasn se d nastavit stroj pro uritou tlouku hrany, vodtka a lepic vlce jedinm digitlnm miem.Stroj um automaticky regulovat teplotu', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20delantera%20abierta.jpg', 0, '334474.00', '371638.00', 'EB140', '_vyrn_1747eb140.jpg', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20delantera%20abierta.jpg', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20display%20tactil.jpg', '_vyrp13_1747eb140-2.jpg', 21, 1, 2, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8931, 1748, 'Automatick olepovaka hran Virutex', 'Automatick olepovaka hran Virutex', '<h3><b>Automatick olepovaka hran</b></h3>\\n<p><span>Olepovaka hran disponuje technologi ZeroLine (olepuje pomoc horkho vzduchu), dky kter je hrana na panel nanesena prakticky dokonale a spoje jsou naprosto hladk.<span></span>Vsledkem tohoto postupu je vysoce kvalitn olepen hran. Vhodou tohoto stroje je tak jeho rychl nastaven a uveden do provozu, kter netrv dle ne <strong>2 minuty</strong>.</span></p>\\n<p><span>Olepovac strojpracuje s PVC a ABS hranami s extrudovanou nebo dodaten zpracovanou aktivn vrstvou a je mon olepovat akryltov a lakovan desky. Lze pout hrany do tlouky 2 mm.</span></p>\\n<p><span>Olepovaka je vybavena automatickm podavaem, o</span><span>ezvac jednotkou s digitlnm nastavenm a<span>m</span>onost ezn s rznm polomrem nebo10 zkosenm.<span></span>Vynikajc povrchov pravy bez zbytk lepidla doshne olepovaka dky dvojit ploch krabce.</span><span><span>Disponuje a</span>utomatickm eznm vpedu a vzadu.</', 'https://b2b-itatools.pl/Obrazki/EB150_153.jpg', 0, '429398.00', '477108.00', 'EB150', '', '_vyrp11_1748EB150-W-3-426x426.jpg', '_vyrp12_1748EB150-W-2-426x426.jpg', '', 21, 1, 4, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8932, 1749, 'Olepovaka Virutex', 'Olepovaka Virutex', '<p><strong>Olepovaka EB25</strong></p>\\n<p><span>Stoln olepovaka pro olepen<span lang=\\\"cs\\\">pravohlch obdlnkovch panel s lemovacmi materily do tlouky 1 mm (PVC, melamin,prodn dha) s pedem nanesenm tavnm lepidlem.Olepovaka disponuje automatickm podvacm systmem a dokeoezvat na obou stranch pomoc motorizovanhorn a spodn ezac jednotky. Tak lze pen oznoutpedn a zadn pesah okrajovho materilu. Olepovaka m snadnou obsluhu i drbu, dky elektronick regulaci teploty a krtk dob zahvn - 30 sekund. Nen teba dnho stlaenho vzduchu ani sbrae prachu.Stl svelkm nosnm povrchem a specilnmi vodtky pro zlepen posuvu obrobku a zabrnn jeho pokozen.Jako dal zazen ke zven ivotnosti a zlepen kvality provdn prce se doporuuje pout antiadhezivn aerosol,kter zabrauje pilepen lepidla k pracovnm stem stroje.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"P', 'https://b2b-itatools.pl/Obrazki/EB25_EB25.jpg', 0, '169006.00', '187785.00', 'EB25', '', 'https://b2b-itatools.pl/Obrazki/EB25_EB25.jpg', 'https://b2b-itatools.pl/Obrazki/EB25_eb25d1.jpg', 'https://b2b-itatools.pl/Obrazki/EB25_eb25d2.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8933, 1750, 'Olepovaka Virutex', 'Olepovaka Virutex', '<p><strong>Olepovaka Virutex EB35</strong></p>\\n<p><span lang=\\\"cs\\\">Charakteristickm rysem tohoto stroje je monost lepen hranovch materil do tlouky 3 mm, nsledovanm frzovnmpesah hranovho materilu a sekrbnm. Systm automatickho podvn obrobenho panelu je synchronizovn sesystmem podvn hrany. Stroj je vybaven frzovac jednotkou, sestvajc ze dvou nezvislchfrzovacch modul, pro odstraovn podlnch pesah (ze spodn a horn strany panelu souasn). Pesn oznutpednho a zadnho pesahu pro lemovac materil do tlouky 2 mm (pi pouit hrany o tlouce 3 mmje pedn konec obroben s pdavkem).Stroj je uren k obkladu pmch obdlnkovch panel s lemovacmi materily (PVC, melamin, prodn dha). Rychl pprava na prci (2 minuty). Stroj se zahv 30 sekund. Dle m elektronickou regulaci teploty. Snadno se obsluhuje i udruje.Stl m velk nosn povrch a speciln vodtka pro zlepen posuvu obrobku a zabrnn jehopokozen. Pro ', 'https://b2b-itatools.pl/Obrazki/EB35_eb35-2013.jpg', 0, '231091.00', '256768.00', 'EB35', '', 'https://b2b-itatools.pl/Obrazki/EB35_eb35-2013.jpg', 'https://b2b-itatools.pl/Obrazki/EB35_EB35-052005_demo1b.jpg', 'https://b2b-itatools.pl/Obrazki/EB35_eb35d1.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8934, 1751, 'Olepovaka hran Virutex', 'Olepovaka hran Virutex', '<p><strong>OlepovakaPEB200TRC</strong></p>\\n<p><span><span lang=\\\"cs\\\">Penosn olepovaka fungujc na bzi zaht lepidla. navren pro olepen rovnch i zakivenchst hranou z PVC, ABS, melaminu a dhy.Tento model je velmi vhodn pro zpracovn malch rovnch dlc v dln. Model je vybaven vysokokapacitn ndobou na lepidlo s teflonovm povlakem. Olepovaka nepouv elektronick nastavovn teploty. Umouje zpracovat dlce o tlouce 10 a 62 mm. Me bt pouita pro zpracovn velkch dl.Jednoduch a rychl nastaven podle typu a ky hrany a tlouky panelu. M nainstalovan automatick podvn psky s vodicm systmem pro umstn okrajovho materilu na lisovacm vlci s runm ovldnm dlky lehacho amotorizovanho ptlanho vlce pro pesn a rychl lepen. Stejn jako ostatn olepovaky ze stejn ady, nepostrd ani tento stroj schopnost upravit tlouku vrstvy lepidla.Praktick je, e pracovn deska m vsuvnou eln st pro vy stabilitu lepen des', 'https://b2b-itatools.pl/Obrazki/PEB200TRC_PEB200TRC.jpg', 0, '58934.00', '65482.00', 'PEB200TRC', '_vyrn_1751peb200trc.jpg', '_vyrp11_1751peb250-4.jpg', '_vyrp12_1751peb250trc-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8935, 1752, 'Olepovaka hran Virutex', 'Olepovaka hran Virutex', '<p><strong>Olepovaka hran</strong></p>\\n<p><span>Penosn olepovaka fungujc na bzi zaht lepidla. Vhodn proPVC, ABS, melaminov, lamintov nebo dhov hrany, kter jsou pedem naezan na poadovanou dlku pro rovn, kulat nebo tvarovan panely.Olepovaka je velmi praktickpro malosriov vroby pro rovn panely.Jej vhodou je snadn ovldn a rychl nastaven.Pracovn deska m vsuvnou eln st pro vy stabilitu lepen desky.</span><span>U olepovaky lze velmi jednodue a intuitivn nastavit vka psky a tlouka panelu.Stroj je vybavenpesnou kontrolou dvkovn lepidla a asistovanm podvnm psky s elektronicky zenou rychlosti podvn.</span><span>Lepic vlec je polymerovou vrstvou a umouje lepit psky s 3D a sklennm efektem. Stroj je vybaven pesnou regulac pro dvkovn lepidla a elektronickou regulac teploty.</span><span>Ndoba na lepidlo a posuvn zkladna je potaen Teflonem pro snadn itn a drbu. Olepovaka je vybavena drkem vl', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_2014.jpg', 0, '66176.00', '73529.00', 'PEB250TRC', '', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_2014.jpg', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_d1.jpg', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_d5.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8936, 1753, 'Manuln naneka lepidla na hrany Virutex', 'Manuln naneka lepidla na hrany Virutex', '<h2><span></span></h2>\\n<p><strong>Manuln naneka lepidla na hrany</strong></p>\\n<div class=\\\"text_producte\\\">\\n<p style=\\\"text-align: left;\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj pro lepen hran pro pozdj pouit pouit se stroji pro pedem nanesen hrany.</span></p>\\n<p style=\\\"text-align: left;\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj je nzkodrbov naneka na nanen hran lepidlem. Jedn se o nanen plastovch i lamintovch hran, vrstvench hran o velikostech 0,4 a 2 mm pro PVC desky, ABS, polyester, melamin nebo devn dhy.Stroj lep psky pro pozdj pouit se stroji pro pedem lepen hrany, kter jsou vyrbny spolenost Virutex, nebo s jakmikoli jinmi horkovzdunmi olepovacmi stroji.Stroj disponujetermoelektrickm zenm teploty, automatickm zapnnm a vypnnm erpadla pro pvod lepidla, v zvislosti na teplot lepidla a pesnm dvkovacm mechanismu, kter dvkuje pesn mnostv ', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P.jpg', 0, '72197.00', '80218.00', 'PR25P', '', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P_d1g.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P_d2e.jpg', 21, 1, 1, 0, '', 0, '3-480-491-0', NULL, '2021-01-10 15:44:11');
