(8937, 1754, 'Automatick naneka lepidla na hrany Virutex', 'Automatick naneka lepidla na hrany Virutex', '<h3><strong>Automatick naneka lepidla na hrany</strong></h3>\\n<p><span>Automatick naneka s automatickou drbou, pro lepen hran z materil jako jsou: plasty nebo lamint i vrstven psy. Stroj je vhodn k pouit hran 0,4 a 3 mm (PVC, ABS, polyester, melamin nebo dha).<span></span>Tento stroj automaticky nan lepidlo na hrany pro pozdj pouit se stroji pro pedem nalepen psky, kter jsou vyrbny spolenost Virutex, i je mon nanesen hrany vyut s jakmikoli jinmi horkovzdunmi stroji.<span>Polepovaka m</span> termoelektrickou regulaci teploty, disponuje automatickm zapnutm a vypnutm erpadla lepidla v zvislosti na teplot lepidla a pesnm dvkovacm mechanismu, kter dvkuje takov pesn mnostv lepidla, aby se zskala poadovan hustota na zadn stran hrany.<span>Stroj m</span> vestavn automatick navijk, kter se snadno odvj a navj a dky zabudovan suc jednotce nehroz riziko nhodnho lepen.</span></p>\\n<p>Provoz stroje zvldne', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25P-DV.jpg', 0, '93222.00', '103580.00', 'PR25P-DV', '', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25P-DV.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25PDV_d10b.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25PDV_d11c.jpg', 21, 1, 2, 1, '', 0, '3-480-491-0', NULL, '2021-01-10 15:44:11'),
(8938, 1756, 'Upnac zazen ASU317S Virutex', 'Upnac zazen ASU317S', '<p><span>Nabzme Vmupnac rovinn podtlakov ppravek, kter<span lang=\\\"cs\\\" id=\\\"result_box\\\">Umouje pevn a stabiln upevnn pi lepen dvou panel ve vodorovn poloze.<span lang=\\\"cs\\\">Upnac podtlakov psavky pracuj jen na rovn a hladk neporzn ploe.</span></span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/1745927_corian%201.jpg', 0, '10952.00', '12169.00', 'ASU317S', '', '', '', '', 21, 1, 1, 1, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:11'),
