(9168, 2006, 'Bon vodtko Virutex pro lamelovac frzku AB111N', 'Bon vodtko Virutex pro lamelovac frzku AB111N', '<p><span>Podili jste si lamelovac frzku AB111N Virutex a potebovali byste rozit jej vyuit? Mme tu nco pmo pro Vs! Nabzme Vm bon vodtko pro lamelovac frzku Virutex. Nasazen na frzku je rychl a snadn, take je tm okamit mon zat Va lamelovac frzkou frzovat i tenk drky do lamina.</span></p>\\n<p></p>\\n<ul></ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/CB64B_CB64B.jpg', 0, '2266.00', '2518.00', 'CB64B', '', '', '', '', 21, 1, 3, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9169, 2007, 'Zvedk na dvee max. 200kg Virutex', 'Zvedk na dvee max. 200kg Virutex', '<p><span>Dven zvedk EP70P je ideln pro snadn zvednut tkch dve.</span><span>Umouje zvedat tk dvee, jako jsou obrnn i protiporn dvee.<span></span>Konstrukce zvedku umouje otoit nstroj na jakoukoli stranu, co usnaduje zvedn i vyjmn dve.<span>Pro usnadnn prce s dvemi je u zvedku jeho eln st nastaviteln a pokryta materilem proti pokrbn.</span><span>Se zvedkem je snadn manipulace dky jeho nzk hmotnosti (1kg).</span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opr', 'https://b2b-itatools.pl/Obrazki/EP70P_ep70.jpg', 0, '1344.00', '1415.00', 'EP70P', '', 'https://b2b-itatools.pl/Obrazki/EP70P_ep02.jpg', 'https://b2b-itatools.pl/Obrazki/EP70P_ep701.jpg', '', 21, 1, 0, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9170, 2008, 'Ptlan vlce Virutex', 'Ptlan vlce Virutex', '<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Zazen pro lisovn lepench povrch.\\nVlec zajiuje rovnomrn rozdlen tlaku na adhezivn vrstvu, aby se <br />odstranily vzduchov bubliny bhem lepen. Dlka je 100 mm.<br /><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><', 'https://b2b-itatools.pl/Obrazki/L100_rolk.jpg', 0, '2013.00', '2237.00', 'L100', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9171, 2010, 'Univezln truhlsk svrka Virutex', 'Univezln truhlsk svrka Virutex', '<p>Univerzln svrka. Je ideln pro truhlsk prce mimo dlnu.<span>Lze ji snadno umstit na tm jakkoliv stl a pichytit jakoukoliv desku.</span><span>Velk elisti dr materil bezpen, spolehliv a nezanechvaj na nm dn stopy.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/MR81B_Mr81b.jpg', 0, '1785.00', '1983.00', 'MR81B', '', 'https://b2b-itatools.pl/Obrazki/MR81B_mr81bd2.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9172, 2011, 'Penosn pracovn stl Virutex', 'Penosn pracovn stl Virutex', '<p>Vkov nastaviteln, pepraviteln a skldac pracovn stl od firmy Virutex. Poskytuje pevn pracovn povrch, na kterm je mon stroj upevnit. Stl se strojem, kter je na nm pipevnn, lze pesouvat a skldat, ani by se stroj neustle fixoval a vyjmal. Je pouiteln napklad pro pilu<span></span>TM72C,<a href=\\\"http://www.stolarske-potreby.cz/pily/tm72c-sklopna-pokosova-prerezavaci-pila-virutex/skupina=200/karta/produkt=599\\\"></a>nebo pro pilu<span></span>TM33L.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravi', 'https://b2b-itatools.pl/Obrazki/MT58K_MT58K.jpg', 0, '10091.00', '11212.00', 'MT58K', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-501-0', NULL, '2021-01-10 15:44:13'),
