(9174, 2013, 'Konstrukce pro upevnn rm dve Virutex', 'Konstrukce pro upevnn rm dve Virutex', '<p><span>ablona je navrena tak, aby usnadovala rychl a dokonal umstn rm dve a pomohla pi zajitn rm pomoc polyuretanov pny.<span></span></span><span>ablona me bt umstna do novch nebo starch dvench rm.<span></span></span><span>Pouit polyuretanov pny zaruuje celkovou odolnost, dky emu dvee pevn dr.<span></span></span><span>Nasatven je rychl (do 10 minut), co umouje rychlou prci a optimln vyuit dostupnho asu.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83e.jpg', 0, '18337.00', '20374.00', 'PB83E', '', 'https://b2b-itatools.pl/Obrazki/PB83E_PB83ED1.jpg', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83ed2.jpg', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83ed3.jpg', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
