(9176, 2016, 'Kolejnicov ablona pro frzovn 120x320 mm Virutex', 'Kolejnicov ablona pro frzovn 120x320 mm Virutex', '<p><span>Frzovac ablona PF400 Vm umoujesloit oezy pomoc smrovac frzy.S ablonou mete vytvoitdrky, vyfrzovat hrany, rmy, oblouky i kruhy. Maximln plocha opracovn je 120x320 mm.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\', 'https://b2b-itatools.pl/Obrazki/PF400_pf400_pf700.jpg', 0, '5380.00', '5978.00', 'PF400', '', 'https://b2b-itatools.pl/Obrazki/PF400_pf700_d1.jpg', 'https://b2b-itatools.pl/Obrazki/PF400_pf400_d2.jpg', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
