(9178, 2018, 'ablona pro frzovn desek a nslednou mont Virutex', 'ablona pro frzovn desek a nslednou mont Virutex', '<p>Pesn a pevn ablona vyroben z fenolickho materilu o tlouce 12 mm. ablona je speciln navrena pro oezvn a mont pracovnch desek o ce 420 mm a 650 mm. hel monte me bt 45 nebo 90. Je ideln pro pouit se smrovacmi frzami modelu FR160P. Lze ji velmi snadn ukotvit dle znaek na ablon. Zkracuje dobu frzovn pouze na 15 minut v rmci frzovn obou stran desky a vrazn sniuje pravdpodobnost chyb pi prci.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>\\n<pre class=\\\"t', 'https://b2b-itatools.pl/Obrazki/PFE60_pfe60%20grande.jpg', 0, '4352.00', '4836.00', 'PFE60', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9179, 2019, 'Kolejnicov ablona - schody Virutex', 'Kolejnicov ablona - schody Virutex', '<p><span>ablona pro tvorbu konstrukce schodi. V porovnn se starmi ablonami, zavd tento model nkolik praktickch opaten pro jednodu a plynulej prci. Jednou z novinek je p<span lang=\\\"cs\\\">tomnost doraz a fixace pomoc svorek ve tvaru psmene L ve spojen s robustnm hlinkovm rmem, je poskytujestabiln pesnost s absolutn jednoduchost designu.Dal nespornou vhodou je monost zskn pravho hlu ve viditelnch oblastech spojen bhounu a stoupaky,eho je dosaeno zvltnm drazem. Chcete-li frzovat profil na opanm stojanu, sta otoit ablonu. Nov je takjednoduch a rychl penosrozmr a frzovn celho profilu bez nutnosti pout pln oznaen - sta oznait pouze prvn dva kroky.</span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) prod', 'https://b2b-itatools.pl/Obrazki/PFP_pfp.jpg', 0, '16484.00', '18315.00', 'PFP', '', 'https://b2b-itatools.pl/Obrazki/PFP_pfp_demo_foll.jpg', 'https://b2b-itatools.pl/Obrazki/PFP_pfp_demo5_cmyk.jpg', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9180, 2020, 'Rybinov nstavec Virutex', 'Rybinov nstavec Virutex', '<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Pesn nstroj pro vytven rybinovho spoje. Standardn se dodv se ablonou se sklonem 26 mm, kterou lze nahradit <br />dal ablonou s jinm sklonem. Stroj je vybaven zarkami pro frzovan dly, kter poskytuj vysoce kvalitn napojen spoje.<br />Polotovary jsou umstny ve dvojicch v horizontln a vertikln rovin s pesahem odpovdajcm stoupn. Me bt pouit s <br /></span><span lang=\\\"cs\\\">frzkami FR66P, FR160P, FRE160P, FR277R, FR278R nebo AS93. Podeev frzy je zcela poloena na ploe, m je udrena <br />stabilita. Pokzen spoje je tedy nepravdpodobn.<br /><br /></span></span></p>\\n<p style=\\\"font-size: 20px;\\\">TECHNICK SPECIFIKACE:</p>\\n<ul>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Pracovn ka: 360 mm</span></span></li>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Rozestupy ablony: 26 mm</span></spa', 'https://b2b-itatools.pl/Obrazki/PL11_PL11.jpg', 0, '9043.00', '10047.00', 'PL11', '', '_vyrp11_2020pl11_1.jpg', '_vyrp12_2020pl11_2.jpg', '_vyrp13_2020pl11_3.jpg', 21, 1, 1, 0, '', 0, '4-497-502-0', NULL, '2021-01-10 15:44:13'),
(9181, 2021, 'ablona pro vrtn dr pro spojovac kolky (d=8mm) pro desky (16 a 19mm) Virutex', 'ablona pro vrtn dr pro spojovac kolky (d=8mm) pro desky (16 a 19mm) Virutex', '<p>ablona je pouvna pro pesn vrtn otvor pro spojovac prostedky.<span>Ureno pro vrtn otvor, slepch nebo prchozch, pro spojovac prvky pro spojovn panel o tlouce 16 a 19 mm pomoc kruhovho kolku (&#216; 8 mm) nebo nbytkovch roub (confermat).Vzhledem k vysok pesnosti tohoto produktu nen nutn dn dal konfigurace. Mete tedy vytvoit spojen jakhokoli typu podl okraje nebo konce a dokonce uprosted dlce.<span lang=\\\"cs\\\">Nepostradateln nstroj pro provdn malch objednvek, oprav, prav atd. Standardn vbava zahrnuje rozprky propanely 16 mm, pouzdro adaptru &#216; 8/5 mm a zastaven vrtn. Pi pouit ablony je nutn dodrovat zsadu jednoty bz,tzn. pokud pi zpracovn bonch stn zakldte ablonu na pedn stran, pak pi zpracovn protilehl sti by mlabt ablona zaloena na pedn stran.Celkov dlka 600mm.</span></span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek', 'https://b2b-itatools.pl/Obrazki/PM11D_PM11D.jpg', 0, '1426.00', '1585.00', 'PM11D', '', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd1.jpg', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd2.jpg', '', 21, 1, 2, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9182, 2024, 'Transportn sada 2ks Virutex', 'Transportn sada 2ks Virutex (pidrovn,penen a zvedn)', '<p>Praktick a ergonomick design umouje snadn penen panel ze deva, kovu, PVC, atd. a do tlouky 46 mm. Skld se z pevnho hlinkovho tla, dvou protiskluzovch koncovek a rukojeti. PT81U je vkonn psluenstv, kter umouje zvednout materil a do 70 kg.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li>ka materilu: 0 - 46 mm</li>\\n<li>Max. zaten: 70 kg</li>\\n<li>Hmotnost: 0,5 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit', '_vyr_20247BCFD4180BD0FE50E3BBD95E61C64AED.jpg', 0, '2585.00', '2722.00', 'PT81U', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13');
INSERT INTO `products` (`id`, `productId`, `name`, `secondName`, `description`, `picture`, `available`, `price`, `secondPrice`, `productnumber`, `previewPicture`, `gallery0`, `gallery1`, `gallery2`, `vat`, `vatlevel`, `amountInStock`, `avaibilityId`, `ean`, `unsaleable`, `categories`, `changedAt`, `dt`) VALUES
(9183, 2025, 'Sada pro run lepen Virutex', 'Sada pro run lepen Virutex', '<p><span>Sada pro run nanen lepidla. Dky mnostv nstavc je mon ji pout pro itok spektrum truhlskch operac.</span></p>\\n<p><span style=\\\"font-size: 20px;\\\"><b>Obsah balen:</b></span></p>\\n<ul>\\n<li><span>250 ml plastov lhev</span></li>\\n<li><span>Nstavec pro ploch nanen (lamely)</span></li>\\n<li>Nstavec pro kulat nanen</li>\\n<li>Hubika pro pm vstikovn</li>\\n<li>Pevn uzvr</li>\\n<li>Kryty na vechny nstavce</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/SEM1_Zestaw%20do%20klejenia%20r%c4%99cznego%20SEM1.jpg', 0, '483.00', '537.00', 'SEM1', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-503-0', NULL, '2021-01-10 15:44:13'),
(9184, 2026, 'Podpra pro dren panelu i jin desky (nosnost 3kg) Virutex', 'Podpra pro dren panelu i jin desky (nosnost 3kg) Virutex', '<p><span>Praktick podpra umoujc pevn dret jakkoli kus (panely, dvee ...).<span></span></span><span>Disponuje vysokou stabilitou.<span></span></span><span>Je mon dret panely nebo dvee o tlouce 6 a 80 mm.<span></span></span><span>Me pojmout kusy do hmotnosti 80 kg.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/SP270R_SP270R_2011.jpg', 0, '4120.00', '4578.00', 'SP270R', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9185, 2027, 'Pojzdn upnac podpra na desky a dvee (8kg) Virutex', 'Pojzdn upnac podpra (8kg) na dvou kolech pro dvee,panely a jin materily do max. 200 kg Virut', '<p><span class=\\\"hps\\\">Praktick</span><span></span><span class=\\\"hps\\\">podpra</span><span></span><span class=\\\"hps\\\">s</span><span></span><span class=\\\"hps\\\">koly</span><span></span><span class=\\\"hps\\\">umouje</span><span>aby</span><span class=\\\"hps\\\">jeden lovk</span><span></span><span class=\\\"hps\\\">drel</span><span></span><span class=\\\"hps\\\">a nosil</span><span></span><span class=\\\"hps\\\">vechny druhy</span><span></span><span class=\\\"hps\\\">panel</span><span>, tk</span><span></span><span class=\\\"hps\\\">dvee,</span><span></span><span class=\\\"hps\\\">truhlsk</span><span></span><span class=\\\"hps\\\">dly</span><span></span><span class=\\\"hps\\\">ze deva</span><span>, hlinku</span><span>, PVC,</span><span></span><span class=\\\"hps\\\">apod.<span></span></span><span class=\\\"hps\\\">Svrka se d</span><span></span><span class=\\\"hps\\\">otevt na</span><span></span><span class=\\\"hps\\\">6-110mm</span><span>,</span><span></span><span class=\\\"hps\\\">ob elisti jsou</span><sp', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_grande_2012.jpg', 0, '6608.00', '7342.00', 'SPR770T', '', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_d2.jpg', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_d3.jpg', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9186, 2028, 'Elektrick vakuov upnac systm Virutex', 'Elektrick vakuov upnac systm Virutex', '<p><span>Vakuov upnac systm ovldan vkonnou, nehlunou elektrickou vakuovou pumpou, kter je vybaven sacmi deskami na obou stranch (horn a spodn) umoujc vodorovn nebo svisl upnut kus rznch materil.<span>U upnacch desek je mon upravit velikost upnac plochy</span>pro upnn mench kus. Soust standardn dodvky je transportn kufk.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Pkon: 120 W</span></li>\\n<li><span>Generovan vakuum: 750mbar</span></li>\\n<li><span>Upnac sla na obou stranch: 95 kg</span></li>\\n<li><span>Velikost upevovac desky: 340x125mm</span></li>\\n<li><span>Celkov rozmry zazen: 390x145x200 mm</span></li>\\n<li><span>Hmotnost: 14,7 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinc', 'https://b2b-itatools.pl/Obrazki/SVE500_SVE500.jpg', 0, '18076.00', '20084.00', 'SVE500', '', 'https://b2b-itatools.pl/Obrazki/SVE500_sve500_d3.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9187, 2029, 'Naklpc / vkyvn elektrick vakuov upnac systm Virutex', 'Naklpc / vkyvn elektrick vakuov upnac systm Virutex', '<p><span>Upnac systm umouje pevn a okamit upevnn kus hladkho a neporznho povrchu vakuem.<span></span>Rovn umouje dret kusy vodorovn, svisle nebo v rznch hlech (v zvislosti na modelu).<span></span>Systm SVE je zaloen na autonomnm a elektrickm vakuovm systmu, kter umouje vyhnout se externmu kompresoru.<span></span>Usnaduje fixaci kus mimo dlnu. (nen nutn tk a objemn extern kompresor)<span></span>K upnut velkch kus lze pout dv nebo vce jednotek.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICK SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Generovan vakuum: 750 mbar</span></li>\\n<li><span>Pkon 95 W</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter ', 'https://b2b-itatools.pl/Obrazki/SVE660_sve660.jpg', 0, '18679.00', '20754.00', 'SVE660', '', 'https://b2b-itatools.pl/Obrazki/SVE660_SVE---VER-2.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9188, 2032, 'Multifunkn upevovac systm Virutex', 'Multifunkn upevovac systm (nklpn, vkyv) Virutex', '<p><span>Systm vcensobnho upevnn SVN460 se skld ze zkladnho systmu SVN250 namontovanho na vkyvn podpe.<span></span></span><span>Model SVN460 umouje obrbn hran a ploch bez nutnosti mnit pozici upevnn.<span></span></span><span>Obsahuje vzduchov rozvad se tymi volnmi zsuvkami, kter umouje pipojen pomocnch jednotek SVN250 nebo SVN470, vybavench ventilem a rychlospojkou slouc k pipojen k pneumatickmu systmu.<span></span></span><span>Soust vybaven je tak G-svorka pro rychl upnut systmu SVN460 k pracovn desce a sada t gumovch tsnn rznch obvod.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky V', 'https://b2b-itatools.pl/Obrazki/SVN460_SVN450.jpg', 0, '10555.00', '11728.00', 'SVN460', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9189, 2033, 'Sklopn upnac podpra Virutex', 'Sklopn upnac podpra Virutex', '<p><span>SVN470 jesklopn podpras napojenm na SVN 450 nebo SVN 460. To umouje vypnat podtlak na obou plochch souasn.</span><span>Umouje obrbn hran a povrchu beze zmny podpry.<span></span>Soust vybaven je tak G-svorka pro rychl upnut systmu SVN460 k pracovn desce a sada t gumovch tsnn rznch obvod.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/SVN470_SVN470.jpg', 0, '6322.00', '7025.00', 'SVN470', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9190, 2034, 'Vakuov upnac zazen (340x125mm) Virutex', 'Vakuov upnac zazen (340x125mm) Virutex', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Vakuov upnac systm ovldan stlaenm vzduchem.\\nSac desky na obou stranch (horn a spodn) umouj vodorovn nebo svisl upnut kus. <br />Oddliteln sac desky pro upnn malch kus. Upnac sla na obou stranch a do 95 kg.<br /><br /></span><span lang=\\\"cs\\\"><span style=\\\"text-decoration: underline; font-size: 20px;\\\"><span style=\\\"font-family: verdana, geneva;\\\">TECHNICK SPECIFIKACE:<br /></span></span><br /><span style=\\\"font-family: verdana, geneva;\\\">Pracovn tlak : 4-6 bar\\nPoadavek na vzduch (4 bar): 48l/min\\nVakuum: 700mbar\\nUpnac sla na obou stranch: 95 kg\\nRozmry sac desky: 340x125mm\\nRozmry jednotky: 390x145x200\\nHmotnost: 10,5 kg\\n</span><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyr', 'https://b2b-itatools.pl/Obrazki/SVN500_SVN500.jpg', 0, '14387.00', '15985.00', 'SVN500', '', 'https://b2b-itatools.pl/Obrazki/SVN500_svn500_d3.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9191, 2035, 'Nstroj ke koprovn hl Virutex', 'Nstroj ke koprovn hl Virutex', '<p><span>Nstroj ke koprovn hlu<span lang=\\\"cs\\\">umouje penet pesnou hodnotu hlu na obrobek pi vrob.Tento nstrojvm umouje vyhnout se men hl a ztrt asu pi vpotech, co z nj in nepostradatelnou pomoc pi vrob hlovch spoj s jinm hlem, ne 90. Nstrojje vybaven malm fixanm roubkem pro zabrnnzmny velikosti hlu pi penosu do stroje.Nastavte nstroj rovnobn s obrobkem a ezn nstroj rovnobn s indiktorem hlu ezu a dostanete ez pesn vpoadovanm hlu. Poteba mit seln hodnoty a vypotat hly je zcela vylouena - vynikajc vsledek snadno arychle.Nstrojje kompatibiln se vemi pokosovmi pilami na devo i kov na trhu.</span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj k', 'https://b2b-itatools.pl/Obrazki/TC133R_TC33.jpg', 0, '531.00', '590.00', 'TC133R', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9192, 2036, 'ablona na dlabn a frzovn zmk Virutex', 'ablona na dlabn a frzovn zmk Virutex', '<p><span>ablona je konstruovna pro provdn elnch a postrannch otvor ve dev pro jakkoliv typ zmk na dvee a protiplech na dvench rmech. ablona je zejmna konstruovna pro frzku Virutex FR66P, ale je kompatibiln i s dalmi typy frzek. S touto ablonou lze frzovat ji zaven dvee bez pokozen povrchu dky bezpenmu a spolehlivmu seven, tud je moun ablonu pout nejen dln, ale i pmo na montch. Standardn vbava obsahuje vodc ty, kter dr ablonu vdy ve stejn vce, dlenkolik przdnch plechovch ablon, do kterch si mete nechat vyfrzovat tvary pro frzovn jakchkoliv zmk nebo protiplech.</span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opravi', 'https://b2b-itatools.pl/Obrazki/UC16K_UC16K.jpg', 0, '17642.00', '19602.00', 'UC16K', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9193, 2037, 'ablona s psavkami Virutex', 'Vodc lita s psavkami Virutex', '<p>Pedstavujeme Vm ablonu pro frzovn drek do materilu typu Corian. Na ablon je mon nastavit dlku drky, hloubku i hel. Nstroj je primrn uren pro frzky FRE317VD nebo FRE317S. Soust standartnho balen je jedna ablona a jedna psavka. Vodc lita UF317S, kter je na vodn fotografii, je takt k mn na naem e-shopu.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Peklad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span la', 'https://b2b-itatools.pl/Obrazki/UC317S_corian%203.jpg', 0, '10369.00', '11521.00', 'UC317S', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9194, 2038, 'Vodc lita s psavkami Virutex', 'Vodc lita s psavkami Virutex', '<p><span>Potebujete-li rozit Vae vybaven o praktickou pomcku v dln, mme zde pro Vs snadnou pomoc. Jednm z psluenstv, kter si mete dokoupit je frzovac vodtko, kter povede Vae ezy s geometrickou pesnost. Aby prce byla dokonal, je vodtko vybaveno dvma psavkami na uchycen vodtka k obrobku bez zanechn jakchkoli stop po upnut. Nehroz Vm tedy, e by se zmnilo nastaven pravtka. Pizpsob se vem modelm kotouovch pil, pmoarch pil a smrova od firmy Virutex</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let st', 'https://b2b-itatools.pl/Obrazki/UCP90_ucp90%20main.jpg', 0, '2893.00', '3214.00', 'UCP90', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9195, 2039, 'ezac vodtko (pravtko) s psavkami Virutex', 'ezac vodtko (pravtko) s psavkami Virutex', '<p><span>Potebujete-li vyut Vai frzku FRE317VD a FRE317S jet efektivnji ne pedtm, mme zde pro Vs snadnou pomoc. Jednm z psluenstv, kter si mete dokoupit je frzovac vodtko, kter povede Vae ezy s geometrickou pesnost. Aby prce byla dokonal, je pravtko vybaveno dvma psavkami na uchycen pravtka k materilu bez zanechn jakchkoli stop po upnut. Nehroz Vm tedy, e by se zmnilo nastaven pravtka.</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit.</p>', 'https://b2b-itatools.pl/Obrazki/UF317S_fre317s_d3.jpg', 0, '7285.00', '8094.00', 'UF317S', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9196, 2040, 'Nstavec ZB93 pro Virutex FR192VG,FR192N', 'Psluenstv pro umisovn roub bez ablony s frzkami Virutex FR 192VG,FR192N', '<p><span>Mme zde pro Vs pomcku pi frzovn k frzkm FR192N a FR192VB. Tento nstavec vm pome frzovat dlaby pro vkldn dvench zvs a to bez pouit ablon.Monost podlnho a pnho pohybu vm umon nainstalovat libovoln zaputn panty a vytvoit drku pod pedn litou zmku.</span></p>\\n<p></p>\\n<ul></ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Pro vrobek od svtov jedniky VIRUTEX:</span></p>\\n<p>Vrobky Virutex jsou vyrbny v Barcelon ve panlsku. Na rozdl od jinch svtovch vrobc kte (vtinou v Asii) produkuj obrovsk srie rznch pstroj kter jsou asto obtn opraviteln, je u Virutexu vroba malosriov. Run montovan vrobky Virutex jsou profesionln pesn, 100 % kvalitn a tak 100 % opraviteln. I vrobek 30 let star je vtinou mono bez problm opravit. </p>\\n<p><span></span></p>\\n<p></p>', '_vyr_204051PC6CvCjXL-_AC_.jpg', 0, '4596.00', '5107.00', 'ZB93', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-507-0', NULL, '2021-01-10 15:44:13'),
(9197, 2041, 'Frza na 2D/3D vyezvn (D=1,6; I=30; L=80; S=8) Z3', 'Frza na 2D/3D vyezvn (D=1,6; I=30; L=80; S=8; R=0,8) Z3', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Z3 ti pozitivn spirlov bity</li>\\n<li>Tlo ze specilnho tvrdho materilu HM</li>\\n<li>Perfektn prava na spodn povrch obrobku</li>\\n<li>Odvod tsky smrem nahoru</li>\\n</ul>\\n<p></p>\\n<h3>POUIT:</h3>\\n<p>ezn a formtovn plastovch a hlinkovch materil pi vysokch rychlostech posuvu. Pro pouit v CNC centrech, plotrech, numericky zench a runch frzkch.</p>\\n<h3>VHODY:</h3>\\n<p><span>Ideln kousek pro 3D ezbstv.</span><span>Pesn ezn 2D a 3D ve velkm mtku.</span><span>Skvl pro hlubok profilovn.2D a 3D tvarovn, profilovn, modelovn a tvorba vzor pro truhlstv, vrobu znamnek, vrobu nbytku a vrobu perk.</span></p>\\n<h3>VHODN MATERILY:</h3>\\n<table class=\\\"vypis_specifikaci\\\">\\n<tbody>\\n<tr>\\n<td>\\n<ul>\\n<li><span>Masiv</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>Bronz</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>Coroplast</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>La', '_vyr_2041152-080-163_474_1526_152_600x6003.jpg', 0, '1056.01', '1173.00', '152.080.163', '_vyrn_2041152-080-163_474_1526_152_600x6003.jpg', '', '', '', 21, 1, 2, 0, '', 0, '2-7-45-0|2-0-0-0|2-7-0-0|2-7-45-598|15-0-0-0|15-641-0-0|15-641-914-0', NULL, '2021-01-10 15:44:13'),
(9198, 2048, 'Frza VHM na kompozity (po rozkliknut vyberete konkrtn produkt)', 'Frza VHM na kompozity (ne vyberte konkrtn produkt)', '<h3><strong>Pouit do materilu:</strong></h3>\\n<table style=\\\"width: 137px; margin-left: auto; margin-right: auto;\\\">\\n<tbody>\\n<tr style=\\\"height: 28px;\\\">\\n<td style=\\\"width: 134px; height: 28px; text-align: left;\\\"> uhlkov vlkno</td>\\n</tr>\\n<tr style=\\\"height: 17px;\\\">\\n<td style=\\\"width: 134px; height: 17px; text-align: left;\\\"> sklenn vlkno</td>\\n</tr>\\n<tr style=\\\"height: 17px;\\\">\\n<td style=\\\"width: 134px; height: 17px; text-align: left;\\\"> graf</td>\\n</tr>\\n<tr style=\\\"height: 17px;\\\">\\n<td style=\\\"width: 134px; height: 17px; text-align: left;\\\"> cellboard</td>\\n</tr>\\n</tbody>\\n</table>\\n<p><a href=\\\"https://www.stopkovefrezy.cz/fotky101456/fotos/_vyrp11_2048CNS.jpg\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><img src=\\\"/fotky101456/CNS.jpg\\\" alt=\\\" width=\\\"650\\\" height=\\\"133\\\" style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" /></a></p>\\n<h3><strong>Specifikace jednotlivch vrobk (<em>konkrtn vrobek vyberete po kliknut na pslun kd</em>):</stron', '_vyr_2048CNS-03-010-045-03R_CNS.jpg', 0, '0.00', '0.00', 'CNS', '', '_vyrp11_2048CNS.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:13'),
(9199, 2053, 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z8 HM stdav zub', 'Kotou lamelovac pro lamelov spoje - D100x3,96 d22 Z8 HM stdav zub', '<p>Nov 100 mm CMT lamelovac kotou s teflonovm oranovm povrchem je vyroben z jakostn oceli. Tlo je osazeno tvrdokovovmi zuby, kter garantuj dlouhou ivotnost. Ureno pro lamelovac frzky.</p>', '', 0, '741.00', '823.00', 'C24100804', '', '', '', '', 21, 1, 5, 1, '', 0, '2-2-286-0|2-2-287-0', NULL, '2021-01-10 15:44:13'),
