(9515, 8503, 'Matice s kinetickm odsvnm pro EOC25', 'Matice s kinetickm odsvnm pro EOC25 KINETIC', '<h3>TECHNICK INFORMACE:</h3>\\n<ul>\\n<li>Pro kletinov systmy <strong>ER32, ER40, EOC25</strong></li>\\n<li>Tlo z lehk slitiny se silnm keramickm potahem</li>\\n<li>Maximln ochrana i minimalizace ten</li>\\n<li>inn pi nzkch otkch, optimln <strong>6000 - 20 000 ot./min</strong>.</li>\\n<li>Vhodn pi prci s <strong>DTD, LTD, MDF, Corianem, sdrokartonem, OSB i HPL deskami</strong></li>\\n<li>Prmr <strong>100 mm</strong></li>\\n<li>Nahrazuje standartn matici</li>\\n<li>Prodluuje ivotnost nstroje</li>\\n<li>Spo as udrenm istho pracovnho prostoru</li>\\n<li>Sniuje prcento devnho prachu ve vzduchu</li>\\n</ul>', '_vyr_8503992-101-EOC25_475_1412_dz_992_kde.jpg', 0, '7990.00', '8877.70', '992.101.EOC25', '_vyrn_8503992-101-EOC25_475_1412_dz_992_kde.jpg', '_vyrp11_8503992-101-EOC25_474_1412_fz_992-kde.jpg', '', '', 21, 1, 2, 0, '', 0, '2-0-0-0|2-8-0-0|2-8-668-0', NULL, '2021-01-10 15:44:16'),
