(9590, 8597, 'Spirlov hrubovac frza na zmky dve (D=16; I=45; S=16; Z=3) RH, DIA povlak.', 'Spirlov hrubovac frza na zmky dve (D=16; I=45; S=16; Z=3) RH, DIA povlak.', '<div>DIA Spirlov<span></span><span>frzy:</span></div>\\n<div><span>Diamantov</span>povlak (DLC) je vsledkem procesu PECVD, kter je jednou z nejnovjch technologi povlakovn. Celkov tlouka povlaku 1 mikron dosahuje velmi odolnho povrchu a nekorozn prosted. Z provedench test vyplvaj velmi dobr vsledky, kter potvrzuj zven ivotnosti eznch nstroj a o 300 %.</div>\\n<div></div>\\n<div></div>\\n<div>VHODY:</div>\\n<div><span> nkolikrt</span>zvyuje ivotnost nstroj HM a HSS,</div>\\n<div> snen ten<span></span><span>pi frzovn,</span></div>\\n<div><span> sniuje</span>zahvn,</div>\\n<div><span> omezen</span>nalepovn tsek,</div>\\n<div><span> Zven</span>ivotnost i po osten.</div>\\n<div></div>\\n<div>Materil:</div>\\n<div><span>Mkk a tvrd</span>masivn devo.</div>\\n<div></div>\\n<div>\\n<h3>KOMPLETN SPECIFIKACE VECH VROBK V TTO PRODUKTOV AD:</h3>\\n<table border=\\\"5\\\" cellpadding=\\\"6\\\" cellspacing=\\\"1\\\">\\n<tbody>\\n<tr>\\', '_vyr_8597_vyr_8341Na-zamky-dveri.jpg', 0, '28194.25', '31327.00', '195.162.11XTR', '_vyrn_8597_vyr_8341Na-zamky-dveri.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-1-11-313|2-7-0-0|2-7-45-0|2-7-45-597', NULL, '2021-01-10 15:44:17'),
